INSERT INTO `actuacion` (`CN_ACTUACION`, `CN_SINIESTRO`, `FE_INICIO`, `FE_VENCIMIENTO`, `FE_CIERRE`, `CN_ESTADO`, `TE_NUMERO_EXP`, `TE_DESCRIPCION`, `TE_OBSERVACIONES`) VALUES
	(9, 9, '2013-09-20', '2013-09-25', '2013-09-23', 2, '', 'SENSOR 5ºPLANTA', '<p><span style="background-color: #00ff00;"><strong>19/09/2013.-</strong>&nbsp;</span>NOS LLAMA JOAQUIN 5&ordm;, INDICANDO QUE LOS SENSORES DE LA 5&ordm; PLANTA NO FUNCIONAN, NO SE ENCIENDEN LAS LUCES. SE LLAMA A LUPE (encargada de limpieza) PARA CONFIRMAR Y NOS DICE QUE EFECTIVAMENTE HAY UNO DE LOS SENSORES QUE NO FUNCIONA, AHORA MISMO NO RECUERDA SI ES EL DE LA DCHA O EL DE LA IZDA.</p>\r\n<p>SE PASA CORREO A I.FASE PARA QUE PROCEDAN A LA COMPROBACI&Oacute;N Y NOS CAMBIEN EL QUE ESTA MAL.CORREO ENVIADO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;<br /><strong>Enviado el:</strong>&nbsp;viernes, 20 de septiembre de 2013 11:31<br /><strong>Para:</strong>&nbsp;\'INGENIERIA FASE S.L.\'<br /><strong>Asunto:</strong>&nbsp;AVISO LEONCIO SUAREZ 10 5&ordm;PLANTA</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente comprobaci&oacute;n (hay dos detectores por planta, uno que corresponde a la parte dcha y otro izda), y sustituci&oacute;n de detector de presencia da&ntilde;ado en la planta 5&ordf; de la comunidad c/Leoncio Suarez 10. Para acceder a dicha comunidad pueden localizar al vecino del 4&ordm; Izda.-A-, Joaqu&iacute;n Verdejo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;<span style="font-size: 10pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p><span style="background-color: #00ff00;"><span style="font-size: 10pt; font-family: Arial;">23/09/2013.-<span style="background-color: #ffffff;"> CORREO RECIBIDO DE I.FASE</span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> INGENIERIA FASE S.L. [mailto:ingenieria@montajeselectricosfase.com] <br /> <strong>Enviado el:</strong> lunes, 23 de septiembre de 2013 9:33<br /> <strong>Para:</strong> administrativo@algonz.es<br /> <strong>Asunto:</strong> Solicitud </span></p>\r\n<p class="MsoNormal">&nbsp;&nbsp;Buenos D&iacute;as Paz:</p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">Por el medio del presente solicito de la Comunidad de propietarios C/ Vel&aacute;zquez n&ordm;22</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="msolistparagraph" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!--[if !supportLists]-->-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->CIF</p>\r\n<p class="msolistparagraph" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!--[if !supportLists]-->-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->NUMERO DE CUENTA</p>\r\n<p class="msolistparagraph">&nbsp;<span style="background-color: #00ccff;"><strong>Tambi&eacute;n aprovecho para comunicarte que se ha realizado la comprobaci&oacute;n y arreglo de la misma en la comunidad C/ Leoncio Suarez n&ordm;10 , estaban manipulados los registros y se ha colocado bombilla en plaf&oacute;n, necesito CIF y NUMERO DE CUENTA de la misma para realizar el cargo.</strong></span></p>\r\n<p class="MsoNormal">&nbsp;Nada mas reciba los datos solicitados te env&iacute;o las facturas.</p>\r\n<p class="MsoNormal">&nbsp;Muchas Gracias por todo</p>\r\n<p class="MsoNormal">&nbsp;Un saludo</p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 11px;">Fdo: In&eacute;s R&iacute;os&nbsp;</span></p>\r\n<p class="MsoNormal">&nbsp;***SE HABLA CON INES (FASE) X TFN Y NOS INDICA QUE ESE SENSOR ESTABA ESTROPEADO XQ ALGUIEN LO MANIPULO (PROBABLEMENTE INTENTARON ARREGLARLO Y NO PUDIERON). ELLA DICE QUE LO CAMBIARON.</p>\r\n<p class="MsoNormal">EN LA FACTURA NO VIENE INDICADO QUE HAYAN CAMBIADO EL SENSOR, SE LLAMA X TFN A LA OFICINA DE FASE Y LA OTRA CHICA (NO ERA INES) REVISA EL PARTE DE TRABAJO Y NOS INDICA QUE NO CAMBIARON NINGUN SENSOR, <strong>SIMPLEMENTE LO ARREGLARON,</strong> X ESO NO VIENE NADA ESPECIFICADO EN LA FACTURA DE CAMBIO DE SENSOR.</p>'),
	(12, 11, '2013-09-24', '2014-03-24', NULL, 1, '', 'REVISION DEL GRUPO DE PRESION', '<p>Paz: Programar revisi&oacute;n del Grupo de Presi&oacute;n, para revisar calderin u otros elementos que estime conveniente Eduardo Corbrero</p>'),
	(16, 14, '2013-01-28', '2013-09-26', '2013-10-07', 2, '', 'HUMEDADES X TEJADO', '<p>De:algonz [administrativo@algonz.es]</p>\r\n<p>Enviado el:lunes, 28 de enero de 2013 13:25</p>\r\n<p>Para:\'sinandamios\'</p>\r\n<p>Asunto:SOLICITUD DE PRESUPUESTO TEJADO C/CARMEN AMAYA 4-6-8</p>\r\n<p><span style="font-size: 11px;">Buenos d&iacute;as.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente presupuesto de comprobaci&oacute;n y/o si fuese necesario arreglo de tejado sito en la comunidad c/Carmen Amaya 4-6-8, ya que durante estos d&iacute;as de lluvias se ha comprobado una humedad en el portal 6, descansillo &uacute;ltima planta, la cual nos informan los vecinos que es reincidente cada vez que llueve, y que parece ser proviene el tejado, el cual esta recubierto de piedras. Para acceder a dicho tejado han de ponerse en contacto con la administraci&oacute;n para las llaves. Gracias.</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p><span style="font-size: 11px;">Paz Ortiz</span></p>\r\n<p>Asesoria Algonz</p>\r\n<p>Tfn/fax.- 985.14.98.36</p>\r\n<p>administrativo@algonz.es</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>28/01/2013.-</strong></span> SE ENVIO CORREO A ACROBACIAS VERTICALES, A ASTUR-OBRAS, Y A ASTURIANA DE TEJADOS Y CANALONES.</span></p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>28/01/2013.-</strong></span> VINO EL PROPIETARIO DE CARMEN AMAYA 4 5&ordm;D BENITO 650.485.890, INDICANDO QUE ESTOS DIAS DE TANTAS LLUVIAS LE HA VUELTO A SALIR HUMEDADES EN SU VIVIENDA. &nbsp;SE LE INDICA SINO LE IMPORTA QUE CUANDO VENGAN A VISITAR EL TEJADO LE LLAMAREMOS PARA QUE NOS PERMITA EL ACCESO A SU VIVIENDA Y ASI PODER DETERMINAR LA PROCEDENCIA DE LA FILTRACION Y/O HUMEDADES, DICE QUE SIN PROBLEMA.</span></p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>04/02/2013 (11:10H).-</strong></span> VINO MARCELINO DE ASTUR.TEJADOS Y CANALONES PARA HACER LA VISITA, VIMOS EL TEJADO CON LA VECINA DE C.A. 6 JULIA 696.223.525, SE LLAMA AL VECINO DEL C.A.4 5&ordm;D PARA IR A VER LA HUMEDAD, NO HAY NADIE EN CASA.</span></p>\r\n<p>NOS PASA PRESUPUESTO DE ARREGLO DE HUMEDADES Y PRESUPUESTO DE RETIRADA DE TODA LA PIEDRA Y COLOCACION DE BALDOSA.</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>05/02/2013.</strong></span>- PRESUPUESTO DE ARREGLO DE ASTURIANA DE TEJADOS Y CANALONES</span></p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>18/02/2013.-</strong></span> VINIERON DE ACROBACIAS VERTICALES Y NOS INDICAN QUE NO PRESUPUESTAN ESE TRABAJO XQ ES IMPOSIBLE DAR UNA GARANTIA DE ARREGLO, YA QUE X ZONAS ES IMPOSIBLE DELIMITAR Y QUITAR TODA LA PIEDRA, IMPERMEABILIZAR Y EMBALDOSAR TODO EL TEJADO ES UN DINERAL.</span></p>\r\n<p><span style="font-size: 11px;">NOS COMENTA LA ADMO. QUE LLEVA EL PORTAL 6 (JULIA, VECINA 1&ordm;) QUE ELLA HABLO CON EL CONSTRUCTOR (ES AMIGO DE SU PADRE) Y QUE LE DIJO QUE LO IBAN A ARREGLAR ELLOS, EN PRINCIPIO SE QUEDA EN QUE ELLOS LO REVISEN, YA QUE ASI EVITAMOS GASTOS.</span></p>\r\n<p>NOS INDICA JULIA QUE ELLA NOS IRA INFORMANDO</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>16/09/2013(09:05H).-</strong></span> SE LLAMA A JULIA (ENCARGADA PORTAL N&ordm;6 696.223.525 / 984.197.138) PARA PREGUNTARLE SI HABIAN HECHO ALGO LOS DE LA CONSTRUCTORA, NOS DICE QUE ELLA HABLO CON ELLOS A FINALES DE AGOSTO PRINCIPIOS DE SEPTIEMBRE X ESTE TEMA, PARA VER SI HABIAN IDO O CUANDO TENIAN PENSADO IR (LE HABIAN COMENTADO QUE TIENEN LLAVES DE TODO Y NO NECESITARIAN QUEDAR CON ELLA), QUEDARON EN QUE LE DEVOLVIAN LA LLAMADA Y HASTA LA FECHA NO HA SABIDO NADA MAS.</span></p>\r\n<p>QUEDAMOS EN QUE LLAMARIAMOS NOSOTROS PARA QUE NOS INDICARAN COMO ESTA EL TEMA&nbsp;</p>\r\n<p><span style="font-size: 11px;">P<span style="background-color: #00ffff;">ROMOCIONES VILLA JOVELLANOS, S.L.</span></span></p>\r\n<p><span style="background-color: #00ffff;">Avda. del Llano, 14, Bajo</span></p>\r\n<p><span style="background-color: #00ffff;">33205 Gij&oacute;n</span></p>\r\n<p><span style="background-color: #00ffff;">985.39.85.01 (TINO)</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #00ff00;"><strong>16/09/2013(09:20H).-</strong> </span>SE LLAMA A LA CONST. VILLA JOVELLANOS, NO COGE NADIE EL TFN.</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>23/09/2013(10:30H).-</strong></span> SE LLAMA A LA CONST.VILLA JOVELLANOS, TINO, NOS INDICA QUE EN ESE TEJADO YA &nbsp;HICIERON MUCHOS TRABAJOS DE IMPERMEABILIZACION Y PARECE SER QUE SIGUE DANDO PROBLEMAS DE HUMEDAD Y/O FILTRACIONES, NOS DICE QUE YA SE LO DIJO AL CONSTRUCTOR Y QUE ESTA A LA ESPERA DE QUE LE CONTESTEN, QUEDAMOS EN LLAMARLE EL JUEVES PARA QUE NOS INFORME.</span></p>\r\n<p>**SE LLAMA A JULIA (PTAL.N&ordm;6) PARA INFORMARLE DE TODO.</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ff00;"><strong>24/09/2013(13:35H).-</strong></span> NOS LLAMA JULIA DEL C.A.6, PREGUNTANDO PRIMERO SI LA ADMO. HABIA ENVIADO A ALGUIEN DE FUMIGACION PARA EL TEJADO, SE LE INDICA QUE NO&hellip;(Y ENTONCES LE DEBE DAR EL AIRE DEL PENSAMIENTO&hellip;.).Y NOS DICE QUE DEBEN SER LOS DE LA CONSTRUCTORA APLICANDO EL PRODUCTO DE IMPERMEABILIZACION, YA QUE ELLA SABE QUE LO APLICAN CON UNAS MAQUINAS COMO LAS DE FUMIGACION&hellip;. SE LE INFORMA QUE EL JUEVES QUEDAMOS EN LLAMAR A LA CONSTRUCTORA PARA VER QUE NOS DICEN.</span></p>\r\n<p><span style="background-color: #00ff00;"><span style="font-size: 11px;"><strong>26/09/2013(17:55h).-</strong><strong><span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">SE LLAMA A LA CONSTRUCTORA, TINO, Y NOS INDICA QUE SABE QUE ESTUVIERON HACIENDO ACTUACIONES ALLI PERO NO SABE EXACTAMENTE QUE HICIERON, QUE SE LE LLAME MAS TARDE QUE VA A PREGUNTAR.</span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 11px;">07/10/2013(17:10h).-</span></strong><span style="font-size: 11px;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A LA CONSTRUCTORA (TINO),IMPERMEABILIZARON CHIMENEAS, (HABLARON CON BENITO 5&ordm;D), NO SABEN EXACTAMENTE DE DONDE PROCEDE ESA HUMEDAD, ELLOS CREEN QUE ES UN PORO PERO A SABER DONDE, EN PRINCIPIO HAY QUE ESPERAR A LAS LLUVIAS PARA VER SI FUNCIONAN O NO LOS TRABAJOS, SI QUEDO RESUELTO YA SE COMPROMETIO EL PROMOTOR (JEFE DE TINO) A PINTAR LA ZONA AFECTADA.</span></span></span></p>'),
	(17, 15, '2013-09-25', '2017-05-07', NULL, 1, '', 'TEMA MANTENIMIENTO HIDROFUGADO EN TEJADO', '<p><span style="background-color: #00ff00;"><strong>24/09/2013.-</strong><strong><span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">LOS ULTIMOS TRABAJOS REALIZADOS SOBRE ESTA ACTUACION FUERON EJECUTADOS POR LA CONSTRUCTORA EN LA FECHA INDICADA. (OUTLOOK).</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">COMENTA LA VECINA DE CARMEN AMAYA 6 1&ordm;E (TRATA CON LA CONSTRUCTORA) QUE SERIA CONVENIENTE PARA NO TENER PROBLEMAS REALIZAR UN MANTENIMIENTO SOBRE DICHAS ACTUACIONES CADA +/- 3 &Oacute; 4 A&Ntilde;OS CON EL PRODUCTO "HIDROREPELL, HIDROFUGANTE EN FACHADAS, DISTRIBUIDOR CURESES (NORE&Ntilde;A)". <strong><span style="background-color: #ffcc00;">ADJUNTAR LO QUE DICE EL ACTA Y PROGRAMAR PARA DENTRO DE 3/4 A&Ntilde;OS</span></strong></span></span></p>\r\n<p><span style="background-color: #ffffff;"><strong>EN JUNTA DE FECHA 31/10/2013 SE DETERMINA QUE:</strong></span></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 9.0pt; font-family: Verdana;">4&ordm;- &nbsp;Ruegos y preguntas. </span></strong></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;S</span></strong><span style="font-family: Verdana; font-size: 9pt; text-indent: 35.4pt;">e realiz&oacute; la limpieza del tejado ascendiendo la misma a 90,75&euro;. Tambi&eacute;n informar que </span>la Constructora<span style="font-family: Verdana; font-size: 9pt; text-indent: 35.4pt;"> en este ejercicio ha realizado reparaciones aplicando un producto impermeabilizante en los tejadillos de ascensor y zonas de chimeneas con la finalidad de evitar filtraciones a las Zonas Comunes. Nos han vuelto a recalcar que es importante realizar una revisi&oacute;n anual del Tejado. Esta imprimaci&oacute;n aplicada por Villa Jovellanos por las inclemencias del tiempo se degrada, por lo que recomiendan cada 3/5 a&ntilde;os retocar las zonas trabajadas para evitar las filtraciones.</span></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><span style="font-family: Verdana; font-size: 9pt; text-indent: 35.4pt;">SE PROGRAMA UNA NUEVA ACTUACION DE ESTE TIPO PARA DENTRO DE 4 A&Ntilde;OS +/-.</span></p>'),
	(18, 16, '2013-09-25', '2013-10-06', '2013-10-22', 2, '', 'LIMPIEZA DE TEJADO', '<p><span style="background-color: #00ff00;"><strong>24/09/2013.-</strong></span>&nbsp;SE FIJA DE FORMA ANUAL UNA LIMPIEZA DE TEJADO (PARA QUITAR PLANTAS Y SUCIEDAD, YA QUE ESE TEJADO-TERRAZA ES DE PIEDRA). SE HABLA CON LA ADMO.DEL PORTAL 6 Y DA EL VISTO BUENO (ESTA MUY DE ACUERDO).</p>\r\n<p><span style="background-color: #00ff00;"><strong>07/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE MANDA CORREO A JOSE A.LEONARDO, PRIMERO SE LLAMA X TFN PARA PREGUNTARLE CUANTO PUEDE SER, SE MANDA CORREO TB</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 07 de octubre de 2013 18:21<br /> <strong>Para:</strong> \'reformas.leonardo@gmail.com\'<br /> <strong>Asunto:</strong> SOLICITUD DE PRESUPUESTO LIMPIEZA DE TEJADO CP CARMEN AMAYA 4-6-8</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente presupuesto para la limpieza de cubierta-tejado de piedra, sita en la CP Carmen Amaya 4-6-8.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p>&nbsp;<span style="background-color: #00ff00;"><strong>10/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE JOSE A.LEONARDO. EN DOCUMENTOS ADJUNTOS.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">SE COMENTA CON M&ordf; DE LOS ANGELES Y SE DA EL VISTO BUENO A LOS TRABAJOS.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>15/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;CORREO ENVIADO CON EL VISTO BUENO A JOSE A.LEONARDO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 15 de octubre de 2013 11:14<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> RE: PRESUPUESTOS</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Indicamos a trav&eacute;s de la presente el visto bueno sobre el presupuesto de limpieza de tejado en la CP Carmen Amaya 4-6-8. Las llaves se localizan en la administraci&oacute;n. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p>&nbsp;<span style="font-size: 10.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial; color: navy;">18/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial; color: navy;"><span style="background-color: #ffffff;">&nbsp;<span style="color: #000000;">SE LLAMA A JOSE A.LEONARDO, QUE PARA LA SEMANA QUE VIENE, PROBABLEMENTE EL LUNES LO HAGA.</span></span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial; color: navy;"><span style="color: #000000;">22/10/2013.-</span></span></strong><span style="font-size: 10.0pt; font-family: Arial; color: navy;"><span style="color: #000000;"><span style="background-color: #ffffff;">&nbsp;VIENE JOSE A.LEONARDO Y NOS INDICA QUE YA ESTA LIMPIO EL TEJADO, QUE SACO 2 BOLSAS DE HIERBAS Y PORQUERIA. QUEDO OK</span></span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial; color: navy;"><span style="color: #000000;"><span style="background-color: #ffffff;">04/11/2013.- SE ADJUNTA FACTURA</span></span></span></span></p>'),
	(19, 17, '2013-09-27', '2014-09-07', NULL, 1, '', 'REVISION/MANTENIMIENTO PORTON', '<p>06/09/2013.- REVISION PASADA EN EL DIA DE HOY X CIAPER. PARTE DE TRABAJO</p>\r\n<p>&nbsp;PTE. FACTURA DE CIAPER CORRESPONDIENTE A LA REVISION SEPT/2013</p>\r\n<p>&nbsp;</p>\r\n<p>SE PROGRAMA NUEVA REVISION PARA MARZO/2014 (CONSULTAR PRIMERO CON M&ordf; DE LOS ANGELES).</p>'),
	(20, 18, '2013-09-27', '2013-10-10', '2013-10-04', 2, '', 'ARRASTRAN RODAMIENTOS X LAS CARRILERAS ASCENSOR', '<p><span style="background-color: #008080;"><strong><span style="background-color: #ffffff;">TFN EMBARBA.- 610.175.239 / 985.252.517</span><br /></strong></span></p>\r\n<p><span style="background-color: #008080;"><strong>27/09/2013//</strong> </span>HOY 27/009/13 ME PONGO EN CONTACTO CON VICTOR PARA INFORMARLE QUE LAS CARRILERAS DE MI ASCENSOR ARRASTRAN MUCHO Y METEN RUIDO. PARA QUE CUANDO REALICEN LA INSPECCION MENSUAL TOMEN NOTA Y LAS REGULEN O HAGAN LO QUE SEA NECESARIO.</p>\r\n<p><span style="background-color: #339966;"><strong>03/10/2013(09:15h).-</strong><span style="background-color: #ffffff;">&nbsp;SE HABLA CON DAVID (TECNICO) X TFN Y NOS INDICA QUE AUN NO SE HAN PASADO PARA LA REVISION, QUE CUANDO PASEN VIENE X LA OFICINA PARA INFORMARNOS Y FIRMAR PARTES.</span></span></p>\r\n<p><strong><span style="background-color: #339966;">03/10/2013.-</span></strong><span style="background-color: #339966;"><span style="background-color: #ffffff;">&nbsp;VINO EL TECNICO Y NOS INDICA QUE ENGRASO LAS RUEDAS QUE VAN X LA CARRILERA, TB LO AJUSTO, PERO NO EXCESO PUESTO QUE ES TAN MALO QUE ESTEN APRETADAS COMO QUE ESTEN FLOJAS.</span></span></p>\r\n<p><strong><span style="background-color: #339966;">04/10/2013.-</span></strong>&nbsp;LO COMPROBO HOY M&ordf; DE LOS ANGELES Y EFECTIVAMENTE HACE MENOS RUIDO.</p>'),
	(21, 19, '2013-09-27', '2014-01-12', NULL, 4, '', 'MANTENIMIENTO PORTON GARAJE', '<p>SEGUIMIENTO ABIERTO EN OUTLOOK.</p>\r\n<p>SE FIJA MANTENIMIENTO DEL PORTON PARA ENERO/2014. PENDIENTE DE TRATAR EN JUNTA M&ordf; DE LOS ANGELES</p>'),
	(22, 20, '2013-10-28', '2013-10-30', '2013-11-07', 2, '', 'RENOVACION LUMINARIA A LED', '<p>EN JUNTA DE FECHA 17/09/2013 SE DETERMINA QUE:</p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">1&ordm;- Proponer y aprobar la colocaci&oacute;n de l&aacute;mparas de emergencias permanentes en rellanos y portal. Presentaci&oacute;n de propuestas y aprobaci&oacute;n de derrama.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">&nbsp;</span><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Despu&eacute;s de debatir el tema, se determina por unanimidad de los asistentes no colocar las l&aacute;mparas de emergencias, sino realizar colocaci&oacute;n de detectores de presencia empotrados en el falso techo, tipo Orbis, Mod Dicromat, independizando todas las plantas sus encendidos. Totalmente &nbsp;montado y conexionado.</span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">&nbsp;</span><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">El importe de los trabajos 452,50&euro; iva incluido, el aporte por vecino asciende a 27&euro;. Esta cuota &uacute;nica la cobrar&aacute; VIPASA, conjuntamente con la cuota de Comunidad del mes de Noviembre/13.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="font-size: 12.0pt; font-family: \'Palatino Linotype\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: red; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">PAZ: ABRIR SINIESTRO EN PLATAFORMA ALGONZ, YA LE REMITI FAX CON LA APROBACI&Oacute;N A FASE. LA FECHA ESTIMADA PARA LA EJECUCION DE LOS TRABAJOS SEG&Uacute;N ME DIJO QUIQUE (FASE) SER&Iacute;AN ANTES DEL 11/10/2013</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="background-color: #ffffff; color: #000000;"><strong><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">30/09/2013.-</span></strong><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">se deja pte. para llamar una vez finalizado el plazo de ejecuci&oacute;n indicado por FASE.</span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="background-color: #ffffff; color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';"><strong>04/10/2013//</strong> Pasa por la Administraci&oacute;n In&eacute;s de Fase y nos informa que en la tarde de hoy dejaran colocados los detectores de movimiento en esta Comunidad. Tamb&iacute;en Paz llama a Tom&aacute;s de Itelco para informarle que pueden pasar a retirar la emergencia que se coloc&oacute; en el 1&ordm; y se le facilita el tlfn de Ana para que deje colocada la vieja (no funciona. <strong>(MA)</strong>. <span style="background-color: #00ccff;">Paz confirmar con Susana la Presidente si ha quedado todo bien, e informarle que procederemos al pago de los trabajos.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">07/10/2013.- </span></span></span></strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">RECIBIMOS CORREO DE FASE SOLICITANDO CIF Y N&ordm; DE CTA PARA FACTURAR LOS TRABAJOS, SE LLAMA A SUSANA 649.054.484 (PTE.) PARA QUE NOS CONFIRME SI LOS TRABAJOS ESTAN CORRECTOS.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">(11:20H).- LLAMADA A SUSANA PTE., NOS CORTA LA LLAMADA. NOS DEVUELVE LA LLAMADA Y NOS INDICA QUE LO COMPROBARA Y NOS LLAMA CON LO QUE SEA.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">10/10/2013.- </span></span></span></strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">NOS LLAMA SUSANA, PTE. DE LA CDAD. Y NOS INDICA QUE LO COMPROBO VARIAS VECES Y QUE NO FUNCIONA BIEN LA PLANTA 1&ordf; Y 2&ordf;, QUE ENCIENDEN JUNTAS, ES DECIR, PASAN A LA PLANTA PRIMERA Y SE ENCIENDE TB LA SEGUNDA Y VICEVERSA, SE HABIA QUEDADO EN QUE SE ENCENDIERAN DE MANERA INDEPENDIENTE CADA PLANTA, TAL Y COMO OCURRE EN LA 3&ordf; Y 4&ordf; PLANTA.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">10/10/2013(17:10H).-</span></span></span></strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">&nbsp;SE LLAMA A INST.FASE, NOS COGE EL TFN QUIQUE Y SE LE INDICA QUE HAN DE PASAR POR LA CDAD. PARA ARREGLAR EL PROBLEMA QUE HAY, NOS INDICA QUE HOY MISMO ENVIA A LOS TECNICOS PARA QUE ARREGLEN ESE TEMA.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">11/10/2013.-</span></span></span></strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">&nbsp;NOS LLAMA INES DE INST.FASE Y NOS INDICA QUE YA ESTA SOLUCIONADO EL TEMA DEL ALUMBRADO DE LA 1&ordm; Y 2&ordm; PLANTA.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">14/10/2013(12:10H).-</span></span></span></strong><span style="background-color: #ffffff;"><span style="color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">&nbsp;SE LLAMA A SUSANA 649.054.484 (PTE. DE LA CDAD.) PARA QUE NOS COMPRUEBE QUE ESTA TODO OK. NO CONTESTA AL TFN.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong>18/10/2013(11:25H).-&nbsp;</strong>SE LLAMA A SUSANA 649.054.484 (PTE. DE LA CDAD.) PARA QUE NOS DIGA SI ESTA TODO OK, NO COGE EL TFN.&nbsp;</p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="background-color: #ffffff; color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';">&nbsp;<strong>18/10/2013.-&nbsp;</strong>llama la vecina de C.52 1&ordm;B, indicando que el tema de la luz est&aacute; peor que antes, que al salir de su vivienda x la noche tiene que llegar hasta la zona del ascensor para q el sensor detecte movimiento y se encienda la luz, con lo cual, seg&uacute;n ella no puede cerrar la puerta hasta que llega al ascensor, da la vuelta y la cierra......no asisti&oacute; a la junta....., se le indica q se comentar&aacute; x si se puede hacer algo.</span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="background-color: #ffffff; color: #000000;"><span style="font-size: 12pt; font-family: \'Palatino Linotype\';"><strong>18/10/2013.-&nbsp;</strong>SE MANDA CORREO A INST.FASE INDICANDO EL PROBLEMA DE LA VECINA<br /></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 18 de octubre de 2013 17:31<br /> <strong>Para:</strong> \'info@montajeselectricosfase.com\'<br /> <strong>Asunto:</strong> RV: C/ Las Cigarreras 52</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nos ha dado aviso la inquilina del 1&ordm;B, indicando que cuando sale de su vivienda en horario nocturno, ha de ir hasta la zona del ascensor para que las luminarias se enciendan, con lo cual, nos indica que tiene que dejar la puerta abierta hasta que el sensor detecta y se ilumina para despu&eacute;s tener que volver a cerrarla. Por favor, cuando tengan alg&uacute;n trabajo por la zona si pueden pasar por esta comunidad y verificar con la vecina cual es el problema para determinar si hay alguna soluci&oacute;n. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, atentamente</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="color: navy; font-family: Arial; font-size: 9pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><strong><span style="font-family: Arial; font-size: 9pt;">23/10/2013.- &nbsp;</span></strong><span style="font-family: Arial; font-size: 9pt;">VIENE INES DE INST.FASE Y NOS INDICA QUE YA ESTA ARREGLADO, QUE REGULARON EL SENSOR Y CUBRIERON LA ZONA QUE INDICABA LA VECINA. TODO OK.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-family: Arial; font-size: 9pt;">28/10/2013.- &nbsp;&nbsp;</span></strong><span style="font-family: Arial; font-size: 9pt;">RECIBIMOS LLAMADA DE LA VECINA DEL 2&ordm;C ISABEL, INDICANDO QUE LA LUZ SE APAGA MUY PRONTO, QUE NO DA TIEMPO A NADA.&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">*11:20H.- SE LLAMA A INST.FASE PARA QUE PASEN A REVISAR ESO YA, HABLAMOS CON TERE Y SE LE INDICA QUE SE PONGA EN CONTACTO INES CON NOSOTROS XQ FALLAN LOS DETECTORES, TOMA NOTA Y NOS LLAMARAN.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">***NOS LLAMA INES, QUE ESTA TODO CORRECTO, PICAN A LA VECINA PERO NO HAY NADIE EN CASA (O NO LES ABRE...), LE DEJARON UNA NOTA PARA QUE SUPIERA QUE HAN ESTADO ALLI Y X SI TIENE ALGUN OTRO PROBLEMA QUE LES LLAME DIRECTAMENTE.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-family: Arial; font-size: 9pt;">29/10/2013.-</span></strong><span style="font-family: Arial; font-size: 9pt;">&nbsp;VIENE LA VECINA DEL 1&ordm; INDICANDO QUE EL TEMA DE LAS LUCES (DETECTOR) ESTA MAL, QUE DURA MUY POCO. VA M&ordf; DE LOS ANGELES CON ESTA VECINA Y EFECTIVAMENTE COMPRUEBA QUE LAS LUCES DURAN ENCENDIDAS 10 SEGUNDOS Y QUE ELLA (M&ordf; DE LOS ANGELES) HABIA QUEDADO CON QUIQUE EN QUE LAS LUMINARIAS DEL PORTAL FUNCIONARAN SOLAMENTE CUANDO NO FUERA DE NOCHE Y CUANDO ENTRARAN &nbsp;AL PORTAL, (LOS SENSORES QUE SE INSTALARON SON DE LUMINOSIDAD Y PRESENCIA), SE LLAMO A INES DE FASE Y SE LE INFORMO DE TODO EL TEMA, SE LE SOLICITO QUE LO ARREGLARAN YA, NOS DICE QUE HOY MISMO VA RUBEN A SOLUCIONARLO.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">REGULARON LOS LUMENES DEL PORTAL Y AHORA SOLAMENTE ENCIENDE CUANDO OSCURECE. ASIMISMO LO DE LAS PLANTAS QUEDO LIQUIDADO.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">TODO OK.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">PTE.FACTURA INST.FASE</span></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(23, 21, '2013-09-30', '2013-10-06', '2013-11-06', 2, '566704281', 'HUNDIMIENTO DE BOTONES V.40 C.A.1', '<p><span style="background-color: #00ff00;"><strong>EN OUTLOOK HAY SEGUIMIENTO ABIERTO SOBRE EL MISMO PROBLEMA "</strong></span><span style="background-color: #00ff00;"><strong>VELAZQUEZ 40 - 42 CP PUERTA DEL SOL -PUERTA PORTAL( SEGURO videoportero)- sampedro-ITELCO"</strong><strong style="font-size: 11px;">&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #00ff00;"><strong>27/09/2013.-</strong><span style="background-color: #ffffff;">&nbsp;RECIBIMOS LLAMADA DEL PTE. DE LA COMUNIDAD, ANTONIO, Y NOS INDICA QUE SE HA PERCATADO QUE EN DOS PORTALES DE LA COMUNIDAD HAN HUNDIDO VARIOS BOTONES DE LAS VIVIENDAS. SE LE INDICA QUE PARA QUE LO CUBRA EL SEGURO HA DE PONER UNA DENUNCIA. NOS DICE QUE ESTA EN MIERES EN EL HOSPITAL CON UN FAMILIAR, QUE EL LUNES LA PONDRA.</span></span></p>\r\n<p><strong><span style="background-color: #00ff00;">30/09/2013.-&nbsp;</span></strong><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">&nbsp;NOS TRAE EL PTE. LA DENUNCIA (ADJUNTADA EN DOCUMTS) SE APERTURA SINIESTRO EN EL SEGURO SE LA COMUNIDAD.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>30/09/2013(18:45H).-</strong><span style="background-color: #ffffff;">&nbsp;MAPFRE (GLORIA) SE LE INFORMA DE TODO EL SINIESTRO, DA&Ntilde;OS EN BOTONES COMUNES DE PLACA EN PORTAL EXTERIOR. SE FACILITA TFN DEL PTE. PARA SU ARREGLO. ANTONIO 634.525.292 Y SE SOLICITA ACTUACION DE TECNICO.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">CORREO ENVIADO A MAPFRE PARA COMENZAR ACTUACION</span></span></p>\r\n<p><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 30 de septiembre de 2013 18:56<br /> <strong>Para:</strong> \'siniestros.mapgen@mapfre.com\'<br /> <strong>Asunto:</strong> EXPTE.- 566704281</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto se remite denuncia sobre expte.indicado n&ordm; 566704281. Se solicita profesional para arreglos, tel&eacute;fono de contacto 634.525.292 Antonio.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, atentamente</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">07/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;RECIBIMOS LLAMADA DEL PERITO BORJA CORTES PALOMINO 677.974.801, INDICANDO QUE VA A DARLO COMO ACTO VANDALICO DE POCO IMPORTE, YA QUE, TENIENDO EN CUENTA DOS TEMAS, UNO QUE CUANDO FUE EL ELECTRICISTA DE LA COMPA&Ntilde;IA SE PERCATO AL QUITAR LA PLACA QUE HABIA PUNTOS DE SILICONA DENTRO DE ELLA, LO QUE SIGNIFICA QUE ESTAN DA&Ntilde;ADOS POR MAL USO O SIMPLEMENTE X EL USO, NO X ACTO VANDALICO, Y SEGUNDO QUE YA HAY OTROS SINIESTROS ABIERTOS X ESTE MISMO TEMA, DE TODAS FORMAS, BORJA VA A DARLO COMO VALIDO ENVIANDO A LA COMPA&Ntilde;IA DA&Ntilde;OS, NOS INDICA QUE MANDEMOS A MABER (LA EMPRESA QUE LO ARREGLO LA VEZ ANTERIOR) Y QUE SI LOS ARREGLOS SON MENOS DE 150,00.-&euro; LE DEMOS EL VISTO BUENO PARA ELLO Y SI SON SUPERIORES LE ENVIEMOS PRESUPUESTO.</span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">**SE MANDA CORREO A <strong>ELECTRICIDAD MABER 985.33.95.40</strong> PARA QUE PASEN A REVISARLO Y ENVIEN PRESUPUESTO.</span></span></span></p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 07 de octubre de 2013 18:04<br /> <strong>Para:</strong> \'Electricidad Maber\'<br /> <strong>Asunto:</strong> CP PUERTA DEL SOL C/VELAZQUEZ 40 C/CARMEN AMAYA 1</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente presupuesto y/o arreglo sobre botoneras en placa exterior ubicadas en los portales c/Velazquez 40 y c/Carmen Amaya 1. Una vez comprobada la reparaci&oacute;n que ha de llevarse a cabo, si est&aacute; no supera los 140,00.-&euro; (IVA incluido) realizar los trabajos de arreglo sobre la marcha, si superar&aacute; dicha cantidad pasar presupuesto a la administraci&oacute;n especificando partidas y precios.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Para realizar dicha visita pueden ponerse en contacto con el presidente de la comunidad <strong><span style="font-size: 8.0pt;">ANTONIO MURILLO</span></strong><strong><span style="font-size: 8.0pt;"> JIMENEZ </span></strong></span><span style="font-size: 8.0pt; font-family: Arial;">CARMEN AMAYA 1, 1&ordm; A </span><span style="font-size: 11.0pt; font-family: Arial;">634.52.52.92.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style="font-size: 10pt; font-family: Arial;">A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">07/10/2013(18:10h).-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA AL PTE PARA INDICAR QUE VAN A LLAMARLE DE ELECTRICIDAD MABER PARA IR A VER EL PROBLEMA, Y QUE SI EL ARREGLO ES INFERIOR A 140 EUROS LO VAN A HACER, DICE QUE &Eacute;L YA SABE QUE NO, QUE ES BASTANTE MAS XQ ESOS BOTONES YA NO LOS HAY, TIENEN QUE SER DE SEGUNDA MANO, QUE PRESIONEMOS AL SEGURO DICIENDO QUE NOS VAMOS PARA QUE LO ARREGLEN, SE LE DICE QUE YO NO ESTOY AQUI PARA PRESIONAR NI AMENAZAR A NADIE,QUE YO ESTOY PARA GESTIONAR ESTOS SINIESTROS Y Q LO ARREGLEN.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong>10/10/2013(10:25h).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA X TFN A MABER (SUSANA) PARA QUE NOS INFORME, NOS INDICA QUE AUN NO SE HAN PASADO, QUE LO TIENEN PARA IR ESTA SEMANA, NO OBSTANTE QUE LO VA A RECLAMAR PARA QUE VAYAN HOY MISMO</span></span>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">*NOS LLAMA SUSANA DE MABER Y NOS DICE QUE LE HA INDICADO EL TECNICO QUE YA ESTA TODO RESUELTO, QUE FUE UNA INTERVENCION MINIMA Y QUEDO SOLUCIONADO.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">**SE LLAMA AL PTE. ANTONIO Y NOS COMPRUEBA IN SITU QUE LA BOTONERA DE CARMEN AMAYA ESTA ARREGLADA, PERO EL DE VELAZQUEZ 40 SIGUE IGUAL, HUNDIDO</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">***13:10H.- SE LLAMA A SUSANA MABER PARA INDICARLE ESTE TEMA Y QUE LO REVISEN, ASI COMO QUE XFAVOR SE PONGAN EN CONTACTO CON EL PTE. PARA IR, YA QUE SI FUERON CON ANTERIORIDAD</span></p>\r\n<p class="MsoNormal"><strong><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;">14/10/2013(10:55h).-</span></span></strong><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;VINO LA PROPIETARIA DE V.40 3&ordm;B PARA INDICAR QUE SU BOTON DEL MICRO SIGUE HUNDIDO, QUE LO ARREGLAN, LE TOCA ALGUIEN Y VUELVE A ESTROPEARSE, CON LO CUAL, EL PROBLEMA NO QUEDA RESUELTO.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">SE VUELVE A DAR AVISO A MABER PARA PREGUNTAR QUE ARREGLO HICIERON ELLOS&nbsp;</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">NOS INDICA SUSANA (MABER) QUE ELLOS FUERON Y COLOCARON EL BOTON, NO SE FIJARON SI ESTABA ROTO O NO, SE LE INDICA QUE VUELVE A ESTAR HUNDIDO, QUE VAYAN Y LO DEJEN CORRECTO, Y QUE LO COMPRUEBEN ANTES DE IRSE.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">17/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;NOS LLAMA BORJA, EL PERITO, PARA INDICARNOS QUE &Eacute;L SE VA UNOS DIAS DE VACACIONES Y QUE DEJARA PTE. PARA SU VUELTA LA ORDEN DE INGRESO DE LA FACTURA DE MABER (XQ AUN NO LA TENEMOS), QUE CUANDO NOS LLEGUE SE LA MANDEMOS Y YA LO TIENE &Eacute;L EN CUENTA A SU VUELTA.</span></span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">&nbsp;</span><span style="font-size: 11px; background-color: #00ff00;"><strong>18/10/2013(11:00H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A MABER PARA PREGUNTAR SI HAN ARREGLADO EL TEMA DEL TIMBRE DE V.40 3&ordm;B Y NOS DICE SUSANA QUE EL TECNICO ESTUVO ALLI EL MISMO LUNES Y QUE HABLO CON EL CONTACTO QUE NOSOTROS LE HABIAMOS PASADO, O SEA, CON ANTONIO (q ya no es pte.) QUE &Eacute;L LO DEJO ARREGLADO. NOS PASA LA FACTURA EL LUNES COMO MUY TARDE.</span></span></p>\r\n<p>&nbsp;<span style="background-color: #00ff00;"><strong>21/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTOS RECIBIDOS DE MABER PARA INSTALAR PLACAS ANTIVANDALICAS EN LOS PORTALES. (DOCUMENTOS ADJUNTOS).</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>24/10/2013(10:50H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A ELECTRICIDAD MABER, SALTA EL CONTESTADOR, SE DEJA AVISO EN EL BUZON</span></span></p>\r\n<p>&nbsp;<span style="background-color: #00ff00;"><strong>29/10/2013(10:30h).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A ELECTRICIDAD MABER, (SUSANA), SE LE SOLICITA X MILLONESIMA VEZ LA FACTURA DE ARREGLO DE LOS MICROS.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>06/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;CORREO RECIBIDO DE MABER CON LA FACTURA. (ARCHIVADA EN DOCUMNTS. ADJUNTOS).</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">SE ENVIA CORREO CON DICHA FACTURA AL SEGURO Y AL PERITO. CORREO ENVIADO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 06 de noviembre de 2013 10:51<br /> <strong>Para:</strong> \'siniestros.reparables@mapfre.com\'<br /> <strong>CC:</strong> \'borja@jbdcortesperitaciones.com\'<br /> <strong>Asunto:</strong> EXPTE.- 566704281</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto remite factura de arreglo sobre los da&ntilde;os indicados en expte. n&ordm; 566704281.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Atentamente</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="color: navy; font-family: Arial; font-size: 9pt;">Paz Ortiz</span>&nbsp;</p>\r\n<p>&nbsp;PTE. DE RECIBIR INDEMNIZACION DEL SEGURO. SE CIERRA EL SEGUIMIENTO CON ESA ANOTACION PARA QUE M&ordf; JOSE LO TENGA EN CUENTA PARA LA CONTABILIDAD.</p>'),
	(24, 22, '2013-10-02', '2014-01-19', NULL, 1, '', 'ADECUACION INSPECCION GARAJE', '<p><strong><span style="background-color: #00ff00;">02/10/2013.-</span></strong><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">&nbsp;M&ordf; DE LOS ANGELES SOLICITA PRESUPUESTOS PARA PASAR LA INSPECCION DEL GARAJE DE LA COMUNIDAD (ABIERTO EN AVISOS DE COMUNIDAD), QUIERE QUE SE SOLICITEN A INSTALACIONES FASE Y A NORTEC, CORREO ENVIADO A AMBOS</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">Buenas tardes.-</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente presupuesto para garaje CP Carmen Amaya 2 sobre el tema de luminarias para realizar la inspecci&oacute;n de baja tensi&oacute;n del mismo. Para el acceso al mismo pueden ponerse en contacto con la administraci&oacute;n. Dicho presupuesto ser&iacute;a necesario para antes del 14/10/2013. Gracias.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></span></p>\r\n<p>&nbsp;<strong><span style="background-color: #00ff00;">07/10/2013.-</span>&nbsp;</strong>PRESUPUESTO RECIBIDO DE INST.FASE. (DOCUMENTOS ADJUNTOS).</p>\r\n<p><strong><span style="background-color: #00ff00;">07/10/2013.-</span>&nbsp;</strong>PRESUPUESTO RECIBIDO DE NORTEC (DOCUMENTO ADJUNTO).</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Nor Tec [mailto:nortecgijon@gmail.com] <br /> <strong>Enviado el:</strong> lunes, 07 de octubre de 2013 11:14<br /> <strong>Para:</strong> administrativo@algonz.es<br /> <strong>Asunto:</strong> Presupuesto CP Carmen Amaya 2</span></p>\r\n<p class="MsoNormal">&nbsp;A la atenci&oacute;n de Paz Ortiz,</p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;">adjunto presupuesto seg&uacute;n conversaci&oacute;n telef&oacute;nica.&nbsp;<span style="font-size: 11px;">En resumen:</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;">&nbsp;- Habr&iacute;a que sustituir 18 luminarias de emergencia para que pasen a ser acordes a la normativa.</p>\r\n<p class="MsoNormal">- Todas ellas llevar&aacute;n las pegatinas correspondientes. Se incluyen dos lotes m&aacute;s de pegatinas para las emergencias que ya hay en LED pero que no tienen colocadas estas pegatinas de se&ntilde;alizaci&oacute;n.</p>\r\n<p class="MsoNormal">- Adem&aacute;s hay un tubo de pl&aacute;stico por debajo de la altura reglamentaria. Tambi&eacute;n est&aacute; en el presupuesto la rectificaci&oacute;n de esta deficiencia.</p>\r\n<p class="MsoNormal">- Necesitar&iacute;amos el bolet&iacute;n actual, es decir, el que se emiti&oacute; tras la construcci&oacute;n del edificio.</p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;">&nbsp;Con estos cambios la instalaci&oacute;n deber&iacute;a pasar la OCA, no obstante si ellos detectasen alguna otra deficiencia, habr&iacute;a que presupuestarla y enmendarla despu&eacute;s de dicha inspecci&oacute;n (el precio de la "segunda oportunidad" por parte del OCA si se produjeran deficiencias va incluido en el precio de la inspecci&oacute;n).</p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;"><span style="font-size: 11px;">He pedido un presupuesto al OCA de confianza de mi electricista, pero a&uacute;n no lo tengo por escrito. En cuanto lo reciba te lo env&iacute;o, pero te adelanto que tendr&aacute; un precio de, aproximadamente, 300 euros.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;"><span style="font-size: 11px;">Un saludo y muchas gracias, para cualquier consulta estamos en el 692410572.</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="background-color: #00ff00;"><strong>09/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE ADJUNTA PRESUPUESTO DE TOMAS ACTUALIZADO EN DOCUMENTOS ADJUNTOS.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;<span style="background-color: #00ff00;"><strong>17/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;EN JUNTA DE FECHA 14/10/2013 SE DETERMINA QUE :</span></span></span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Por &uacute;ltimo se informa que en Julio/2014 hay que realizar la inspecci&oacute;n de baja tensi&oacute;n para el garaje y hay +/- un total de 18 emergencias fundidas entre el -1, -2 y accesos por ascensor y escalera, las cuales hay que reponer para realizar dicha inspecci&oacute;n. Debido a que uno de los puntos que se confirman en dicha inspecci&oacute;n es si la iluminaci&oacute;n&nbsp; de emergencia es la adecuada para el tipo de garaje. Se llevan varias propuestas determinando colocar las luminarias de emergencias con NorTec, se explica que son emergencias LED con marcado CE y que nos dan una garant&iacute;a al igual que cualquier marca de 2 a&ntilde;os. En la actualidad hay tres emergencias LED colocadas en el garaje, las que se aprueba colocar ser&iacute;a de las mismas caracter&iacute;sticas pero con un blanco mate. Lo que har&iacute;amos ser&iacute;a recolocar estas en accesos por las escaleras y/o ascensores y dejar todas las del garaje con el mismo dise&ntilde;o. Esta adecuaci&oacute;n se acuerda realizarla en los meses de Enero/Febrero del 2014, para no tener que aportar derrama y realizarlo con el superavit acumulado del ejercicio. El importe de las luminarias es de 610,92&euro; m&aacute;s iva y lote de 20 pegatinas (emergencia) 40,00&euro;.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong style="text-indent: 35.4pt; font-size: 11px;"><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">PAZ: QUEDA APROBADO ESTE PRESUPUESTO PARA ENERO/FEBRERO DEL 2014, UNA VEZ REALIZADO AVISAS A MARIA JOSE PARA QUE EN JULIO PROGRAME LA INSPECCI&Oacute;N DEL GARAJE TE DEJO EL PRESUPUSTO APROBADO.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="background-color: #00ff00;"><strong style="text-indent: 35.4pt; font-size: 11px;">24/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE MANDA CORREO A NORTEC C.B. PARA QUE TENGA PRESENTE LOS TRABAJOS Y ANOTE EN AGENDA (PRESUPUESTO APROBADO EN DOCUMENTOS ADJUNTOS).</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 24 de octubre de 2013 13:13<br /> <strong>Para:</strong> \'Nor Tec\'<br /> <strong>Asunto:</strong> RE: Presupuesto CP Carmen Amaya 2</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Informamos a trav&eacute;s de la presente de la aceptaci&oacute;n en junta de fecha 14/10/2013 del presupuesto presentado por vds. (Nortec C.B.) n&ordm; 96/2013, por importe total de //822,62//.-&euro; (se adjunta presupuesto aprobado). Asimismo indicarles que <strong><span style="text-decoration: underline;">los trabajos han de efectuarse en enero/febrero 2014</span></strong> para tenerlo todo listo para la inspecci&oacute;n del garaje.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="color: navy; font-family: Arial; font-size: 9pt;">Paz Ortiz</span>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;">&nbsp;</p>'),
	(25, 23, '2013-10-02', '2013-10-10', NULL, 1, '', 'SOLICITUD PRESUPUESTOS PINTURA PORTAL', '<p><span style="background-color: #00ff00;"><strong>02/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;M&ordf; DE LOS ANGELES SOLICITA PRESUPUESTOS DE PINTURA DEL PORTAL PARA EXPONER EN JUNTA DE FECHA 15/10/2013.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">SE SOLICITA A JOSE A.LEONARDO, D&amp;J, CHUS GUERVOS.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">CORREO ENVIADO DE SOLICITUD DE PRESUPUESTO A JOSE A.LEONARDO Y CHUS GUERVOS. AL PINTOR D&amp;J (636.115.062/684.022.156)SE LE SOLICITA A TRAVES DE TFN (02/10/2013 19:00H)</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong style="font-size: 11px;">08/10/2013.-</strong></span><span style="background-color: #ffffff;"><span style="background-color: #00ff00;">&nbsp;</span>PRESUPUESTO RECIBIDO DE D&amp;J, (LO DEJO EN EL BUZON). EN DOCUMENTOS ADJUNTOS.</span></p>\r\n<p><span style="background-color: #00ff00;"><strong>10/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE JOSE A.LEONARDO, EN DOCUMENTOS ADJUNTOS.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>14/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE SOLICITO PRESUPUESTO A CHUS</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>15/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PINTURAS Y DECORACIONES DEL POZO (PINTOR QUE ENVIO UN VECINO) HA TRAIDO PRESUPUESTO DEL MISMO (ADJUNTADO EN DOCUMENTOS)</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>29/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;EN JUNTA DE FECHA 11/10/2013 SE APROBO PRESUPUESTO DE PINTURAS RENDUELES. PRESUPUESTO APROBADO ARCHIVADO EN DOCUMENTS.ADJUNTOS.&nbsp;<strong><span style="background-color: #ffff00;">PAZ RECEURDA QUE HAY QUE ENVIAR A VIPASA COMPARATIVO DE LOS TRES PRESUPUESTOS// REQUERIR A JOSE ANTONIO/LES CIGARRERES 46 QUE NOS ENVIE SU PRESUPUESTO CON PINTURAS RENDUELES PUES VA FACTURAR POR LA EMPRESA DEL HIJO. EL IVA EN TODOS EL DEL 10%</span></strong></span></span></p>'),
	(26, 24, '2013-10-03', '2013-10-17', NULL, 1, '', 'FILTRACIONES PZA. GARAJE ALFREDO Y SOLEDAD', '<p><strong><span style="background-color: #00ccff;">03/10/2013.-</span> (aperturado x M&ordf; de los Angeles)</strong>SEGUN HAB&Iacute;AMOS QUEDADO CON AFREDO Y SOLEDAD REALIZAR&Iacute;AMOS PRUEBAS PARA PODER DETERMINAR SI LA FILTRACI&Oacute;N VIENE POR LAS REJILLAS DE VENTILACION O POR LA TELA ASFALTICA DEL SUELO DEL PATIO. <strong><span style="background-color: #00ccff;">03/10/2013</span> </strong>ME HE PUESTO EN CONTACTO CON SOLEDAD <span style="color: #000000;"><strong>669.993.317 / 985.09.69.71</strong> </span>Y LE HE COMUNICADO QUE COMO LLOVI&Oacute; EN LA MADRUGADA DEL 02/10/2013 Y HOY POR LA MA&Ntilde;ANA FUI HACIA SU PLAZA PERCATANDOME QUE LA MISMA ESTABA MOJADO HOY PROCEDERIAMOS A COLOCAR EN LA REJILLAS UN PLASTICO PARA SI LLUEVE ESTA NOCHE DETERMINAR SI EL AGUA VIENE POR LAS REJILLAS. HE LLAMADO A JOSE ANTONIO LEONARDO Y LE HE SOLICITADO QUE COLOQUE DICHO PLASTICO Y OTRO EN LA PLAZA PARA QUE CUANDO LLUEVA NOS PODAMOS DAR CUENTA DE QUE HA CAIDO AGUA PUES HOY LA PLAZA ESTA MOJADA. QUEDO EN COLOCARLO POR LA TARDE PORQUE AHORA ESTABA EN LUGONES.&nbsp;<strong>ADJUNTO PROPUESTA DE ASTURIANA DE TEJADOS Y CANALONES.</strong></p>\r\n<p><span style="background-color: #00ccff;"><strong>18/10/2013.-&nbsp;<span style="background-color: #ffffff;">&nbsp;HE LLAMADO A JAVIER DE ASTUR OBRAS PARA PEDIR PROPUESTA DE RESOLUCION EN CUANTO A ESTE TEMA.</span></strong></span></p>\r\n<p><strong><span style="background-color: #00ccff;">18/10/2013.-&nbsp;<span style="background-color: #ffffff; color: #0000ff;"> HE LLAMADO ALBERTO DE SYPSA PARA SOLICITAR PROPUESTA PARA LA REPARACION DE ESTA FILTRACION. TAMBIEN VOY ADJUNTAR PROPUESTA DE FILTRACION EN LA PLAZA DE GARAJE MINUSVALIDOS QUE ME HABIAN OFERTADO HACE UN TIEMPO.</span></span></strong></p>\r\n<p><span style="background-color: #00ccff;"><span style="color: #0000ff;"><strong>&nbsp;07/11/2013.-<span style="background-color: #ffffff;"> HE PASADO POR EL GARAJE Y ESTA EL PLASTICO BIEN COLOCADO EN LA CHIMENEA GOTEA EL AGUA EN LA PLAZA DE GARAJE DE REFERENCIA. HE LLAMADO JAVIER ASTUR - OBRAS 985.16.70.03 PARA INFORMARLE QUE PUEDE QUE LA REJILLA ESTE COLOCADO DE MANERA INVERSA PERO ADEMAS DE ESO HAY OTRO PUNTO DE ENTRADA. </span><span style="color: #008000; background-color: #ffffff;">TAMBIEN HE LLAMADO A JOSE ANTONIO LEONARDO PARA INFORMAR DE LO OCURRIDO. QUEDO EN COLOCAR EL PLASTICO POR LA PARTE DE LA CHIMENEA PARA IR DESCARTANDO POSIBILIDADES. TENGO PENDIENTE LLAMAR A ALFREDO PARA INFORMARLE.</span><span style="color: #008080;"><br /></span></strong></span></span></p>\r\n<p><strong><span style="background-color: #00ccff;">15/11/2013(13:15h).-</span></strong><span style="background-color: #00ccff;"><span style="background-color: #ffffff;">&nbsp; SE LLAMA A ASTUR OBRAS (JAVI), NOS DICE QUE YA SABE QUE LO TIENE PTE., Q TUVO UNA SEMANA MUY LIADA, QUE LA SEMANA QUE VIENE SE PASA SIN FALTA Y TE DICE ALGO.</span></span></p>'),
	(27, 25, '2013-10-03', '2013-10-09', '2013-10-09', 2, '', 'LUMINARIA ESCALERA 1º - 2º Y PORTAL', '<p><strong><span style="background-color: #00ccff;">04/10/2013&nbsp;<span style="background-color: #ffffff;">&nbsp;HE LLAMADO A JULIO MORO PARA INFORMALE QUE HAY ESTAS LUMINARIA PENDIENTE DE REPONER.&nbsp;<span style="background-color: #ffff00;">TELF JULIO 639.005.970</span></span></span></strong></p>\r\n<p><strong><span style="background-color: #00ccff;"><span style="background-color: #ffffff;"><span style="background-color: #ffff00;">08/10/2013.-<span style="background-color: #ffffff;">&nbsp;FUE M&ordf; JOSE A LLEVAR LAS ACTAS Y COMPROBO QUE TODAS LAS LUMINARIAS ESTABAN FUNCIONANDO OK.</span></span></span></span></strong></p>'),
	(28, 26, '2013-10-07', '2013-10-08', '2013-10-07', 2, '', 'ASCENSOR PARADO PORTAL C', '<p><span style="background-color: #00ff00;"><strong>07/10/2013(09:20H).-<span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">RECIBIMOS LLAMADA DE VECINO DEL PORTAL C INDICANDO QUE EL ASCENSOR ESTA PARADO.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">SE DA AVISO A EMBARBA</span></span></p>\r\n<p><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;">985.252.517 / 952.176.517 / 610.175.239 (M&oacute;vil de empresa Victor) /&nbsp;</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;">07/10/2013(10:30H).-</span></strong><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A EMBARBA X TFN, NOTIFICADA AVERIA, SE PASAN CUANTO ANTES.</span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;">07/10/2013(18:25h).-</span></strong><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A EMBARBA (DAVID tecnico 619.630.264)PARA VER QUE TENIA EL ASCENSOR, NO COGE EL TFN, NOS DEVUELVE LA LLAMADA, FUE ALLI, LO RESETEO, LO COMPROBO Y CUANDO ESTABA SUBIENDO AL COCHE LE AVISAN QUE SE QUEDO UNA SRA. ENCERRADA, VUELVE PARA ALLA Y CREE QUE EL PROBLEMA ES DE UN CONTACTO DE AJUSTE DE PUERTAS DE CABINA (como si llegara a planta y no abria las puertas), QUEDO EN IR MA&Ntilde;ANA A COMPROBAR SI VA TODO BIEN Y PASA X AQUI A DEJARNOS EL PARTE. QUEDO FUNCIONANDO CORRECTAMENTE.</span></span></span></p>'),
	(29, 27, '2013-10-08', '2013-10-10', '2013-10-08', 2, '', 'ASCENSOR', '<p><strong>07/10/2013.-&nbsp;</strong>DA AVISO VECINO ASCENSOR PARADO CON PERSONA ATRAPADA (MANUEL, CHICO EN SILLA DE RUEDAS), SE COMPRUEBA QUE EL ASCENSOR ESTA PARADO EN EL PORTAL CON LAS PUERTAS SEMI-ABIERTAS Y DESENCAJADAS, UN VECINO TRATA DE EMPUJARLAS PARA PODER SACAR A MANUEL, EMPUJA VARIAS VECES Y LOGRA QUE SE ABRAN, SE COMPRUEBA QUE&nbsp;<span style="background-color: #00ffff;"><strong>NO FUNCIONA NINGUN TFNO.</strong><span style="background-color: #ffffff;">&nbsp;NI EN EL ASCENSOR DEL 23 NI DEL 25, SE LLAMA AL TFN DE URGENCIAS (902....) &nbsp;Y SE INFORMA DEL TODO EL TEMA ASI COMO DE QUE NO HAY LINEA TELEFONICA.</span></span></p>\r\n<p><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">PRIMERA LLAMADA DESDE LA ADMINISTRACION AL N&ordm; DE URGENCIAS DEL ASCENSOR A LAS 19:30H. , A LAS 20:00H. NO HABIA APARECIDO NINGUN OPERARIO.....</span></span></p>\r\n<p><strong><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">08/10/2013(11:20H).-</span></span></strong><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A OLGA DE TRESA Y SE LE INFORMA Y SOLICITA QUE VENGA UN TECNICO DE MANERA URGENTE A REVISAR ESE ASCENSOR Y COMPROBAR XQ NO HAY LINEA DE TFN EN NINGUNO DE LOS ASCENSORES, AYER EL CHICO INTENTANDO LLAMAR Y NADA DE NADA, SONABA UNA ALARMA........, DICE OLGA QUE INTENTARAN VENIR HOY, SE LE DICE QUE NADA DE INTENTAR, QUE NO HAY LINEA DE TFN Y ESO ES UN PROBLEMA MUY GRAVE SI ALGUIEN SE QUEDA ATRAPADO, NOS DICE QUE SINO PASAN X LA MA&Ntilde;ANA PASARAN X LA TARDE.</span></span></p>\r\n<p><strong><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">08/10/2013(11:45H).-&nbsp;</span></span></strong><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">VINIERON LOS TECNICOS DE TRESA Y COMPROBAMOS CON ELLOS IN SITU QUE TODO FUNCIONABA CORRECTAMENTE, DEJARON PUESTA UNA PEGATINA DE COMO REALIZAR LA LLAMADA EN CASA DE QUEDAR ATRAPADO.(EN DOCUMENTOS ADJUNTO ESTA EL PARTE DE TRABAJO).</span></span></p>'),
	(30, 29, '2013-10-08', '2013-10-22', '2013-11-12', 2, '', 'LUMINARIAS EXTERIORES SOPORTAL', '<p><strong><span style="background-color: #00ff00;">8/10/2013.-</span>&nbsp;EN JUNTA DE FECHA 30/09/2013 INFORMAN QUE&nbsp;</strong>LOS GLOBOS DE LUZ QUE ESTAN SITOS A LA ENTRADA DEL PORTAL, SOPORTAL, PARED DE ENTRADA AL PORTAL, ESTAN ENCENDIDOS EN HORARIO DE MA&Ntilde;ANA. LOS VECINOS QUIEREN QUE SE DETERMINE DONDE SE CENTRALIZA EL ENCENDIDO DE LOS MISMOS Y CUAL ES EL INTERVALO HORARIO QUE TIENEN DE ENCENDIDO, YA QUE NO COINCIDE CON NINGUNO DE LOS OTROS DOS PORTALES E INSISTEN QUE X LAS MA&Ntilde;ANA ESTAN ENCENDIDOS.</p>\r\n<p>ENTERARSE BIEN DE TODO EL TEMA E INFORMAR A TRAV&Eacute;S DEL TABLON DE ANUNCIOS A LOS VECINOS.</p>\r\n<p>CORREO ENVIADO A TOMAS PARA QUEDAR CON &Eacute;L E IR ALL&Iacute; PARA VERIFICAR QUE OCURRE.</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> martes, 08 de octubre de 2013 13:38<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO CP CARBONERA 58</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos han dado aviso los vecinos en junta realizada que las luminarias tipo globo que est&aacute;n en el soportal de c/Carbonera 58, encienden a horas que no son necesarias, es decir, que por la ma&ntilde;ana se ven encendidos y por la tarde &ndash; noche apagados. Solicitan se arregle este tema y &nbsp;nos informemos&nbsp; de donde se centraliza el encendido de los mismos y que horario tienen, tambi&eacute;n nos hacen referencia a que los otros dos portales encienden y apagan +/- a la misma hora. Por favor, planificar visita para ver todo este tema con la administraci&oacute;n (con M&ordf; de los Angeles o con Paz), ya que nos han solicitado los vecinos que as&iacute; sea. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">09/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;HOY REALIZARON VISITA M&ordf; DE LOS ANGELES CON TOMAS (ITELCO) Y GERARDO LES ACOMPA&Ntilde;O EN TODO MOMENTO....., VERIFICARON QUE ESAS LUMINARIAS FUNCIONAN CON SENSORES CREPUSCULARES, O SEA, SENSORES DE LUMINOSIDAD, POR LO TANTO ENCIENDEN Y APAGAN SEGUN LA LUZ DEL EXTERIOR. SI ES CIERTO QUE CUANDO FUERON M&ordf; DE LOS ANGELES COMPROBO QUE A LAS 09:25H. ESTABAN ENCENDIDOS, Y ERA DEBIDO A QUE LOS SENSORES ESTABAN MUY SUCIOS Y X LO TANTO DETECTABAN MUCHO PEOR LA LUZ, LOS LIMPIARON Y DEJARON LISTOS, SUPUESTAMENTE AHORA DEBEN FUNCIONAR CORRECTAMENTE.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">SE COLOCARA CARTEL INFORMATIVO DE TODO ELLO CUANDO SE LLEVEN LAS ACTAS (DOCUMENTOS ADJUNTOS).</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">10/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;PASA M&ordf; DE LOS ANGELES X LA CDAD. Y SE PERCATA QUE A LAS 09:05H ESTABAN LAS LUCES ENCENDIDAS, TANTO DEL PORTAL 58 COMO DEL PORTAL 60. M&ordf; DE LOS ANGELES LLAMA A TOMAS DE ITELCO Y LE INDICA QUE SE PASA HOY MISMO PARA REGULAR NUEVAMENTE ESOS SENSORES, QUE LLAMA CON LO QUE SEA.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">14/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;"> PASE <strong>(MA)</strong> EL SABADO 12 DE OCTUBRE CAMINANDO POR LA ZONA DE CARBONERA 58-62 A LAS 8:50 HORAS DE LA MA&Ntilde;ANA Y SOLO ESTABA ENCENDIDO EL PORTAL 60.&nbsp;<span style="background-color: #ffcc00;"><strong>AVISA A TOMAS PARA CUANDO PUEDA, PASE POR LA ZONA Y AJUSTE UN PELIN MAS EL SENSOR DEL PORTAL 60.</strong></span></span></span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>22/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;CORREO RECIBIDO DE ITELCO</span></span></p>\r\n<p class="MsoPlainText">De: Itelco [mailto:info@itelcoasturias.com] <br /> Enviado el: martes, 22 de octubre de 2013 11:23<br /> Para: Paz<br /> Asunto: Presupuesto de reparacion portero Les Cigarreres, 42</p>\r\n<p class="MsoPlainText">&nbsp;Buenos d&iacute;as Paz.</p>\r\n<p class="MsoPlainText">&nbsp;Te adjunto presupuesto de reparaci&oacute;n para Les cigarreres, 42. <span style="color: #ff0000;"><strong>Por otro</strong></span></p>\r\n<p class="MsoPlainText"><span style="color: #ff0000;"><strong>lado comentarte que se regul&oacute; el sensor de Carbonera 60,</strong></span> en cuanto a los</p>\r\n<p class="MsoPlainText">dos avisos de ayer se realizar&aacute;n esta tarde.</p>\r\n<p class="MsoPlainText">&nbsp;Un saludo.</p>\r\n<p class="MsoPlainText">&nbsp;<span style="font-size: 11px;">Tom&aacute;s</span></p>\r\n<p class="MsoPlainText">&nbsp;<strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">29/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;SE PREGUNTA M&ordf; DE LOS ANGELES Y NOS DICE QUE ELLA TODAVIA HOY VIO COMO CARBONERA 58 Y 62 ESTABAN APAGADOS Y QUE CARBONERA 60 ESTTABA ENCENDIDO, LAS LUCES EXTERIORES DE BALONSE LLAMA A TOMAS, ITELCO, PARA COMPROBAR SI PASO X ALLI DE NUEVO, NOS DICE QUE LA ULTIMA VEZ YA LO DEJO MUY AJUSTADO, QUE PASARA DE NUEVO Y LO DEJARA AL MAXIMO PERO QUE TENGAMOS EN CUENTA QUE ESOS SENSORES ESTAN MUY DETERIORADOS Y QUE CADA VEZ QUE LOS MANIPULA SE ROMPE ALGUNA PIEZA (PATILLAS DE AJUSTE, ETC).SE PREGUNTA EL PVP DE ESOS SENSORES Y NOS DICE QUE +/- 80,00.-&euro;, M&ordf; DE LOS ANGELES DICE QUE ESO NO SE CAMBIA, YA QUE NADIE SE QUEJO HASTA LA FECHA (los arreglos se realizaron xq lo advirtio directamente M&ordf; de los Angeles).</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">QUEDO TOMAS EN LLAMARNOS X TFN E INDICARNOS CUANDO LO PUSIERA A TOPE.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Arial;">30/10/2013.- </span></strong><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;CORREO RECIBIDO DE TOMAS, ITELCO</span></p>\r\n<p class="MsoPlainText">De: Itelco [mailto:info@itelcoasturias.com] <br /> Enviado el: martes, 29 de octubre de 2013 20:40<br /> Para: administrativo@algonz.es<br /> Asunto: [Fwd: Presupuesto de reparacion portero Les Cigarreres, 42]</p>\r\n<p class="MsoPlainText">&nbsp;Buenos d&iacute;as Paz,</p>\r\n<p class="MsoPlainText">Este era el correo, se regul&oacute; el 22 de octubre, pasaremos esta semana para</p>\r\n<p class="MsoPlainText">regularlo a tope aunque es posible que no sirva de nada ya que el detector</p>\r\n<p class="MsoPlainText">est&aacute; en mal estado.</p>\r\n<p class="MsoPlainText">&nbsp;Un saludo.</p>\r\n<p class="MsoNormal">&nbsp;Tom&aacute;s.</p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;">12/11/2013.- &nbsp;</strong>SE PREGUNTA A M&ordf; DE LOS ANGELES Y NOS INDICA QUE ELLA ULTIMAMENTE LO VE TODO CORRECTO CUANDO PASA X ALLI.</p>\r\n<p class="MsoNormal">SE DA X OK EL SEGUIMIENTO.</p>\r\n<p class="MsoNormal">PTE. FACTURA ITELCO</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(31, 30, '2013-10-08', '2013-10-22', NULL, 1, '', 'PINTURA Y ARREGLO ESCAYOLA 6ºA', '<p><strong>08/10/2013.- EN JUNTA DE FECHA 30/09/2013 SE DETERMINO QUE</strong>&nbsp;<span style="font-family: Verdana; font-size: 10pt; text-align: justify; text-indent: 35.4pt;">En referencia al tema de desperfectos en la escayola del piso 6&ordm; A, se ha determinado en Junta que se solicite presupuestos a dos reparadores para que le sea reparada la escayola a esta vecina, indicando la misma que no reclama pintura del techo ni de pared del sal&oacute;n. Se presentaran estas propuestas al Presidente para determinar con cual de los reparadores realizar los trabajos y as&iacute; liquidar este tema que ya se viene comentando en Junta desde 17/02/2012.</span></p>\r\n<p>&nbsp;<strong><span style="font-size: 10.0pt; font-family: Verdana; color: red;">EN REFERNCIA A LA TAREA QUE DEBES TENER ABIERTA EN OUTLOOK SOBRE EL VECINO DEL 6&ordm;A QUE POR LA FILTRCION DE AGUA SE LE HUMEDECIO LA ESCAYOLA Y SE LE DECONCHO SE QUEDO EN JUNTA QUE SE REALIZAR&Iacute;A REPARACION DE LA ESCAYOLA DEL SALON PARA DEJAR SUBSANDA DICHA INCIDENCIA En esta actuaci&oacute;n se incluye repasar los alrededores de la escayola por el techo y por el sal&oacute;n la pintura del sal&oacute;n la suministra la Sra. Ana. DE TODAS FORMAS ME HE PUESTO EN CONTACOT CON ELLA POR TLFN 04/10/2013 Y LE INFORME QUE LO QUE APRUEBAN LOS VECINOS NO ES PINTARLE TOTAL DE PARED DEL SALON Y TOTAL DE PARED DEL TECHO SINO LO QUE INDICO EN LETRA MINUSCULA.</span></strong></p>\r\n<p><span style="color: #000000;"><strong><span style="font-size: 10pt; font-family: Verdana;">LA AFECTADA QUEDO CONFORME CON LO QUE APROBARON LOS VECINOS, QUE ES ARREGLO DE TROZO DE ESCAYOLA Y PINTURA DE ESA ZONA.</span></strong></span></p>\r\n<p><span style="font-family: Verdana; font-size: 10pt; text-align: justify; text-indent: 35.4pt;">SEGUIMIENTO TOTAL ARCHIVADO EN DOCUMENTOS ADJUNTOS PDF</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-family: Verdana; font-size: 10pt; text-align: justify; text-indent: 35.4pt;">08/10/2013.-</span></strong><span style="font-family: Verdana; font-size: 10pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;SE SOLICITAN PRESUPUESTOS DE ARREGLO DE ESCAYOLA Y PINTURA SOLO Y EXCLUSIVAMENTE DE LA ZONA AFECTADA A JOSE A.LEONARDO (X CORREO ELECTRONICO) Y A D&amp;J 636.115.062 / 684.022.156 (X TFN)</span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 08 de octubre de 2013 19:39<br /> <strong>Para:</strong> \'reformas.leonardo@gmail.com\'<br /> <strong>Asunto:</strong> SOLICITUD DE PRESUPUESTO CP CARBONERA 58 6&ordm;A</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente presupuesto sobre arreglo de trozo de escayola y zona de alrededor de la misma (<strong>solo y exclusivamente esa zona, nada m&aacute;s</strong>). Para ir a visitar la vivienda han de ponerse en contacto con el propietario Jose Enrique 649.234.098 c/Carbonera 58 6&ordm;A.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">10/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;VIENE JOSE A.LEONARDO X LA ADMINISTRACION Y NOS DICE QUE HOY ESTUVO EN EL DOMICILIO DE LA AFECTADA Y COMPROBO QUE LA ESCAYOLA NO ESTA AFECTADA, ES DECIR, QUE NO ES NECESARIO CAMBIARLA, ESTA AFECTADA X EL TEMA DE LA HUMEDAD QUE HABRIA EN SU MOMENTO (hace como 4 a&ntilde;os tranquilamente), SERIA RASCAR, EMPLASTECER X ALGUNA ZONA Y PINTAR LA ESCAYOLA Y LA PARTE DE HUMEDAD DE PARED, JOSE A.LEONARDO NOS DICE QUE SE LO INDICO ASI A LA SRA. Y QUE ESTA LE DIJO QUE SI SOLAMENTE ERA PINTURA QUE &nbsp;YA LO PINTABA ELLA. SE LE DICE A JOSE A.LEONARDO QUE NOS PASE PRESUPUESTO CON LO QUE &Eacute;L CONSIDERE QUE HAY QUE HACER.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">SE LLAMA X TFN A LA AFECTADA, ANA 649.234.098, PARA PREGUNTARLE X EL TEMA Y .....CON PALABRAS UN POCO MAL SONANTES, NOS DICE QUE ELLA NO DIJO QUE NO A NADA, QUE ESCUCHO LO QUE LE DIJO EL QUE FUE SIMPLEMENTE, Y QUE AHORA ESTABA OTRO PINTOR ALLI (D&amp;J).</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">NOS LLAMA EL D&amp;J DESDE CASA DE LA VECINA, ESTANDO ELLA DELANTE, PARA DECIR QUE LO QUE HABRIA QUE HACER ES PINTAR EL PA&Ntilde;O ENTERO......., SE LE DICE QUE PRESUPUESTE Y LO MANDE Y Q NOS LLAME CUANDO ESTE FUERA DE LA VIVIENDA.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">NOS LLAMA CUANDO SALE Y SE LE EXPLICA QUE NO ES RAZONABLE QUE LLAME DELANTE DE LA VECINA PARA DECIR LO QUE HAY QUE HACER O DEJAR DE HACER, YA QUE ESOS TRABAJOS SE DETERMINAN EN JUNTA (tal y como se le dijo x tfn que solamente habian acordado pintarle la zona afectada.........) Y NI NOSOTROS NI EL SOMOS NADIE PARA CONTRADECIR A LO QUE DICEN LOS VECINOS, NO LE PARECE BIEN Y DICE QUE &Eacute;L LLAMO PARA DECIR LO QUE HABIA QUE HACER PARA DEJARLO BIEN BIEN, QUE ES PINTAR TODO EL PA&Ntilde;O, QUE SI SABEMOS DE ALGUIEN QUE LO HAGA MEJOR QUE ESTUPENDO (parece como un poco bebido...) QUE QUIZAS NO DEBERIA HABER LLAMADO DELANTE DE LA SRA. PERO QUE &Eacute;L NO SABE LOS ROLLOS QUE NOSOTROS NOS TRAEMOS CON LA GENTE, SE LE INDICA NUEVAMENTE QUE LA ADMINISTRACION NO SE TRAE NINGUN ROLLO CON NINGUN VECINO, SIMPLEMENTE SE REALIZAN LOS TRABAJOS QUE LA COMUNIDAD NOS ENCARGA, SOLO Y EXCLUSIVAMENTE, AL IGUAL QUE &Eacute;L DEBERIA HACER Y MANTENER SU OPINION PARA &Eacute;L. QUEDO EN PASARNOS EL PRESUPUESTO</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">10/10/2013.-</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE JOSE A.LEONARDO. DOCUMENTOS ADJUNTOS</span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;">24/10/2013.-</span></span></strong><span style="background-color: #00ff00;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;HE LLAMADO A JOSE ANTONIO DJ NOS ENVIAR&Aacute; PRESUPUESTO LO ANTES POSIBLE.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">18/11/2013.-<span style="background-color: #ffffff;">&nbsp;</span></span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;VIENE EL PTE. DE LA CDAD. Y APROVECHAMOS PARA DECIRLE EL TEMA DE ESTA PINTURA, APRUEBA EL PRESPUESTO DE D&amp;J X 70,00 EUROS, ES DECIR SOLO LA ZONA AFECTADA. SE PASA CORREO A D&amp;J PARA QUE PASE CUANDO PUEDA Y QUE TENGA MUCHO CUIDADO CON ESTE TRABAJO.</span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 18 de noviembre de 2013 19:31<br /> <strong>Para:</strong> \'jose\'<br /> <strong>Asunto:</strong> RE: CARBONERA N&ordm; 58-6&ordm;A</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Se informa a trav&eacute;s de la presente de la ACEPTACI&Oacute;N de presupuesto remitido sobre pintura piso 6&ordm;A por valor de 70,00.-&euro;. Ponerse en contacto con la propietaria <span style="color: black; background-position: initial initial; background-repeat: initial initial;">Jose Enrique</span><span style="color: black; background-position: initial initial; background-repeat: initial initial;"> 649.234.098 c/Carbonera 58 6&ordm;A.</span></span><span style="font-size: 8pt; font-family: Arial;"> para la realizaci&oacute;n de los mismos. Tener especial atenci&oacute;n en este trabajo.Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">&nbsp;</span><span style="font-size: 8pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">&nbsp;</span><span style="font-family: Arial; font-size: 8pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="background-color: #00ff00;"><strong>20/11/2013(18:05h).-</strong><span style="background-color: #ffffff;">&nbsp;LLAMADA A JOSE A. D&amp;J Y NOS INFORMA EL HIJO QUE NO COGE EL TFN XQ TUVO UNA CAIDA CON UN GOLPE EN LA CABEZA EN LA BASE DEL CRANEO Y ESTA INGRESADO EN OVIEDO, QUE ESTA SEMANA SE PONE &Eacute;L CON LOS CORREOS Y TRABAJOS PARA IR QUEDANDO CON LA GENTE Y REALIZANDO LOS TRABAJOS POCO A POCO (XQ ESTA EL SOLO).</span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">21/11/2013.-(1010 h).- Llame a Ana y le comente que se ha retrasado un poco el trabajo porque el pintor ha sufrido una caida y esta en el hospital y tratar&aacute; de realizarlo lo antes posible.&nbsp;<span style="background-color: #99ccff;">Me informa Ana que le llamo el hijo y que pasaria el lunes a las 9:00 horas por su vivienda para dejar resuelto el tema.</span></span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong>25/11/2013(17:45h).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA AL HIJO DE D&amp;J PARA QUE NOS INFORME SI ESTA TODO LISTO 684.022.156, QUE YA SE PASO X ALLI Y LO DEJO LISTO, QUE EN PRINCIPIO LA AFECTADA QUEDO CONFORME, PERO QUE NO SE DIO CUENTA DE DARLE A FIRMAR EL PARTE DE TRABAJO, QUE SI HAY ALGUN PROBLEMA QUE LE LLAMEMOS&nbsp;</span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong>17:50H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A ANA, VECINA AFECTADA, QUE ESTUVO ALLI EL CHICO X LA MA&Ntilde;ANA, QUE ELLA ASI A SIMPLE VISTA LO VE BIEN PERO QUE HASTA QUE &nbsp;NO LLEGUE SU MARIDO Y LO REVISE &Eacute;L ELLA NO DICE NADA, QUE NOS LLAMARA CON LO QUE SEA.</span></span></p>'),
	(32, 32, '2013-10-09', '2013-10-16', '2013-10-23', 2, '', 'LUMINARIAS FUNDIDAS 5º PLANTA', '<p><strong><span style="background-color: #00ffff;">08/10/2013.-</span>&nbsp;</strong>NOS LLAMA EL ENCARGADO DEL PORTAL, IVAN BADAJOZ 26 6&ordm;A, INDICANDO QUE LE HA COMUNICADO EL VECINO DE LA 5&ordm; PLANTA QUE EN SU DESCANSILLO LAS EMERGENCIAS ESTAN FUNDIDAS. SE PASA AVISO A LA EMPRESA DE LIMPIEZA PARA QUE LA REPONGA.</p>\r\n<p><strong><span style="background-color: #00ffff;">09/10/2013.-</span>&nbsp;</strong>CORREO ENVIADO A XENIA</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 09 de octubre de 2013 12:34<br /> <strong>Para:</strong> \'Xenia\'<br /> <strong>Asunto:</strong> AVISO LUMINARIAS CP EDIF.PRISMA</span></p>\r\n<p class="MsoNormal">&nbsp;B<span style="font-size: 10.0pt; font-family: Arial;">uenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso el responsable de c/Badajoz 26 (6&ordm;A Iv&aacute;n), indicando que ha recibido quejas de los vecinos sobre las luminarias, que llevan tiempo fundidas y nadie las repone. A continuaci&oacute;n detallamos las emergencias fundidas y/o estropeadas, dar un repaso a toda la comunidad e indicar en la administraci&oacute;n si esta solucionado o no, ya que han quedado en venir el viernes para que se les indique este tema. Si es un problema de tipo electrico dar aviso en la administraci&oacute;n para enviar al tecnico.</span></p>\r\n<ul style="margin-top: 0cm;" type="disc">\r\n<li class="MsoNormal"><strong><span style="font-size: 10pt; font-family: Arial; color: #ff00ff;">Badajoz 26 luz emergencia descansillo 5&ordf; planta</span></strong></li>\r\n<li class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;"><strong><span style="color: #ff00ff;">Badajoz 26, varias emergencias en escalera.</span></strong></span></li>\r\n<li class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Garaje seg&uacute;n se accede bajando la cuesta, a mano izda. fallan varias emergencias.</span></li>\r\n</ul>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">A la espera de noticias , un saludo</span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><strong><span style="background-color: #00ffff;">18/10/2013(11:30H).-</span>&nbsp;</strong>SE LLAMA A XENIA, NOS DICE QUE ESTAN LAS LUMINARIAS CAMBIADAS PERO QUE HAY ALGUNAS EMERGENCIAS EN EL GARAJE QUE ES DE TIPO ELECTRICO, SE LE DICE A XENIA, QUE ENTONCES NOS HAGAN UN LISTADO DE TODA LA COMUNIDAD CON TODAS LAS LUMINARIAS QUE ESTAN ESTROPEADAS, Y NOS LO TRAIGA A LA ADMO., DICE QUE LO HARA JONNY LA SEMANA QUE VIENE.</p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="background-color: #00ffff;"><strong>22/10/2013(18:50H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA X TFN A IVAN B.26 6&ordm;A 984.394.553, VA A COMPROBAR SI ESTA CORRECTO Y SI NO NOS LLAMA ES QUE TODO ESTA BIEN.</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="background-color: #00ffff;"><strong>24/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;NO HEMOS RECIBIDO LLAMADA. SE DA X FINIQUITADO EL TEMA.</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;">&nbsp;</p>'),
