	(34, 34, '2013-10-09', '2013-10-16', '2013-11-13', 2, '', 'PRESUPUESTOS PARA MANTENIMIENTO DE ZONAS VERDES', '<p><span style="background-color: #00ff00;"><strong>09/10/2013(18:10H).-</strong><span style="background-color: #ffffff;">&nbsp;SOLICITUD DE PRESUPUESTOS X TFN.A:</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">JARDINES LA MADERA (JUAN) 617.091.862. SOLICITADO</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">JARDIFLOR (PACO) 629.255.240. SOLICITADO</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">FRANGEL-GREEN (FRAN) 655.532.222. SOLICITADO</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">VEGAPRESAS 985.13.70.89. NO CONTESTAN AL TFN.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>10/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE JARDIFLOR, PACO. VER EN DOCUMENTOS ADJUNTOS (150,00+IVA)</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>15/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE FRANGEL-GREEN. VER EN DOCUMENTOS ADJUNTOS (70,00+IVA UNA VEZ AL MES (+30,00 SI SE LE A&Ntilde;ADE OTRA ACTUACION MAS, O SEA DOS VECES AL MES)</span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>22/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE JARDINES LA MADERA (JUAN), DEJARON EN LA ADMINISTRACION.(DOCUMENTOS ADJUNTOS)</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Verdana;">EN JUNTA DE FECHA 24/10/2013 SE DETERMINA QUE:</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Verdana;">2&ordm; Renovaci&oacute;n del contrato del Mantenimiento de la Zona Exterior. Presentaci&oacute;n de otras ofertas si procede su aprobaci&oacute;n.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></strong><span style="font-size: 8.0pt; font-family: Verdana;">Este tema se trae a consideraci&oacute;n de los vecinos debido a que siempre hay quejas de los trabajos que realiza dicha empresa. Se explica que en la Administraci&oacute;n se lleva un hist&oacute;rico de las visitas que realiza, con el objeto de llevar una secuencia de los trabajos que realiza.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 8.0pt; font-family: Verdana;">De la parte trasera no realizan ninguna queja, b&aacute;sicamente se quejan de las hiedras no por la siega en si, sino porque las mismas no las rebajan y tienen un grosor considerable entendiendo los vecinos que no est&aacute; bien cuidado. En cuanto a la zona de las lavandas en las piedras siguen existiendo hierbas malas. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-family: Verdana; font-size: 8pt; text-indent: 35.4pt;">Se presentan 3 propuestas de mantenimiento siendo dos de ellas por igual coste pero con menos prestaciones, ya que en la temporada de invierno s&oacute;lo pasar&iacute;an 1 vez al mes y en temporada de verano 2 actuaciones al mes. La otra m&aacute;s econ&oacute;mica no determina la cantidad de actuaciones a realizar.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong><span style="font-family: Verdana; font-size: 8pt; text-indent: 35.4pt;">En principio se aprueba continuar con la misma empresa, reclamar detalles que se explican el p&aacute;rrafo segundo de este punto del orden del d&iacute;a y dar seguimiento a los trabajos. En cuanto al seguimiento explica </span></strong>la Administradora<span style="font-family: Verdana; font-size: 8pt; text-indent: 35.4pt;"><strong> que en el verano es f&aacute;cil programar las fechas espec&iacute;ficas pero en invierno por el tiempo no siempre se pueden cuadrar con exactitud.</strong>&nbsp;</span></p>'),
	(35, 35, '2013-10-10', '2014-01-13', NULL, 1, '', 'INSTALACION DE CONTADOR AGUA VECINO 5ºK', '<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="background-color: #00ff00;"><strong><span style="font-family: \'Palatino Linotype\';">10/10/2013.-<span style="background-color: #ffffff;">&nbsp;EN JUNTA DE FECHA 03/10/2013, SE DETERMINA QUE:</span></span></strong></span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><strong style="text-indent: 35.25pt; font-size: 11px;"><span style="font-family: \'Palatino Linotype\';">2&ordm;- Presentaci&oacute;n y aprobaci&oacute;n de presupuestos para la colocaci&oacute;n de contadores individuales en los rellanos de cada planta, seg&uacute;n solicitud en Junta de fecha 20/05/2013. Aprobaci&oacute;n de derrama.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Se explica que los contadores se colocar&iacute;a en los rellanos en cada una de las tuber&iacute;a que entran hacia la vivienda con el fin de que cada vivienda pague seg&uacute;n los m3 que consuma, la propuesta m&aacute;s econ&oacute;mica para la colocaci&oacute;n de un contador por vivienda asciende a un total de 1.149,50&euro; que por vecino habr&iacute;a que aportar 45,98&euro; del total de vecinos que asisti&oacute; a&nbsp;</span>la Junta<span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">&nbsp;solo le interesaba al piso 5&ordm;K. Por lo que el planteamiento a los vecinos fue el siguiente &ldquo;Autorizar al Vecino del 5&ordm; K Victor Rodr&iacute;guez Villabrille a la colocaci&oacute;n por su cuenta y coste del contador en el armario de la escalera. Aprobar lectura anual del mismo, as&iacute; como aprobar del cobro del Agua seg&uacute;n los m3 consumidos&rdquo;.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Por unanimidad de los asistentes se autoriza al vecino del 5&ordm; K a la colocaci&oacute;n del contador individual para su vivienda,</span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">&nbsp;&nbsp;</span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">siempre y cuando corra con los costes de colocaci&oacute;n y cualquier gasto futuro que pueda ocasionar el contador o sus elementos de enganche. Tambi&eacute;n est&aacute;n de acuerdo y as&iacute; lo autorizan para que en su caso se cobre el agua no por coeficiente sino seg&uacute;n los m3 consumidos, participando al igual que los dem&aacute;s vecinos en los t&eacute;rminos fijos de la facturaci&oacute;n.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;"><span style="color: #ff0000;"><strong>COMPROBAR SI EL VECINO HA HECHO LA INSTALACION DEL CONTADOR PARA TENER EN CUENTA E IR A REALIZAR LA LECTURA.</strong></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px; color: #000000;"><strong>EL 25/11/13 LLAME A VICTOR ME DIJO QUE DE MOMENTO &nbsp;NO LO HABIA INSTALADO QUE IBA ESPERAR A TERMINAR EL A&Ntilde;O. QUEDO EN AVISARNOS EL CUANDO LO TUVIERA COLOCADO. VAMOS A AMPLIAR EL VTO HASTA ENERO 14</strong></span></p>'),
	(36, 36, '2013-10-14', '2013-10-15', '2013-10-15', 2, '', 'BOTONERA ASCENSOR 4º PLANTA DESDE EL RELLANO', '<p><span style="background-color: #00ccff;"><strong>14/10/2013&nbsp;</strong><span style="background-color: #ffffff;">&nbsp;NOTIFICA MAYTE 4&ordm; C 680.938.450 QUE LA BOTONERA PARA SOLICITAR EL ASCENSOR DESDE EL RELLANO DE LA 4&ordm; PLANTA ESTA HUNDIDA QUE TIENEN QUE BAJAR A LA 3&ordm; O SUBIR A LA 5&ordm; PARA SOLICITAR EL ASCENSOR. CREE QUE SE HA DA&Ntilde;ADO EN LA MA&Ntilde;ANA DE HOY XQ ESCUCHO AL VECINO BAJAR POR EL ASCENSOR HOY EN LA MA&Ntilde;ANA. A CONTINUACI&Oacute;N&nbsp;<span style="background-color: #ffcc00;">LLAMO A IMEM 985.31.28.98 ME ATIENDE DAVID TOMA NOTA DE LA INCIDENCIA Y QUE AVISA EN LA MA&Ntilde;ANA DE HOY PARA QUE PASEN POR LA CDAD A REPARAR.</span></span></span></p>\r\n<p><span style="background-color: #33cccc;"><strong>14/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;VIENE EL CHICO DE IMEN Y NOS INFORMA QUE ESTABA LA BOTONERA PILLADA X UNAS PESTA&Ntilde;ITAS QUE TIENE, LO DESMONTO, LIMPIO Y DEJO SOLUCIONADO.</span></span></p>'),
	(37, 11, '2013-10-02', '2013-11-13', '2013-11-08', 2, '', 'INCIDENCIAS DEL GRUPO DE PRESION', '<p><strong><span style="background-color: #ffffff;"><span style="background-color: #00ccff;">02/10/2013</span> &nbsp;</span></strong><span style="background-color: #ffffff;">NOS AVISO RICARDO DEL PORTAL 4 - 6&ordm; PLANTA INFORMANDONOS QUE HAY UNA FUGA DE AGUA EN EL GRUPO DE PRESION QUE YA ESTABA EN SU MOMENTO CUANDO REALIZARON LAS ADECUACIONES DEL GRUPO DE PRESION Y QUE NO SE ARREGL&Oacute;. LLAMO A EDUARDO 666.765.995 PARA NOTIFICAR EL TEMA, SE ESTRA&Ntilde;A PUES DICE QUE NO SE PERCATARON DE ESTO NI LUIS NI EL QUE PASA POR LAS LLAVES Y QUE LO VA REVISAR.</span></p>\r\n<p><span style="background-color: #ffffff;"><strong><span style="background-color: #00ccff;"> 14/10/2013&nbsp;<span style="background-color: #ffffff;">ME PONGO EN CONTACTO CON EDUARDO PARA QUE ME EXPLIQUE Y ME COMENTA QUE LA TUBERIA QUE SALE DE LAS BOMBAS TIENE UN PORO Y LO QUE HAY QUE HACER ES RODAR LA LLAVE DE PASO PARA QUE EL PUNTO DE SALIDA DE AGUA COINCIDA CON LA LLAVE DE PASO Y AS&Iacute; PODER CON LA ROSCA QUEDA DENTRO DE LA LLAVE DE PASO EL PORO QUE TIENE LA TUBERIA.&nbsp;<span style="color: #ff00ff;">QUERIA ENVIARME PRESUPUESTO PERO LE INSINUE QUE RICARDO AL DAR EL AVISO ME HABIA NOTIFICADO QUE YA ESO EXISTIA ANTES DE INICIAR LAS OBRAS Y QUE PASAR AHORA OTRO RECIBO POR OTRA ACTUACI&Oacute;N TOMANDO EN CUENTA QUE YA EL VECINO SE HABIA PERCATADO DE ELLA ME IBA SER DIFICIL, ADEMAS YA ME HAB&Iacute;A EXCEDIDO DEL PRESUPUESTO INCIAL POR OTRAS CUESTIONES QUE HUBO QUE REALIZAR PARA DEJAR LO MEJOR POSIBLE EL GRUPO DE PRESION.&nbsp;<span style="color: #00ff00;">&nbsp;<span style="color: #0000ff;">DIJO QUE LO IBA A MIRAR Y QUE TRATARIA EN LO POSIBLE DE NO PASAR NINGUN RECIBO EXTRA.</span></span></span></span></span></strong></span></p>\r\n<p><span style="background-color: #00ccff;"><strong><span style="color: #000000;">23/10/2013-<span style="background-color: #ffffff;">&nbsp;</span></span></strong><span style="color: #000000;"><span style="background-color: #ffffff;">VINO LUIS DE ESPA INDICANDO QUE YA ESTABAN LOS TRABAJOS REALIZADOS, Y QUE LAS TUBERIAS QUE IBAN AL GRUPO DE PRESION ESTABAN MUY MAL. DE MOMENTO ASI SE QUEDAN HASTA QUE DUREN.......</span></span></span></p>\r\n<p><span style="background-color: #00ccff;"><span style="color: #000000;"><span style="background-color: #ffffff;">EN PRINCIPIO ESTOS TRABAJOS IRIAN SIN CARGO (Hablo con M&ordf; de los Angeles y le dijo Eduardo que iba a hacer todo lo posible para que fuera sin recibo).</span></span></span></p>\r\n<p><span style="background-color: #00ccff;"><span style="color: #000000;"><span style="background-color: #ffffff;"><strong><span style="background-color: #00ccff;">08/11/2013.-</span></strong> ME LLAMA RICARDO INFORMANDO QUE A&Uacute;N SIGUE GOTEANDO LA ZONA DEL TUBO QUE VA AL COLECTOR, A CONTINUACION LLAMO A EDUARDO/ BOMBAS Y LE COMENTO LO INFORMADO POR EL PROPIETARIO. QUEDA EN PASAR HOY POR LA TARDE A POR LAS LLAVES PARA REVISAR DICHA INCIDENCIA. EN PRINCIPIO DA DOS OPCIONES UNA PONER UN GEBO PARA TAPAR EL PORO QUE TIENE LA TUBERIA Y LO OTRO SERIA CAMBIAR EL TUBO QUE VA AL COLECTOR</span></span></span></p>\r\n<p><span style="background-color: #00ccff;"><span style="color: #000000;"><span style="background-color: #ffffff;"><strong><span style="background-color: #00ccff;">13/11/13.-</span></strong> LLAMA &nbsp;EDUARDO A PAZ PARA INFORMARLE QUE PASO POR LA COMUNIDAD Y QUE EL PROBLEMA DE AHORA ERA QYE LA TUERCA DE SALIDA DE AGUA DE LA BOMBA PINGABA LA APRETO NO CAMBIO NADA Y SE QUEDO CON LA LLAVE PARA MONITORIZAR UN POCO LA SITUACION . INFORMA QUE COMO ES UN GRUPO DE PRESION ANTIGUO Y QUE NO ESTABA OPERATIVO PUEDEN IR SALIENDO ESTE TIPO DE INCIDENCIAS.&nbsp;</span></span></span></p>'),
	(38, 37, '2013-10-14', '2013-10-15', '2013-10-15', 2, '', 'ASCENSOR', '<p><strong>14/10/2013(12:55H)</strong>.- RECIBIMOS LLAMADA DE VECINO 5&ordm;A INDICANDO QUE EL ASCENSOR VA MAL, NO SE ENCIENDE EL BOTON DE INTERIOR DE LUMINARIA, CUANDO SUBE Y BAJA PARA EN TODOS LOS PISOS, Y HACE UN RUIDO BASTANTE EXTRA&Ntilde;O.&nbsp;</p>\r\n<p><strong>*19:20H.-&nbsp;</strong>SE LLAMA A ASCENSORES EMBARBA PARA VERIFICARLE EL AVISO, NOS DICE QUE NO LE LLAMO NINGUN VECINO, SE LE INDICA EL PROBLEMA Y NOS DICE QUE AHORA ESTA EN AVILES, QUE SE PASA MA&Ntilde;ANA X LA MA&Ntilde;ANA PARA VER QUE OCURRE Y VIENE POR LA OFICINA PARA INDICARLO.</p>\r\n<p>&nbsp;<strong>15/10/2013(10:00h).-&nbsp;</strong>VIENE EL TECNICO DE EMBARBA Y NOS INDICA QUE ESTUVO ALL&Iacute; AYER Y ESTA MA&Ntilde;ANA Y QUE NO NOTO NADA EXTRA&Ntilde;O EN EL ASCENSOR, QUE FUNCIONABA CORRECTAMENTE, ESTUVO PREGUNTANDO A LOS VECINOS Y NINGUNO HABIA NOTADO NADA EXTRA&Ntilde;O, INCLUSO ESTUVO HABLANDO CON EL VECINO DEL 5&ordm;A, EL CUAL LE DIJO QUE DIO EL AVISO &Eacute;L, SALIO A REALIZAR UNAS COMPRAS Y CUANDO VOLVIO YA FUNCIONABA CORRECTAMENTE.</p>'),
	(39, 38, '2013-10-14', '2013-10-21', '2013-11-11', 2, '567400981', 'HUMEDAD - GOTERA EN TECHO COCINA 3ºD', '<p><strong>14/10/2013.-&nbsp;</strong>VINO EL PROPIETARIO DEL 3&ordm;D PEDRO 619.499.534, INDICANDO QUE TIENE UNA HUMEDAD EN EL TECHO DE SU COCINA, JUSTO ENCIMA DEL FREGADERO QUE INCLUSO HA CAUSADO UN AGUJERO EN EL MISMO X DONDE CAE EL AGUA, ES UN GOTEO, NOS DICE QUE ES MUY PROBABLE QUE SEA DE LA COCINA DE LA VECINA DEL 4&ordm;D OTILIA 985.16.52.21 / 676.500.362 (Norma hija de Otilia).</p>\r\n<p>SE LE INDICA QUE COMO EL SEGURO DE LA COMUNIDAD CUBRE DA&Ntilde;OS X AGUA (BAJANTES Y CA&Ntilde;ERIAS) PRIVATIVOS Y COMUNES QUE VAMS A APERTURAR EL SINIESTRO X EL SEGURO DE LA COMUNIDAD</p>\r\n<p><strong><span style="font-size: 10.0pt; font-family: Arial;">N&ordm; POLIZA.- 076-0980021799</span></strong><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;Portales y Zonas Com.</span></p>\r\n<p><span style="font-size: 10.0pt; font-family: Arial;">TFN.-902.136.524</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10pt; font-family: Arial;">14/10/2013(18:20H).-</span></strong><span style="font-size: 10pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;MAPFRE (NURIA GLEZ.) SE APERTURA EXPTE POR AGUA (HUMEDADES) Y SE FACILITA LOS DATOS DEL VECINO AFECTADO <strong>PEDRO 619.199.534&nbsp;</strong>C/VELAZQUEZ 32 3&ordm;D., NOS INDICA LA OPERADORA QUE SE PONDRAN EN CONTACTO CON EL AFECTADO PARA IR A VER EL PROBLEMA</span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10pt; font-family: Arial;">18/10/2013(13:05H).-</span></strong><span style="font-size: 10pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A PEDRO (AFECTADO) PARA SABER SI YA HAN IDO, NOS DICE QUE SI HAN IDO, ERA UN CODO QUE PERDIA, HICIERON EL ARREGLO, SOLO ESTA PTE. EL TEMA DE PINTURA Y QUEDARON EN LLAMARLO A &Eacute;L DIRECTAMENTE.</span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10pt; font-family: Arial;">29/10/2013(10:35H).-</span></strong><span style="font-size: 10pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;NO COGEN EL TFN.</span></span></span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10pt; font-family: Arial;">11/11/2013(18:05H).-</span></strong><span style="font-size: 10pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A PEDRO (AFECTADO), SE PONE SU MUJER Y SE LE PREGUNTA SI ESTA LIQUIDADO EL TEMA, NOS INDICA ELLA QUE QUEDARON CON EL PINTOR ESTA SEMANA Y QUE CON ESO FINALIZA TODO EL TEMA, SE LE DICE QUE NOSOTROS DAMOS X FINIQUITADO EL SEGUIMIENTO, SI TIENEN ALGUN PROBLEMA QUE SE PONGAN EN CONTACTO CON NOSOTROS.</span></span></span></p>'),
	(40, 39, '2013-10-15', '2013-10-27', '2013-10-24', 2, '', 'LIMPIEZA REJILLA DESAGÜE', '<p><strong>10/10/2013.-&nbsp;</strong>LA EMPRESA DE LIMPIEZA (L.LOZANO) NOS HA DADO AVISO A TRAVES DE CORREO ELECTRONICO QUE LAS REJILLAS DE ENTRADA AL GARAJE (DESAG&Uuml;E) ESTAN LLENAS DE HOJAS Y SUCIEDAD, PERO QUE NO PUEDEN LIMPIARLO XQ ESTAN ATORNILLADAS Y ES IMPOSIBLE.</p>\r\n<p>CORREO RECIBIDO DE LIMPIEZAS LOZANO</p>\r\n<div>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;"><strong><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;">De:</span></span></strong><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;"> Conchi - Limpiezas Lozano [mailto:conchi@limpiezaslozano.es] <br /><strong>Enviado el:</strong> jueves, 10 de octubre de 2013 14:52<br /><strong>Para:</strong> ALGONZ<br /><strong>Asunto:</strong> Crta. Vizcaina, 20. Aspirado Garaje</span></span></p>\r\n</div>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\'; font-size: medium;"><span style="font-size: 12pt;">&nbsp;</span></span><span style="color: #0033cc; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">Buenos d&iacute;as,</span></span></p>\r\n<div>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;"><span style="color: #0033cc; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><span style="font-size: 10pt; color: #0033cc; font-family: Arial;">Adjunto les remito el Certificado del apirado del garaje realizado &eacute;sta ma&ntilde;ana.</span></p>\r\n</div>\r\n<div>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;"><span style="color: #0033cc; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><span style="font-size: 10pt; color: #0033cc; font-family: Arial;">Nos comentan que han intentado limpiar el desague de la entrada del garaje pero les fue imposible levantar las regillas por estar atornilladas. S&oacute;lo han podido realizarlo en un trozo peque&ntilde;o. Parece que est&aacute;n muy tupidas y ser&iacute;a conveniente que se enviara a alguien que las desatornillara para proceder a su limpieza.</span></p>\r\n</div>\r\n<div>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;"><span style="color: #0033cc; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><span style="font-size: 10pt; color: #0033cc; font-family: Arial;">Atentamente,</span></p>\r\n</div>\r\n<div>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;"><span style="color: #0033cc; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;Conchi Garcia <br />Limpiezas Lozano<br /></span></span></p>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;">&nbsp;</p>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;"><span style="color: #0033cc; font-family: Arial; font-size: small;"><span style="font-size: 10pt;"><strong><span style="color: #000000;">15/10/2013.-</span></strong><span style="color: #000000;"> CORREO ENVIADO A JOSE A.LEONARDO</span><br /></span></span></p>\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0pt;">&nbsp;<strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin: 0cm; margin-bottom: .0001pt;"><span style="font-size: 10.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> martes, 15 de octubre de 2013 17:52<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> RV: Crta. Vizcaina, 20. Aspirado Garaje</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial; color: navy;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Solicitamos a trav&eacute;s de la presente, por favor, &nbsp;limpieza de rejilla de desag&uuml;e sita en CP Garaje Vizcaina 20. Para ello, tal y como indican desde la empresa de limpieza, es necesario desatornillar&nbsp; las mismas, volviendo a dejarlas una vez finalizados los trabajos de igual forma. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10pt; font-family: Arial; color: #000000;">23/10/2013.- </span></strong><span style="font-size: 10pt; font-family: Arial; color: #000000;">&nbsp;SE LLAMA X TFN A JOSE A.LEONARDO PARA VER SI HABIA HECHO EL TRABAJO Y SE LE HABIA PASADO, LO HARA MA&Ntilde;ANA.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10pt; font-family: Arial; color: #000000;">24/10/2013.- </span></strong><span style="font-size: 10pt; font-family: Arial; color: #000000;">&nbsp;VIENE JOSE A.LEONARDO X LA ADMINISTRACION INDICANDO QUE LA LIMPIEZA DE LAS REJILLAS (CANALETAS) DE ENTRADA AL GARAJE YA ESTAN LIMPIAS, QUE ESTABAN LLENITAS DE PORQUERIA. NOS DICE QUE ESTUVO PACO PRESENTE EN LOS TRABAJOS.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial; color: #000000;">PTE. FACTURA JOSE A.LEONARDO</span></p>\r\n</div>'),
	(41, 40, '2013-10-15', '2013-10-17', '2013-10-22', 2, '', 'TIMBRES HUNDIDOS', '<p><strong><span style="background-color: #ff00ff;">15/10/2013(13:15H).-</span>&nbsp;</strong>RECIBIMOS LLAMADA DE LA VECINA DEL 1&ordm;A CRISTINA 658.575.654 / 984.047.610, INDICANDO QUE NO LE FUNCIONA EL TIMBRE DESDE EL SABADO APROX., QUE NO DIJO NADA ANTES XQ PENSO QUE ERA PROBLEMA SUYO, PERO QUE SE ENCONTRO CON UNA VECINA DEL 6&ordm; QUE LE DIJO LO MISMO. SE LE INDICA QUE SE DARA AVISO AL PTE. PARA QUE INTERPONGA LA CORRESPONDIENTE DENUNCIA Y ASI PODER GESTIONARLO A TRAVES DEL SEGURO, NOS DICE QUE OK.</p>\r\n<p><span style="background-color: #ff00ff;"><strong>15/10/2013(18:00H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA AL PTE. PARA INDICARLE DE LO DICHO X LA VECINA DEL 1&ordm;A Y NOS DICE QUE &Eacute;L ES LA PRIMERA NOTICIA QUE TIENE, QUE &Eacute;L VIVE SOLO Y NO SE TOCA AL TIMBRE, QUE LO COMPROBARA Y CON LO QUE SEA, VERA SI PROCEDE A PONER LA DENUNCIA.</span></span></p>\r\n<p><span style="background-color: #ff00ff;"><strong>16/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;VIENE EL PTE. DE LA CDAD. ATILANO, Y NOS COMUNICA QUE &Eacute;L NO VE NINGUN TIPO DE ACTO VANDALICO EN LOS TIMBRES, DE HECHO FUNCIONAN TODOS EXCEPTO EL DE LA VECINA DEL 1&ordm;A, YA QUE ESTUVO HABLANDO CON LA DEL 6&ordm;B Y LE DIJO QUE A ELLA LE FALLABA DE MANERA INTERMITENTE, X LO TANTO NO PONE DENUNCIA Y CREE QUE PUEDE SER TEMA PRIVATIVO.</span></span></p>\r\n<p><span style="background-color: #ff00ff;"><strong>17/10/2013(11:35H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A LA VECINA DEL 1&ordm;A CRISTINA, PARA INFORMARLE DE TODO EL TEMA, NO COGE EL TFN.</span></span></p>\r\n<p><span style="background-color: #ff00ff;"><strong>18/10/2013(12:40h).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A LA VECINA 1&ordm;A Y NO COGE EL TFN.</span></span></p>\r\n<p><span style="background-color: #ff00ff;"><strong>22/10/2013(18:55H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA A LA VECINA DEL 1&ordm;A CRISTINA PARA INFORMARLE DE TODO EL TEMA Y NOS DICE QUE YA ESTUVO HABLANDO CON ELLA EL PTE. Y LE DIJO QUE LOS AVISOS HABIA QUE DARSELOS TODOS A &Eacute;L. NOS INDICA QUE PROBARA ELLA SU VIDEO PORTERO X SI FUERA PROBLEMA PRIVATIVO.</span></span></p>'),
	(42, 41, '2013-10-16', '2013-10-16', '2013-10-16', 2, '', 'RECLAMACION LIMPIEZA', '<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><strong><span style="font-size: 9.0pt; font-family: \'Palatino Linotype\';">EN JUNTA DE FECHA 03/10/2013, EN EL APARTADO RUEGOS Y PREGUNTAS LOS VECINOS INDICAN DEFICIENCIAS EN LA EMPRESA DE LIMPIEZA. SE DETERMINA QUE:</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; font-size: 9pt; text-indent: 35.25pt;">Se le dar&aacute; un toque de atenci&oacute;n a la limpiadora, posterior a </span>la Junta<span style="font-family: \'Palatino Linotype\'; font-size: 9pt; text-indent: 35.25pt;"> he hablado con la encargada de limpiezas Loan y me confirma que la empleado habitual que tiene </span>la Comunidad<span style="font-family: \'Palatino Linotype\'; font-size: 9pt; text-indent: 35.25pt;"> tom&oacute; vacaciones del 13/09/2013 al 30/09/2013 por lo que es probable que est&aacute; dejadez se hubiera producido durante el periodo de vacaciones de la empleada. El Presidente de </span>la Comunidad<span style="font-family: \'Palatino Linotype\'; font-size: 9pt; text-indent: 35.25pt;"> si observa dejadez de la empresa que lo notifique a </span>la Administraci&oacute;n<span style="font-family: \'Palatino Linotype\'; font-size: 9pt; text-indent: 35.25pt;"> para que asignen otro personal para el desempe&ntilde;o de los servicios contratados.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-size: 9.0pt; font-family: \'Palatino Linotype\';">&nbsp;</span><strong style="text-indent: 35.25pt; font-size: 11px;"><span style="font-size: 9.0pt; font-family: \'Palatino Linotype\'; color: red;">PAZ: ESTO YA LO COMENTE CON ROSA DE LIMPIEZAS LOAN SI QUIERES ABRIR SINIESTRO O TAMBIEN SE PUEDE ESPERAR A VER EN QUE QUEDA EL ASUNTO PUES ME PARECE QUE PUDO SER EN EL PERIODO DE VACIONES DE LA LIMPIADORA HABITUAL.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="color: #000000;"><strong style="text-indent: 35.25pt; font-size: 11px;"><span style="font-size: 9pt; font-family: \'Palatino Linotype\';">**SE INICIA POR SI SE TUVIERAN MAS RECLAMACIONES AL RESPECTO</span></strong></span></p>'),
	(43, 42, '2013-10-16', '2013-10-23', '2013-10-29', 2, '', 'LUMINARIAS ', '<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-size: 9.0pt; line-height: 150%; font-family: Verdana;">3&ordm; - Ruegos y Preguntas</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Con la finalidad de ahorrar energ&iacute;a el&eacute;ctrica se determina por todos los asistentes en eliminar el encendido de algunas bombillas del portal y de los rellanos de las escaleras. En el portal se eliminaran dos una cerca de la puerta de la vivienda letra B y la mas alejada seg&uacute;n se entra al portal a la izquierda. En los rellanos se dejar&aacute; &uacute;nicamente para que encienda la que esta sito enfrente de los ascensores. Tambi&eacute;n se determino disminuir a 30 segundos el encendido de las plantas ya que est&aacute;n agrupadas de dos en dos y al pulsar cualquier vecino se encienden 6 bombillas, de esta forma solo se encender&aacute;n dos. Tambi&eacute;n es este mismo tema se aprueba por todos los asistentes colocar un sensor crepuscular/movimiento en el portal&nbsp; para que en el d&iacute;a no se enciendan las bombillas del portal ya que el portal es lo suficientemente luminoso y no ven la necesidad que tienen algunos vecinos en encender para entrar y salir del mismo durante el d&iacute;a. El predio del mismos asciende a +/- 70&euro; m&aacute;s el IVA. </span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;</span><strong style="text-align: justify; font-size: 11px;"><span style="font-size: 9.0pt; font-family: Verdana; color: red;">&nbsp;</span></strong><strong style="text-align: justify; font-size: 11px;"><span style="font-size: 9.0pt; font-family: Verdana; color: red;">PAZ: TE DEJO CROQUIS DE LAS BOMBILLAS QUE SE QUIEREN ANULAR QUE SE LLEVE UNA COPIA JULIO MORO Y QUE LO PEGUE EN EL CUARTO DE CONTADORES PARA CUANDO TENGAN QUE CAMBIAR BOMBILLAS NO SE LES PASE Y NOS LA CAMBIEN TODAS PENSANDO QUE LAS ANULADAS ESTAN FUNDIDAS, SCANEA EN PLATAFORMA ALGONZ PARA QUE NO SE NOS OLVIDE A NOSOTROS DILE A JULIO QUE NOS QUITE LAS QUE SE ANULAN O QUE LAS DEJE SI ENRROSCAR TOTALMENTE. </span></strong><span style="font-size: 9pt; font-family: Verdana; color: #000000;">LUEGO EN CUENTO AL DETECTOR QUE QUIEREN COLOCAR LLAMA A FASE PARA QUE LE COLOQUE UNO EN EL PORTAL UNICAMENTE (INDIVIDUALIZAR PORTAL Y COLOCAR DETECTOR). ES DECIR QUE LAS PLANTAS QUEDAN TAL CUAL ENCENDIENDO DE DOS EN DOS, LES DICES A LOS DE FASE QUE TE AJUSTEN LOS ENCENDIDOS DE LOS RELLANOS A 30 SEGUNDOS.</span></p>\r\n<p><span style="font-size: 9pt; font-family: Verdana; color: #000000;"><strong><span style="background-color: #00ff00;">24/10/2013.-</span></strong> LLAMO A JULIO MORO PARA PREGUNTAR SI YA ADECUO SEGUN SOLICITARON LOS VECINOS Y ME DICE QUE SE LE PASO QUE MA&Ntilde;ANA SIN FALTA LO REALIZA Y PASA POR LA ADMINISTRACION PARA INFORMARNOS</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 9pt; font-family: Verdana; color: #000000;">25/10/2013.-</span></strong><span style="font-size: 9pt; font-family: Verdana; color: #000000;"><span style="background-color: #ffffff;">&nbsp;PASO JULIO MORO X LA ADMO. Y NOS DIJO QUE YA ESTABAN TODAS LAS LUMINARIAS REPUESTAS, ASIMISMO HIZO EL COMENTARIO QUE LE HIZO EL INQUILINO JOSE LUIS (TALIBAN) SOBRE EL DETECTOR DE PRESENCIA QUE SE INSTALO EN EL PORTAL DICIENDO QUE "se quitara eso de ahi que hay no era un portal de ricos, y que en cuanto el llegara un dia cabreao lo iba a arrancar"......</span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;"><span style="background-color: #00ff00;">28/10/2013.-</span></span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">&nbsp;CORREO RECIBIDO DE FASE CON LA FACTURA. ARCHIVADA EN DOCUMTS. ADJUNTOS.</span></span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span><span style="font-size: 9.0pt; font-family: Tahoma;"> ADMINISTRACION FASE S.L. [mailto:administracion@montajeselectricosfase.com] <br /> <strong>Enviado el:</strong> lunes, 28 de octubre de 2013 11:36<br /> <strong>Para:</strong> \'Algonz.Paz\'<br /> <strong>Asunto:</strong> RE: Envio de Factura Les Cigarreres N&ordm; 40 </span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">Buenos d&iacute;as Paz;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">Le envio la factura modificada y seg&uacute;n comente con usted por tel&eacute;fono , el viernes por la tarde quedo solucionado el tiempo de encendido .</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">Un saludo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">Tere</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">Dpto. Administraci&oacute;n</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">&nbsp;</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 9pt; font-family: Verdana; color: #000000;">29/10/2013.-</span></strong><span style="font-size: 9pt; font-family: Verdana; color: #000000;"><span style="background-color: #ffffff;">&nbsp;NO HEMOS RECIBIDO NINGUNA LLAMADA SOBRE EL DETECTOR COLOCADO, SE DA EL EXPTE. X FINALIZADO.</span></span></span></p>\r\n<p>&nbsp;</p>'),
	(44, 43, '2013-10-16', '2013-10-23', '2013-10-28', 2, '', 'COLOCACION DE SENSOR Y AJUSTE DE ILUMINACION', '<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-size: 9.0pt; line-height: 150%; font-family: Verdana;">EN JUNTA DE FECHA07/10/2013 SE DETERMINA : 3&ordm; - Ruegos y Preguntas</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Con la finalidad de ahorrar energ&iacute;a el&eacute;ctrica se determina por todos los asistentes en eliminar el encendido de algunas bombillas del portal y de los rellanos de las escaleras. En el portal se eliminaran dos una cerca de la puerta de la vivienda letra B y la mas alejada seg&uacute;n se entra al portal a la izquierda. En los rellanos se dejar&aacute; &uacute;nicamente para que encienda la que esta sito enfrente de los ascensores. Tambi&eacute;n se determino disminuir a 30 segundos el encendido de las plantas ya que est&aacute;n agrupadas de dos en dos y al pulsar cualquier vecino se encienden 6 bombillas, de esta forma solo se encender&aacute;n dos. Tambi&eacute;n es este mismo tema se aprueba por todos los asistentes colocar un sensor crepuscular/movimiento en el portal&nbsp; para que en el d&iacute;a no se enciendan las bombillas del portal ya que el portal es lo suficientemente luminoso y no ven la necesidad que tienen algunos vecinos en encender para entrar y salir del mismo durante el d&iacute;a. El predio del mismos asciende a +/- 70&euro; m&aacute;s el IVA.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;</span>&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: -12.0pt; margin-right: -12.8pt;">\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">&nbsp;</span></strong><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">PAZ: T</span></strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;"><span style="color: #000000;">E DEJO CROQUIS DE LAS BOMBILLAS QUE SE QUIEREN ANULAR QUE SE LLEVE UNA COPIA JULIO MORO Y QUE LO PEGUE EN EL CUARTO DE CONTADORES PARA CUANDO TENGAN QUE CAMBIAR BOMBILLAS NO SE LES PASE Y NOS</span>&nbsp;</span><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">L</span></strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">A CAMBIEN TODAS</span><span style="font-size: 9.0pt; font-family: Verdana; color: red;">&nbsp;P<span style="color: #000000;">ENSANDO QUE LAS ANULADAS ESTAN FUNDIDAS, SCANEA EN PLATAFORMA ALGONZ PARA QUE NO SE NOS OLVIDE A NOSOTROS DILE A JULIO QUE NOS QUITE LAS QUE SE ANULAN O QUE LAS DEJE SI ENRROSCAR TOTALMENTE.</span>&nbsp;</span><strong><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">LUEGO EN CUENTO AL DETECTOR QUE QUIEREN COLOCAR LLAMA A FASE PARA QUE LE COLOQUE UNO EN EL PORTAL UNICAMENTE (INDIVIDUALIZAR PORTAL Y COLOCAR DETECTOR). ES DECIR QUE LAS PLANTAS QUEDAN TAL CUAL ENCENDIENDO DE DOS EN DOS, LES DICES A LOS DE FASE QUE TE AJUSTEN LOS ENCENDIDOS DE LOS RELLANOS A 30 SEGUNDOS.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><span style="color: #000000; background-color: #00ff00;"><strong>16/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;CORREO ENVIADO A FASE PARA QUE PROCEDA A REALIZAR LOS TRABAJOS</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 16 de octubre de 2013 19:14<br /> <strong>Para:</strong> \'info@montajeselectricosfase.com\'<br /> <strong>Asunto:</strong> CP CIGARRERES 40</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; line-height: 150%; font-family: Verdana;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-size: 10.0pt; line-height: 150%; font-family: Verdana;">&nbsp;</span><span style="font-size: 10.0pt; line-height: 150%; font-family: Verdana;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Solicitamos a trav&eacute;s de la presente trabajos de colocaci&oacute;n de detector (sensor crepuscular/movimiento, mismo que CP Cigarreres 52) en el portal de la comunidad Cigarreres 40 (solamente en el portal), as&iacute; como ajustar el tiempo de encendido en los rellanos dej&aacute;ndolo a 30 segundos. Gracias.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-size: 10.0pt; line-height: 150%; font-family: Verdana;">&nbsp;</span><span style="font-size: 10.0pt; line-height: 150%; font-family: Verdana;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;A la espera de sus noticias, atentamente &nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-size: 9.0pt; line-height: 150%; font-family: Verdana;">&nbsp;</span></strong><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">23/10/2013.- &nbsp;</span></strong><span style="font-size: 10.0pt; font-family: Arial;">VINO INES DE INST.FASE, INDICANDO QUE YA COLOCARON EL SENSOR EN EL PORTAL, QUE LO SITUARON JUSTO A LA ENTRADA DEL MISMO, O SEA, QUE CUANDO SALEN DEL ASCENSOR TIENEN QUE CAMINAR DOS PASOS PARA QUE SE ENCIENDAN LAS LUCES. DE MOMENTO SE DEJA AS&Iacute;, SI NO SE RECIBEN AVISOS DE MAL ALUMBRADO X PARTE DE LOS INQUILINOS SE DEJARA TAL CUAL.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;">&nbsp;<strong>25/10/2013(11:30h).-</strong>&nbsp;SE LLAMA A INES INST.FASE 615.447.569, PARA PREGUNTARLE X EL TEMA DE ENCENDIDO DE LOS RELLANOS, NO TIENE EL TFN OPERATIVO, SE LE DEJA AVISO EN EL BUZON PARA QUE NOS LLAME.<strong>&nbsp;</strong></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;">&nbsp;<strong>25/10/2013.-</strong> CORREO RECIBIDO DE INST.FASE CON FACTURA Y DOCUMENTACION PARA VIPASA. (ARCHIVADO EN DOCUMENTOS ADJUNTOS)</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> ADMINISTRACION FASE S.L. [mailto:administracion@montajeselectricosfase.com] <br /> <strong>Enviado el:</strong> viernes, 25 de octubre de 2013 12:23<br /> <strong>Para:</strong> administrativo@algonz.es<br /> <strong>Asunto:</strong> Envio de Factura Les Cigarreres N&ordm; 40 </span></p>\r\n<p class="MsoNormal">&nbsp;Buenos d&iacute;as Paz;</p>\r\n<p class="MsoNormal">Te envio la factura correspondiente a los trabajos realizados en dicha Comunidad de Propietarios. Una vez nos des el visto bueno , te enviaremos la factura por correo ordinario.</p>\r\n<p class="MsoNormal">&nbsp;Un saludo.</p>\r\n<p class="MsoNormal">&nbsp;Tere</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;">&nbsp;Dpto. Administraci&oacute;n</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;">&nbsp;<strong>25/10/2013.-&nbsp;</strong>SE MANDA CORREO A FASE INDICANDO QUE HAY TRABAJOS PTES.</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 25 de octubre de 2013 13:39<br /> <strong>Para:</strong> \'ADMINISTRACION FASE S.L.\'<br /> <strong>Asunto:</strong> RE: Envio de Factura Les Cigarreres N&ordm; 40 </span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos dejado varios avisos en el m&oacute;vil de In&eacute;s, indicar que en este trabajo est&aacute; pendiente el ajuste de tiempo de encendido en los rellanos, tal y como se indic&oacute; en correo de solicitud de trabajo (en la factura no figura).</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="color: navy; font-family: Arial; font-size: 10pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="font-family: Arial; font-size: 10pt;"><strong>28/10/2013.-</strong><strong>&nbsp; &nbsp;</strong>TRABAJOS TERMINADOS, FACTURA RECIBIDA DE INST.FASE CON TODA LA DOCUMENTACION SOLICITADA. FACTURA ARCHIVADA EN DOCUMENTS ADJUNTOS</span></span></p>\r\n</div>'),
	(45, 44, '2013-10-17', '2013-10-21', '2013-10-18', 2, '', 'PULSADOR PORTAL LADO ASCENSOR', '<p><strong>16/10/2013.-&nbsp;</strong>VIENE X LA ADMINISTRACION VECINO DE LA COMUNIDAD (CUBANO) INDICANDO QUE EL PULSADOR QUE ESTA AL LADO DEL ASCENSOR DE LA PLANTA BAJA ESTA ROTO, QUEDA CONECTADO TODO EL TIEMPO, ES DECIR, CUANDO LO PULSAN PARA LA LUZ, QUEDA LA MISMA ENCENDIDA HASTA QUE VUELVEN A PULSARLO.</p>\r\n<p>SE MANDA A ELECTRICISTA PARA QUE LO SOLUCIONE.</p>\r\n<p><strong>17/10/2013.-</strong>&nbsp;CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;<br /><strong>Enviado el:</strong>&nbsp;jueves, 17 de octubre de 2013 12:58<br /><strong>Para:</strong>&nbsp;\'Itelco\'<br /><strong>Asunto:</strong>&nbsp;CP CIGARRERES 54</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de vecino de la comunidad indicando que el pulsador sito al lado del ascensor en el portal CP Cigarreres 54, cuando se pulsa queda encajado todo el tiempo, hay que volver a pulsar para que desencaje, esto acarrea que las luces esten continuamente encendidas, ya que nadie se percata que tiene que volver a pulsar. Por favor, pasarse por all&iacute; y solucionarlo. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 10pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 10pt; font-family: Arial;">18/10/2013.-&nbsp;</span></strong><span style="font-size: 10pt; font-family: Arial;">CORREO RECIBIDO DE ITELCO</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Itelco [mailto:info@itelcoasturias.com] <br /> <strong>Enviado el:</strong> jueves, 17 de octubre de 2013 17:09<br /> <strong>Para:</strong> Algonz.Paz<br /> <strong>Asunto:</strong> RE: CP CIGARRERES 54</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">Hola Paz, ya lo solucionamos.</p>\r\n<p class="MsoNormal">Un saludo.</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">Tom&aacute;s</p>'),
	(46, 45, '2013-10-17', '2013-10-21', '2013-10-22', 2, '', 'LUMINARIAS', '<p><strong><span style="background-color: #cc99ff;">16/10/2013.-</span>&nbsp;</strong>AVISO DADO X JOSE A. PADUANO DE LUMINARIAS FUNDIDAS</p>\r\n<p>CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 17 de octubre de 2013 13:29<br /> <strong>Para:</strong> \'limpiezasmoro@hotmail.com\'<br /> <strong>Asunto:</strong> PLAZA DONANTES 1- 2 GARAJE LUMINARIAS</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as Julio.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de propietarios indicando que hay muchas luminarias fundidas, pasamos a detallar cuales son, asimismo indicar en la administraci&oacute;n si no hacen una revisi&oacute;n de la luminaria, ya que los propietarios nos indican que hace mucho tiempo de la falta de esas luminarias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Luminarias fundidas para reponer y si fuera problema de tipo electrico dar aviso en la administraci&oacute;n para enviar al tecnico. Gracias.</span></p>\r\n<ul style="margin-top: 0cm;" type="disc">\r\n<li class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Portal 1.- oculo encima de los buzones</span></li>\r\n<li class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Soportal zona portal 1.- luminaria encima de la puerta de portal</span></li>\r\n<li class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Soportal zona portal 1.- varias luminarias que no encienden.</span></li>\r\n<li class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Garaje de la 1&ordf; a la 2&ordf; planta el &uacute;nico fluorescente que hay esta fundido.</span></li>\r\n</ul>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="background-color: #cc99ff;"><span style="font-size: 10.0pt; font-family: Arial;">22/10/2013.-</span></span></strong><span style="background-color: #cc99ff;"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;VIENE JULIO MORO Y NOS INDICA QUE ESTAN TODAS LAS LUMINARIAS REPUESTAS Y FUNCIONANDO Y QUE HAY UN PULSADOR EN LA RAMPA DE BAJADA DEL -1 AL -2 (TRES PULSADORES JUNTOS) EL PULSADOR DEL MEDIO NO FUNCIONA, SE ABRE NUEVO EXPTE. PARA ELECTRICISTA.</span></span></span></p>'),
