	(49, 48, '2013-10-18', '2013-10-23', '2013-10-21', 2, '', 'TIMBRE 4ºA', '<p><strong><span style="background-color: #00ffff;">16/10/2013.-</span>&nbsp;</strong>RECIBIMOS LLAMADA (M.JOSE) DE LA VECINA NATIVIDAD 4&ordm;A 985.314.939 / 678.002.687, INDICANDO QUE TIENE EL TIMBRE ESTROPEADO, SE LE COMENTA SI HA COMPROBADO EL PRIVATIVO SUYO, YA QUE NADIE MAS NOS HA LLAMADO CON ESTE PROBLEMA Y CONTESTA (LIGERAMENTE ENFADADA) QUE ES PROBLEMA DE ABAJO, SE LE INDICA QUE SI ES PROBLEMA PRIVATIVO ELLA SE HARA CARGO Y DICE QUE YA.</p>\r\n<p><strong><span style="background-color: #00ffff;">18/10/2013.-</span>&nbsp;</strong>SE MANDA CORREO A ITELCO PARA QUE VAYAN A COMPROBARLO Y LLAMEN A LA AFECTADA IN SITU. CORREO ENVIADO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 18 de octubre de 2013 19:06<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> ALAVA 50 4&ordm;A TIMBRE</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso la propietaria de Alava 50 4&ordm;A Natividad 985.314.939 / 678.002.687 indicando que no le funciona el micro, se le pregunta si ha comprobado su parte privativa, ya que no hemos recibido aviso de m&aacute;s vecinos respecto a este problema y contesta que no es problema suyo, que viene de abajo. Por favor, pasarse por all&iacute;, <strong>quedar con la afectada, </strong>revisar todo el tema y si es comunitario solucionarlo, y si fuera privativo indicarselo a la afectada. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><span style="background-color: #00ffff;"><strong>21/10/2013.-</strong><span style="background-color: #ffffff;"> CORREO RECIBIDO DE ITELCO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Itelco [mailto:info@itelcoasturias.com] <br /> <strong>Enviado el:</strong> lunes, 21 de octubre de 2013 11:34<br /> <strong>Para:</strong> Algonz.Paz<br /> <strong>Asunto:</strong> RE: ALAVA 50 4&ordm;A TIMBRE</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt;">Hola Paz, ya pasamos por alli y le coment&eacute; que en la placa exterior funcionaba todo correctamente, qe el problema est&aacute; en el interior.&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">Un saludo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">Tom&aacute;s.</span></p>\r\n<p class="MsoNormal"><span style="color: #575757; font-size: 9pt;">Enviado de Samsung Mobile</span></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; font-family: \'Times New Roman\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;"><br /> <!--[if !supportLineBreakNewLine]--><br /> <!--[endif]--></span></p>'),
	(50, 49, '2013-10-18', '2014-01-27', NULL, 4, '', 'EMERGENCIAS Y PULSADOR', '<p><strong>16/10/2013.-&nbsp;</strong>VINO ATILANO EL PTE. DE LA COMUNIDAD INDICANDO QUE CUANDO TENGA QUE IR EL ELECTRICISTA A REALIZAR CUALQUIER TRABAJO A LA COMUNIDAD SE APROVECHE LA SALIDA Y CAMBIE LA EMERGENCIA DE LA CUARTA PLANTA Y ARREGLE EL PULSADOR &nbsp;DE LA ZONA DE LOS TRASTEROS,</p>\r\n<p><strong>21/10/2013.-&nbsp;</strong>CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;<br /><strong>Enviado el:</strong>&nbsp;lunes, 21 de octubre de 2013 12:04<br /><strong>Para:</strong>&nbsp;\'Itelco\'<br /><strong>Asunto:</strong>&nbsp;CARBONERA 58</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido varios avisos para efectuar en esta comunidad (CP Ctra. Carbonera 58):</span></p>\r\n<p class="MsoNormal" style="margin-left: 36pt; text-indent: -18pt;"><span style="font-size: 9pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 9pt; font-family: Arial;">No ven los canales de tv. Varios vecinos desde la semana pasada no ven la mayor&iacute;a de los canales (todo tienen tdt). Pasarse por la comunidad para ver que ocurre y&nbsp;<strong><span style="text-decoration: underline;">confirmar con los vecinos afectados</span></strong>&nbsp;que todo quedo correcto.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36pt; text-indent: -18pt;"><span style="font-size: 9pt; font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp