7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></strong></span><span style="font-size: 9.0pt; font-family: Arial;"><span style="color: #ff0000;"><strong>Arreglo de pulsador zona de trasteros correspondiente a Ctra. Carbonera 58 (tanto para este aviso como para la emergencia pueden ponerse en contacto con el presidente Atilano 1&ordm; B 617.073.611, el cual indicara donde se encuentran.</strong></span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9pt; font-family: Arial;">Por favor, una vez realizados los trabajos indicarlo en&nbsp;la administraci&oacute;n. Gracias.</span></p>\r\n<p class="MsoNormal" style="margin-left: 18pt;"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9pt; font-family: Arial;">24/10/2013.-&nbsp;</span></strong><span style="font-size: 9pt; font-family: Arial;"> SOLICITADOS PRESUPUESTOS A : INST.FASE, ROYFE Y RAMOS Y MASID.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; font-family: Arial;">EL PULSADOR ESTA ARREGLADO POR FASE. (PTE.FACTURA)</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9pt; font-family: Arial;">28/10/2013.- </span></strong><span style="font-size: 9pt; font-family: Arial;">&nbsp;PRESUPUESTO RECIBIDO DE ROYFE (ARCHIVADO EN DOCUMENTS. ADJUNTOS)</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9pt; font-family: Arial;">29/10/2013.- </span></strong><span style="font-size: 9pt; font-family: Arial;">&nbsp;PRESUPUESTO RECIBIDO DE INST.FASE (ARCHIVADO EN DOCUMENTS. ADJUNTOS)</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; font-family: Arial;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11.111111640930176px;">&nbsp;</span><strong style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11.111111640930176px;">07/11/2013.-&nbsp;</strong><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11.111111640930176px;">VIENE EL PTE. DE LA CDAD. ANIBAL <strong>(ATILANO/PAZ)</strong> PARA TRATAR EL TEMA DE LA SE&Ntilde;AL DE ANTENA DE TV Y TRATAMOS TB EL TEMA DE LAS EMERGENCIAS, NOS INDICA EL PTE. QUE NADIE SE QUEJA DE ESTE PROBLEMA XQ SE VE CORRECTAMENTE , POR LO TANTO SE DEJARA PTE. PARA TRATAR EN LA PROXIMA JUNTA Y EXPONER TODOS LOS PRESUPUESTOS. ARCHIVADOS EN DOCUMENTOS ADJUNTOS.&nbsp;<strong>EL PULSADOR FUE REPARADO POR FASE, CREO HABER ENTENDIDO.</strong></span></span></p>'),
	(51, 50, '2013-10-21', '2013-10-23', '2013-11-25', 2, '', 'SEÑAL ANTENA TV (TDT)', '<p><span style="background-color: #00ff00;"><strong>21/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;RECIBIMOS CORREO DEL VECINO DEL 1&ordm;D INDICANDO QUE TIENE TDT Y DE LA SEMANA PASADA PARA ESTA NO VE NINGUN CANAL DE TV. ASIMISMO RECIBIMOS LLAMADA TFN DEL 4&ordm;D INDICANDO QUE NI ELLA NI SU VECINA DEL 5&ordm;A VEN LA TV (TB TIENEN TDT).</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">SE HABLA CON EL PTE. PARA QUE ESTE INFORMADO DE TODO EL TEMA Y QUE SEPA QUE SE VA A ENVIAR A UN TECNICO PARA QUE LO REVISE Y SOLUCIONE.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">VECINOS AFECTADOS:</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">*1&ordm;B ATILANO.- 617.073.611</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">*1&ordm;D JAVIER MENENDEZ.- 669.864.896</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">*4&ordm;D M&ordf; JOSE.- 627.036.255</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">*5&ordm;A FLOR.- 695.989.345</span></span></p>\r\n<p><strong><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">21/10/2013(11:15H).- </span></span></strong><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">&nbsp;PTE. ATILANO 617.073.611 1&ordm;B NOS INDICA QUE EL TAMPOCO VE ALGUNOS CANALES, PERO QUE NO LE DIO IMPORTANCIA XQ PENSO QUE ERA DE LA TV,&nbsp;<strong>DA EL VISTO BUENO A LOS TRABAJOS DE ARREGLO DE ANTENA Y APROVECHANDO LA SALIDA DE CAMBIO DE EMERGENCIA Y DE ARREGLO DE PULSADOR.</strong></span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;"><strong>21/10/2013.-&nbsp;</strong>CORREO ENVIADO A ITELCO</span></span></p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 21 de octubre de 2013 12:04<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> CARBONERA 58 </span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="color: #ff0000;"><strong><span style="font-size: 9.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></strong></span></p>\r\n<p class="MsoNormal"><span style="color: #ff0000;"><strong><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido varios avisos para efectuar en esta comunidad (CP Ctra. Carbonera 58):</span></strong></span></p>\r\n<p class="MsoNormal"><span style="color: #ff0000;"><strong><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 9.0pt; font-family: Arial;">No ven los canales de tv. Varios vecinos desde la semana pasada no ven la mayor&iacute;a de los canales (todo tienen tdt). Pasarse por la comunidad para ver que ocurre y <span style="text-decoration: underline;">confirmar con los vecinos afectados</span> que todo quedo correcto.</span></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">1&ordm;B Atilano 617.073.611</span></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">1&ordm;D Javier Menendez 669.864.896</span></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">4&ordm;D M&ordf; Jose 627.036.255</span></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--></strong></span><span style="font-size: 9.0pt; font-family: Arial;"><span style="color: #ff0000;"><strong>5&ordm;A Flor 695.989.345</strong></span></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Cambio de emergencia planta 4&ordf; planta.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Arreglo de pulsador zona de trasteros correspondiente a Ctra. Carbonera 58 (tanto para este aviso como para la emergencia pueden ponerse en contacto con el presidente Atilano 1&ordm; B 617.073.611, el cual indicara donde se encuentran.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Por favor, una vez realizados los trabajos indicarlo en la administraci&oacute;n. Gracias.</span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial;">23/10/2013.- &nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">CORREO RECIBIDO DE ITELCO, PRESUPUESTO EN DOCUMENTO ADJUNTO.</span></p>\r\n<p class="MsoPlainText">De: Itelco [mailto:info@itelcoasturias.com] <br /> Enviado el: mi&eacute;rcoles, 23 de octubre de 2013 10:36<br /> Para: Algonz.Paz<br /> Asunto: Re: CARBONERA 58</p>\r\n<p class="MsoPlainText">&nbsp;Hola Paz.</p>\r\n<p class="MsoPlainText">&nbsp;Estuvimos ayer con el presidente realizando las reparaciones. Lo de la tv</p>\r\n<p class="MsoPlainText">es producido por unos amplificadores antiguos que se estaban reutilizando</p>\r\n<p class="MsoPlainText">para ver los &uacute;ltimos canales que salieron, esto produc&iacute;a interferencias en</p>\r\n<p class="MsoPlainText">los canales de la televisi&oacute;n p&uacute;blica, por lo que decidimos anularlos con</p>\r\n<p class="MsoPlainText">el consentimiento del presidente. Ahora mismo se ven los canales</p>\r\n<p class="MsoPlainText">principales, para ver toda la parrilla recomendamos instalar una central</p>\r\n<p class="MsoPlainText">programable ya que con los cambios que va a ver en el futuro, y con esta</p>\r\n<p class="MsoPlainText">se puede seguir utilizando sin cambiar mas amplificadores, s&oacute;lo se</p>\r\n<p class="MsoPlainText">facturar&iacute;a por reprogramarla.&nbsp; Te adjunto presupuesto.</p>\r\n<p class="MsoPlainText">&nbsp;Un saludo.</p>\r\n<p class="MsoPlainText">&nbsp;<span style="font-size: 11px;">Tom&aacute;s</span></p>\r\n<p class="MsoPlainText">&nbsp;<span style="background-color: #00ff00;"><strong>24/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE SOLICITAN PRESUPUESTOS X CORREO ELECTRONICO A:</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">INSTALACIONES FASE</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">RAMOS Y MASID</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">ROYFE</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>28/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp; PRESUPUESTO RECIBIDO DE ROYFE (ARCHIVADO EN DOCUMENTS.ADJUNTOS).</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>29/10/2013.-<span style="background-color: #ffffff;">&nbsp; &nbsp;</span></strong><span style="background-color: #ffffff;">PRESUPUESTO RECIBIDO DE INST.FASE (ARCHIVADO EN DOCUMENTS. ADJUNTOS).</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>05/11/2013.-<span style="background-color: #ffffff;"> &nbsp;</span></strong><span style="background-color: #ffffff;">&nbsp;PRESUPUESTO RECIBIDO DE RAMOS Y MASID (ARCHIVADO EN DOCUMENTS.ADJUNTOS).</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>06/11/2013.-<span style="background-color: #ffffff;">&nbsp; </span></strong><span style="background-color: #ffffff;">&nbsp;LLAMADA RECIBIDA DE VECINO DEL 1&ordm;D PREGUNTANDO SOBRE ESTE TEMA, QUIERE QUE SE SOLUCIONE LO MAS RAPIDO POSIBLE.</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>06/11/2013(12:40h).-<span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA AL PTE. ATILANO 617.073.611, NO COGE EL TFN.</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><strong>11/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;VIENE EL PTE. DE LA CDAD. ATILANO PARA FIRMAR PRESUPUESTO DE ACEPTACION DE TRABAJOS PARA EL ARREGLO DE CANALES DE TV. SE DECIDE X EL CAMBIO DE CENTRAL Y X EL PRESUPUESTO DE ITELCO (PRESUPUESTO FIRMADO CON EL VISTO BUENO ARCHIVADO EN DOCUMNTS.ADJUNTOS)</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #00ff00;"><span style="background-color: #ffffff;"><span style="background-color: #00ff00;"><strong>12/11/2013.-</strong>&nbsp;</span>CORREO ENVIADO A ITELCO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 12 de noviembre de 2013 12:09<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> PRESUPUESTO ACEPTADO CP CARBONERA 58 (CENTRAL TV)</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto se remite presupuesto aceptado para la instalaci&oacute;n de central de tv en la comunidad CP Carretera Carbonera 58. Por favor, necesitamos nos indiquen d&iacute;a previsto de realizaci&oacute;n de los trabajos para indicar a la comunidad que estar&iacute;an sin tv. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="background-color: #00ff00;">18/11/2013.-</span> &nbsp;</strong>SE LLAMO X TFN A TOMAS Y QUEDO CON EL PTE. ATILANO (QUE ESTABA AQUI) EN QUE EL JUEVES A LAS 15:30H. IBAN PARA ALLA A COLOCAR LA CENTRAL. NOS INDICA EL PTE. QUE EL SE ENCARGA DE PONER LOS CARTELES COMUNICATIVOS.</p>\r\n<p class="MsoNormal"><span style="background-color: #00ff00;"><strong>25/11/2013.-<span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">SE LLAMA A LOS VECINOS PARA VER SI VEN LA TV CORRECTAMENTE</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><span style="font-size: 9.0pt; font-family: Arial;">- 1&ordm;D Javier Menendez 669.864.896.-</span></strong><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;11:05H.- todo ok</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;</span></span><span style="font-size: 9.0pt; font-family: Arial;">4&ordm;D M&ordf; Jose 627.036.255.-&nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">11:07h.- todo ok</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="color: #ff0000;"><strong><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: Arial;">-<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;</span></span></strong></span><span style="font-size: 9.0pt; font-family: Arial;"><span style="color: #ff0000;"><strong>5&ordm;A Flor 695.989.345.-</strong> 11:10h.- no coge el tfn.</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;">&nbsp;</p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt;"><span style="font-size: 9pt; font-family: Arial; color: #000000;">SE DA X VALIDADO EL TRABAJO.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(52, 51, '2013-10-21', '2013-10-24', '2013-10-23', 2, '', 'SEÑAL ANTENA TV (TDT)', '<p><strong>21/10/2013.-&nbsp;</strong>RECIBIMOS LLAMADA EL VIERNES TARDE (a ultima hora)18/10/2013 DE BAJO D MANUELA 636.869.910, INDICANDO QUE NO VE LA TV (TDT), QUE NO VE NINGUN CANAL (no entiende absolutamente nada de lo que se le dice....es como hablar con una pared).</p>\r\n<p>SE DA AVISO A ITELCO, CORREO ENVIADO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 21 de octubre de 2013 18:36<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> CP SENDA DEL ARCEDIANO 2, SE&Ntilde;AL ANTENA TV</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt; text-align: justify;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de la inquilina de </span>la comunidad Senda<span style="font-family: Arial; font-size: 8pt; text-align: justify;"> del Arcediano n&ordm;2, Bajo D Manuela 636.869.910, indicando que no ve ning&uacute;n canal de la tv (tiene TDT), se le pregunta si ha comprobado el funcionamiento de la tv en otras se&ntilde;ales de antena de la vivienda, y dice que no tiene porque no tiene m&aacute;s tv&hellip;..(o no entiende o no quiere entender), se le indica que se enviara al tecnico para que revise el tema comunitario, por favor, &nbsp;si es as&iacute; solucionarlo, y si fuera problema privativo&hellip;.indicarselo a </span>la inquilina. Gracias.</p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;">23/10/2013.-</strong><span style="font-size: 11px;"> CORREO RECIBIDO DE ITELCO, SE LE LLAMO X TFN Y NOS INDICA QUE TUVIERON QUE CAMBIAR DOS DERIVADORES, QUE ESTABAN MAL, FUE DAVID Y LE COSTO BASTANTE TRABAJO LOCALIZAR LA AVERIA.</span></p>\r\n<p class="MsoPlainText">De: Itelco [mailto:info@itelcoasturias.com] <br /> Enviado el: mi&eacute;rcoles, 23 de octubre de 2013 10:29<br /> Para: Algonz.Paz<br /> Asunto: Re: CP SENDA DEL ARCEDIANO 2, SE&Ntilde;AL ANTENA TV</p>\r\n<p class="MsoPlainText">&nbsp;Buenos d&iacute;as Paz.</p>\r\n<p class="MsoPlainText">&nbsp;Se repar&oacute; ayer.</p>\r\n<p class="MsoPlainText">&nbsp;Un saludo.</p>\r\n<p class="MsoPlainText">&nbsp;<span style="font-size: 11px;">Tom&aacute;s</span></p>\r\n<p class="MsoPlainText">&nbsp;</p>'),
	(53, 52, '2013-10-21', '2013-10-24', '2013-10-22', 2, '', 'PUERTA PEATONAL PORTON GARAJE', '<p><strong>21/10/2013.-&nbsp;</strong>&nbsp;NOS DA AVISO EL PROPIETARIO DE LA PLAZA N&ordm; 30, INDICANDO QUE EL BOMBIN DE LA PUERTA PEATONAL DE ACCESO AL GARAJE ESTA SUELTA Y ESTROPEADA</p>\r\n<p>SE ENVIA CORREO A RABA (AMAESTRAMIENTO) PARA QUE SE PASEN</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;<br /><strong>Enviado el:</strong>&nbsp;lunes, 21 de octubre de 2013 19:15<br /><strong>Para:</strong>&nbsp;\'Raba Cierres El&eacute;ctricos S.A\'; \'Jos&eacute; Luis Huerta\'; RABA CIERRES Y APERTURAS (ana.alonso@rblocks.com)<br /><strong>Asunto:</strong>&nbsp;CP Puerta peatonal GARAJE AMPURDAN 13</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de propietario de plaza de garaje&nbsp; indicando que la puerta peatonal de acceso al garaje no funciona, parece que esta todo suelto de manera interna (amaestramiento con RABA). Por favor, pasarse por all&iacute; y solucionar el tema, para ello pueden ponerse en contacto con el presidente Concepci&oacute;n 985.143.458 &oacute; vicepresidente Luis Lopez 985.399.641. Gracias.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">22/10/2013.-&nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;"> NOS LLAMA LA PTE. DE LA CDAD. CONCHI INDICANDO QUE ESTA ALLI CON LOS DE RABA Y LA PUERTA ABRE Y CIERRA PERFECTAMENTE, QUE EL PROBLEMA HA DE SER DEL VECINO, QUE PARA LA PROXIMA EL VECINO LO COMPRUEBE O SINO SE HAGA CARGO DE LA SALIDA.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial;">22/10/2013(18:10H).- &nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">SE LLAMA X TFN AL VECINO QUE DIO LA NOTIFICACION, <strong>PLAZA N&ordm; 30 BLAS SANDONIS 985.14.20.92 (hijo)</strong> PARA INDICARLE QUE LA PUERTA NO TENIA NINGUN PROBLEMA, QUE TANTO LA PTE. COMO EL TECNICO DE RABA COMPROBARON QUE EL BOMBIN, CERRADURA Y PUERTA ESTABA CORRECTO. EL NOS INDICA QUE EL INQUILINO DE LA PLAZA LE DIJO QUE NO FUNCIONABA Y LA PROBO DELANTE DE &Eacute;L CUANDO LE PAGO EL MES Y FUNCIONO UNA VEZ PERO LA SIGUIENTE NADA. SE QUEDA CON &Eacute;L EN QUE SI LE VUELVE A FALLAR NOS LO DIGA Y ENVIAMOS AL TECNICO PARA QUE LO COMPRUEBE CON SUS LLAVES, DICE QUE OK.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(54, 53, '2013-10-21', '2013-10-25', '2013-10-24', 2, '', 'LUMINARIAS -EMERGENCIAS-', '<p>21/10/2013.- LISTA ENTREGADA X EL TRABAJADOR DE XENIA (JONNY) SOBRE LAS EMERGENCIAS FUNDIDAS EN GARAJE</p>\r\n<p>DA M&ordf; DE LOS ANGELES EL V&ordm;B&ordm; PARA QUE SE MANDE LOS TRABAJOS A INST.FASE</p>\r\n<p>CORREO ENVIADO A INST.FASE</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 21 de octubre de 2013 19:47<br /> <strong>Para:</strong> \'INGENIERIA FASE S.L.\'<br /> <strong>Asunto:</strong> AVISO LUMINARIAS CP PRISMA -GARAJE-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente el cambio de emergencias en el garaje que corresponde a la comunidad Prisma c/Velazquez 20, c/Badajoz 26-28, indicar que algunas emergencias simplemente parpadean, con lo cual, puede que tengan arreglo sin necesidad de realizar el cambio. A continuaci&oacute;n detallamos las luminarias:</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Plaza 18.- emergencia averiada CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Plaza 26.- emergencia parpadeando ARREGLO &Oacute; CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Plaza 33.- emergencia averiada CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Contigua a plaza 33.- emergencia averiada CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Contigua a plaza 42.- emergencia parpadeando ARREGLO &Oacute; CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Plaza 49.- emergencia averiada CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Acceso a garaje zona exterior (por el patio) portal &nbsp;Velazquez 20.- emergencias (exterior e interior) averiadas CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">Acceso a garaje zona exterior (por el patio) portal Badajoz 28.- emergencia exterior averiada CAMBIO</span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="font-family: Arial; font-size: 9pt;">Para acceder a dichas zonas pueden localizar las llaves en </span>la administraci&oacute;n. Gracias.</p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial;">24/10/2013.- &nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">LUMINARIAS EMERGENCIA CAMBIADAS HOY X INST.FASE.&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">PTE. FACTURA INST.FASE</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">28/10/2013.- FACTURA RECIBIDA DE INST.FASE ARCHIVADO EN DOCUMNTS. ADJUNTOS</span></p>'),
	(55, 28, '2013-10-08', '2013-10-22', '2013-11-07', 2, '', 'PULSADORES', '<p><strong><span style="background-color: #00ff00;">8/10/2013.-</span>&nbsp;EN JUNTA DE FECHA 02/10/2013 SE DETERMINA QUE&nbsp;</strong>PUNTO 3&ordm; RUEGOS Y PREGUNTAS, "SOLICITAN SE REPARE VARIOS PULSADORES DE MICRO QUE NO TIENEN PULSADOR, Y QUE SE APROVECHE Y SE LE SANEE YA QUE INTERMITENTEMENTE ALGUNOS VECINOS SE PERCATAN QUE EN OCASIONES EL TIMBRE NO HACE CONTACTO. EN JUNTA NOTIFICARON 1&ordm; PLANTA (ROCIO) Y 4&ordm; PLANTA (M&ordf; CARMEN).</p>\r\n<p>CORREO ENVIADO A TOMAS ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;<br /><strong>Enviado el:</strong>&nbsp;martes, 08 de octubre de 2013 12:17<br /><strong>Para:</strong>&nbsp;\'Itelco\'<br /><strong>Asunto:</strong>&nbsp;AVISO CIGARRERES 42</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Han solicitado los vecinos de la comunidad indicada CP Cigarreres 42,&nbsp; la reparaci&oacute;n y/o saneamiento de pulsadores en placa exterior de micros. En junta notificaron que no les hace contacto (no les funciona) los vecinos de 1&ordf; y 4&ordf; planta, pero parece ser que es generalizado. Por favor, pasarse por all&iacute; y solucionarlo, comprobarlo con los vecinos que se encuentren en las viviendas y sobre todo con el 1&ordm;B (Rocio) y 4&ordm;A (Carmen) que fueron las que iniciaron el aviso. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="font-size: 10pt; font-family: Arial;">21/10/2013.-</span></strong><span style="font-size: 10pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp; CORREO RECIBIDO DE ITELCO CON PRESUPUESTO PARA CAMBIO DE PLACA, QUE ES LO NECESARIO (DOCUMENTOS ADJUNTOS)</span></span></span></p>\r\n<p class="MsoPlainText">De: Itelco [mailto:info@itelcoasturias.com] <br /> Enviado el: martes, 22 de octubre de 2013 11:23<br /> Para: Paz<br /> Asunto: Presupuesto de reparacion portero Les Cigarreres, 42</p>\r\n<p class="MsoPlainText">&nbsp;Buenos d&iacute;as Paz.</p>\r\n<p class="MsoPlainText">&nbsp;<span style="background-color: #00ff00;"><span style="font-size: 10pt; font-family: Arial;"><span style="background-color: #ffffff;"><span style="font-size: 12.0pt; font-family: \'Times New Roman\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">Te adjunto presupuesto de reparaci&oacute;n para Les cigarreres, 42.&nbsp;</span></span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;"><span style="background-color: #00ff00;">24/10/2013.-</span> solicitud de presupuesto a Fase</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Angeles [mailto:angeles@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 24 de octubre de 2013 19:36<br /> <strong>Para:</strong> \'ingenieria@montajeselectricosfase.com\'<br /> <strong>Asunto:</strong> Solicitud de Presupuesto Les Cigarreres 42</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span class="apple-converted-space"><span style="font-size: 10pt; font-family: Arial;">&nbsp;</span></span><span style="font-size: 10pt; font-family: Arial;">Han solicitado los vecinos de la comunidad indicada CP Cigarreres 42,&nbsp; la reparaci&oacute;n y/o saneamiento de pulsadores en placa exterior de micros. En junta notificaron que no les hace contacto (no les funciona) los vecinos de 1&ordf; y 4&ordf; planta, pero parece ser que es generalizado. Por favor, pasarse por all&iacute; y solucionarlo, comprobarlo con los vecinos que se encuentren en las viviendas y sobre todo con el 1&ordm;B (Rocio) y 4&ordm;A (Carmen) que fueron las que iniciaron el aviso. Tambi&eacute;n presupuesta placa completa por si la diferencia no es mucha ya cambiar todo y as&iacute; no tener mas incidencias Gracias. </span></p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; font-family: Arial;">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 7.5pt; font-family: Verdana;">Mar&iacute;a Angeles Gonz&aacute;lez Guti&eacute;rrez</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">C/ Les CIgarreres 25 Bajo </span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">33211 Gijon</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Tel&eacute;fono y Fax : 985.14.98.36</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 7.5pt; font-family: Verdana;"><a href="mailto:angeles@algonz.es"><strong><span style="color: windowtext; text-decoration: none;">angeles@algonz.es</span></strong></a></span></p>\r\n<p class="MsoPlainText">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;PASARON X LA CDAD. Y SOLUCIONARON EL PROBLEMA SANEANDO TODOS LOS PULSADORES, CAMBIANDO LOS PULSADORES DE LAS VIVIENDAS QUE DABAN FALLO Y CAMBIANDO TB UNA PIEZA (PLACA) QUE ESTABA OXIDADA EN EL INTERIOR DE LA PLACA GENERAL. NO PRESUPUESTAN NI HACEN EL CAMBIO GRAL. DE PLACA XQ HABRIA QUE CAMBIAR TB EL GRUPO FONICO Y ESO SUBIRIA BASTANTE. DE MOMENTO SE DEJA TAL CUAL YA QUE QUEDO FUNCIONANDO CORRECTAMENTE.</p>\r\n<p class="MsoNormal">PTE. FACTURA INST.FASE</p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(56, 55, '2013-10-22', '2013-10-25', '2013-10-23', 2, '', 'SEÑAL ANTENA TV (TDT)', '<p><strong>22/10/2013.-&nbsp;</strong>VIENEN LOS INQUILINOS DE CP CIGARRERES 54 BAJO A MARCELO BENITO 649.604.644 INDICANDO QUE NO VEN LA TV., SE LES PREGUNTA SI PROBARON EN OTRAS HABITACIONES DONDE TENGAN SE&Ntilde;AL DE ANTENA Y DICE QUE NO LO VEN EN NINGUNA...., INDICAN QUE HASTA AYER VEIAN LA TV TODOS LOS CANALES PERFECTAMENTE Y QUE DE REPENTE DEJARON DE VERLO, SE LES EXPLICA QUE ENVIAREMOS UN TECNICO SI ES PROBLEMA COMUNITARIO SE SOLUCIONARA Y SI ES PROBLEMA PRIVATIVO DEBERAN ARREGLARLO ELLOS.</p>\r\n<p>CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 22 de octubre de 2013 14:03<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO CP CIGARRERES 54 BAJO A</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del inquilino indicado c/Cigarreres 54 Bajo A Marcelo Benito 649.604.644, indicando que no ve ning&uacute;n canal de tv, se le pregunta si en otras habitaciones de la vivienda ven la tv y nos indica que en ninguna, y que fue de repente (solamente tienen TDT), se le indica que si es problema comunitario se soluciona y si es privativo se lo indican. Por favor pasarse, verificar que ocurre y si pertenece a la comunidad arreglarlo, en caso contrario hablar con los inquilinos. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;<strong>23/10/2013.-&nbsp;</strong>CORREO RECIBIDO DE ITELCO</p>\r\n<p class="MsoPlainText">De: Itelco [mailto:info@itelcoasturias.com] <br /> Enviado el: mi&eacute;rcoles, 23 de octubre de 2013 10:28<br /> Para: Algonz.Paz<br /> Asunto: Re: AVISO CP CIGARRERES 54 BAJO A</p>\r\n<p class="MsoPlainText">&nbsp;Hola Paz.</p>\r\n<p class="MsoPlainText">&nbsp;Era tema particular. Est&aacute; Informada la vecina.</p>\r\n<p class="MsoPlainText">&nbsp;Saludos.</p>\r\n<p class="MsoPlainText">&nbsp;<span style="font-size: 11px;">Tom&aacute;s</span></p>\r\n<p class="MsoPlainText">&nbsp;</p>'),
	(57, 16, '2013-10-22', '2013-11-27', NULL, 4, '', 'LIMPIEZA DE TEJADO', '<p><strong>22/10/2013.-&nbsp;</strong>SE REALIZO LIMPIEZA DE TEJADO X JOSE A.LEONARDO (ABIERTO SEGUIMIENTO).&nbsp;</p>\r\n<p>TRATAR EN PROXIMA JUNTA SI QUIEREN FIJAR MANTENIMIENTO DE LIMPIEZA ANUAL DE DICHO TEJADO - TERRAZA (PIEDRAS).</p>'),
	(58, 54, '2013-10-22', '2013-10-23', '2013-10-23', 2, '', 'AMPLIACION TIEMPO ILUMINACION', '<p><strong>VECINA DE V.22 2&ordm;G SOLICITA QUE SE AMPLIE EL TIEMPO DE ILUMINACION DE SU RELLANO XQ LO CONSIDERA INSUFICIENTE.</strong></p>\r\n<p><strong>22/10/2013.-&nbsp;</strong>SE MANDA CORREO A ITELCO</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;"><strong>Enviado el:</strong>&nbsp;martes, 22 de octubre de 2013 17:50<br /><strong>Para:</strong>&nbsp;\'Itelco\'<br /><strong>Asunto:</strong>&nbsp;CP EUROPA C/VELAZQUEZ 22 PLANTA 2&ordf; (2&ordm;G)</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de la propietaria de c/Velazquez 22 2&ordm;G indicando que el tiempo de encendido en el descansillo es insuficiente, solicita se amplie al doble de lo presente. Por favor, modificar dicho horario de alumbrado (que la luz este encendida m&aacute;s del doble de lo que esta ahora) y confirmar con la propietaria si lo encuentra correcto. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial;">23/10/2013.-</span></strong><span style="font-size: 9.0pt; font-family: Arial;"> &nbsp;VIENE DAVID DE ITELCO Y NOS INDICA QUE CAMBIO UNA PLACA Y REPROGRAMO PARA QUE ENCENDIERA 40 SEGUNDOS. TRABAJO FINALIZADO.</span></p>'),
	(59, 56, '2013-10-24', '2013-10-28', '2013-11-14', 2, '', 'LUMINARIAS ', '<p><strong>EN JUNTA DE FECHA 14/10/2013, EN EL PUNTO 4&ordm; RUEGOS Y PREGUNTAS SE APROBO:</strong></p>\r\n<p>&nbsp;<span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Reponer fluorescente del garaje seg&uacute;n se entra al garaje por la rampa, el que esta de frente a la entrada.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><strong><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">PAZ: AVISA A XENIA PARA QUE REALICE LA REPOSICION Y UNA VEZ EN EL GARAJE DE UNA REVISADA A LAS DEMAS LUMINARIAS/ RECUERDA LOS FLUORESCENTES SE DEJA ENCENDIDO UNA LAMPARA DE LAS DOS QUE TIENE EL PORTA LAMPARAS.&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><span style="color: #000000;"><span style="background-color: #ffff99;"><strong><span style="font-size: 9pt; font-family: Verdana;">24/10/2013.-</span></strong></span><span style="font-size: 9pt; font-family: Verdana;">&nbsp;CORREO ENVIADO A XENIA</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 24 de octubre de 2013 11:56<br /> <strong>Para:</strong> \'Xenia\'<br /> <strong>Asunto:</strong> AVISO LUMINARIAS CARMEN AMAYA 2</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; En junta de fecha 14/10/2013 indican que en la entrada al garaje por la rampa, reponer los fluorescentes que estan frente a dicha entrada, recordando que de las dos luminarias que tiene solamente se deja funcionando una, asimismo, por favor, hacer una revisi&oacute;n a todo el garaje, como en CP Prisma, e indicar todas las emergencias que necesitan ser cambiadas. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p><span style="font-size: 9.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p><strong><span style="font-size: 9.0pt; font-family: Arial;"><span style="background-color: #ffff99;">08/11/2013.-</span>&nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">RECIBIMOS LLAMADA DE PROPIETARIA 2&ordm;D PTE. INDICANDO QUE EN EL GARAJE HAY DOS FLUORESCENTES QUE NO FUNCIONAN:</span></p>\r\n<p><span style="font-size: 9.0pt; font-family: Arial;">* PLANTA -1 BAJADA ULTIMO FLUORESCENTE QUE HAY ANTES DE BAJAR</span></p>\r\n<p><span style="font-size: 9.0pt; font-family: Arial;">* PLANTA -2 PRIMER FLUORESCENTE QUE HAY SEGUN SE TERMINA LA BAJADA.</span></p>\r\n<p><strong><span style="font-size: 9.0pt; font-family: Arial;">12/11/2013(11:25H).-</span></strong><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; SE LLAMA X TFN A XENIA PARA INDICARLE QUE PASEN HOY A CAMBIAR ESTOS FLUORESCENTES, NOS DICE QUE TIENE AL CHICO X LA ZONA QUE LOS CAMBIAN HOY SIN FALTA.</span></p>\r\n<p><strong><span style="font-size: 9.0pt; font-family: Arial;">14/11/2013(11:25H).- &nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">NO COGE EL TFN, VIENE X LA OFICINA XENIA Y NOS INDICA QUE ESTA TODO CAMBIADO Y FUNCIONANDO OK.</span></p>\r\n<p><span style="font-size: 9.0pt; font-family: Arial;">12:05H.- SE LLAMA A LA PTE. ISABEL 699.016.158 PARA INDICARLE QUE YA ESTABA TODO REPUESTO Y CAMBIADO Y NOS DIJO QUE YA LO HABIA VISTO, QUE HABIA SIDO EL MISMO DIA DE SU LLAMADA. NOS DIO LAS GRACIAS Y QUEDO TODO OK.</span></p>\r\n<p>&nbsp;</p>'),
	(60, 57, '2013-10-24', '2013-11-12', '2013-10-31', 2, '', 'TENSOR SOMBRERETE EOLICO', '<p><strong>EN JUNTA DE FECHA 14/10/2013 EN EL APARTADO 4&ordm; RUEGOS Y PREGUNTAS SE INDICA:</strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Notifican que hay un tensor del sobrerote aeolico colocado en una de las chimenas esta suelto, se ofrecen a revisarlo e intentar repararlo los vecinos de los pisos 2&ordm; C y 2&ordm; E. De no poder realizar reparaci&oacute;n solicitamos que cualquiera de los dos informe a la Administraci&oacute;n para solicitar al reparador la sujeci&oacute;n del mismo.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><strong><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">PAZ: ESTA OBRA SE HIZO EN JUNIO/11, SI NO LO HACEN ESTOS VECINOS&nbsp; YA LA GARANTIA DE DOS A&Ntilde;O HA TERMINADO EN JUNIO/13, NO SE SI LLAMAR A CONLOA O A JOSE ANTONIO LEONARDO.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><span style="color: #000000;"><strong><span style="font-size: 9pt; font-family: Verdana;">24/10/2013.- &nbsp;</span></strong><span style="font-size: 9pt; font-family: Verdana;">NO HEMOS RECIBIDO NOTICIA DE LOS VECINOS ENCARGADOS, SE DEJA UN POCO MAS DE TIEMPO PARA QUE LO REALICEN.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><strong><span style="color: #000000;"><span style="font-size: 9pt; font-family: Verdana;">31/10/2013.-</span></span></strong><span style="color: #000000;"><span style="font-size: 9pt; font-family: Verdana;">&nbsp;VINO EL VICEPTE. SALIENTE ROBERTO VILLA PALACIO 2&ordm;C, INDICANDO QUE YA COLOCO EL TENSOR DEL SOMBRERETE, QUE GASTO 2,45.-&euro; (SE LOS PAGO M&ordf; DE LOS ANGELES)</span></span></p>'),
	(61, 58, '2013-10-24', '2013-10-31', NULL, 1, '', 'PUERTA PORTAL', '<p><strong>EN JUNTA DE FECHA 14/10/2013, PUNTO 4&ordm; RUEGOS Y PREGUNTAS SE DETERMINA QUE:</strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">La puerta de entrada no est&aacute; funcionando de manera adecuada, requieren que se mire por el seguro para poder reclamar dicha reparaci&oacute;n por actos vand&aacute;licos y as&iacute; evitar un gasto a la Comunidad.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong style="text-indent: 35.4pt; font-size: 11px;"><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">PAZ: ESTO LO HABLAS CON HERIBERTO CUANDO VENGA PUES TENDR&Aacute; QUE PONER UNA DENUNCIA, LA PRESIDENTE DIJO QUE PARA ELLA ERA MUY COMPLICADO XQ TRABAJABA FUERA DE GIJON. TAMBIEN LE DIJE A HERIBERTO QUE SE LE PODIA HACER POR INTERNET PERO QUE DE TODAS MANERAS EL TENIA QUE IR A RECOGERLA Y FIRMARLA A LA POLICIA.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong>12/11/2013.-</strong> VINO HERIBERTO X LA OFICINA PARA DAR AVISO DE LUCES Y SE LE RECORDO ESTE TEMA, NOS DIJO QUE TENIA PTE. IR A PONER LA DENUNCIA.&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong>25/11/2013.-&nbsp;</strong>SE LLAMA X TFN A HERIBERTO 618.194.792 / 985.155.901, PARA RECORDARLE EL TEMA DE LA DENUNCIA, NO COGE EL TFN.</p>'),
	(62, 59, '2013-10-25', '2013-11-17', NULL, 1, '', 'SUELO DESCANSILLOS Y/O ESCALERAS', '<p><strong>25/10/2013.-</strong>VARIOS VECINOS CUANDO SE ESTA ARREGLANDO EL PORTAL LE INDICAN AL CONTRATISTA QUE REALIZA LOS TRABAJOS QUE PODIA ARREGLAR LO QUE ESTA MAL EN LOS DESCANSILLOS. SE HABLA CON EL PTE. Y NOS DICE QUE ESO ES PARA TRATAR EN OTRA JUNTA, QUE HAY MUCHAS PLANTAS AFECTADAS (EL EDIFICIO TIENE SUS A&Ntilde;OS.....) Y HABRIA QUE PEDIR PRESUPUESTOS.</p>\r\n<p>CORREOS RECIBIDOS Y ENVIADOS A VECINO DEL 5&ordm; (el que m&aacute;s insistencia tiene con el tema de las baldosas)</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 25 de octubre de 2013 13:03<br /> <strong>Para:</strong> \'Garcia Ordas, Luis\'<br /> <strong>Asunto:</strong> RE: Deterioro baldosas rellano 5&ordm; piso San Nicolas 80</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Informamos a trav&eacute;s de la presente que tras conversaci&oacute;n mantenida con el presidente sobre este tema, se ha fijado tratarlo en una pr&oacute;xima junta, ya que son varias las plantas que tienen estos problemas y el asunto que se trato en junta y por el cual se contrato a la persona era para la adecuaci&oacute;n del portal, no de los descansillos y/o escaleras, para lo que habr&iacute;a que solicitar presupuestos.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Atentamente, un saludo</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Asesor&iacute;a Algonz</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Tfn/Fax.- 985.14.98.36</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;"><a href="mailto:administrativo@algonz.es">administrativo@algonz.es</a></span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;*****************************************************************************************************************************************************************************************************</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Garcia Ordas, Luis [mailto:luis.garcia-ordas@arcelormittal.com]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> viernes, 25 de octubre de 2013 10:50<br /> <strong>Para:</strong> \'administrativo@algonz.es\'<br /> <strong>Asunto:</strong> Deterioro baldosas rellano 5&ordm; piso San Nicolas 80</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as, ayer estuvieron arreglando la descolocaci&oacute;n de baldosas del 5&ordm; piso quedando la reparaci&oacute;n perfectamente. &nbsp;Lo &uacute;nico que veo es que no repararon el deterioro de las baldosas del rellano (parte letra D), ya que adem&aacute;s de que estaban descolocadas algunas baldosas, hay varias en el mismo rellano con deterioros importantes y es una pena que ya que arreglaron las que estaban movidas no aprovechen a dejar las de al lado igual. &nbsp;Adjunto fotos del deterioro de las baldosas que est&aacute;n al lado de las que arreglaron.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Muchas gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Saludos.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;*****************************************************************************************************************************************************************************************************</span></p>\r\n<div class="MsoNormal" style="text-align: center;" align="center">&nbsp;</div>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Garcia Ordas, Luis <br /> <strong>Enviado el:</strong> martes, 15 de octubre de 2013 10:55<br /> <strong>Para:</strong> \'administrativo@algonz.es\'<br /> <strong>Asunto:</strong> 1de 2 - Deterioro baldosas rellano 5&ordm; piso San Nicolas 80</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as, como les coment&eacute; telef&oacute;nicamente adjunto fotos sacadas en el d&iacute;a de ayer de la situaci&oacute;n de deterioro y descolocaci&oacute;n de las baldosas del rellano (parte letra D) de la escalera del piso 5&ordm; de San Nicol&aacute;s 80, que en el acta de la reuni&oacute;n de fecha 6 de junio de 2013 se dec&iacute;a que cuando se realizasen las obras del portal, realizar&iacute;an dicha reparaci&oacute;n.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Muchas gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Saludos.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-family: Arial; font-size: 8pt;">Nota: Env&iacute;o dos e-mails por el tama&ntilde;o de las fotos.</span></p>'),
	(63, 60, '2013-10-28', '2013-10-30', '2013-11-14', 2, '', 'PUERTA PORTAL', '<p><strong><span style="background-color: #339966;">28/10/2013.-</span> &nbsp;</strong>RECIBIMOS CORREO DE GERARDO ROBLES CON FOTOGRAFIA INDICANDO QUE LA PUERTA DEL PORTAL ESTABA MAL.</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Gerardo Robles [mailto:gerardo.robles@gmail.com] <strong>En nombre de </strong>Gerardo Robles<br /> <strong>Enviado el:</strong> s&aacute;bado, 26 de octubre de 2013 23:03<br /> <strong>Para:</strong> &Aacute;ngeles Algonz<br /> <strong>Asunto:</strong> Puerta portal</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt;">Hola,</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt;">os mando esto de la carretera Carbonera 60.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt;">no se lo que ser&iacute;a lo que pas&oacute; en el portal esta ma&ntilde;ana, pero habr&iacute;a que solucionarlo. Yo puse unos tornillos y arregl&eacute; la puerta, pero el problema es que los pasadores est&aacute;n tan justos, que cuando alguien tiene que abrirlo cuesta much&iacute;simo, y despu&eacute;s volver a cerrarlos m&aacute;s todav&iacute;a. Al no cerrarlos bien, suceden estas cosas que se ven en las fotos. La cerradura convendr&iacute;a estudiar revisarla, junto a los pasadores.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt;">Por otra parte, yo sigo notando que la cerradura de llamar al ascensor del garaje de la torre 60 no funciona bien, y a veces cuesta mucho que haga contacto y llame al ascensor.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt;">Saludos!!!</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;"><span style="background-color: #339966;">&nbsp;<strong>28/10/2013.-&nbsp;</strong></span>SE HABLA CON EL PTE. DE LA CDAD. JOSE MANUEL OSORIO PARA INFORMARLE DE TODO EL TEMA, &Eacute;L DICE QUE NO VE LA PUERTA TAN MAL, NO OBSTANTE QUE SE MANDE A ARREGLAR.<br /></span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">CORREO ENVIADO A RABA</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 28 de octubre de 2013 10:50<br /> <strong>Para:</strong> \'Raba Cierres El&eacute;ctricos S.A\'; \'Jos&eacute; Luis Huerta\'<br /> <strong>Asunto:</strong> RV: Puerta portal CP Carbonera 60</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto remitimos fotograf&iacute;a sobre cerradura de puerta del portal sito en CP Carretera Carbonera 60, los vecinos nos informan que ni abre correctamente (ni con llave ni a trav&eacute;s de los micros) ni cierra, hacen la indicaci&oacute;n que los pasadores est&aacute;n demasiado juntos y en parte eso impide tanto la apertura como el cierre de </span>la misma. Por<span style="color: navy; font-family: Arial; font-size: 9pt;"> favor, pasarse por la comunidad para solucionar el problema, si el arreglo conllevara un importe superior a 90,00.-&euro; se solicita presupuesto de arreglo del mismo para exponer a los vecinos.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">Para facilitar llaves de la puerta, pueden ponerse en contacto con el presidente de la comunidad Jose Manuel Osorio 637.802.569.</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 9.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="background-color: #339966;"><strong><span style="font-size: 9pt; font-family: Arial;">28/10/2013.-</span></strong></span><span style="font-size: 9pt; font-family: Arial;"><span style="background-color: #339966;">&nbsp;</span> CORREO RECIBIDO DE RABA</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-family: Tahoma; font-size: xx-small;"><span style="font-size: 9pt;">De:</span></span></strong><span style="font-family: Tahoma; font-size: xx-small;"><span style="font-size: 9pt;"> Jos&eacute; Luis Huerta [mailto:jose.huerta@rblocks.com] <br /> <strong>Enviado el:</strong> lunes, 28 de octubre de 2013 11:03<br /> <strong>Para:</strong> \'Algonz.Paz\'<br /> <strong>Asunto:</strong> RE: Puerta portal CP Carbonera 60</span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; color: navy; font-family: Arial;">Hola, ok pasamos.</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\'; font-size: xx-small;"><span style="font-size: 9.0pt;">Creo que ser&iacute;a bueno pensar en cambiar de sistema, la cerradura existente es una de cierre muy duro, es Italiana y muy mala. Miraremos que pasa y se lo comentaremos al presidente.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\'; font-size: xx-small;"><span style="font-size: 9.0pt;">Saludos, Huerta</span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; color: navy; font-family: \'Times New Roman\';">Raba Cierres El&eacute;ctricos S.A&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: \'Times New Roman\'; font-size: xx-small;"><span style="font-size: 9pt;"> C/ Marqu&eacute;s de San Esteban 16.</span></span><span style="color: navy; font-family: \'Times New Roman\'; font-size: medium;"><span style="font-size: 12pt;">&nbsp;</span></span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="background-color: #339966;"><strong>06/11/2013.- &nbsp;</strong></span>RECIBIMOS LLAMADA DEL PTE. DE LA CDAD. JOSE MANUEL OSORIO INDICANDO QUE LA PUERTA DEL PORTAL NO ABRE, QUE LO COMPROBO CON MAS VECINOS Y NO ABRE CON NINGUNO, ASIMISMO NOS INDICA QUE &Eacute;L NO VA A ESTAR EN DOS DIAS .</span></p>\r\n<p class="MsoNormal"><span style="color: #000000;">SE ENVIA CORREO A RABA</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 06 de noviembre de 2013 18:14<br /> <strong>Para:</strong> \'Jos&eacute; Luis Huerta\'; \'Raba Cierres El&eacute;ctricos Raba Cierres El&eacute;ctricos\'<br /> <strong>Asunto:</strong> RE: Puerta portal CP Carbonera 60</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del presidente de </span>la comunidad CP Carbonera<span style="color: navy; font-family: Arial; font-size: 9pt;"> 60 indicando que la puerta de portal no abre, probaron con varios vecinos y no abre con ninguna llave. Por favor, pasarse por all&iacute;, comprobar que ocurre y solucionar el problema. Asimismo, por favor, indicar a la administraci&oacute;n que ocurria y que trabajos se realizaron. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 9pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="background-color: #339966;"><strong><span style="font-family: Arial; font-size: 9pt;">07/11/2013.-</span></strong></span><span style="font-family: Arial; font-size: 9pt;"><span style="background-color: #339966;">&nbsp;</span>CORREO RECIBIDO DE RABA</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-family: Tahoma; font-size: xx-small;"><span style="font-size: 9pt;">De:</span></span></strong><span style="font-family: Tahoma; font-size: xx-small;"><span style="font-size: 9pt;"> Raba [mailto:raba@rblocks.com] <br /> <strong>Enviado el:</strong> jueves, 07 de noviembre de 2013 11:08<br /> <strong>Para:</strong> \'Algonz.Paz\'<br /> <strong>Asunto:</strong> RE: Puerta portal CP Carbonera 60</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\'; font-size: xx-small;"><span style="font-size: 9.0pt;">&nbsp;</span></span><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">Hola, lo que reparamos el otro d&iacute;a no era el bombillo fue la cerradura y el 3&ordm;B nos dio el visto bueno (tambi&eacute;n nos pidi&oacute; una llave y que la carguemos a la comunidad), te comento lo que hicimos.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">&nbsp;</span></span><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">1 flexo pasacables.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">1 cajero de cerradura.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">1 sujetar pasadores puerta fija.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">1 reparar la cerradura el&eacute;ctrica internamente (la bobina).</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">1 llave para el presidente, dice que para asuntos de comunidad.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">1 nos llev&oacute; 3 horas de mano de obra.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">Antes de hacer nada se lo dijimos al presidente que nos pasar&iacute;amos del presupuesto que nos indicabas (90&euro;), dijo que hici&eacute;ramos lo que tuvi&eacute;ramos que hacer que lo autorizaba &eacute;l.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">&nbsp;</span></span><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">No nos dijo nada del bombillo. Si ahora quieres el bombillo lo cambiamos.</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">&nbsp;</span></span><span style="font-size: 9pt; color: navy; font-family: Arial;">Saludos,</span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="background-color: #339966;"><strong><span style="font-size: 9pt; font-family: Arial;">07/11/2013.- </span></strong></span><span style="font-size: 9pt; font-family: Arial;"><span style="background-color: #339966;">&nbsp;</span>RESPUESTA ENVIADA A RABA</span></span></p>\r\n<p class="MsoNormal">&nbsp;<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> jueves, 07 de noviembre de 2013 12:28<br /> <strong>Para:</strong> \'Raba\'<br /> <strong>Asunto:</strong> RE: Puerta portal CP Carbonera 60</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Gracias por la informaci&oacute;n.</span></p>\r\n<p class="MsoNormal" style="text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Arial; color: navy;">Lo que solicitamos ahora es que seg&uacute;n la misma persona que autorizo los trabajos, la cerradura de la puerta no funciona, por lo tanto, lo que estamos solicitando es su arreglo, nosotros como administraci&oacute;n no sabemos si despu&eacute;s de todos los trabajos que describes se realizaron en correo anterior la puerta deber&iacute;a funcionar correctamente &oacute; habr&iacute;a que haberse cambiado el bombillo, solo sabemos que no funciona. Por favor, indicar en un presupuesto lo que supondr&iacute;a dicho arreglo para solicitar el visto bueno del representante de la comunidad. Gracias.</span></p>\r\n<p class="MsoNormal" style="text-indent: 35.4pt;"><span style="color: navy; font-family: Arial; font-size: 9pt; text-indent: 35.4pt;">A la espera de noticias, un saludo</span></p>\r\n<p class="MsoNormal" style="text-indent: 35.4pt;"><span style="color: navy; font-family: Arial; font-size: 9pt; text-indent: 35.4pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><strong><span style="background-color: #339966;">08/11/2013.-</span> &nbsp;</strong>CORREO RECIBIDO DE RABA&nbsp;</p>\r\n<p class="MsoNormal"><strong><span style="font-family: Tahoma; font-size: xx-small;"><span style="font-size: 9pt;">De:</span></span></strong><span style="font-family: Tahoma; font-size: xx-small;"><span style="font-size: 9pt;"> Raba [mailto:raba@rblocks.com] <br /> <strong>Enviado el:</strong> viernes, 08 de noviembre de 2013 18:05<br /> <strong>Para:</strong> \'Algonz.Paz\'<br /> <strong>Asunto:</strong> RE: Puerta portal CP Carbonera 60</span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; color: navy; font-family: Arial;">Hola, estuvimos all&iacute; probamos con una llave original HDP-2 y abre perfectamente el bombillo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; color: navy; font-family: Arial;">Seguramente se quejan llaves piratas.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; color: navy; font-family: Arial;">El presidente nos dijo que no eran las llaves que era el muelle, lo probamos y cierra correctamente.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; color: navy; font-family: Arial;">Saludos,</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="background-color: #339966;"><strong>14/11/2013 (11:25H).-</strong><span style="background-color: #ffffff;">&nbsp;LLAMAMOS AL PTE. DE LA CDAD. JOSE MANUEL OSORIO 637.802.569 PARA QUE NOS CONFIRME SI TODO ESTA BIEN, NO NOS COGE EL TFN. PTE. QUE NOS DEVUELVA &nbsp;LA LLAMADA. </span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #339966;"><span style="background-color: #ffffff;">12:35H.- NOS DEVUELVE LA LLAMADA JOSE MANUEL OSORIO Y NOS DICE QUE TRAS LA ULTIMA VISITA DE RABA HA QUEDADO OK, O X LO &nbsp;MENOS &Eacute;L NO HA VUELTO A RECIBIR MAS QUEJAS DE VECINOS AL RESPECTO.</span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #339966;"><span style="background-color: #ffffff;">SE DA X FINALIZADO LA TAREA</span></span></p>\r\n<p class="MsoNormal"><span style="background-color: #339966;"><span style="background-color: #ffffff;">PTE. FACTURA DE RABA&nbsp;</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: xx-small;"><span style="font-size: 9pt;">&nbsp;</span></span></p>'),
	(64, 61, '2013-10-28', '2013-10-28', '2013-10-28', 2, '', 'EMERGENCIAS', '<p><strong>23/10/2013.-</strong>&nbsp;CON EL LISTADO QUE NOS HA ENTREGADO LA ENCARGADA DE LA LIMPIEZA SOBRE LAS EMERGENCIAS NECESARIAS EN LA COMUNIDAD, SE HABLA CON M&ordf; DE LOS ANGELES Y SE DA EL V&ordm;B&ordm; AL CAMBIO DE LAS MISMAS CON INSTALACIONES FASE QUE ES MUCHO MAS BARATA.</p>\r\n<p>SE MANDA CORREO A INST.FASE</p>\r\n<p><span style="font-size: 11px;">De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p>Enviado el: mi&eacute;rcoles, 23 de octubre de 2013 17:40</p>\r\n<p>Para: \'INGENIERIA FASE S.L.\'</p>\r\n<p>Asunto: LUMINARIAS CP PUERTA DEL SOL C/VELAZQUEZ 40-42 C/CARMEN AMAYA 1</p>\r\n<p><span style="font-size: 11px;">Buenas tardes.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente el cambio y/o reposici&oacute;n de emergencias en la comunidad arriba indicada CP Puerta del Sol, c/Velazquez 40 &ndash; 42 c/Carmen Amaya 1. A continuaci&oacute;n detallamos las luminarias:</span></p>\r\n<p>Velazquez 42</p>\r\n<p>Emergencia en trastero (izda.)</p>\r\n<p>Emergencia en 3&ordf; planta (funciona pero esta colgando por los cables, arreglar no sustituir).</p>\r\n<p>Emergencia en escalera 5&ordf; y 6&ordf; planta.</p>\r\n<p>Velazquez 40</p>\r\n<p>Emergencia portal encima de la puerta</p>\r\n<p>Emergencia puerta salida a piscina</p>\r\n<p>Emergencia trastero puerta entrada.</p>\r\n<p><span style="color: #ff0000;"><strong>Carmen Amaya 1</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia en escalera 2&ordf; planta.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Para acceder a la comunidad pueden localizar las llaves en la administraci&oacute;n.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Atentamente</p>\r\n<p>&nbsp;</p>\r\n<p>Paz Ortiz</p>\r\n<p>&nbsp;<strong>28/10/2013.-</strong> &nbsp;TRABAJO FINALIZADO, TRAJO FACTURA INES. DOCUMTS.ADJUNTOS</p>'),
	(65, 62, '2013-10-28', '2013-10-30', '2013-10-28', 2, '', 'EMERGENCIAS', '<p><strong>23/10/2013.-</strong>&nbsp;CON EL LISTADO QUE NOS HA ENTREGADO LA ENCARGADA DE LA LIMPIEZA SOBRE LAS EMERGENCIAS NECESARIAS EN LA COMUNIDAD, SE HABLA CON M&ordf; DE LOS ANGELES Y SE DA EL V&ordm;B&ordm; AL CAMBIO DE LAS MISMAS CON INSTALACIONES FASE QUE ES MUCHO MAS BARATA.</p>\r\n<p>SE MANDA CORREO A INST.FASE</p>\r\n<p><span style="font-size: 11px;">De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p>Enviado el: mi&eacute;rcoles, 23 de octubre de 2013 17:40</p>\r\n<p>Para: \'INGENIERIA FASE S.L.\'</p>\r\n<p>Asunto: LUMINARIAS CP PUERTA DEL SOL C/VELAZQUEZ 40-42 C/CARMEN AMAYA 1</p>\r\n<p><span style="font-size: 11px;">Buenas tardes.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente el cambio y/o reposici&oacute;n de emergencias en la comunidad arriba indicada CP Puerta del Sol, c/Velazquez 40 &ndash; 42 c/Carmen Amaya 1. A continuaci&oacute;n detallamos las luminarias:</span></p>\r\n<p>Velazquez 42</p>\r\n<p>Emergencia en trastero (izda.)</p>\r\n<p>Emergencia en 3&ordf; planta (funciona pero esta colgando por los cables, arreglar no sustituir).</p>\r\n<p>Emergencia en escalera 5&ordf; y 6&ordf; planta.</p>\r\n<p><span style="color: #ff0000;"><strong>Velazquez 40</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia portal encima de la puerta</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia puerta salida a piscina</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia trastero puerta entrada.</strong></span></p>\r\n<p>Carmen Amaya 1</p>\r\n<p>Emergencia en escalera 2&ordf; planta.</p>\r\n<p>&nbsp;</p>\r\n<p>Para acceder a la comunidad pueden localizar las llaves en la administraci&oacute;n.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Atentamente</p>\r\n<p>&nbsp;</p>\r\n<p>Paz Ortiz</p>\r\n<p>&nbsp;28/10/2013.- TRABAJO FINALIZADO, TRAJO FACTURA INES. FACTURA DOCUMENTS.ADJUNTOS</p>'),
	(66, 63, '2013-10-28', '2013-10-30', '2013-10-28', 2, '', 'EMERGENCIAS', '<p><strong>23/10/2013.-</strong>&nbsp;CON EL LISTADO QUE NOS HA ENTREGADO LA ENCARGADA DE LA LIMPIEZA SOBRE LAS EMERGENCIAS NECESARIAS EN LA COMUNIDAD, SE HABLA CON M&ordf; DE LOS ANGELES Y SE DA EL V&ordm;B&ordm; AL CAMBIO DE LAS MISMAS CON INSTALACIONES FASE QUE ES MUCHO MAS BARATA.</p>\r\n<p>SE MANDA CORREO A INST.FASE</p>\r\n<p><span style="font-size: 11px;">De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p>Enviado el: mi&eacute;rcoles, 23 de octubre de 2013 17:40</p>\r\n<p>Para: \'INGENIERIA FASE S.L.\'</p>\r\n<p>Asunto: LUMINARIAS CP PUERTA DEL SOL C/VELAZQUEZ 40-42 C/CARMEN AMAYA 1</p>\r\n<p><span style="font-size: 11px;">Buenas tardes.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente el cambio y/o reposici&oacute;n de emergencias en la comunidad arriba indicada CP Puerta del Sol, c/Velazquez 40 &ndash; 42 c/Carmen Amaya 1. A continuaci&oacute;n detallamos las luminarias:</span></p>\r\n<p><span style="color: #ff0000;"><strong>Velazquez 42</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia en trastero (izda.)</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia en 3&ordf; planta (funciona pero esta colgando por los cables, arreglar no sustituir).</strong></span></p>\r\n<p><span style="color: #ff0000;"><strong>Emergencia en escalera 5&ordf; y 6&ordf; planta.</strong></span></p>\r\n<p>Velazquez 40</p>\r\n<p>Emergencia portal encima de la puerta</p>\r\n<p>Emergencia puerta salida a piscina</p>\r\n<p>Emergencia trastero puerta entrada.</p>\r\n<p>Carmen Amaya 1</p>\r\n<p>Emergencia en escalera 2&ordf; planta.</p>\r\n<p>&nbsp;</p>\r\n<p>Para acceder a la comunidad pueden localizar las llaves en la administraci&oacute;n.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Atentamente</p>\r\n<p>&nbsp;</p>\r\n<p>Paz Ortiz</p>\r\n<p>&nbsp;28/10/2013.- TRABAJO FINALIZADO. TRAJO FACTURA INES. FACT.EN DOCUMENTS.ADJUNTOS</p>'),
	(67, 64, '2013-10-28', '2014-05-04', NULL, 1, '', 'CAMBIO REJILLAS ', '<p><strong>28/10/2013.- EN JUNTA DE FECHA 10/10/2013 SE DETERMINO "</strong><span style="font-size: 9pt; text-align: justify;">En cuanto a las rejillas de alrededor de la piscina est&aacute; pendiente de reponer las esquinas y pedir otras 100 unidades para sustituir las que est&aacute;n algo deterioradas.</span><span style="font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt;">\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; color: blue;">PAZ: CUANDO LLEGUE LA TEMPORADA DE USO DE PISCINA UNOS MESES ANTES PEDIR ESTAS QUE QUEDAN POR COLOCAR Y NO SE SI LAS COLOCARA ANTONIO O SINO DARSELAS A LOS DEL MANTENIMEINTO DE LAS PISCINAS QUE NOS COBREN LA MANO DE OBRA EN CASO DE QUE NO LO QUIERA COLOCAR POR LA CARA.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="color: #000000;">DEL PEDIDO INICIAL QUE SE REALIZO EN JUNIO/2013, SOBRARON REJILLAS QUE EL PTE. DE LA FECHA, ANTONIO, GUARDO EN EL CUARTO DE PISCINA (O EN EL CUARTO QUE ESTA AL LADO DE LA SALIDA AL PATIO DE V.40., REVISAR CUANTAS SOBRARON Y HACER PEDIDO DE LAS RESTANTES.</span></strong></p>\r\n</div>'),
	(68, 65, '2013-10-28', '2014-05-04', NULL, 1, '', 'PREPARACION Y MANTENIMIENTO PISCINA', '<p><strong>28/10/2013.- &nbsp;</strong>EN JUNTA DE FECHA 10/10/2013 SE DETERMINA QUE "<strong style="text-align: justify; font-size: 11px;">4&ordm;.- Mantenimiento de piscina, presentar y aprobar presupuestos si procede. Valorar renovaci&oacute;n de los servicios y/o contrataci&oacute;n de una nueva empresa. Informa de actuaciones que se deben llevar a cabo.</strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong>&nbsp;</strong><span style="font-size: 9pt; text-indent: 14.4pt;">Se acuerda contratar la empresa de Mantenimiento Sam para en el siguiente ejercicio seg&uacute;n el coste que se indica (1) y tambi&eacute;n <span style="color: #ff0000;"><strong>autorizan para la siguiente temporada realizar el cambio Total de la arena</strong></span> seg&uacute;n recomiendan las empresas encuestadas y el Principado. El importe a pagar por el cambio de carga de arena 1.175&euro; mas IVA. Esta partida se toma del fondo de maniobra.</span><span style="font-size: 9pt; text-indent: 14.4pt;">&nbsp; &nbsp;&nbsp;</span><strong><br /></strong></p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: 21.0pt; margin-right: 0cm;">\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 14.4pt; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; color: blue;">PAZ: PROGRAMA PARA LA SIGUIENTE TEMPORADA DE BA&Ntilde;O ESTAS ACTUACIONES. REALIZALO CON TIEMPO SUFICIENTE NO VAYA A SURGIR IMPREVISTOS Y QUE TENGAMOS TIEMPO SUFICIENTE PARA SOLVENTARLOS PUES ESTO ES LA PRIMERA VEZ QUE SE REALIZA (ARENA)&nbsp;</span></strong></p>\r\n</div>'),
	(69, 66, '2013-10-28', '2013-11-24', NULL, 1, '', 'MOTOS APARCADAS EN ZONAS COMUNES GARAJE', '<p><strong>28/10/2013.- EN JUNTA DE FECHA 10/10/2013 SE DETERMINA QUE "&nbsp;</strong><span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Por &uacute;ltimo pero no menos importante se ha vuelto a tratar el tema de las motos colocadas en las zonas comunes del garaje. Se ha informado recurrentemente que los estatutos de la comunidad indican que dichas zonas deben ser utilizada como zona de paso y/o maniobra de veh&iacute;culos, se ha realizado una Junta Extraordinaria &uacute;nica y exclusivamente para tratar ese Tema y no ha habido asistencia suficiente para tomar una determinaci&oacute;n en cuanto a las propuestas ofrecidas (alquiler, cierre etc). En cuanto a la moto colocada en el lateral del portal 40, la propietaria informa que si los dem&aacute;s vecinos retiran las motos de las zonas de paso y/o maniobra ella tambi&eacute;n lo har&iacute;a. En cuanto a este tema se acuerda por todos los presentes dar de plazo de un mes a los vecinos usuarios de estas zonas para sacar las motos y conseguir donde guardarlas, de permanecer las motos aparcadas en las zonas de paso y maniobra para el 1 de Diciembre de 2013, se autoriza al Presidente de&nbsp;</span>la Comunidad<span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">&nbsp;para interponer una denuncia en los Juzgados donde solicite la retirada de la moto &oacute; motos que est&eacute;n aparcadas en dichas zonas.</span><span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">&nbsp;&nbsp;</span></p>\r\n<div style="border: 1pt solid windowtext; padding: 1pt 4pt;">\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm;"><strong><span style="font-size: 9pt; color: blue;">PAZ: PROGRAMA PARA QUE VENZA A FINALES DE NOVIEMBRE ESTA TAREA. MIENTRAS&nbsp;&nbsp;1. HAY QUE TOMAR FOTOS DE LAS MOTOS QUE ESTAN APARCADAS Y ANOTAR MATRICULA 2. CON LAS MATRICULAS DE ESAS MOTOS HAY QUE SACAR EN TRAFICO UNA NOTA SIMPLE PARA SABER A QUIEN PERTENECEN Y CUANDO ESTE A PUNTO DE VENCER EL PLAZO ENVIARLES UN BUROFAX PARA QUE QUEDE FEHACIENTEMENTE ENTERADO.</span></strong></p>\r\n</div>'),
	(70, 67, '2013-10-28', '2013-11-18', NULL, 1, '', 'LLAVE CONTADORES HC ', '<p><strong>28/10/2013.- EN JUNTA DE FECHA 10/10/2013 SOLICITAN "</strong><span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Solicitan que se pida un duplicado de las llaves de los contadores de HC de todos los portales pues en poder del Presidente no se encuentran.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><strong><span style="font-size: 9.0pt; color: blue;">PAZ: PARA QUE LO VAYAS TRABAJANDO, LA DE LA LIMPIEZA DE ESTA COMUNIDAD SE BRINDO PARA INVESTIGAR CON EL MARIDO SI NOS PODIA FACILITAR DUPLICADO SI SON DE LAS DE RABA HAY QUE SOLICITAR EL DUPLICADO POR CUENTA DE LA COMUNIDAD PERO OJO QUE CUESTAN MUCHO &euro;&euro;&euro;&euro; ASI QUE PRIMERO SE CONSULTA AL PRESIDENTE Y LUEGO SE EJECUTA.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;"><span style="color: #000000;"><strong><span style="font-size: 9pt;">28/10/2013.- &nbsp; &nbsp;</span></strong><span style="font-size: 9pt;">SE PREGUNTA A CARMEN (LIMPIEZA), QUE LO VA A PREGUNTAR AL MARIDO Y NOS DICE.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt;">\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;">&nbsp;</p>\r\n</div>'),
	(71, 68, '2013-10-28', '2014-05-04', NULL, 1, '', 'APERTURA, CIERRE Y LUMINARIAS DE PISCINA', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial; background: lime; mso-highlight: lime;">Inicio de temporada 1 de Junio de c/a&ntilde;o y finalizaci&oacute;n de la temporada de piscina el 30 de Septiembre de c/a&ntilde;o</span></strong><strong><span style="text-decoration: underline;"><span style="font-size: 8.0pt; font-family: Arial;">. Se puede utilizar hasta mediados de Septiembre.</span></span></strong></p>\r\n<p class="MsoNormal"><strong>EN JUNTA DE FECHA 10/10/2013 SE HABLA Y&nbsp;</strong>M&ordf; DE LOS ANGELES HACE LA ANOTACION CORRESPONDIENTE,&nbsp;<span style="color: #ff0000;"><strong>EN EPOCA DE INVIERNO SE APAGUEN LOS FOCOS DE LA PISCINA Y SE ENCIENDAN EN APERTURA DE PISCINA.</strong></span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><strong>28/10/2013.- &nbsp;</strong>ESTA VEZ LO APAGO EL PTE. SALIENTE ANTONIO, ANOTARLO PARA QUE EN LO SUCESIVO LO REALICEN TECNICOS Y/O REPRESENTANTES.</span></p>'),
	(72, 69, '2013-10-29', '2014-04-06', NULL, 1, '', 'LIMPIEZA ANUAL', '<p class="MsoNormal"><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">LA LIMPIEZA SE</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">&nbsp;REALIZO</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">&nbsp;EN ABRIL/2013</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">18/04/2013.- EN LA ULTIMA JUNTA REALIZADA SE FIJO QUE SE LIMPIARIA UNA VEZ AL A&Ntilde;O, REALIZANDO DICHA LIMPIEZA LIMPIEZAS ASTUR (MAIKA-LUPE), Y QUEDANDO EN SUMINISTRAR EL AGUA DE LA SIGUIENTE MANERA: (CORREO ENVIADO A L.ASTUR)</span></strong></p>\r\n<p>&nbsp;<span style="font-size: 8.0pt; font-family: Arial; mso-fareast-language: ES;">Hoy se ha puesto en contacto conmigo el Presidente de la CP Eulalia del Llano y Noriega 2, &nbsp;&nbsp;Manuel Param&aacute; Blanco 4&ordm; Izda. 692.65.39.91 el os va dejar el agua para proceder a la limpieza del patio. Me coment&oacute; que para el 29/04/2013 se marcha para Galicia por 10 d&iacute;as para que lo teng&aacute;is en cuenta. Se lo comentas a Lupe que estaba pendiente de que nosotros se lo informaramos.</span></p>'),
	(73, 71, '2013-10-30', '2014-01-15', NULL, 1, '', 'COLOCACION BOMBIN APERTURA LLAVE', '<p><strong>30/10/2013.- EXPTE. PASADO DE OUTLOOK. PDF CON HISTORIAL ADJUNTO EN DOCUMENTOS</strong></p>'),
	(74, 72, '2013-10-30', '2014-10-20', NULL, 1, '', 'MANTENIMIENTO BOMBAS GARAJE', '<p>EN JUNTA DE FECHA 29/04/2013</p>\r\n<p>Revisi&oacute;n de Bombas:</p>\r\n<p>Comenta una vecina del portal 58 que los vecinos 5&ordm; C, 3&ordm; B, y 6&ordm; C de ese mismo portal, cada cierto tiempo est&aacute;n pendientes de ellas. Tomando en cuenta que hay personas que revisan el funcionamiento de las mismas se determina no contratar mantenimiento alguno, lo que si es conveniente que cualquier anomal&iacute;a que se detecte en ellas es conveniente que sea notificada con el fin de resolverla sobre la marcha.</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>10/10/2013.-</strong></span> EN JUNTA DE CP CARBONERA 58 DE FECHA 30/09/2013 SE DETERMINA QUE DILIGENCIA DE CORRECCION DE ERROR de la Junta General Garaje y Exteriores celebrada en Abril 2013 en el sal&oacute;n de reuniones del portal Carbonera 60.&nbsp;</span></p>\r\n<p><span style="font-size: 11px;">En relaci&oacute;n a lo comentado en el punto de Ruegos y Preguntas (Revisi&oacute;n de Bombas) informar que el vecino del piso 5&ordm; C no manifest&oacute; en ning&uacute;n momento que &nbsp;revisara dichas bombas, sino que el se brinda para informar a los profesionales que designe la Comunidad General del Garaje y Exteriores la ubicaci&oacute;n de las mismas y puede monitorizar la intervenci&oacute;n con el fin de que queden bien realizado los trabajos de limpieza y revisi&oacute;n de las mismas, recomendando que deben de realizar dicha revisi&oacute;n los que montaron las bombas. &nbsp;</span></p>\r\n<p><span style="font-size: 11px;">En cuanto a este Tema lo comentaremos con los otros dos pisos se&ntilde;alados en el &nbsp;Acta y con los representantes de la Comunidad General del Garaje.</span></p>\r\n<p><span style="font-size: 11px;">PAZ: EN ESTE TEMA ME GUSTARIA QUE SE HABLE Y SI PUEDES INVESTIGUES EN LOS DOCUMENTOS ANTERIORES A VER SI PODEMOS SABER QUIEN REALIZO LA COLOCACION DE LAS MISMAS YA QUE ESTE INDICA QUE TRABAJARON MUY BIEN Y Q NUNCA MAS SE HAN TENIDO AVERIA CON ELLAS. SERIA IMPORTANTE DARLE UN EMPUJON A ESTE TEMA YA QUE VIENE LA TEMPORADA DE LLUVIAS. RECUERDALE A XENIA LO DE LA RECOGIDA DE HOJAS QUE EN ESTA EPOCA ES CON MAS FRECUENCIA QUE EN EL RESTO DEL A&Ntilde;O</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #00ffff;"><strong>07/10/2013(11:35H).-</strong></span> M&ordf; DE LOS ANGELES HABLO CON EDUARDO (ESPA), EL CUAL LE INDICA QUE ESAS BOMBAS LAS COLOCO CAMUNINI, Y QUE ESTA JUBILADO Y/O A PUNTO DE CERRAR, DE HECHO, LUIS, EL TRABAJADOR QUE ESTA CON EDUARDO TRABAJABA EN CAMUNINI. HABLAR CON LOS RESPONSABLES E INDICARLES EL TEMA PARA VER QUE DECIDEN.</p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #00ffff;"><strong>10/10/2013(11:05H).-</strong></span> SE LLAMA A CAMUNINI PARA QUE NOS CONFIRMEN SU SITUACION ACTUAL Y SI SE PUEDEN HACER CARGO, TFN 985.388.238 camunini@je-ca.com, NOS INDICA QUE SIGUEN EN ACTIVO Y QUE LES PASEMOS UN CORREO CON LO NECESARIO PARA QUE PASEN POR ALLI Y VEAN COMO ESTAN LAS BOMBAS Y LO QUE NECESITAN.</p>\r\n<p>RESPONSABLES DE PORTALES:</p>\r\n<p>CARBONERA 58.- ATILANO 617.073.611</p>\r\n<p>CARBONERA 60.- JOSE M.OSORIO 637.802.569</p>\r\n<p>CARBONERA 62.- JUAN LUIS OVIES 629.994.587 / ROSA 985.14.15.86</p>\r\n<p>SE LLAMO A TODOS LOS REPRESENTANTES Y &hellip;ATILANO NO SE LE LLAMA XQ NO SABE NI LO QUE DICE&hellip;.. JOSE M. PERFECTO, COMO SIEMPRE, Y JUAN LUIS, TANTO &Eacute;L COMO SU MUJER ESTAN TODO EL DIA FUERA Y NO PUEDEN ESTAR, X LO TANTO SOLAMENTE SE FACILITA EL TFN DE JOSE M.OSORIO.</p>\r\n<p>CORREO ENVIADO A CAMUNINI</p>\r\n<p>De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</p>\r\n<p>Enviado el: jueves, 10 de octubre de 2013 11:58</p>\r\n<p>Para: \'camunini@je-ca.com\'</p>\r\n<p>Asunto: SOLICITUD DE PRESUPUESTO REVISION Y/O MANTENIMIENTO DE BOMBAS GARAJE CP CARBONERA 58-60-62</p>\r\n<p><span style="font-size: 11px;">Buenos d&iacute;as.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Tras conversaci&oacute;n telef&oacute;nica mantenida, solicitamos presupuesto para revisi&oacute;n y/o mantenimiento de bombas de garaje sitas en CP Garaje Ctra. Carbonera 58-60-62. Dichas bombas fueron instaladas inicialmente por vds., no dando ning&uacute;n problema hasta la fecha, por lo que la comunidad solicita sean vds. mismos lo que realicen la revisi&oacute;n y/o mantenimiento.&nbsp;</span></p>\r\n<p>Para la visita a dicha comunidad han de ponerse en contacto con el responsable de la misma, Jose Manuel Osorio 637.802.569 (Carbonera 60).&nbsp;</p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, atentamente</span></p>\r\n<p><span style="font-size: 11px;">Paz Ortiz</span></p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p>Telf./Fax 985.149.836</p>\r\n<p>administrativo@algonz.es</p>\r\n<p>c/Les Cigarreres n&ordm; 25 bajo</p>\r\n<p>33211 Gij&oacute;n &nbsp;-Asturias-</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>14/10/2013.-</strong></span> RECIBIMOS LLAMADA TELEFONICA DE CAMUNINI INDICANDO QUE ESTUVO CON EL PTE. DE LA COMUNIDAD (JOSE M.OSORIO) REVISANDO TODO EL TEMA DE BOMBAS Y COMPROBO QUE LAS BOMBAS ESTAN BIEN, EL FOSO NO TIENE SUCIEDAD (POLVO Y LO NORMAL), LO UNICO QUE HABRIA QUE HACER SERIA CAMBIAR LOS ELECTRODOS, QUE NO SE CAMBIAN DESDE LA INSTALACION DE LAS MISMAS, Y REVISAR CORRECTAMENTE LOS SENSORES PARA VER QUE TODO FUNCIONA BIEN. SE LE PREGUNTA SOBRE EL IMPORTE DE TODO ELLO Y NOS DICE QUE SERIA 170,00&euro;+IVA.(INCLUYE LOS ELECTRODOS)SI CUANDO SE REALICE LA REVISION SE VIERA QUE HABRIA Q CAMBIAR ALGUNA OTRA PIEZA PASARIA PRESUPUESTO DE DICHO&nbsp;</span></p>\r\n<p>*VIENE EL PTE. DE LA CDAD. JOSE M. OSORIO, SE LE INFORMO SOBRE LA LLAMADA DE CAMUNINI Y DIO EL VISTO BUENO A LOS TRABAJOS.</p>\r\n<p>**12:30H.- SE LLAMA X TFN A JESUS CAMUNINI, SE LE DA EL VISTO BUENO PARA REALIZAR LA REVISION A FONDO DE LAS BOMBAS, SE LE COMENTA QUE QUEDE CON EL PTE. PARA CUANDO VAYA ESTE PRESENTE Y LE FACILITE EL ACCESO A LAS INSTALACIONES, NOS DICE QUE OK, QUE YA TIENE EL TFN DE LA ANTERIOR VISITA.&nbsp;</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>21/10/2013.</strong></span>-FACTURA Y PARTE DE TRABAJO RECIBIDO X CORREO ELECTRONICO DE CAMUNINI</span></p>\r\n<p>&nbsp;&nbsp;<span style="color: #ff00ff;"><strong>SE FIJA MIRAR SI SE REALIZA PROXIMA REVISION DE BOMBAS PARA DENTRO DE UN A&Ntilde;O. CONSULTAR. Y REVISAR SI SE REALIZA CON CAMUNINI O CON ESPA (EDUARDO) YA QUE LOS TRABAJOS LOS REALIZA EL TRABAJADOR QUE TIENE EDUARDO TRABAJANDO CON EL.</strong></span></p>'),
	(75, 73, '2013-10-30', '2015-07-06', NULL, 1, '', 'LIMPIEZA BAJANTES COMUNITARIAS', '<p><span style="background-color: #00ffff;"><strong><span style="background-color: #ff6600;">TAREA DE OUTLOOK. TAREA COMPLETA GUARDADA EN DOCUMENTS.ADJUNTOS.</span><br /></strong></span></p>\r\n<p><span style="background-color: #00ffff;"><strong>31/05/2013.-</strong></span><span style="font-size: 11px;"> EN JUNTA REALIZADA DE FECHA 27/05/2013 SE FIJO</span></p>\r\n<p>Realizaci&oacute;n de limpiezas de bajantes. &nbsp;Se expone a los asistentes que MAPFRE nos ofrece por un coste anual &nbsp;de 59&euro; el servicio de desatascos en la p&oacute;liza comunitaria, siempre y cuando ocurran es decir no como mantenimiento sino como un siniestro m&aacute;s dentro de las coberturas de la p&oacute;liza. Tambi&eacute;n se expone el presupuesto de Desatascos Gesal el cual nos limpia todas las bajantes por importe de 205,70&euro;. Un vecino de la Comunidad expone que entiende es mejor el preventivo que realizar&iacute;a Gesal ya que de la otra manera puede ocasionar desperfectos en la vivienda aportando inconvenientes a los vecinos e incrementando la prima de la p&oacute;liza de seguro a su renovaci&oacute;n. Se determina realizar la limpieza anual preventiva en las bajantes. Si se hace mucho hincapi&eacute; en que se cercioren bien de que todas las bajantes se realicen para no tener incidencias posteriores.&nbsp;</p>\r\n<p><strong><span style="font-size: 11px;">PRESUPUESTO APROBADO DE GESAL</span></strong></p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>31/05/2013.-</strong></span> CORREO ENVIADO A GESAL</span></p>\r\n<p><span style="font-size: 11px;">Buenas tardes Norma.-</span></p>\r\n<p><span style="font-size: 11px;">Adjunto remito documentaci&oacute;n solicitada, por favor, al margen de contactar con el presidente de la comunidad para que este presente en los trabajos que se efect&uacute;en, COMPROBAR LA LIMPIEZA DE BAJANTES CON LOS PISOS PRIMEROS, as&iacute; como dejar debidamente identificadas las trampillas con las letras a las que pertenecen. Gracias.</span></p>\r\n<p>1&ordm; A.-JOSE POSADA GARCIA 985.450.519/615.652.033 CTRA. CARBONERA, 60, 1A</p>\r\n<p>33211 GIJON</p>\r\n<p>1&ordm; B.-FRANCISCO MARTINEZ VELASCO 984.192.811/699.429.580/689.039.539</p>\r\n<p>CTRA. CARBONERA 60, 1&ordm; B</p>\r\n<p>33211 GIJON</p>\r\n<p>1&ordm; C.-M&ordf; MAR VAZQUEZ ESTEBANEZ 985.160.108 CTRA. CARBONERA 60, 1&ordm; C</p>\r\n<p>33211 GIJON</p>\r\n<p>1&ordm; D.-JOSE IGNACIO RODRIGUEZ BAJO 985.55.88.24/639.61.64.17 CTRA. CARBONERA, 60, 1&ordm; D</p>\r\n<p>33211 GIJON</p>\r\n<p>PRESIDENTE DE LA COMUNIDAD.- JOSE MANUEL OSORIO PEREIRO 3&ordm; B &ndash;</p>\r\n<p>985.15.04.66/637.80.25.69</p>\r\n<p>&nbsp;</p>\r\n<p>A la espera de noticias, un saludo</p>\r\n<p>&nbsp;</p>\r\n<p>Paz Ortiz</p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p>Tfn/fax.- 985.14.98.36</p>\r\n<p>administrativo@algonz.es</p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #00ffff;"><strong>08/07/2013.-</strong></span> NOS LLAMA NORMA DE GESAL Y NOS INDICA QUE LA BAJANTE DE LA LETRA D NO ESTA IDENTIFICADA NI ABIERTA TRAMPILLA, SE LE INDICA QUE HABLE CON EL PTE. Y QUE QUEDEN PARA HACER ESA LIMPIEZA Y DEJAR TRAMPILLA IDENTIFICADA.</p>\r\n<p><span style="font-size: 11px; background-color: #00ffff;"><strong>03/09/2013(10:15H.).-</strong></span><span style="font-size: 11px;"> LLAMAMOS A NORMA PARA QUE NOS INFORME, EL MANTENIMIENTO SE HIZO EN JULIO, (FIRMO PARTE EL PTE.), ESTA PTE. LA COLOCACION DE LA TRAMPILLA DE LA BAJANTE DE LA LETRA D.</span></p>\r\n<p><span style="font-size: 11px;">PTE. FACTURA DE GESAL (DE MANTENIMIENTO Y DE COLOCACION DE TRAMPILLA) HAY FACTURA POR IMPORTE DE 205.70E</span></p>\r\n<p>&nbsp;</p>'),
	(76, 74, '2013-10-30', '2013-11-30', NULL, 1, '', 'SOLICITUD PRESUPUESTOS PARA PINTURA DE FACHADA', '<p>EN JUNTA DE FECHA 04/02/2013 SE DETERMINO POR LOS VECINOS SOLICITAR PRESUPUESTOS PARA LA PINTURA DE LA FACHADA DEL EDIFICIO. SE SOLICITO PRESUPUESTO A GARCIA RAMA- SYYPSA Y MURALCOLOR EN FEBRERO 2013, A FECHA ACTUAL 30/10/13 SOLO SE HA RECIBIDO EL DE SYPSA, HAY QUE SOLICITAR MAS PRESUPUESTOS A IVAN DE FARO Y TECONS.</p>'),
	(77, 76, '2013-10-30', '2014-09-01', NULL, 1, '', 'REVISION LIMPIEZA TEJADO', '<p><span style="background-color: #ffffff; color: #ff0000;"><strong>30/10/2013.- TAREA IMPORTADA DE OUTLOOK. EXPTE. COMPLETO ARCHIVADO EN PDF JUNTO CON EL PRESUPUESTO DE JOSE A.LEONARDO.</strong></span></p>\r\n<p>&nbsp;<span style="background-color: #00ffff;"><strong>31/05/2013.-</strong></span> EN JUNTA DE FECHA 27/05/2013 SE DETERMINO</p>\r\n<p>Solicitan que se revise el Tejado para cerciorarnos de que el mismo este en buenas condiciones y los canalones limpios. Se proceder&aacute; a la revisi&oacute;n del mismo.</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>11/06/2013.-</strong></span> NO SE PUEDEN DESCARGAR LAS FOTOS DE LA CAMARA (NI M&ordf; DE LOS ANGELES NI YO), SE HABLA CON EL PTE. PARA PREGUNTARLE SI QUIERE HACER UNA LIMPIEZA AHORA O PROGRAMARLA PARA SEPT./OCTUB. CUANDO EMPIECEN LAS LLUVIAS (SI ES Q PARAN ESTE A&Ntilde;O&hellip;&hellip;)EL PTE. NOS INDICA QUE SE DEJE PARA OCTUBRE.</span></p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>17/09/2013.-</strong> </span>VIENE JOSE A.LEONARDO Y NOS INDICA QUE AYER ESTABA ARREGLANDO LO DEL TEMA DE LA PINTURA DEL BALCON DEL 5&ordm;C C.60 Y QUE SE ENCONTRO CON EL PTE. Y LE PREGUNTO CUANDO SE IBA A HACER LA LIMPIEZA DEL TEJADO&hellip;.&iquest;&iquest;???&iexcl;&iexcl;&iexcl;&iexcl; (SI FUE &Eacute;L EL QUE DIJO QUE PARA OCTUBRE&hellip;.) SE LE LLAMA X TFN (13:20H) Y SE LE INDICA TODO EL TEMA AL PTE., NOS DICE QUE MEJOR EN SEPTIEMBRE QUE LLUEVE MENOS.</span></p>\r\n<p>**SE LE ENVIA CORREO A JOSE A.LEONARDO PARA QUE LO LIMPIE (QUE NOS CONFIRME CUANTO VA A COBRAR X ELLO)</p>\r\n<p>De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</p>\r\n<p>Enviado el: martes, 17 de septiembre de 2013 19:56</p>\r\n<p>Para: \'Jose Antonio Leonardo\'</p>\r\n<p>Asunto: TEJADO CARBONERA 60</p>\r\n<p><span style="font-size: 11px;">Buenas tardes.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente los trabajos de limpieza en canalones y tejado de la comunidad arriba indicada CP Carbonera 60. Para realizar dichos trabajos ha de ponerse en contacto con el presidente Jose Manuel Osorio - 3&ordm; B &ndash; &nbsp;985.15.04.66/637.80.25.69, para que proceda a dar el acceso a dicho tejado. Asimismo necesitamos nos env&iacute;es el presupuesto de dichos trabajos antes de su ejecuci&oacute;n. Gracias.</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p><span style="font-size: 11px;">Paz Ortiz</span></p>\r\n<p>Asesoria Algonz</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #00ffff;"><strong>24/09/2013.-</strong></span> CORREO RECIBIDO DE JOSE A.LEONARDO</span></p>\r\n<p><span style="background-color: #00ffff;"><strong>&nbsp;23/10/2013(17:57H).-</strong></span> SE LLAMA A JOSE A.LEONARDO Y SE LE PASO LA LIMPIEZA&hellip;..SE LE REENVIA EL CORREO PARA QUE LO HAGA</p>\r\n<p><span style="font-size: 11px;">TRABAJO REALIZADO. CONFIRMADO CON EL PTE. JOSE MANUEL OSORIO.</span></p>\r\n<p>&nbsp;</p>'),
	(78, 75, '2013-10-30', '2013-11-15', NULL, 1, '', 'LIMPIEZA REJILLAS DE DESAGÜE GARAJE', '<p>RECORDAR A XENIA QUE MANTENGA BIEN LIMPIAS ESTAS REJILLAS PARA EVITAR ATASCO EN LAS BOMBAS AL COMIENZO DE LAS LLUVIAS. SE LE REMITIO &Uacute;LTIMO CORREO A XENIA EL 16/10/13 Y CONTESTO QUE LO HACE SEMANALMENTE Y QUE ESTA TODO CORRECTO.</p>\r\n<p><strong>15/11/2013(13:55H).-&nbsp;</strong>SE LLAMA A XENIA PARA QUE SE ACUERDE DE LIMPIAR LAS REJILLAS DE LOS GARAJES Q AHORA ESTAN CAYENDO TODAS LAS HOJAS Y HAY QUE TENERLO LIMPIO, NOS DICE QUE TENIAN PREVISTO IR HOY, QUE LES VA A MANDAR WASAP PARA QUE LO TENGAN EN CUENTA Y LO HAGAN.</p>'),
	(79, 77, '2013-10-30', '2014-03-10', NULL, 1, '', 'REVISION PORTON GARAJE', '<p><span style="color: #0000ff;"><strong>30/10/2013.- TAREA DE OUTLOOK. EXPTE. COMPLETO CON PDF ARCHIVADO EN DOCUMENTS.ADJUNTOS.</strong></span></p>\r\n<p><span style="background-color: #cc99ff;"><strong>03/09/2013.-</strong></span> SE MANDA CORREO A CIAPER PARA QUE HAGAN LA REVISION DEL PORTON.</p>\r\n<p>CORREO ENVIADO</p>\r\n<p>De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</p>\r\n<p>Enviado el: martes, 03 de septiembre de 2013 13:29</p>\r\n<p>Para: \'CIAPER AUTOMATISMOS \'</p>\r\n<p>Asunto: REVISION PORTON C/CARMEN AMAYA 2</p>\r\n<p><span style="font-size: 11px;">Buenos d&iacute;as.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente revisi&oacute;n del port&oacute;n del garaje de la CP Carmen Amaya 2. La llave la tenemos en la administraci&oacute;n.</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p><span style="font-size: 11px;">Paz Ortiz</span></p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #cc99ff;"><strong>06/09/2013.-</strong></span> REVISION PASADA EN EL DIA DE HOY X CIAPER. PARTE DE TRABAJO</span></p>\r\n<p>&nbsp;PTE. FACTURA DE CIAPER CORRESPONDIENTE A LA REVISION SEPT/2013</p>\r\n<p><span style="font-size: 11px;"><span style="background-color: #cc99ff;"><strong>21/10/2013.-</strong> </span>FACTURA RECIBIDA DE CIAPER</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
	(81, 79, '2013-10-31', '2014-05-05', NULL, 1, '', 'LIMPIEZA DE TEJADO', '<p><strong>31/10/2013.-</strong> TRANSFERIDO DE LA PLATAFORMA. ARCHIVO COMPLETO ARCHIVADO EN DOCUMTS.ADJUNTOS.</p>\r\n<p><strong>21/05/2013.-</strong> EN JUNTA DE FECHA 07/05/2013 SE DETERMINA</p>\r\n<p>Se informa de que se proceder&aacute; a la limpieza del tejado ya que se observan ramas y es conveniente tenerlo lo m&aacute;s al d&iacute;a posible con el fin de que la tela asf&aacute;ltica no sufra alteraciones, se programara para mirarlo cada a&ntilde;o por si hiciera falta limpieza.</p>\r\n<p><span style="font-size: 11px;"><strong>31/05/2013.-</strong> FACTURA RECIBIDA DE JOSE A.LEONARDO</span></p>\r\n<p>&nbsp;</p>'),
	(82, 80, '2013-10-31', '2014-02-02', NULL, 4, '', 'PROBLEMAS ASCENSOR', '<p>13/08/2013.- TAL Y COMO INDICA M&ordf; DE LOS ANGELES SE DEJA PTE. PARA EXPONER EN UNA PROXIMA JUNTA, YA QUE ES UNA CANTIDAD IMPORTANTE Y QUE PRIMERO ESTA LO DE HC.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>31/10/2013.-</strong>TAREA TRANSFERIDA DE OUTLOOK. ARCHIVADA EN SU TOTALIDAD PDF ARCHIVOS ADJUNTOS</p>\r\n<p><span style="font-size: 11px;"><strong>13/08/2013(13:10H).-</strong> SE LLAMA AL PTE.PARA QUE ESTE INFORMADO DE TODO EL TEMA, NOS DICE JULIO QUE YA ESTA ENTERADO, QUE &Eacute;L ESTUVO CON ELLOS CUANDO FUERON A ARREGLAR LAS PUERTAS.</span>QUE LAS NIVELARON Y AHORA MISMO VAN BIEN, ESTA DE ACUERDO EN DEJARLO ASI HASTA LA NUEVA JUNTA.</p>\r\n<p>&nbsp;</p>'),
	(83, 81, '2013-10-31', '2013-12-16', NULL, 1, '', 'LIMPIEZA CANALONES (TEJADO)', '<p><strong>30/10/2013.-&nbsp;</strong>TAREA MANTENIMIENTO TRANSFERIDA DE OUTLOOK.</p>\r\n<p>RECORDAR A ARMANDO PARA NOVIEMBRE/DICIEMBRE DEL 2013 SI NOS PUEDE IR DICIENDO COMO VE LOS CANALONES PARA HACER LIMPIEZA ANTES DE QUE SALGAN HUMEDADES.&nbsp;</p>\r\n<p><span style="font-size: 11px;"><strong>31/10/2013//</strong> ARMANDO YA NO VIVE EN LA CDAD. PERO DE TODOS MODOS SE LE PUEDE DECIR SINO LA SRA. EULALIA QUE ES LA OTRA QUE TIENE BAJO CUBIERTA TAMBIEN SE LE PUEDE PEDIR INFORMACI&Oacute;N AL RESPECTO.</span></p>\r\n<p>&nbsp;</p>'),
	(84, 82, '2013-10-31', '2014-01-20', NULL, 1, '', 'MANTENIMIENTO PORTON GARAJE', '<p><strong>30/10/2013.-</strong> TAREA DE MANTENIMIENTO TRANSFERIDA DE OUTLOOK. ARCHIVADA TOTAL EN PDF DOCUMNTS.ADJUNTOS.</p>\r\n<p><strong>15/07/2013.-</strong> VINO EL TECNICO DE NOVOFERM INDICANDO QUE YA ESTA LA REVISION PASADA, QUE TUVO Q CAMBIAR UN CABLE.&nbsp;</p>\r\n<p>ASIMISMO NOS DEJO AQU&Iacute; EN LA OFICINA LOS MANDOS DEL GARAJE PARA ENTREGAR A LOS PROPIETARIOS, CONJUNTAMENTE CON LA FACTURA INCLUIRA LOS MANDOS (40,00+21%IVA= 48,40.-&euro;). LOS MANDOS COBRARLOS EN EFECTIVO A LA ENTREGA E INGRESAR EL DINERO EN LA CUENTA DE LA COMUNIDAD PONIENDO COMO CONCEPTO "COMPENSACION A FACTURA DE NOVOFERM X MANDOS AL C.52 1&ordm;A Y C.54 BAJO B)</p>\r\n<p><span style="font-size: 11px;">PTE. FACTURA NOVOFERM REVISION JULIO/2013.</span></p>\r\n<p><span style="color: #ff0000;"><strong><span style="font-size: 11px;">PROXIMA REVISION FIJADA PARA ENERO/2014</span></strong></span></p>\r\n<p>&nbsp;</p>'),
	(85, 83, '2013-10-31', '2014-01-31', NULL, 1, '', 'LIMPIEZA CUARTO RITI', '<p><strong>31/10/2013.-</strong> MANTENIMIENTO LIMPIEZA CUARTO. TAREA TRANSFERIDA OUTLOOK.</p>\r\n<p><span style="font-size: 11px;"><strong>21/05/2013.-</strong> SE MANDA CORREO A XENIA PARA QUE RECUERDE LIMPIARLO. CORREO ENVIADO.</span></p>\r\n<p>Buenos d&iacute;as.-</p>\r\n<p>Recordamos a trav&eacute;s de la presente la limpieza del cuarto de telecomunicaciones de la CP Cigarreras general 46 al 54, se hab&iacute;a fijado realizarla de forma semestral (aproximadamente). Por favor, enviar correo o aviso cuando este realizado. Gracias.</p>\r\n<p>Un saludo</p>\r\n<p>Paz Ortiz</p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p><span style="font-size: 11px;"><strong>23/05/2013.-</strong> VINO LA CHICA QUE TRABAJA PARA XENIA (YOLANDA) Y SE LLEVO LA LLAVE DEL CUARTO PARA LIMPIARLO. Devolvio las llaves y dijo que el cuarto estaba bastante limpio repaso un poco la instalaci&oacute;n y lo programamos para dentro de 8 meses se le vuelva a dar otra revisada al mismo</span></p>\r\n<p>&nbsp;</p>'),
	(86, 84, '2013-10-31', '2014-02-03', NULL, 1, '', 'MANTENIMIENTO PORTON GARAJE', '<p><strong>31/10/2013.-</strong> MANTENIMIENTO PREVENTIVO PORTON GARAJE. TAREA TRANSFERIDA OUTLOOK. ARCHIVADA EN DOCUMNTS.ADJUNTOS.</p>\r\n<p><strong style="font-size: 11px;">HACER UNA REVISION CADA 6/7 MESES DEL PORTON. PROGRAMARLA PARA JULIO DEL 2013.</strong></p>\r\n<p><strong>26/07/2013.-</strong> SE MANDA CORREO A NOVOFERM PARA QUE HAGA LA REVISION DEL PORTON</p>\r\n<p>De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</p>\r\n<p>Enviado el: viernes, 26 de julio de 2013 12:03</p>\r\n<p>Para: \'automatismosycierres@gmail.com\'</p>\r\n<p>Asunto: AVISO REVISION (MANTENIMIENTO) PORTON CP CIGARRERES 40 AL 44 GIJON</p>\r\n<p><span style="font-size: 11px;">Buenos d&iacute;as.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente la revisi&oacute;n del port&oacute;n del garaje correspondiente a la CP Cigarreres 40 al 44. Gracias.</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p><span style="font-size: 11px;">Paz Ortiz</span></p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p><span style="font-size: 11px;"><strong>06/08/2013.-</strong> CORREO RECIBIDO DE MONTERO</span></p>\r\n<p>De: Ana D&iacute;az - MONTERO AUTOMATISMOS Y CIERRES, S.L [mailto:automatismosycierres@gmail.com]&nbsp;</p>\r\n<p>Enviado el: lunes, 05 de agosto de 2013 15:34</p>\r\n<p>Para: Algonz.Paz</p>\r\n<p>Asunto: Re: AVISO REVISION (MANTENIMIENTO) PORTON CP CIGARRERES 40 AL 44 GIJON</p>\r\n<p><span style="font-size: 11px;">Buenas tardes Paz.</span></p>\r\n<p><span style="font-size: 11px;">Me pongo en contacto contigo para comunicarte que la revisi&oacute;n de la Cdad Les Cigarreres 40 -44 ya est&aacute; realizada.</span></p>\r\n<p>Un saludo.</p>\r\n<p><span style="font-size: 11px;">Ana D&iacute;az</span></p>\r\n<p>&nbsp;</p>'),
	(87, 85, '2013-10-31', '2014-03-03', NULL, 1, '', 'MANTENIMIENTO PORTON GARAJE', '<p><strong>31/10/2013.-&nbsp;</strong>MANTENIMIENTO PREVENTIVO PORTON GARAJE. TAREA TRANSFERIDA DE OUTLOOK. ARCHIVADO EL EXPTE. EN DOCUMENTOS ADJUNTOS.</p>\r\n<p><strong>06/09/2013.-</strong> REVISION PASADA X CIAPER EN EL DIA DE HOY. PARTE DE TRABAJO</p>\r\n<p>&nbsp;PTE. FACTURA CIAPER REVISION SEPTIEMBRE/2013.</p>\r\n<p><strong>21/10/2013.-</strong> FACTURA RECIBIDA DE CIAPER</p>\r\n<p><span style="color: #ff0000;"><strong>&nbsp;SE PROGRAMA PROXIMA REVISION PARA MARZO/2014.</strong></span></p>\r\n<p>&nbsp;</p>'),
	(88, 86, '2013-10-31', '2014-02-25', NULL, 1, '', 'LUMINARIAS SOPORTALES ', '<p>EN <span style="background-color: #ffff00;"><strong>JUNTA 24/10/13</strong></span> SE DETERMINO QUE PARA UNA SIGUIENTE JUNTA SE MIRARA LA LUMINARIA DE LOS SOPORTALES, YA SEA PARA MEJORARLA COLOCANDO LUMINARIA LED O REPARANDO LAS EXISTENTES PUES ALGUNOS PUNTOS DE LUZ ESTAN SUELTOS O FALTA EL CRISTAL DEL DOWNLIGHT.&nbsp;</p>\r\n<p>HAY QUE <strong>SOLICITAR PRESUPUESTO A ITELCO Y FASE.</strong></p>'),
	(89, 87, '2013-11-04', '2013-11-07', '2013-11-14', 2, '568360631', 'SINESTRO EN COCINA privativo 1F', '<p><span style="color: #000080;"><strong>31/10/2013.- &nbsp;RECIBIMOS LLAMADA DEL VECINO DEL 1&ordm;F JUAN MANUEL 684.614.364, INDICANDO QUE SE LE HABIA PRENDIDO FUEGO LA COCINA DE SU VIVIENDA, HABIA LLAMADO A SU SEGURO EL CUAL LE INDICO QUE LOS DA&Ntilde;OS DE CONTINENTE TENIA QUE NOTIFICARLOS AL SEGURO DE LA COMUNIDAD....., SE LE PREGUNTA Q SI EL CAUSANTE FUE &Eacute;L QUE NO SABEMOS Q TIENE QUE VER EL SEGURO DE LA CDAD. NO OBSTANTE QUE APERTURAMOS SINIESTRO YA QUE ASI LO INDICA.</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;MAPFRE / 902.136.524 CENTRAL</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="color: #000080;"><strong>N&ordm; POLIZA 076-0680445228&nbsp;</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="color: #000080;"><strong>04/11/2013 (13:30H).- MAPFRE (LAURA CARVAJAL)TOMA NOTA DE DATOS DE PERJUDICADO Y SE PONDRAN EN CONTACTO CON EL.</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="color: #000080;"><strong>14/11/2013(11:45H).- &nbsp;MAPFRE (ANA), NOS INDICA QUE SE SOLICITABA AL SEGURO DE LA CDAD. REPARAR LOS DA&Ntilde;OS DE PINTURA LOS CUALES YA HAN EJECUTADO EN VARIAS ESTANCIAS DE LA VIVIENDA. TODO FINALIZADO X PARTE DE LA COMPA&Ntilde;IA DE LA CDAD.</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="color: #000080;"><strong>14/11/2013(12:20H).- SE LLAMA AL VECINO CAUSANTE 1&ordm;F JUAN, NOS INDICA QUE SI, QUE YA LO TIENE TODO CORRECTO EN SU VIVIENDA, QUE SOLAMENTE ESTA PTE. EL TEMA DEL EXTINTOR DE SU PLANTA, EL CUAL &Eacute;L UTILIZO PARA APAGAR EL FUEGO DE SU COCINA Y A FECHA ACTUAL NO ESTA REPUESTO.</strong></span></p>\r\n<p><span style="color: #000080;"><strong>&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #000080;"><strong>SE ABRE SEGUIMIENTO DE EXTINTORES.</strong></span></p>'),
	(90, 88, '2013-11-04', '2013-11-05', '2013-11-05', 2, '', 'NO HAY SEÑAL TV', '<p>El sabado 2/11/13 llaman a Mar&iacute;a Angeles de la &nbsp;C.P. Sor Juana In&eacute;s de la Cruz 26, para informarle que se han quedado sin se&ntilde;al de TV, s&oacute;lo los que tienen &nbsp;TDT. El lunes 4/11/13 se remite e-mail a ITELCO para que se pase en cuanto pueda, el piso 3&ordm; A tiene las llaves de acceso a RITI y el propietario se llama Jorge y su telefono es 666.734.096.&nbsp;</p>\r\n<p>El 4/11/13 vino Tom&aacute;s dijo que estaba da&ntilde;ado el amplificador, que normalmente todos funcionan a 24 w pero este funciona a 12w, y que conseguir uno as&iacute; era imposible para hoy pero ma&ntilde;ana a primera hora estar&aacute; colocado. El importe sera de 120&euro; + IVA= 145,20&euro;</p>\r\n<p>El 5/11/13 llame a Tom&aacute;s y me dijo que ya esta colocada la fuente de alimentacion modular, es una pieza necesaria para que funcionen los amplificadores.</p>\r\n<p><strong><span style="background-color: #ff0000;">PTE DE FACTURA.</span></strong></p>\r\n<p>SE VA A ABRIR SINIESTRO EN SEGURO A VER SI SE HACE CARGO.&nbsp;</p>'),
	(91, 89, '2013-11-04', '2014-05-06', NULL, 1, '', 'MANTENIMIENTO TEJADO/CANALONES', '<p>FIJAR REVISION PARA PROXIMO A&Ntilde;O Y EXPONER EN JUNTA Y/O A REPRESENTANTES DEL MOMENTO PARA VALORAR SI SE REALIZA MANTENIMIENTO O NO.</p>\r\n<p><span style="font-size: 11px;">04/11/2013.- TRANSFERIDO A PLATAFORMA ALGONZ. ARCHIVADO EN PDF EN DOCUMENTS ADJUNTOS.</span></p>'),
	(92, 90, '2013-11-04', '2013-11-27', NULL, 4, '', 'PRESUPUESTO COLOCACION EXTINTORES', '<p>EN JUNTA 30/7/13 SE DETERMINA " LA VECINA DEL PISO 1&ordm; A COMENTA QUE SERIA CONVENIENTE LA COLOCACION DE EXTINTORES EN LA COMUNIDAD SE SOLICITAR&Aacute; PROPUESTA PARA INFORMAR AL PRESIDENTE DE LOS NECESARIOS PARA ESTA COMUNIDAD Y EL IMPORTE DE COLOCACION DE LOS MISMOS."</p>\r\n<p>SE SOLICITO PRESUPUESTO A ABEX Y A EXTINOR. SE ADJUNTAN EN DOCUMENTOS. POR SER UN EDIFICIO DE M&Aacute;S DE 25 A&Ntilde;OS NO SE LE APLICA LA NORMATIVA VIGENTE Y POR TANTO NO SERIA EXIGIBLE LA INSTALACION DE EXTINTORES. LO BASICO SERIA INSTALAR 3 EXTINTORES DE 6 KG, Y &nbsp;1 DE 2 KG DONDE LA CENTRALIZACION DE CONTADORES, ME COMENT&Oacute; JESUS DE ABEX QUE ESTE ES CONVENIENTE PORQUE SI PASA UNA INSPECCION EXIGEN UN EXTINTOR DONDE LA NUEVA CENTRALIZACION CONTADORES. EXTINOR SOLO PRESUPUESTO 3 EXTINTORES Y 5 EXTINTORES.</p>\r\n<p>EL 4/11/13 LLAME AL PRESIDENTE Y SE LO COMENTE ME DIJO QUE LE PARECIA BIEN, PERO QUE LA VECINA QUE LO SOLICITO NO VIVE ALL&Iacute; Y QUE EL NO SABE QUE HACER PORQUE A LO MEJOR LOS DEMAS VECINOS NO LES PARECE BIEN, ME DICE QUE HABLE CON CESAR DEL 5&ordm; A HABER QUE OPINA EL. EL 5/11/13 ME LLAMO CESAR Y LE COMENTE LOS PRESUPUESTOS DE EXTINTORES, EL ME DICE QUE ESO MEJOR TRATARLO EN LA PROXIMA JUNTA PORQUE YA VAN A TENER BASTANTES GASTOS COMO PARA METERSE EN M&Aacute;S.</p>'),
	(93, 91, '2013-11-04', '2013-11-08', '2013-11-14', 2, '', 'MICRO 4ºD - 3ºD', '<p><strong>31/10/2013.-</strong> RECIBIMOS VISITA DEL PROPIETARIO DEL 4&ordm;D PLAZA DONANTES 2 JOSE LUIS IROA 645.172.362, INDICANDO QUE EL MICRO NO LE FUNCIONA. QUE NO LE ABRE LA PUERTA, SE LE INDICA QUE LO REVISE CORRECTAMENTE YA QUE NO HEMOS TENIDO AVISOS DE MAS VECINOS CON EL MISMO PROBLEMA, Y ES PROBABLE QUE SEA PRIVATIVO, NOS INDICA QUE NO QUE SEGURO ES DE LA PLACA DE ABAJO (lo habla con M&ordf; de los Angeles y quedan en que se le envien al tecnico). CORREO ENVIADO A ITELCO</p>\r\n<p><strong style="font-size: 11px;">04/11/2013.-&nbsp;</strong><span style="font-size: 11px;">CORREO ENVIADO A ITELCO</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 04 de noviembre de 2013 18:18<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> PLAZA DONANTES 2 4&ordm;D MICRO</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del propietario de c/Plaza de Donantes 2 4&ordm;D Jose Luis Iroa &nbsp;645.172.362, indicando que su micro no funciona. Se le indica si lo ha comprobado correctamente ya que es el &uacute;nico que ha dado aviso sobre esta incidencia y nos dice que s&iacute;, que est&aacute; seguro que es problema de la placa de abajo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Por favor, pasarse por all&iacute; para comprobar que ocurre e indicarlo al propietario, si es problema comunitario solucionarlo, si es problema privativo indicarlo al propietario. De todas formas, indicar en administraci&oacute;n de donde proced&iacute;a el problema. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;"><strong style="font-family: Verdana, Arial, Helvetica, sans-serif;">05/11/2013.- &nbsp;</strong><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-weight: normal;">LLAMO LA VECINA DE PLAZ.DONANTES 2 3&ordm;D 664.364.957, LLAMO LA MADRE DE LA PROPIETARIA, INDICANDO QUE YA QUE ESTABAN ALLI LOS CHICOS MIRANDO EL PROBLEMA DEL 4&ordm;D QUE MIRARAN EL SUYO XQ A SU HIJA TAMPOCO LE FUNCIONABA BIEN.</span></span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-weight: normal;"><strong>14/11/2013.-&nbsp;</strong>LLAMAMOS A DAVID DE ITELCO PARA QUE NOS INDIQUE QUE FUE LO QUE HICIERON EN ESTA CDAD. Y NOS INDICA QUE CAMBIARON LOS BOTONES DEL 4&ordm;D Y 3&ordm;D XQ ESTABAN MUY OXIDADOS (NOS DICE QUE ESA PLACA COGE MUCHO OXIDO). QUEDO FUNCIONANDO CORRECTAMENTE<br /></span></span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-weight: normal;">SE LLAMA A LOS AFECTADOS PARA QUE NOS INFORMEN:</span></span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-weight: normal;">4&ordm;D.- JOSE LUIS MICRO ARREGLADO OK.</span></span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;"><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-weight: normal;">3&ordm;D.- MADRE DE PROPIETARIA ARREGLADO OK.</span></span></strong></p>\r\n<p class="MsoNormal">PTE. FACTURA ITELCO</p>'),
	(94, 92, '2013-11-04', '2013-11-11', NULL, 1, '562455901', 'DAÑOS EN VEHICULO POR GOTERAS', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">30/10/2013.- &nbsp;</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;">CORREO RECIBIDO DE LA COMPA&Ntilde;IA DEL VECINO RECLAMANDO DA&Ntilde;OS, SE LES INDICA QUE HASTA LA FECHA NO TENIAMOS NOTICIAS DE NINGUN TIPO DE RECLAMACION AL RESPECTO, &nbsp;AL MARGEN QUE DICHA RECLAMACION HA DE HACERLA PERSONALMENTE EL PROPIETARIO DE LA VIVIENDA, QUE ES EL AFECTADO EN PRIMERA PERSONA.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Angels Pozo [mailto:iuris1@iurisart.com] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 30 de octubre de 2013 13:20<br /> <strong>Para:</strong> administrativo@algonz.es<br /> <strong>Asunto:</strong> N/REF: 7131857-A - N/ASEG.: JOSE L. EIROA BASTIAN</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span lang="ES-TRAD" style="text-align: right; font-size: 8pt; font-family: Arial;">&nbsp;</span><span lang="ES-TRAD" style="text-align: right; font-size: 8pt; font-family: Arial;">Barcelona, 30 de octubre de 2013</span></p>\r\n<p class="datos"><strong><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span></strong><strong><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">N/Rfa. 7131857-A</span></strong></p>\r\n<p class="MsoNormal"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Muy Sr. Nuestro:</span></p>\r\n<p class="MsoNormal"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Nos dirigimos &nbsp;a Ud. en calidad de Abogados de<span class="MsoCommentReference">&nbsp; ge&nbsp; </span>&nbsp;GENERALI Seguros.</span></p>\r\n<p class="textoinforme"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Dicha entidad nos ha encomendado proceder a la reclamaci&oacute;n de los da&ntilde;os sufridos en su veh&iacute;culo asegurado, matr&iacute;cula 4778-DWR, a consecuencia del siniestro ocurrido en fecha <strong>01/02/2013</strong>, en el parking de la Pza. Donantes, 1-2.</span></p>\r\n<p class="textoinforme"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Puestos en contacto con su Compa&ntilde;&iacute;a de Seguros MAPFRE, nos confirman no tener Parte de Siniestro.</span></p>\r\n<p class="textoinforme"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><strong><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Por ello, le rogamos se sirva cursar el parte de accidentes a su Compa&ntilde;&iacute;a Aseguradora en la mayor brevedad posible, puesto que de lo contrario nos veremos en la obligaci&oacute;n de reclamarle a su cliente directamente los da&ntilde;os ocasionados al veh&iacute;culo de nuestro cliente interponiendo la correspondiente demanda judicial.</span></strong></p>\r\n<p class="textoinforme"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Quedamos a su entera disposici&oacute;n</span></p>\r\n<p class="MsoNormal"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">Atentamente,</span></p>\r\n<p class="fdo"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;</span><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp; &nbsp; &nbsp; &nbsp;Angels Pozo&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; EXTENSI&Oacute;N 210</span></p>\r\n<p class="fdo"><span lang="ES-TRAD" style="font-size: 8.0pt; font-family: Arial; mso-ansi-language: ES-TRAD;">&nbsp;iuris1@iurisart.com - FAX: 931815752</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;<strong>31/10/2013.- &nbsp;</strong>VIENE EL PROPIETARIO AFECTADO A INDICAR LA RECLAMACION SOBRE LOS DA&Ntilde;OS DEL VEHICULO, (HABLA CON M&ordf; DE LOS ANGELES), SE ME INDICA QUE APERTURE SINIESTRO EN EL SEGURO DE LA COMUNIDAD.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;"><span style="color: #ff0000;"><strong>MAPFRE</strong></span><br /></span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;"><span style="color: #ff0000;"><strong>N&ordm; POLIZA.- 076-0080211883</strong></span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;"><span style="color: #ff0000;"><strong>TFN.- 902.136.524&nbsp;</strong></span></span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt;">04/11/2013(18:45H).- </span></strong><span style="font-size: 8.0pt;">MAPFRE (MARIOLA), COMO LA CAUSA ES LA MISMA QUE EN EL EXPTE. ANTERIOR APERTURADO LO QUE HIZO FUE UNA AMPLIACION DE SINIESTRO,SIENDO EL MISMO N&ordm; DE EXPTE. QUE EL YA ABIERTO EN SU DIA (ARCHIVADO EN OUTLOOK COMO "SEGURO PLAZA DONANTES - DA&Ntilde;OS EN VEHICULO"). SE PONDRAN EN CONTACTO CON EL PERJUDICADO.</span></p>\r\n<p class="MsoNormal">&nbsp;<strong>05/11/2013(11:10h).-&nbsp;</strong> RECIBIMOS LLAMADA DE BORJA CORTES, PERITO DE MAPFRE, INDICANDO QUE LE ENVIEMOS FACTURA DE REPARACION Y CARTA DE RECLAMACION DEL SEGURO DEL PERJUDICADO. ENVIADO EN CORREO A borja@jbdcortesperitaciones.com.</p>\r\n<p class="MsoNormal"><strong>06/11/2013.-</strong>CORREO RECIBIDO DEL PERITO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma; color: windowtext;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma; color: windowtext;"> Jesus Cortes [mailto:jbdcortesperitaciones@gmail.com] <strong>En nombre de </strong>Borja cortes Palominio<br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 06 de noviembre de 2013 9:02<br /> <strong>Para:</strong> Algonz.Paz<br /> <strong>Asunto:</strong> Re: RV: N/REF: 7131857-A - N/ASEG.: JOSE L. EIROA BASTIAN</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\'; font-size: 9pt;">Buenos d&iacute;as, he comprobado que el agua todav&iacute;a sigue filtr&aacute;ndose, en varias zonas, a trav&eacute;s del forjado del garaje por lo que la causa no ha sido reparada definitivamente.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9pt; font-family: \'Times New Roman\';">Saludos<br /> <!--[if !supportLineBreakNewLine]--><br /> <!--[endif]--></span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>'),
