	(96, 94, '2013-11-04', '2013-11-20', NULL, 1, '', 'PRESUPUESTOS LIMPIEZA TEJADO', '<p>EN JUNTA 31/7/13 SE ACORD&Oacute; SOLICITAR PRESUPUESTOS PARA LA LIMPIEZA DEL TEJADO, YA QUE HACE A&Ntilde;OS QUE NO SE REVISA Y HAY MUCHAS GAVIOTAS Y ESTA MUY SUCIO. SE SOLICITO PRESUPUESTOS A ASTUROBRAS, ASTURIANA DE TEJADOS Y CANALONES, TECONS, ACROBACIAS VERTICALES Y IVAN DE FARO.</p>\r\n<p><strong>07/11/2013.-&nbsp;</strong>APROBADO POR M&ordf; DE LOS ANGELES PRESUPUESTO DE TECONS (ARCHIVADO EN DOCUMNTS.ADJUNTOS)</p>\r\n<p><strong>12/11/2013.- &nbsp;</strong>SE MANDA CORREO A TECONS PARA QUE EJECUTE LOS TRABAJOS LO ANTES POSIBLE. SE LE LLAMA X TFN PARA CONFIRMAR, ESTA APAGADO, SE LE PASA AVISO EN EL CORREO Q SE PONGAN EN CONTACTO CN NOSOTROS.</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 12 de noviembre de 2013 17:34<br /> <strong>Para:</strong> \'tecons@telecable.es\'<br /> <strong>Asunto:</strong> CP FERMIN CANELLA 4. APROBACION PRESUPUESTO</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto remitimos presupuesto n&ordm; 260-13, el cual resulto aprobado. Solicitamos, por favor, comunicaci&oacute;n telef&oacute;nica con la administraci&oacute;n para revisar dicho presupuesto, ya que habr&iacute;a que a&ntilde;adir dos partidas m&aacute;s. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p>&nbsp;NOS DEVUELVE LA LLAMADA JAVIER, SE LE INDICA LAS PARTIDAS PTES. Y NOS DICE QUE SOBRE EL TEMA DE LOS PINCHOS PARA LOS PAJAROS QUE NO LO VE VIABLE XQ NO PUEDE GARANTIZAR QUE NO ANIDEN, SINO ES EN ESA ZONA LO HARAN EN OTRO LADO DEL TEJADO, AL MARGEN QUE ESA MALLA ES MUY CARA PARA TODOS LOS METROS QUE DEBERIAN HACERSE. SE ANULA DICHA PARTIDA.</p>\r\n<p>NOS INDICA QUE ESTA TERMINANDO DOS TEJADOS, QUE EN CUANTO ACABE SE PONE CON FERMIN CANELLA , +/- SEMANA QUE VIENE.</p>\r\n<p>&nbsp;</p>'),
	(97, 95, '2013-11-14', '2013-11-15', NULL, 1, '', 'EXTRACTORES Y DETECTORES (division garaje)', '<p><strong>30/10/2013.-&nbsp;</strong>&nbsp;RECIBIMOS LLAMADA DEL PTE. DE LA CDAD., J<strong>AVIER 636.530.040,</strong> INDICANDO QUE LOS EXTRACTORES DEL GARAJE NO VAN BIEN, QUE HABRIA QUE REVISARLOS.</p>\r\n<p>SE LLAMA A EXTINOR Y SE APROVECHA PARA SOLICITAR LA REVISION PTE. X PARTE DE ISMAEL SOBRE LA DIVISION QUE IBA A HACER DEL GARAJE (CAMBIO DE MODULO EN LA CENTRAL, QUE VA A HACER EN GARANTIA, NO VA A SUPONER NINGUN COSTE A LA CDAD.)</p>\r\n<p><strong>05/11/2013.-&nbsp;</strong>SE LLAMA A EXTINOR, GONZALO, PARA PREGUNTARLE SI YA HAN PASADO X EL GARAJE DE JAPON, NOS DICE QUE VA A HABLAR CON ISMAEL Y QUE NOS LLAMA CON LO QUE SEA.</p>\r\n<p>NOS DEVUELVE LA LLAMADA ISMAEL Y NOS PIDE EL TFN DEL PTE. PARA PASARSE POR EL GARAJE, QUE ESTA MUY LIADO Y NO PUDO PASARSE ANTES, QUE VA A REVISAR LOS EXTRACTORES Y CAMBIAR EL MODULO DE LA CENTRAL DE INCENDIOS).</p>\r\n<p><strong>08/11/2013(13:45H).-</strong>&nbsp;LLAMAMOS A JAVIER (PTE.) PARA PREGUNTARLE SI SE HAN PASADO PARA EL TEMA DE LOS EXTRACTORES Y NOS DICE QUE NO, Y QUE TAMPOCO LE HAN LLAMADO, QUE SIGUE ESPERANDO....</p>\r\n<p>** SE LLAMA A ISMAEL 674.165.898 PARA QUE LE LLAME Y VAYA YA MISMO, ISMAEL NO COGE EL MOVIL, SE LLAMA A LA OFICINA EXTINOR 984.112.928 GONZALO, SE LE INDICA QUE SE DEBERIAN PASAR YA, QUE EN BREVE TOCA REVISION DE EXTINTORES Y SE LA ESTAN JUGANDO....NOS DICE GONZALO QUE SE PASAN HOY.</p>\r\n<p><strong>11/11/2013(12:55h).- </strong>&nbsp;SE LLAMA X TFN A<strong>&nbsp;</strong>JAVIER PTE., SE LE INDICA QUE YA ESTUVIERON LOS DE EXTINOR Y QUE REGULARON EL RELOJ DE LOS EXTRACTORES &nbsp;QUE ESTABA DESPROGRAMADO, BIEN X UN APAGON, X EL CAMBIO DE HORA O XQ EL RELOJ NO VAYA MUY BIEN (ESTA VIEJO Y PUEDE IR FALLANDO), EN PRINCIPIO LO PROGRAMO PARA FUNCIONAR 2 VECES DIARIAS (SEGUN LEY) A +/- 7:30 - 19:30 HRS., TIENEN QUE IR VIGILANDO LOS VECINOS X SI VOLVIERA A DESPROGRAMARSE.</p>\r\n<p>TB CAMBIARON DE LA CENTRAL DE CO2 UNA PLACA QUE ESTABA AVERIADA</p>\r\n<p><span style="color: #ff0000;"><strong>EL PRESIDENTE JAVIER, NOS INDICA QUE CUANDO LE LLAMARON X TFN LE INDICARON QUE ESTOS TRABAJOS IRIAN SIN CARGO X LA TARDANZA, POR LO TANTO, NO TIENE QUE TENER NINGUNA FACTURA!!!!!</strong></span></p>\r\n<p>&nbsp;<strong>14/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE FLOR 7&ordm;C, INDICANDO QUE LOS EXTRACTORES ESTAN FUNCIONANDO SIN PARAR DESDE EL DOMINGO ....</p>\r\n<p>&nbsp;<strong>18/11/2013.-&nbsp;</strong>LLAMAMOS X TFN A JAVIER (VECINO DE LA CDAD.)696.563.283 Y NOS DIJO QUE LO IBA A VIGILAR UNOS DIAS&nbsp;</p>'),
	(98, 96, '2013-11-05', '2013-11-07', '2013-11-08', 2, '', 'PUERTA HC', '<p><strong>05/11/2013.-</strong> LLAMADA DE VECINA DE PLZ.DONANTES 2 1&ordm;A AZUCENA INDICANDO QUE LA PUERTA DEL CUARTO DE HC CON EL VIENTO HA VUELTO A ABRIRSE Y DAR GOLPAZOS, QUE HA TENIDO QUE BAJAR ELLA Y CERRARLA CON UN CABLE. NOS INDICA QUE NO ES PROBLEMA DE QUE SE DEJE ABIERTA LA PUERTA, ES PROBLEMA QUE LA CERRADURA ESTA MAL, NO AJUSTA BIEN Y CADA VEZ QUE HACE VIENTO ENTRA X LAS RANURAS Y HACE QUE LA PUERTA SE ABRA Y DE GOLPES. SE LE INDICA A LA VECINA, AZUCENA, QUE VAMOS A ENVIAR A UN CERRAJERO PARA QUE LE ECHE UN VISTAZO.</p>\r\n<p><strong>05/11/2013.- &nbsp;</strong>CORREO ENVIADO A SYTEC</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 05 de noviembre de 2013 18:17<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> AVISO PLAZA DONANTES 2 (PUERTA HC)</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de propietaria de </span>la comunidad Plaza Donantes<span style="font-family: Arial; font-size: 8pt;"> 2 1&ordm;A Azucena, indicando que la puerta de HC, con el viento ha vuelto a abrirse dando golpes contra </span>la pared. Nos<span style="font-family: Arial; font-size: 8pt;"> indica que no es problema de que la gente deje abierta la puerta, sino que la cerradura debe estar mal, no ajusta y siempre queda abierto. Por favor, pasarse por all&iacute; para revisar dicha puerta (puerta de HC que tiene un cable sujetando el cierre), si la soluci&oacute;n no implica mucho importe realizarlo, si es una reparaci&oacute;n considerable enviar presupuesto. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong>08/11/2013.-&nbsp;</strong> FACTURA REMITIDA X SYTEC ARCHIVADA EN DOCUMENTS ADJUNTOS.</p>'),
	(99, 98, '2013-11-05', '2013-11-06', '2013-11-06', 2, '', 'PORTON ESTROPEADO', '<p><strong>05/11/2013.-&nbsp;</strong>RECIBIMOS AVISO DEL VECINO (RUBIO Q TRABAJA EN EMULSA) INDICANDO QUE LA PUERTA DEL PORTON NO VA, QUE ESTA A LA MITAD Y NI SUBE NI BAJA.</p>\r\n<p>**SE LLAMA X TFN A MONTERO PARA QUE SE PASEN, NO LO COGEN, SE MANDA CORREO ELECTRONICO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 05 de noviembre de 2013 14:04<br /> <strong>Para:</strong> \'Ana D&iacute;az - MONTERO AUTOMATISMOS Y CIERRES, S.L\'<br /> <strong>Asunto:</strong> edificio el roble</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos acaban de dar aviso de porton averiado en </span>la cp El Roble<span style="font-family: Arial; font-size: 8pt;">, c/Les Cigarreres 23-25. Por favor, enviar tecnico. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal">*** 17:30H.- SE LLAMA A ANA DE MONTERO Y NOS INDICA QUE RECIBIO EL CORREO Y QUE EN CUANTO EL TECNICO QUEDE LIBRE, (Q ESTA TERMINANDO UN TRABAJO EN UNA OBRA) SE PASARA X EL ROBLE</p>\r\n<p class="MsoNormal"><strong>06/11/2013.- &nbsp;</strong>CORREO RECIBIDO DE MONTERO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Ana D&iacute;az - MONTERO AUTOMATISMOS Y CIERRES, S.L [mailto:automatismosycierres@gmail.com] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 06 de noviembre de 2013 10:15<br /> <strong>Para:</strong> Algonz.Paz<br /> <strong>Asunto:</strong> Re: edificio el roble</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt;">Buenos d&iacute;as Paz.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">La reparaci&oacute;n de la C/ Les Cigarreres 23-25 ya est&aacute; realizada de ayer por la tarde.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">Se enderez&oacute; la transmisi&oacute;n de la contrapesada. Ten&iacute;a un golpe.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">Un saludo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt;">Ana D&iacute;az</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt;">PTE. FACTURA MONTERO</span></p>'),
	(100, 94, '2013-11-06', '2013-11-20', NULL, 1, '', 'HUMEDAD - CONDENSACION 6ºB', '<p><strong>EXPTE. TRANSFERIDO DE OUTLOOK.&nbsp;</strong>ARCHIVADO EN DOCUMENTOS ADJUNTOS</p>\r\n<p><strong>08/10/2013(17:30H).-</strong> VIENE EL PTE. DE LA CDAD. A LA OFICINA PARA TRATAR EL TEMA DE LA POSIBLE HUMEDAD DEL VECINO DEL 6&ordm;B, PARA &Eacute;L TB ES CONDENSACION, NOS INDICA QUE FUE CON UNA EMPRESA QUE VISITO EL TEJADO PARA EL PRESUPUESTO Y TB LE DIJO QUE ERA CONDENSACION Y QUE EL PROPIETARIO SABIA QUE ERA ESO&hellip;..QUEDO CON M&ordf; DE LOS ANGELES EN QUE SE HABLARA CON EL AFECTADO Y SE LE INDICARA QUE VAN A HACER UNA SERIE DE OBRAS Y AJUSTES EN EL TEJADO (RECOLOCACION DE TEJAS Y SELLAMIENTO DE CASETON EN TEJADO) PARA SOLUCIONAR SU PROBLEMA Y QUE HA DE LIMPIAR SU VIVIENDA PARA PROCEDER A LA PINTURA DE LA MISMA, HA DE HACERSELE VER QUE ESO QUE TIENE ES CONDENSACION Y QUE LE PUEDE VOLVER A SALIR SINO LO TRATA CADA VEZ QUE &Eacute;L VEA QUE APAREZCA.</p>\r\n<p>SE DETERMINA CUANDO REALICEN LA LIMPIEZA DEL TEJADO SELLAR PUNTOS DE POSIBLES FILTRACIONES TANTO EN VELUX COMO EN LO POSIBLE MITIGAR LA INCIDENCIA (Q. ES CONDENSACION) DEL VECINO 6&ordm;B</p>\r\n<p>&nbsp;</p>'),
	(101, 99, '2013-11-05', '2013-11-11', '2013-11-07', 2, '', 'COLOCACION ESQUINERA DESCANSILLO 1º PLANTA', '<p><strong>05/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DEL PTE. MIGUEL ANGEL 1&ordm;A 676.259.263 INDICANDO QUE UNA ESQUINERA DE LAS DEL DESCANSILLO DE LA PRIMERA PLANTA SE DESPEGO Y ESTA SUELTA. SOLICITA QUE VAYA ALGUIEN A PEGARLA, LA DEJO APOYADA DE DONDE SE SOLTO.</p>\r\n<p><strong>06/11/2013.-&nbsp;</strong>CORREO ENVIADO A JOSE A.LEONARDO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 06 de noviembre de 2013 17:42<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> CTRA.VIZCAINA 20 PORTAL</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso el pte. de la comunidad Miguel Angel 1&ordm; A 676.259.263, indicando que una esquinera de las sitas en la 1&ordf; planta se despego y esta suelta (la dejaron apoyada en la misma zona). Por favor, pasarse por la comunidad y pegarla, indicarselo al presidente cuando se deje lista. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">07/11/2013.-</span></strong><span style="font-size: 9.0pt; font-family: Arial;"> VINO JOSE A.LEONARDO Y NOS INDICA QUE YA LO ARREGLO, TODO OK (COINCIDIO CON FERNANDO LI&Ntilde;EIRA).</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">PTE. FACTURA DE JOSE A.LEONARDO</span></p>'),
	(102, 62, '2013-11-05', '2013-11-12', '2013-11-08', 2, '', 'CAMBIO EMERGENCIA V.40 4ª PLANTA', '<p><strong>05/11/2013.-&nbsp;</strong>VIENE LA VECINA 4&ordm;A NURIA 696.880.614, INDICANDO QUE LA EMERGENCIA DE SU DESCANSILLO ESTA QUEMADA, QUE ESTA TODA LA EMERGENCIA Y PARTE DE LA PARED NEGRA.&nbsp;</p>\r\n<p><strong>06/11/2013.-&nbsp;</strong>SE MANDA CORREO A INST.FASE PARA QUE PASE A CAMBIARLA</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 06 de noviembre de 2013 17:58<br /> <strong>Para:</strong> \'INGENIERIA FASE S.L.\'<br /> <strong>Asunto:</strong> CP PUERTA DEL SOL C/VELAZQUEZ 40</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de vecino de </span>la comunidad CP Puerta<span style="font-family: Arial; font-size: 9pt;"> del Sol c/Velazquez 40, indicando que la emergencia del descansillo de su vivienda, planta 4&ordf;, se ha quemado (esta toda negra, incluso alrededor de la propia emergencia). Por favor, reponer (cambiar) dicha emergencia por tipo LED, en c/Velazquez 40 4&ordf; planta, y una vez terminado dar aviso en </span>la administraci&oacute;n. Gracias.</p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">07/11/2013.-</span></strong><span style="font-size: 9.0pt; font-family: Arial;"> VINO INES DE FASE Y NOS INDICA QUE HOY CAMBIARON LA EMERGENCIA, LA VIEJA REALMENTE ESTABA QUEMADA, LA BOMBILLA HACIA MAL CONTACTO Y QUEMO.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial;">08/11/2013.- </span></strong><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;RECIBIDA FACTURA INST.FASE (ARCHIVADA EN DOCUMENTS.ADJUNTOS)</span></p>'),
	(103, 101, '2013-11-06', '2013-11-13', NULL, 1, '568536121', 'ROTURA DE CRISTALES EN VELUX 6º A - 6º C', '<p>EN JUNTA DE FECHA 31/07/2013 SE TRATA "<span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Solicitan se pidan presupuestos para la limpieza del tejado, ya que hace unos a&ntilde;os que no se revisa e informan que hay gaviotas y puede est&aacute; sucio. Se autoriza pedir al menos dos propuestas y valorarlas con el Presidente para determinar la ejecuci&oacute;n de&nbsp;</span>la obra. En<span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="color: #ff0000;"><strong>&nbsp;este mismo tema las vecinas del piso 6&ordm; A y 6&ordm; C indican que tienen los cristales rotos del velux, solicitan que se de parte al seguro por si en el mismo tienen cobertura,</strong></span>&nbsp;se determina primero realizar la obra de limpieza del tejado y luego dar parte al seguro siempre aprovechando una mala inclemencia del tiempo.</span></p>\r\n<p><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">06/11/2013.-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">&nbsp;AUN NO SE HA REALIZADO LA LIMPIEZA DEL TEJADO PERO APROVECHANDO LAS RACHAS DE VIENTO QUE HEMOS TENIDO ESTOS DIAS ATRAS (SEGUN LA ESTADISTICA EL 04/11/2013 11:35H.HUBO RACHAS IMPORTANTES, NO SABEMOS SI LLEGAN A CUBRIR LO QUE SOLICITA EL SEGURO)...</span></p>\r\n<p><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">MAPFRE&nbsp;</span></strong></p>\r\n<p><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">TFN.- 902.136.524</span></strong></p>\r\n<p><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">N&ordm; POLIZA.- 076-0880334584</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">06/11/2013(18:55H).-</span></strong></span><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">&nbsp;MAPFRE (NOELIA) SE APERTURA SINIESTRO X ROTURA (RAJADA) DE CRISTALES, SE FACILITAN DATOS DE LOS AFECTADOS:</span></p>\r\n<p><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">- 6&ordm;A ARTURO MORIS 619.304.527 / MANUELA 606.074.778</span></strong></p>\r\n<p><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">- 6&ordm;C JOSE CARLOS RAMOS 639.226.444 / 609.339.977</span></strong></p>\r\n<p><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">EL TECNICO SE PONDRA EN CONTACTO CON LOS PERJUDICADOS EN UN PLAZO DE 12-24 HRS.</span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">14/11/2013(18:50H).-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A LOS AFECTADOS PARA SABER SI SE HAN PUESTO EN CONTACTO CON ELLOS:</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">6&ordm;A.- NO ESTA DISPONIBLE</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">6&ordm;C.- SE HABLA CON LA MUJER DE JOSE CARLOS Y NO HAN RECIBIDO NINGUNA LLAMADA.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">14/11/2013(18:55H).-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp; MAPFRE (PATRICIA), EFECTIVAMENTE NO TIENEN EN EL SEGURO NOTIFICACION ALGUNA SOBRE QUE SE HAYAN PUESTO EN CONTACTO CON LOS AFECTADOS, LA OPERADORA PASA NOTA URGENTE PARA QUE ASI SEA, SE FACILITAN NUEVAMENTE LOS TFNS DE LOS PERJUDICADOS.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">20/11/2013 (18:10H).-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A LOS AFECTADOS PARA SABER SI SE HAN PUESTO EN CONTACTO CON ELLOS:</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">6&ordm;A.- SE LLAMA X TFN A MANUELA, NOS INDICA QUE ELLA LE DIO EL TFN AL DEL SEGURO QUE LLAMO, QUE ELLA NO ESTA EN GIJON, ESTA MAS ARTURO, DE TODAS FORMAS LE CONSTA QUE FUERON A MEDIR EL CRISTAL.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">SE LLAMA X TFN A ARTURO Y NOS INDICA QUE FUE UN CRISTALERO PARA TOMAR MEDIDAS Y LES DIJERON QUE TENIAN QUE PEDIRLO A FABRICA, QUE EN CUANTO LO TUVIERON LES LLAMARIAN DIRECTAMENTE A ELLOS PARA IR A INSTALARLO, (LA INSTALACION SERIA +/- MEDIA HORA).</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">6&ordm;C.- NOS DICE JOSE CARLOS QUE A ELLOS NO LES LLAMO NADIE.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">20/11/2013 (18:35H).-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;MAPFRE (IRENE) SE SOLICITA SE PONGAN EN CONTACTO DE MANERA URGENTE CON EL PISO 6&ordm;C PARA IR A VISITARLO.</span></span></span></p>\r\n<p><strong><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">18:40H.-</span></span></span></strong><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A JOSE CARLOS Y SE LE INDICA QUE SE PONDRAN EN CONTACTO CON EL ENTRE HOY Y MA&Ntilde;ANA Y QUE DE NO SER ASI XFAVOR NOS LLAME, NOS DICE QUE OK.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">22/11/2013 (13:25h).-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;RECIBIMOS LLAMADA DE JOSE CARLOS 6&ordm;C INDICANDO QUE NADIE SE HA PUESTO EN CONTACTO CON ELLOS</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">13:30HRS.-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;MAPFRE (TERESA) SE HACE LA RECLAMACION SOBRE 6&ordm;C Y NOS INFORMA LA OPERADORA QUE LA TRAMITADORA SE INTENTO PONER EN CONTACTO CON EL AFECTADO EL 20/11 A LAS 19:01 - 19:08 - 19:11 HRS. RESULTANDO NEGATIVAS TODAS LAS LLAMADAS, SE LE INDICA QUE ME RESULTA EXTRA&Ntilde;O, QUE DE TODAS FORMAS SE SOLICITA SE PONGAN EN CONTACTO HOY DE MANERA URGENTE CON EL PERJUDICADO BIEN EL TRAMITADOR O BIEN EL CRISTALERO, PERO QUE SEA HOY.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">13:45HR.- SE LLAMA AL AFECTADO PARA INFORMARLE DE TODO EL TEMA, QUEDAMOS EN LLAMARLE EL LUNES PARA CONFIRMAR</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">25/11/2013(10:30h).-<span style="background-color: #ffffff;">&nbsp;</span></span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp; SE LLAMA AL AFECTADO Y NOS INDICA QUE NADIE SE HA PUESTO EN CONTACTO CON &Eacute;L. (ESTA ENFADADO...NORMAL)</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">10:35H.-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;MAPFRE (VERONICA) SE SOLICITA HABLAR CN LA TRAMITADORA PARA PONER LA RECLAMACION, DESPUES DE 20 MINUTOS ESPERANDO NOS DICE LA OPERADORA QUE NO PUEDE CONTACTAR CON EL TRAMITADOR, SE DEJA NOTA QUE NOS LLAME DE MANERA URGENTE.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><strong>18:00H.-</strong><strong><span style="background-color: #ffffff;"> &nbsp;</span></strong><span style="background-color: #ffffff;">NO HEMOS RECIBIDO NINGUNA LLAMADA, VOLVEMOS A LLAMAR A MAPFRE (ELENA DE DIEGO) SE LE INDICA QUE QUEREMOS PONER RECLAMACION Y NOS INDICA QUE VA A PASAR RECLAMACION AL GESTOR DE CALIDAD PARA QUE SE PONGA EN CONTACTO CON NOSOTROS PARA LA RECLAMACION, Y ELLA PERSONALMENTE SE COMPROMETE A QUE EL CRISTALERO LLAME ESTA TARDE AL AFECTADO.&nbsp;</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">18:45H.-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;RECIBIMOS LLAMADA DE MAPFRE, ELENA DE DIEGO, INFORMANDO QUE HA CONFIRMADO QUE EL CRISTALERO SE HA PUESTO EN CONTACTO CON EL PERJUDICADO Y QUE LO HA COMPROBADO ELLA MISMA LLAMANDO X TFN AL AFECTADO Y DISCULPANDO EL RETRASO.</span></span></span></p>\r\n<p><span style="background-color: #ff9900;"><strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">18:50H.-</span></strong><span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA AL AFECTADO JOSE CARLOS PARA COMPROBAR SI SE HAN PUESTO EN CONTACTO CON &Eacute;L. NOS DICE Q SI, Q LE HA LLAMADO TANTO EL SEGURO COMO EL CRISTALERO, PERO QUE AHORA QUEDA QUE LE LLAMEN PARA IR A SU CASA. QUEDAMOS CON &Eacute;L EN QUE NOS IRIA INFORMANDO.</span></span></span></p>'),
	(104, 102, '2013-11-07', '2013-11-08', '2013-11-07', 2, '', 'LLAVE ATASCADA DE CERRADURA PTA.ACCESO A TRASTEROS', '<p><strong>07/11/2013.-&nbsp;</strong>NOS LLAMA EL PTE. DE LA CDAD. INDICANDO QUE A UN VECINO SE LE HA QUEDADO LA LLAVE ATASCADA EN LA PTA. DE ACCESO A LOS TRASTEROS, QUE LA DEJARON ALLI XQ NO LA PODIAN SACAR Y QUE DEJO UNA NOTA DEL PISO AL QUE PERTENECIA LA LLAVE EN LA PUERTA....., SE PASA CORREO A SYTEC PARA QUE PASEN X ALLI.</p>\r\n<p>CORREO ENVIADO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 07 de noviembre de 2013 12:28<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> CP PORTAL VIZCAINA 20</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso el presidente de la comunidad indicando que un vecino de la comunidad al acceder a la zona de trasteros se le ha quedado la llave dentro de la cerradura, la han dejado all&iacute; con una nota de la vivienda a la que pertenece&hellip;&hellip;. Por favor, pasarse por la comunidad para solucionar el problema y dejar funcionando la puerta correctamente. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">**13:30H.-</span></strong><span style="font-size: 9.0pt; font-family: Arial;"> NOS LLAMA ANDRES DE SYTEC INDICANDO QUE ESTA EN EL PORTAL Y LA UNICA PUERTA QUE HAY NI TIENE CARTEL NI TIENE NINGUNA LLAVE DENTRO, SE LLAMA AL PTE. PARA QUE NOS CONFIRME SI ES ESA LA PUERTA Y NOS DICE QUE SI, QUE &Eacute;L CUANDO SALIO A TRABAJAR ESTA MA&Ntilde;ANA VIO UN CARTEL CON UNA LLAVE ATASCADA Y QUE NOS LLAMO. ANDRES NOS DICE QUE LE CONFIRMA UNA VECINA QUE SI Q HABIA UNA LLAVE PERO QUE ALGUIEN LA SACO Y LA METIO EN EL BUZON DEL QUE ERA, COMPRUEBA LA PUERTA CON LA LLAVE DE LA VECINA Y VEN QUE ABRE Y CIERRA PERFECTAMENTE. ANDRES NOS DICE QUE ANULA EL AVISO PERO QUE NO SABE SI COBRARAN LA SALIDA.</span></p>'),
	(105, 103, '2013-11-07', '2013-11-21', NULL, 1, '', 'GOTERA PLAZA DE GARAJE 11', '<div>&nbsp;</div>\r\n<div class="Section1">\r\n<div>\r\n<div class="MsoNormal" style="text-align: center;" align="center"><hr tabindex="-1" align="center" size="2" width="100%" /></div>\r\n<p class="MsoNormal"><strong><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;">De:</span></span></strong><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /><strong>Enviado el:</strong> lunes, 04 de noviembre de 2013 19:49<br /><strong>Para:</strong> \'Angeles\'<br /><strong>Asunto:</strong> GARAJE SOL DE MONTEVIL C/ALAVA 46-48-50</span></span></p>\r\n</div>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\'; font-size: medium;"><span style="font-size: 12pt;">&nbsp;</span></span><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">HEMOS RECIBIDO LLAMADA DE LA PROPIETARIA DE LA PLAZA N&ordm; 11 INDICANDO QUE TIENE UNA GOTERA CONTINUA EN SU PLAZA DE GARAJE N&ordm; 11. SE LE PREGUNTA SI TUVO GOTERAS EN ALGUNA OTRA OCASI&Oacute;N &nbsp;Y NOS DICE QUE NO, QUE ELLA NUNCA (SE REVISO EL EXPTE. DE OUTLOOK Y NO LA TENGO ANOTADA EN NINGUNA ACTUACI&Oacute;N).</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">QUEDE PTE. DE LLAMARLA CUANDO SUPIERA ALGO</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">C/ALAVA 48 5&ordm;A PLAZA N&ordm; 11 ANGELES 630.55.77.77</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><strong><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">Paz Ortiz</span></span></strong></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><