	(106, 104, '2013-11-07', '2014-01-15', NULL, 1, '', 'PROPUESTAS SEGURO COMUNIDAD', '<p>EN JUNTA 18/7/2013 SE ACORDO SOLICITAR PROPUESTAS DE SEGURO PARA LA COMUNIDAD, NEGOCIAR CON MAPFRE Y PEDIR OTRAS PROPUESTAS PARA TRATAR EN LA PROXIMA JUNTA QUE SE HAGA ANTES DEL VENCIMIENTO DE LA POLIZA QUE ES EL 13/07/2014.</p>\r\n<p>SE VA A SOLICITAR A MAPFRE-GENERALI-ALLIANZ-CATALANA</p>'),
	(107, 105, '2013-11-07', '2014-01-15', NULL, 1, '', 'PRESUPUESTOS ELECTRICIDAD PULSADORES', '<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;">En Junta 18/7/2013 se acord&oacute;:</span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;"><span style="background-color: #ffcc99;">Para una siguiente Junta requieren que se solicite propuestas para la renovaci&oacute;n de los pulsadores ya que observa piso 6&ordm; F que los del 3&ordm;,&nbsp; 4&ordm;, y 5&ordm;&nbsp; en ocasiones est&aacute;n las luces permanentes y es por que queda atascado alg&uacute;n interruptor. Tambi&eacute;n quieren que una vez puesto con el tema el&eacute;ctrico se mire la posibilidad de independizar las escaleras de los rellanos.&nbsp;</span></span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;"><span style="background-color: #ffcc99;"><span style="background-color: #ffffff;">Solicitar presupuestos a ITELCO-FASE-RUBEN-MATILLA</span><br /></span></span></p>'),
	(108, 106, '2013-11-07', '2013-12-03', NULL, 1, '', 'PRESUPUESTOS MTTO ASCENSORES DONANTES', '<p>SOLICITAR PRESUPUESTOS PARA EL MTTO ASCENSORES DE DONANTES A IMEN-OTIS-CANTABRICO-TRESA</p>\r\n<p>El 7/11/13, llame a TRESA, con la centralita me tomaron nota para pasarla a Alberto o Pablo y que ya se pasarian por la comunidad; llame a Lino de Ascensores Cant&aacute;brico quedo en pasar ma&ntilde;ana por la Comunidad; remit&iacute; un e-mail a Angel de OTIS y otro a Patricia de IMEN.</p>\r\n<p>TENEMOS PRESUPUESTOS DE OTIS-TRESA-ENINTER (ORIGINALES GUARDADOS EN BANDEJA INSPECCION ASCENSORES)</p>'),
	(109, 107, '2013-11-07', '2013-11-13', NULL, 1, '568596521', 'DAÑOS EN COMUNIDAD (PATIO) ACTOS VANDALICOS', '<p><span style="background-color: #cc99ff;"><strong>06/11/2013.-</strong></span> EN DIAS ANTERIORES RECIBIMOS LLAMADA DE VARIOS VECINOS (SALVADOR, ERNESTO, MAGDALENA (la vicepte.))INDICANDO QUE SE HAN CAUSADO VARIOS DESPERFECTOS Y DESTROZOS EN EL PATIO X UNOS JOVENES QUE CREEN QUE NO PERTENECIAN A LA CDAD.</p>\r\n<p>SE SOLICITA AL PTE. REALICE DENUNCIA PARA PODER APERTURAR SINIESTRO A TRAVES DEL SEGURO DE LA CDAD. X ACTOS VANDALICOS</p>\r\n<p><strong>MAPFRE</strong></p>\r\n<p><strong>N&ordm;POLIZA.- 076-0880246215</strong></p>\r\n<p><strong>TFN.- 902.136.524</strong></p>\r\n<p><strong><span style="background-color: #cc99ff;">07/11/2013(18:30H).-</span>&nbsp;</strong>MAPFRE (CARMEN) SE APERTURA SINIESTRO X ACTOS VANDALICOS, SE FACILITA EL TFN DEL PTE. PARA QUE SE PONGAN EN CONTACTO CON &Eacute;L. VARIOS DA&Ntilde;OS:</p>\r\n<p>- TEJADILLO DE BARBACOA ARRANCADO Y TIRADO EN EL SUELO</p>\r\n<p>- PAPELERAS ARRANCADAS</p>\r\n<p>- BARRAS DE GUIAS DE ENREDADERAS PARA LAS PLANTAS ROTAS Y DOBLADAS.</p>\r\n<p>SE MANDA CORREO A siniestros.mapgen@mapfre.com CON LA DENUNCIA PARA QUE TRAMITE EL SINIESTRO.</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> jueves, 07 de noviembre de 2013 18:51<br /> <strong>Para:</strong> \'siniestros.mapgen@mapfre.com\'<br /> <strong>Asunto:</strong> EXPTE. 568596521 </span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenas tardes:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto se remite denuncia efectuada sobre da&ntilde;os causados por actos vandalicos en C.P. San Nicolas 80.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">Se solicitan la reparaci&oacute;n y/o lo que la compa&ntilde;&iacute;a estime oportuno. </span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, atentamente</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;<strong><span style="background-color: #cc99ff;">08/11/2013.-</span>&nbsp;</strong>CORREO RECIBIDO DE MAPFRE</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> si24.atencion.al.cliente@mapfre.com [mailto:si24.atencion.al.cliente@mapfre.com] <br /> <strong>Enviado el:</strong> jueves, 07 de noviembre de 2013 20:28<br /> <strong>Para:</strong> Algonz.Paz<br /> <strong>Asunto:</strong> Respuesta a su solicitud __Ref:46318379__Cmp:170__</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: gray;">Buenas tardes,</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial; color: gray;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial; color: gray;">En relaci&oacute;n con su solicitud relativa al expediente n&uacute;mero n&ordm; 568596521, queremos informarle que hemos trasladado la informaci&oacute;n que nos ha facilitado al Centro Tramitador correspondiente.</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.