or: #cc99ff;"><strong>12/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;NOS LLAMA BORJA CORTES Y NOS INDICA QUE LE HAN DICHO QUE LA BARBACOA NO TIENE ARREGLO XQ ES TODA UNA PIEZA, POR LO TANTO ESTUVO REVISANDO LAS BARBACOAS DE LEROY MERLIN Y NOS PREGUNTA SI NOS PARECE CORRECTO QUE LA INDEMNIZACION SEA X EL PVP QUE TIENE UNA BARBACOA CASI IDENTICA A LA QUE TIENEN AHORA EN LEROY MERLYN (FOTOGRAFIA ADJUNTA EN DOCUMENTS ADJUNTOS) X LO TANTO VA A PASAR EL INFORME A LA COMPA&Ntilde;IA POR //391,95//.-&euro; DE BARBACOA + //100,00//.-&euro; DE MANO DE OBRA = //491,95//.-&euro;</span></span></p>\r\n<p><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">&nbsp;<span style="background-color: #cc99ff;"><strong>20/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;NO HEMOS RECIBIDO PRESUPUESTO NI DEL TEMA DE ENREDADERAS NI DE PAPELERAS, SE SOLICITA TELEFONICAMENTE DE NUEVO PARA QUE NOS LO ENVIEN.</span></span></span></span></p>\r\n<p><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;"><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">BABILONIA.- SERGIO 666.806.071 ME LO MANDA MA&Ntilde;ANA, TRAE LA FACTURA XQ YA LO ARREGLO.</span></span></span></span></p>\r\n<p><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;"><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">JOSE A.LEONARDO 626.374.219.- PAPELERAS SE PASA MA&Ntilde;ANA PARA DARME EL PRESUPUESTO.&nbsp;</span></span></span></span></p>\r\n<p>&nbsp;<span style="background-color: #cc99ff;"><strong>21/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;NOS LLAMA BORJA PARA SOLICITAR LOS PRESUPUESTOS, SE LE INDICA QUE HOY ANTES DE LAS 20:00HRS. LO TIENE</span></span></p>\r\n<p><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">SE LLAMA A SERGIO Y NOS DICE DE PALABRA QUE LA FACTURA SON 70,00 + IVA (21%)= 84,70.-&euro;</span></span></p>\r\n<p><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">SE LLAMA A JOSE A.LEONARDO Y NOS DICE QUE HOY NOS LO DICE.</span></span></p>\r\n<p><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">RECIBIMOS CORREO DE JOSE A.LEONARDO CON PRESUPUESTO DE PAPELERAS 19,00 c/u (57,00) + 6,00 mano de obra + IVA = 76,23.-&euro; A BORJA CORTES PERITO SE LE DICE X TFN QUE CADA PAPELERA ES 22,00 c/u (66,00) + IVA = 79,86 + 25,00 euros de mano de obra al cual no le aplica el IVA = 104,86.-&euro;. ARCHIVADOS AMBOS EN DOCUMNTS. ADJUNTOS (tanto el que nos envio jose A.Leonardo como el que se modifico aqui, yo.....)</span></span></p>\r\n<p class="MsoPlainText">&nbsp;*SE RECIBE CORREO DE BORJA CORTES CON INDEMNIZACION GRAL. PARA PASAR A LA COMPA&Ntilde;IA, SE ADJUNTA CORREO RECIBIDO Y RESPUESTA&nbsp;</p>\r\n<p class="MsoPlainText">De: Algonz.Paz [mailto:administrativo@algonz.es] <br /> Enviado el: jueves, 21 de noviembre de 2013 18:51<br /> Para: \'Borja cortes Palominio\'<br /> Asunto: RE: 568596521 SAN NICOLAS 80</p>\r\n<p class="MsoPlainText">&nbsp;Buenas tardes.-</p>\r\n<p class="MsoPlainText">&nbsp;&nbsp; &nbsp; &nbsp;Todo ok. Adjunto remitimos denuncia sobre el expte.</p>\r\n<p class="MsoPlainText">&nbsp;Un saludo</p>\r\n<p class="MsoPlainText">&nbsp;Paz Ortiz</p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">-----Mensaje original-----</span></p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">De: Jesus Cortes [mailto:jbdcortesperitaciones@gmail.com] En nombre de Borja cortes Palominio</span></p>\r\n<p class="MsoPlainText">Enviado el: jueves, 21 de noviembre de 2013 18:23</p>\r\n<p class="MsoPlainText">Para: Algonz.Paz</p>\r\n<p class="MsoPlainText">Asunto: 568596521 SAN NICOLAS 80</p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">Buenas tardes Paz, soy Borja Cort&eacute;s, un perito de MAPFRE, la valoraci&oacute;n</span></p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">de todos los da&ntilde;os ocasionados por actos vand&aacute;licos en el siniestro que</span></p>\r\n<p class="MsoPlainText">nos ocupa es de:</p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">1/ Suministro e instalaci&oacute;n de barbacoa: 491,95 &euro; (I.I)</span></p>\r\n<p class="MsoPlainText">2/ Suministro y colocaci&oacute;n de 3 papeleras= 3 X (22,00 &euro; + IVA21%) =</p>\r\n<p class="MsoPlainText">66,00 &euro; + 21% IVA = 79,86 &euro; (I.I) + 1HORA DE INSTALACI&Oacute;N 25,00 &euro; (SIN</p>\r\n<p class="MsoPlainText">IVA) = 104,86 &euro; (I.I SOLO EN EL SUMINISTRO).</p>\r\n<p class="MsoPlainText">3/ Suministro e instalaci&oacute;n de estructura de enredaderas = 84,70 &euro;(I.I).</p>\r\n<p class="MsoPlainText"><strong><span style="font-size: 11px;">TOTAL: 681,51 &euro; (I.I).</span></strong></p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">Si estas conforme con la valoraci&oacute;n dame la conformidad lo antes posible</span></p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">y cuando puedas pasame la denuncia.</span></p>\r\n<p class="MsoPlainText"><span style="font-size: 11px;">Saludos</span></p>\r\n<p class="MsoPlainText"><strong><span style="background-color: #cc99ff;">22/11/2013.-</span></strong><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">&nbsp;NOS LLAMA EL TRAMITADOR DEL SINIESTRO DE MAPFRE INDICANDONOS QUE VAN A EFECTUAR UNA TRANSFERENCIA POR EL IMPORTE FIJADO X EL PERITO. UNA VEZ TENGAMOS LAS FACTURAS REMITIRSELAS AL CORREO ajhevia@mapfre.com</span></span><span style="background-color: #cc99ff;"><br /></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #cc99ff;"><span style="background-color: #ffffff;">*NOS TRAE EN MANO FACTURA SERGIO DE BABILONIA. ARCHIVADA X DOCUMNTS.ADJUNTOS.</span></span></p>\r\n<p class="MsoPlainText"><span style="background-color: #cc99ff;"><strong>25/11/2013.-<span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">&nbsp;SE MANDA CORREO A JOSE A.LEONARDO CON LA ACEPTACION DL PRESUPUESTO DE LAS PAPELERAS.</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 25 de noviembre de 2013 11:16<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> RE: SAN NICOLAS 80</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto remitimos presupuesto aceptado para sustituci&oacute;n de 3 papeleras en las zonas comunes CP San Nicolas 80.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoPlainText">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoPlainText">&nbsp;A FECHA DE 25/11/2013 NO HAY NINGUN INGRESO EN LA CUENTA DE LA COMUNIDAD</p>'),
	(110, 108, '2013-11-08', '2013-12-17', NULL, 1, '', 'PROPONER EN JUNTA QUE REALIZAR CON ESTA INCIDENCIA', '<p class="MsoNormal" style="margin-left: 71.25pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 71.25pt;"><strong><span style="background-color: #00ccff;">08/11/2013.-</span></strong><span style="background-color: #00ccff;">&nbsp;</span><span style="background-color: #00ccff;"><span style="background-color: #ffffff;">&nbsp;ME INFORM&Oacute; MARIA JOSE QUE LE HAB&Iacute;A NOTIFICADO A LA SRA. ENCARNACION VIA MAIL LO QUE SUCEDE. ESTE TEMA HAY QUE TRATARLO EN LA SIGUIENTE JUNTA QUE SE REALICE EN ENERO/14 PUES QUIEREN PONER CADENAS PARA QUE NO LO UTILICE NADIE O QUIEREN ALQUILARLO. HAY QUE TRATARLO EN ORDEN DEL DIA.</span></span></p>\r\n<p class="MsoNormal" style="margin-left: 71.25pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 71.25pt;"><!--[if !supportLists]--><span style="font-size: 10.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style="font-size: 9.0pt; font-family: Verdana;">Motos aparcadas en hueco debajo rampa garaje.</span></strong><span style="font-size: 8.0pt; font-family: Verdana;">En cuanto a este Tema en una de las primera Juntas se aprob&oacute; que se utilizara este hueco por propietarios que tengan motos, ya en la anterior Junta hubo quejas de que un vecino tiene aparcada m&aacute;s de una moto dentro de ese hueco impidiendo que otro vecino haga uso de ese espacio. Al haber mas usuarios que espacio en principio se requiere que cada propietario de piso haga uso de un solo espacio para dar facilidad a otros y puedan aparcar. De todas maneras requieren la mayor&iacute;a de los presentes en esta Junta que se lleve el Tema a la siguiente Junta y se trate de manera detallada, con el fin de tambi&eacute;n tener identificados los usuarios de esos espacios no vayan a estar utilizados por personas ajenas a la Comunidad. En este punto tambi&eacute;n requieren que se les informe de las coberturas de la p&oacute;liza comunitaria ante un siniestro de incendi&oacute; o robo&nbsp; tomando en cuenta que estas motos no est&aacute;n situadas en plazas destinadas para el estacionamiento de veh&iacute;culos.</span></p>\r\n<p>&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: 53.25pt; margin-right: 0cm;">\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 6.0pt; font-family: Verdana; color: blue;">MARIA JOSE: ESTE TEMA VIENE POR LAS MOTOS APARCADAS POR EL MARIDO DE ENCARNACION PISO EN BADAJOZ TAMBIEN, ESCRIBELE UN MAIL INFORMANDO QUE ESTE PTO&nbsp; SE HABL&Oacute; PORQUE SEG&Uacute;N ME INFORMAN LOS VECINOS Y ME HAB&Iacute;A CONFIRMADO SU MARIDO HACE UNOS MESES QUE LE PREGUNTE TIENEN DOS MOTOS APARCADAS EN ESA ZONA, SI PODRIAN POR FAVOR SACARNOS UNA.</span></strong></p>\r\n</div>'),
	(111, 110, '2013-11-08', '2013-11-13', NULL, 1, '', 'GOTERA ENFRENTE DE PLAZA 18 y 50', '<p><strong><span style="background-color: #00ccff;">08/11/2013.- &nbsp;</span></strong><span style="background-color: #00ccff;"><span style="background-color: #ffffff;"> NOS INFORMA PATRICIA LA VECINA DE SOR JUANA INES DE LA CRUZ 22 (PATROCINADORA DE LAS MALLAS DE OCULTAMIENTO DE LA ZONA DE PATIO) QUE ESTOS D&Iacute;AS QUE HA LLOVIDO ENTRA AGUA ENFRENTE DE SU PLAZA DE GARAJE. HE LLAMADO A CEFERINO AL TLFN 676.22.03.33 PARA INFORMARLE SOBRE LA INCIDENCIA, A LOS POCOS MINUTOS RECIBO LLAMADA DE CEFERINO INFORMANDOME QUE QUEDARON CON EL DEL AISLANTE PARA IR A VER LA GOTERA. QUEDO PENDIENTE DE MAS NOTICIAS SUYAS EN RELACION A LA FECHA DE REALIZACI&Oacute;N DE LOS TRABAJOS Y DEMAS.&nbsp;</span></span></p>\r\n<p><strong><span style="background-color: #00ccff;">19/11/2013.-</span></strong><span style="background-color: #00ccff;"><span style="background-color: #ffffff;">&nbsp;He vuelto a llamar a Ceferino &nbsp;<strong><span style="background-color: #ff0000;">676.22.03.33</span></strong> en para que una vez que miren lo de la plaza 8 se mire la bajante que esta enfrente de la plaza 50. Resulta que esta bajante ya se repar&oacute; el invierno pasado pero todav&iacute;a cae algo de agua y como el terreno esta pendiente recude justo enfrente del trastero de mi plaza de garaje. El d&iacute;a que colocamos las estanterias en el tratero nos dimos cuenta de que arrolla el agua desde esa bajante.</span></span><span style="background-color: #00ccff;"><span style="background-color: #ffffff;"><br /></span></span></p>\r\n<p><strong><span style="background-color: #00ccff;">20/11/2013.&nbsp;</span></strong><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> mi&eacute;rcoles, 20 de noviembre de 2013 13:06<br /> <strong>Para:</strong> \'Angeles\'<br /> <strong>Asunto:</strong> GARAJE BADAJOZ 45</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">13:05HRS. LLAMA CEFERINO RENDUELES&nbsp; Y NOS INDICA QUE ESTUVO SU HERMANO X EL GARAJE VARIOS DIAS, Y QUE FUE HOY CUANDO LLOVIA Y AQUELLO ESTA SECO, QUE LE AVISES CUANDO LO VUELVAS A VER IN SITU PARA IR EL MISMO DIA Y VER X DONDE PUEDE ENTRAR ESA AGUA.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong><strong><span style="background-color: #00ccff;">-&nbsp;</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="background-color: #00ccff;">21/11/2013.-<span style="background-color: #ffffff;"> llame a Cefereino para informar que Jos&eacute; Ram&oacute;n paso por la Comunidad y constato que cae agua desde la bajante, dijo Ceferino que pasaria por la Comunidad que ten&iacute;a que comentar cosas con Joaqu&iacute;n y o pasar&iacute;a a ver.&nbsp;</span></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
	(112, 28, '2013-10-28', '2013-10-29', '2013-11-08', 2, '', 'ARREGLO DE PLACA INST.FASE', '<p><strong>28/10/2013.-&nbsp;</strong> VIENE INES DE FASE PARA REVISAR LOS DETECTORES DE CIGARRERES Y SE LE SOLICITA QUE NOS ECHE UN VISTAZO Y SI PUDIERA SER ARREGLE EL TEMA DE LOS MICROS DE C.42, QUE SI LO VE MUY MAL NOS PASE PRESUPUESTO PARA PODER REMITIRLO A VIPASA.</p>\r\n<p>REALIZA LA VISITA Y NOS INDICA INES QUE YA LO ARREGLARON, QUE SANEARON LA PLACA, CAMBIARON LAS BOTONERAS MAS DA&Ntilde;ADAS Y SUSTITUYERON UNA PLACA PEQUE&Ntilde;ITA QUE TIENE ARRIBA LA PLACA GRAL DE MICROS, COMPROBARON EL FUNCIONAMIENTO CON LOS VECINOS QUE SE ENCONTRABAN Y LO DEJARON OK.</p>\r\n<p>NOS INDICA QUE NO NOS PASA PRESUPUESTO DE CAMBIO DE PLACA GRAL.XQ SERIA MUY ELEVADO, YA QUE HAY QUE CAMBIAR GRUPO FONICO Y DEMAS Y ESO ES CARO.</p>\r\n<p><strong>08/11/2013.-&nbsp;</strong>FACTURA RECIBIDA DE INST.FASE, ARCHIVADA EN DOCUMENT. ADJUNTOS.</p>'),
	(113, 111, '2013-11-08', '2013-12-08', NULL, 1, '', 'ARREGLO ALERONES TEJADO', '<p>EN JUNTA DE FECHA 23/07/2013 SE DETERMINO QUE 4&ordm;- Presentar propuesta para pintar el alero de la Comunidad. Aprobaci&oacute;n de derrama si procede.</p>\r\n<p><span style="font-size: 11px;">Este punto se determina tratar en la Junta General del a&ntilde;o que viene, se llevaran m&aacute;s propuestas que las presentadas en esta Junta con el fin de comparar prestaciones que ofrezcan los contratistas.</span></p>\r\n<p><span style="font-size: 11px;">02/09/2013.- &nbsp;SE SOLICITAN PRESUPUESTOS DE PINTURA A ASTUR OBRAS, ACROBACIAS, TECONS</span></p>\r\n<p>TODO ARCHIVADO EN DOCUMNTS.ADJUNTOS. EXPTE. TRASNFERIDO DE OUTLOOK.</p>'),
	(114, 112, '2013-11-11', '2014-01-13', NULL, 1, '', 'MANTENIMIENTO PORTONES GARAJE', '<p>EN JUNTA DE FECHA 06/06/2013 SE DETERMINO:</p>\r\n<p><span style="font-size: 11px;">En cuanto al mantenimiento del port&oacute;n se requiere que la Administraci&oacute;n programe revisi&oacute;n de los mismos cada 6 meses, seg&uacute;n se ha realizado el a&ntilde;o pasado.</span></p>\r\n<p>17/09/2013(17:25h).- LLAMA JOSE A.MATILLA Y NOS INDICA QUE EL PORTON C/SAN NICOLAS ESTA ARREGLADO, PATIN COLOCADO, REVISADO Y FUNCIONANDO CORRECTAMENTE.</p>\r\n<p>&nbsp;</p>'),
	(115, 102, '2013-11-11', '2013-11-13', '2013-11-12', 2, '', 'PUERTA PORTAL', '<p><strong>11/11/2013.-&nbsp;</strong>NOS LLAMA LA VECINA DE VIZCAINA 20 2&ordm;A INFORMANDO QUE HACE MUCHO TIEMPO QUE LA PUERTA DEL PORTAL NO FUNCIONA BIEN, QUE QUEDA ABIERTA, AUNQUE APARENTEMENTE PAREZCA CERRADA ESTA ABIERTA, AL MARGEN QUE AUNQUE ESTE CERRADO CON UN GOLPE MEDIO SE ABRE SIN FALTA DE LLAVE. SE LE COMUNICA QUE NO TENIAMOS AQUI CONSTANCIA DE MAL FUNCIONAMIENTO DE ESA PUERTA, Y NOS INDICA QUE SEGURO QUE ALGUN VECINO (INGENIERO DIJO) SE ENCARGO DE "ARREGLAR" LA PUERTA, DEJANDOLA COMO LA DEJAN. QUIERE QUE SE ARREGLE XQ ULTIMAMENTE HAY MUCHO MENDIGO X LA ZONA Y NO QUIERE LLEVAR UN SUSTO ENCONTRANDOSELO EN EL PORTAL</p>\r\n<p>SE PASA CORREO A SYTEC</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 11 de noviembre de 2013 13:17<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> AVISO CTRA VIZCAINA 20 PUERTA PORTAL</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso la vecina de Ctra.Vizcaina 20 2&ordm;A, indicando que la puerta del portal queda abierta, no ajusta bien, a simple vista parece que cierra correctamente pero no es as&iacute;, hay que empujarla para que ajuste y cierre del todo, y a&uacute;n as&iacute;, nos comenta que con un golpe medianamente fuerte la puerta abre sin necesidad de llave. Por favor, pasarse por all&iacute;, comprobar que ocurre y solucionarlo. Gracias.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong>12/11/2013.- &nbsp;</strong>NOS LLAMA ANDRES DE SYTEC Y NOS DICE QUE:</p>\r\n<p class="MsoNormal">-AJUSTO LA PUERTA AMBAS HOJAS</p>\r\n<p class="MsoNormal">-SE PERCATO QUE EL BOMBIN ESTABA VACIO, ES DECIR, NO TIENE LAS GUIAS PUESTAS CORRECTAMENTE....(amaestramiento de sanpedro)LOS VECINOS QUE FUERON ENTRANDO ABRIERON PERFECTAMENTE CON SUS LLAVES, QUEDANDO EN ALGUNA OCASION LA LLAVE GIRADA PERO ABRIENDO, ANDRES DE SYTEC DICE QUE SABE CUANTO PUEDE DURAR ESO, PERO QUE ELLOS NO PUEDEN HACER NADA XQ NO TIENEN PERFIL NI AMAESTRAMIENTO DE ESA CERRADURA.</p>\r\n<p class="MsoNormal">-MUELLE PIERDE ACEITE, LO QUE SIGNIFICA QUE A MEDIDA QUE VAYA QUEDANDO SIN ACEITE IRA DANDO MAS GOLPE...(NOS PASA PRESUPUESTO DE MUELLE SYTEC)</p>\r\n<p class="MsoNormal">LA PUERTA QUEDO FUNCIONANDO CORRECTAMENTE.</p>\r\n<p class="MsoNormal">PTE. FACTURA SYTEC</p>\r\n<p class="MsoNormal">13/11/2013 factura y presupuesto recibida de sytec. Archivado en document.adjuntos.</p>'),
	(116, 113, '2013-11-11', '2013-11-19', NULL, 1, 'REF. 42364866', 'DAÑOS EN ANTENA TV COMUNITARIA', '<p>CON FECHA 11/11/13 LLAME A MUTUA DE PROPIETARIOS (902.500.033) PARA APERTURAR EXPEDIENTE EN EL SEGURO POR LOS DA&Ntilde;OS OCASIONADOS EL 4/11/13 EN ANTENA TV COMUNITARIA (FUENTE DE ALIMENTACI&Oacute;N MODULAR) COMO CONSECUENCIA DE UNA DESCARGA ELECTRICA. ME FACILITAN EL N&Uacute;MERO DE REFERENCIA QUE ES 42364866, Y QUE REMITA POR E-MAIL siniestros@mutuadepropietarios.es, EL PRESUPUESTO O FACTURA DE REPARACION.&nbsp;</p>\r\n<p>LLAME A TOM&Aacute;S DE ITELCO EL 11/11/13 Y LE SOLICITE ME REMITIERA UN PRESUPUESTO (AUNQUE YA EST&Aacute; REPARADO) EXPLICANDO LO QUE OCURRI&Oacute;. QUED&Oacute; EN REMITIRMELO POR E-MAIL ESTA TARDE.</p>\r\n<p><strong>14/11/2013(13:30H).-&nbsp;</strong>LLAMO EL PERITO BORJA CORTES PARA PREGUNTAR SI PODIA IR A VER LA REPARACION QUE SE HABIA HECHO Y SOLICITAR QUE SE LE MANDE LA FACTURA (DABA X ECHO QUE YA ESTABA SOLUCIONADO). LLAMARLE ESTA TARDE E INDICARLE LO QUE CORRESPONDA (PREGUNTAR A TOMAS SI LO QUE CAMBIO LO DEJO ALLI O LO TIRO, Y A SU VEZ QUE MANDE LA FACTURA DE ARREGLO) TFN. DE BORJA CORTES 677.974.801, LLAMARLE, SI NO LO COGE ES QUE ESTA MUY LIADO, DEJARLE AVISO EN EL BUZON Y NOS DEVUELVE LA LLAMADA.</p>\r\n<p><strong>14/11/13</strong>.- (15.35).- LLAME A BORJA EL PERITO LE COMENT&Eacute; QUE SE HABIA REPARADO PORQUE LOGICAMENTE NO SE PODIA TENER MUCHOS DIAS SIN VER TV A LOS VECINOS, NO OBSTANTE EL TECNICO ME FACILITO EL PRESUPUESTO QUE LUEGO SERA FACTURA, Y LA PIEZA QUE CAMBIO LA DEJO ALLI, ME DIJO QUE LE REMITIERA POR E-MAIL ESE PRESUPUESTO Y QUE PASARIA A VERLO. E-MAIL es borja@jbdcortesperitaciones.com. TAMBIEN REMITI E-MAIL A MUTUA DE PROPIETARIOS CON EL PRESUPUESTO.</p>\r\n<p><strong>22/11/13.</strong>- (16.55) LLAME A MUTUA PROPIETARIOS ME DICEN QUE EL PRESUPUESTO ESTA ACEPTADO Y QUE PROCEDERAN A ABONAR LA INDEMNIZACI&Oacute;N PARA EL LUNES O EL MARTES 26 DE NOVIEMBRE 2013. COMPROBAR EL ABONO PARA CERRAR EL AVISO Y PTE FACTURA DE TOMAS.</p>\r\n<p>&nbsp;</p>'),
	(117, 114, '2013-11-11', '2013-11-14', '2013-11-14', 2, '', 'SEÑAL ANTENA TV (TDT)', '<p><strong>11/11/2013.-&nbsp;</strong>EL 09/11/2013 SE RECIBE CORREO (AL CORREO DE ALGONZ) DE VECINO CARMEN AMAYA 1 2&ordm;A INDICANDO QUE NO VE LOS CANALES DEL 35 Y 32 TELEVES.</p>\r\n<p>CON FECHA 15/12/2011 SE RECIBE CORREO A LA PAG.ALGONZ DEL MISMO PROPIETARIO INDICANDO EL MISMO PROBLEMA, PROCEDIENDO POR PARTE DE ITELCO A LA SUSTITUCION DE AMPLIFICADORES DA&Ntilde;ADOS DE CANAL 32 Y CANAL 35 TELEVES (ARCHIVADO EN DOCUMENTS.ADJUNTOS FACTURA Y AVISO DE ESA FECHA).</p>\r\n<p>SE MANDA CORREO A ITELCO</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 11 de noviembre de 2013 17:45<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> RV: Problemas con la Antena de TV</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de propietario CP Carmen Amaya 1 2&ordm;A Javier, indicando que como ocurrio con fecha 15/12/2011, vuelve a no ver los mismos canales que entonces. Adjunto se remite factura de sustituci&oacute;n de amplificadores asi como aviso inicial del propietario. Por favor, pasarse por la comunidad para revisar este tema y dejarlo solucionado. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Asesoria Algonz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Tfn/Fax.- 985.14.98.36</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;"><a href="mailto:administrativo@algonz.es">administrativo@algonz.es</a></span></p>\r\n<p class="MsoNormal">&nbsp;<strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> ASESORIA ALGONZ [mailto:soporte@cosmomedia.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> s&aacute;bado, 09 de noviembre de 2013 19:28<br /> <strong>Para:</strong> angeles@algonz.es<br /> <strong>Asunto:</strong> Mail enviado desde el formulario contactar de la web asesoria algonz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span></p>\r\n<table class="MsoNormalTable" style="width: 583px; background-color: #dee1e5; height: 551px; background-position: initial initial; background-repeat: initial initial;" border="0" width="100%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="padding: 0cm 0cm 0cm 0cm;" valign="top">\r\n<div align="center">\r\n<table class="MsoNormalTable" style="width: 450.0pt; mso-cellspacing: 0cm; background: #474C54; mso-padding-alt: 0cm 0cm 0cm 0cm;" border="0" width="600" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes; height: 93.0pt;">\r\n<td style="width: 450.0pt; padding: 0cm 0cm 0cm 0cm; height: 93.0pt;" width="600">\r\n<p class="MsoNormal" style="text-align: center; line-height: 15.0pt;" align="center"><strong><span style="font-size: 8.0pt; color: white;">Mail enviado desde el formulario Contactar</span></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p class="MsoNormal" style="text-align: cen