s="MsoNormal" style="text-align: center;" align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>14/11/2013.-&nbsp;</strong>SE LLAMA A DAVID DE ITELCO, QUE FUE A REVISAR ESTE TEMA Y NOS INDICA QUE LOS AMPLIFICADORES COLOCADOS EN INICIO ESTABAN BIEN, PERO SE PERCATO QUE LAS CABECERAS DE LOS MISMOS ESTABAN MAL REGULADAS, ESTUVO REGULANDO LAS DE LOS 3 PORTALES Y LO DEJO FUNCIONANDO CORRECTAMENTE.</p>\r\n<p>AUN ASI NOS INFORMA QUE EL CANAL 28 Y TELEDEPORTE EMPIEZA A FALLAR (LOS AMPLIFICADORES ESTAN MAL) Y NO SABE CUANTO TIEMPO PUEDEN DURAR. DE MOMENTO SE VEN Y QUEDARON FUNCIONANDO.</p>\r\n<p>SE LLAMA A LOS AFECTADOS PARA QUE NOS INDIQUEN SI TODO VA BIEN:</p>\r\n<p>C.A.1 2&ordm;A TODO OK</p>\r\n<p>&nbsp;</p>'),
	(118, 115, '2013-11-11', '2013-11-14', '2013-11-14', 2, '', 'LUMINARIAS PLANTA -1', '<p><strong>11/11/2013.- &nbsp;</strong>NOS INFORMA EL VICEPTE. HERIBERTO INDICANDO Q UN VECINO LE HA INFORMADO QUE LAS LUMINARIAS DE LA PLANTA -1 LLEVA UNA SEMANA ENCENDIDA DE CONTINUO.</p>\r\n<p>SE MANDA CORREO A ITELCO PARA QUE SE PASEN</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9pt; font-family: Tahoma;">&nbsp;Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Tahoma;"><strong>Enviado el:</strong>&nbsp;lunes, 11 de noviembre de 2013 18:46<br /><strong>Para:</strong>&nbsp;\'Itelco\'<br /><strong>Asunto:</strong>&nbsp;AVISO CP CARMEN AMAYA 2 PLANTA -1 SOTANO</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del vicepte. de&nbsp;</span>la comunidad Heriberto<span style="font-family: Arial; font-size: 9pt;">&nbsp;c/Carmen Amaya 2 2&ordm;E, indicando que un vecino le notifico que todas las luminarias de la planta -1 del garaje llevan una semana encendidas de continuo. Por favor, pasarse por all&iacute; para revisar que ocurre y solucionarlo. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong>&nbsp;</p>\r\n<p>&nbsp;<strong>14/11/2013.-&nbsp;</strong>LLAMAMOS A ITELCO, DAVID QUE REALIZO LOS TRABAJOS, NOS INDICA QUE EL PROBLEMA ERA QUE EL RELOJ TEMPORIZADOR ESTABA ESTROPEADO Y X ESO QUEDABAN LAS LUCES FIJAS CONSTANTES. LO CAMBIO Y DEJO LAS LUMINARIAS FUNCIONANDO OK.</p>\r\n<p><strong>12:05H.-&nbsp;</strong>SE LLAMA A HERIBERTO 985.155.901, NOS COGE EL TFN SU MUJER, SE LE EXPLICA TODO EL TEMA Y NOS DICE QUE YA SE LO DICE ELLA A HERIBERTO.</p>\r\n<p>SE CIERRA EL EXPTE.</p>\r\n<p>&nbsp;</p>'),
	(119, 116, '2013-09-26', '2013-09-27', '2013-09-26', 2, '', 'AGUA SUCIA Y/O FALTA DE LA MISMA', '<p><strong>26/09/2013.- &nbsp;</strong>NOS LLAMA EL VECINO DEL OXIDO EN LA LAVADORA 629.347.674 7&ordm;A JOSE MARIA, INDICANDO QUE ESTA SIN AGUA, Y QUE EL OTRO DIA LE SALIA MUY SUCIA, DABA IGUAL EL TIEMPO QUE LA DEJARA CORRER</p>\r\n<p>SE LLAMA A PRYMASTUR 985.160.625 / 667.425.274 PABLO Y NOS INDICA QUE ESTUVIERON ALLI REVISANDO LAS CALDERAS Y QUE VE RARO QUE ESTEN SIN AGUA, VA A LLAMAR AL TECNICO Y NOS LLAMA.</p>\r\n<p>NOS LLAMA PABLO PRYMASTUR Y NOS DICE QUE EL AGUA SUCIA PUEDE SER XQ ESTUVIERON HACIENDO LA REVISION (PRESURIZANDO LOS VASOS) &nbsp;Y QUE LA TUBERIA ESTUVIERA CON SUCIEDAD Y SALGA X LOS GRIFOS, Y LO DE QUEDAR SIN AGUA ES X EL MISMO MOTIVO, QUE CORTA EL AGUA PARA HACER LA REVISION, PERO QUE DURA UN MOMENTO.&nbsp;</p>\r\n<p>SE LLAMA AL VECINO Y SE LE INFORMA DE TODO, QUEDO OK</p>'),
	(120, 116, '2013-11-08', '2013-11-15', '2013-11-20', 2, '', 'RUIDO EN LAS TUBERIAS', '<p><strong>07/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DEL VECINO <strong>8&ordm;D JULIO 984.192.201</strong> INDICANDO QUE LAS TUBERIAS HACEN UN RUIDO EXAGERADO, QUE LLEVA +/- UNOS DOS MESES CON ESE RUIDO. LO NOTAN MUCHO MAS CUANDO LOS VECINOS ABREN LOS GRIFOS, QUE LE RETUMBA TODA LA CASA.</p>\r\n<p>VA A PREGUNTAR A LOS VECINOS COLINDANTES Y DE LETRA PARA VER SI TIENEN EL MISMO PROBLEMA Y QUE NOS INFORMA PARA ASI PODER LLAMAR A <strong>PRYMASTUR (985.160.615 / 610.719.616 PABLO)</strong></p>\r\n<p><strong>12/11/2013.-&nbsp;</strong>VIENE EL VECINO DEL 8&ordm;D JULIO PARA INFORMAR QUE ESTUVO PREGUNTANDO Y QUE EL 7&ordm;D; 8&ordm; C Y D; 9&ordm;D; 10&ordm;D TIENEN EL MISMO PROBLEMA QUE &Eacute;L. QUIERE QUE SE REVISE XQ PUEDE SER QUE SEA UNA BOMBA DE AIRE O ALGO PEOR QUE PUEDA LLEGAR A DA&Ntilde;AR LAS TUBERIAS.</p>\r\n<p><strong>12/11/2013(10:20H).-&nbsp;</strong>SE LLAMA A PABLO DE PRYMASTUR PARA INDICARLE LA PROBLEMATICA CON LAS TUBERIAS Y QUE LO REVISEN ANTES QUE VAYA A MAS. NOS DICE PABLO (COMO SIEMPRE.....) QUE LE PARECE RARO XQ UN TRABAJADOR SUYO VIVE AHI Y NO LE COMENTO NADA &iquest;&iquest;&iquest; SE LE DICE QUE PUEDE QUE NO VIVA EN LA MISMA LETRA O EN LOS PISOS DE ARRIBA O SIMPLEMENTE QUE NO SE LO HAYA DICHO, PERO QUE EL PROBLEMA ESTA AHI Y TIENEN QUE SOLUCIONARLO</p>\r\n<p>SE PASAN X LA CDAD Y NOS INFORMAN CON LO QUE SEA.</p>\r\n<p><strong>14/11/2013(13:15H).-&nbsp;</strong>SE DEJA AVISO EN EL CONTESTADOR DE PABLO</p>\r\n<p><strong>19/11/2013(11:15h).- &nbsp;</strong>SIN NOTICIAS DE PRYMASTUR, HA VUELTO A LLAMAR EL VECINO Y QUIERO UNA SOLUCI&Oacute;N HOY.</p>\r\n<p>SE DEJA AVISO EN EL CONTESTADOR DEL MOVIL DE PABLO Y SE LLAMA A LA OFICINA 985.160.625, NOS PASAN CON PABLO EL CUAL NOS INDICA QUE VA A ENVIARNOS UN CORREO CON EL PROBLEMA QUE ESTUVIERON MIRANDO, ENTRE ELLOS EL TRABAJADOR VECINO DE LA CDAD. QUE VIVE EN EL 9&ordm; Y NOS DICE PABLO DE PRYMASTUR QUE ES PROBLEMA DE UNA CISTERNA...&iquest;&iquest;??, QUE YA LES OCURRIO EN OTRA CDAD Y ERA ESO, NO OBSTANTE QUE TB OBSERVARON QUE UNA BOMBA HACE UN LIGERO RUIDO DEBIDO A DESGASTE DE LOS RODAMIENTOS, LOS CUALES PROCEDERAN A CAMBIAR UNA VEZ PASEN ESTOS DIAS (QUE AHORA SE LE ESTA DANDO MUCHO USO INICIAL X EL FRIO Y NO ES CONVENIENTE PARARLA)</p>\r\n<p>ANTE LA DISCREPANCIA EN LA CAUSA DE LOS RUIDOS SE QUEDA CON PABLO EN QUE HOY 19/11/2013 A LAS 15:00HRS. PASAN X CASA DEL VECINO AFECTADO JULIO 8&ordm;D PARA DETERMINAR CAUSA Y SOLUCION DE LOS MISMOS, SE AVISA AL VECINO AFECTADO <strong>JULIO 626.523.663</strong>&nbsp;PARA QUE ESTE ALGUIEN EN EL DOMICILIO A ESA HORA, NOS DA EL OK., ASIMISMO SE SOLICITA QUE UNA VEZ EFECTUADA DICHA VISITA NOS LLAMEN PARA EXPLICARNOS.<strong>&nbsp;</strong></p>\r\n<p><strong>20/11/2013.-&nbsp;</strong> NOS LLAMA JULIO 8&ordm;D, INDICANDO QUE AYER ESTUVO EL VECINO QUE TRABAJA EN PRYMASTUR EN SU VIVIENDA REVISANDO LO DEL RUIDO Y LE INSISTIO Y DETERMINO QUE ESE RUIDO ERA DE CISTERNA, EL AFECTADO 8&ordm;D, AJUSTO EL LLENADO DE LA MISMA (EN SU CASA) Y CAMBIO UNA GOMA Y EFECTIVAMENTE DICE QUE AHORA NO TIENE NINGUN TIPO DE RUIDO, DESDE AYER QUE LO HIZO NO HA VUELTO A TENER RUIDOS. NOS COMENTA QUE LO VA A VIGILAR PERO QUE EN PRINCIPIO EL PROBLEMA ESTA SOLUCIONADO, ERA DE LA CISTERNA DE LA PROPIA VIVIENDA.</p>'),
	(121, 117, '2013-11-12', '2013-11-14', '2013-11-14', 2, '', 'MICRO 3ºA', '<p><strong>12/11/2013.-&nbsp;</strong> NOS HA LLAMADO LA VECINA DE CARMEN AMAYA 1 3&ordm;A INDICANDO QUE SU MICRO CUANDO TOCAN ABAJO NO SUENA NI ABAJO NI ARRIBA EN SU CASA, Y QUE CUANDO SUENA TAMPOCO LE ABRE.</p>\r\n<p>SE LLAMA A ITELCO PARA PREGUNTARLE QUE CUANDO FUERON A HACER LOS TRABAJOS EN EL PISO 4&ordm;C ME INDICO TOMAS QUE HABIAN SANEADO LA BOTONERA Y COMPROBADO APERTURA EN CERRADURA, ASI COMO APERTURA DESDE EL PISO. QUE SI VOLVIERA A FALLAR HABRIA QUE LLAMAR AL CERRAJERO.</p>\r\n<p><strong>12/11/2013.-&nbsp;</strong>NOS LLAMA LA VECINA DEL 3&ordm;A INDICANDO QUE NO LE FUNCIONA EL MICRO, QUE NO LE SUENA ABAJO NI EN CASA CUANDO LE PICAN AL TIMBRE ABAJO, Y QUE EN OCASIONES TAMPOCO LE ABRE.</p>\r\n<p>SE LLAMA X TFN A TOMAS ITELCO PARA QUE SE PASE A REVISARLO, VIENE DAVID A BUSCAR LAS LLAVES PARA SOLUCIONAR EL TEMA DE LA TV Y LUMINARIAS DE CARMEN AMAYA Y DE PASO MIRAR QUE OCURRE CON ESTE TIMBRE.</p>\r\n<div dir="ltr"><strong><span style="background-color: #00ccff;">14/11/13.-</span></strong> NOS AVISA SUSANA RODRIGUEZ //HOLA SOY VECINA DEL PORTAL 1 DEL PISO 3&ordm;C DE LA CALLE CARMEN AMAYA QUERIA DAR AVISO DE QUE DESDE CASA NO ME ABRE LA PUERTA DEL PORTAL&nbsp; DEBO TENER MAL EL TERMINAL.CON EL FIN DE QUE PASEN A MIRARMELO YA QUE CADA VEZ QUE PICAN HE DE BAJAR A&nbsp; ABRIR LA PUERTA DEL PORTAL .TE MANDO UN SALUDO Y TE DOY LAS GRACIAS.</div>\r\n<div dir="ltr">&nbsp;</div>\r\n<div dir="ltr"><strong>14/11/2013.-&nbsp;</strong>SE LLAMA A ITELCO (DAVID) Y NOS INFORMA QUE ESTUVO LIMPIANDO LAS BOTONERAS DE LA PLACA PARA QUE HICIERAN CONTACTO CORRECTAMENTE Y QUE SE PERCATO QUE LA PUERTA DEL PORTAL, LA PARTE QUE QUEDA FIJA ESTA DESAJUSTADA, ES DECIR, ESTA SUELTA Y ESO OCASIONA QUE LA PUERTA AL CERRAR NO HAGA EL CONTACTO SUFICIENTE EN LA CERRADURA, POR LO TANTO PUEDE SER ESE EL PROBLEMA DEL XQ NO ABRE LA PUERTA DESDE LOS MICROS DE LAS CASAS, YA QUE LA CUESTION ELECTRICA ESTA CORRECTA.&nbsp;</div>\r\n<div dir="ltr"><strong>SE ABRE SINIESTRO CON CERRAJERIA.</strong></div>'),
	(122, 118, '2013-11-12', '2013-11-14', NULL, 1, '', 'CUADRO DE BOMBAS GARAJE PLANTA -2', '<p><strong>12/11/2013.-&nbsp;</strong>NOS LLAMA JOSE MANUEL DE VELAZQUEZ 22 985.14.11.76, INDICANDO QUE EL CUADRO DE AUTOMATICOS DE LAS BOMBAS QUE ESTA EN EL GARAJE PLANTA -2 LLEVA +/- UNA SEMANA CON UN PILOTO ROJO DE SOBRECALENTAMIENTO ENCENDIDO. NO ES CAPAZ DE LOCALIZAR AL REPRESENTANTE DEL PORTAL POR ESO NOS LLAMA EL.</p>\r\n<p>SE LLAMA A EDUARDO DE ESPA QUE FUE EL QUE REALIZO EL MANTEMIENTO DE LAS MISMAS HACE POCO.</p>\r\n<p><strong>12/11/2013(18:40H).-&nbsp;</strong>LLAMADA A EDUARDO 666.765.995. QUE SE PASA MA&Ntilde;ANA A BUSCAR LAS LLAVES PARA IR A VER QUE OCURRE. NOS DICE QUE ES EL PILOTO DE SENSORES, QUE ESO HA TENIDO QUE SER Q X ALGUN MOTIVO UNA DE LAS BOMBAS HA DEJADO DE FUNCIONAR Y QUE SI TODO VA BIEN LA OTRA DEBERIA ESTAR FUNCIONANDO.</p>\r\n<p><strong>14/11/2013(17:20h).-&nbsp;</strong>SE HABLA CON EDUARDO QUE VA AHORA ESTA TARDE, NOS LLAMA CON LO QUE SEA.</p>\r\n<p><strong>14/11/2013 (20:00h).- &nbsp;</strong>NOS LLAMA EDUARDO PARA INFORMARNOS QUE LA BOMBA GRANDE DEL -2 (QUE ES UNA BOMBA MUY CARA Y MUY BUENA) ESTA LLENA DE OXIDO Y MAL, EL MOTOR PARECE QUE LO TIENE QUEMADO (NO HACE NINGUN RUIDO), EL FOSO ESTA LLENO DE SUCIEDAD, SE HAN LLEVADO LA BOMBA PARA EL TALLER Y VA A PRESUPUESTAR PARA SU ARREGLO Y/O LA COLOCACI&Oacute;N DE UNA BOMBA NUEVA DE NO SER RENTABLE.</p>\r\n<p>QUEDO LA OTRA BOMBA FUNCIONANDO CORRECTAMENTE (LA CUAL INSTALO &Eacute;L, EDUARDO ESPA, HACE +/- UN A&Ntilde;O).</p>\r\n<p>QUEDAMOS A LA ESPERA DE RECIBIR PRESUPUESTO.</p>\r\n<p><strong>18/11/2013.-&nbsp;</strong>NOS LLAMA EDUARDO DE ESPA 666.765.995, NOS INDICA QUE EL MOTOR ESTA QUEMADO, HA PEDIDO PRESUPUESTO DE LAS PIEZAS DE ESA BOMBA CONJUNTAMENTE CON MOTOR NUEVO Y LOS PRESUPUESTOS SON:</p>\r\n<p>* MOTOR NUEVO Y PIEZAS A SUSTITUIR SOBRE LA BOMBA QUE ESTA INSTALADA (MARCA Y BOMBAS CARAS) 854,00+IVA</p>\r\n<p>* BOMBA NUEVA CON MOTOR Y DEMAS IGUAL QUE LA INSTALADA ACTUALMENTE 1.285,00 + IVA</p>\r\n<p>*BOMBA NUEVA CON MOTOR MARCA QUE TRABAJA EDUARDO DE ESPA CON LA MISMA CAPACIDAD QUE LA INSTALADA ACTUALMENTE (2 CABALLOS DE POTENCIA) + MANO DE OBRA TANTO DE DESISTALACION DE LA VIEJA E INSTALACION DE LA NUEVA + IVA 1.000,00</p>\r\n<p>SE COMENTA CON M&ordf; DE LOS ANGELES Y NOS DICE QUE SU OPINION ES LA COLOCACION DE BOMBA NUEVA DE ESPA, NO OBSTANTE QUE SE LLAME A <strong>GRACIELA (PTE.) 609.370.743</strong> PARA COMENTARLE TODO EL TEMA QUE ESTE INFORMADA Y DE SU PUNTO DE VISTA</p>\r\n<p><strong>18:15H.-&nbsp;</strong> SE LLAMA X TFN A GRACIELA Y NO COGE EL TFN.</p>\r\n<p><strong><span style="background-color: #00ccff;">21/11/2013.- 10:30h</span></strong><span style="background-color: #00ccff;"><span style="background-color: #ffffff;">&nbsp;He llamado a Graciela para informarle de que hoy proceder&aacute; Javier de Fedecor a darnos unas peque&ntilde;as explicaciones del port&oacute;n y aprovech&eacute; y le toque el tema de la Bomba me dice que si que si hay que colocarla que se realice la reparaci&oacute;n. <strong><span style="color: #000080;">Ser&iacute;a conveniente tener dos propuestas Paz y mejor ser&iacute;a que tengan las mismas prestaciones para que sean comparativas.</span></strong></span></span></p>\r\n<p>BOMBA INICIAL MODELO LOWARA DFC (2 CABALLOS potencia)</p>\r\n<p>Bomba que coloca Espa Eduardo SENIC (+/- 2 CABALLOS potencia)</p>\r\n<p>TRIFASICO (NOS INDICA EDUARDO Q TB SERVIRIA MONOFASICA, YA QUE ESE MODELO ADMITE AMBAS)</p>\r\n<p><span style="background-color: #00ffff;"><strong>25/11/2013.-&nbsp;</strong></span>&nbsp;X TFN CON JOSE GESAL SE SOLICITA PRESUPUESTO DE DICHA BOMBA CON LAS MISMAS CARACTERISTICAS DE LA QUE SE ESTROPEO, NOS DICE QUE BUSCARA UNA SIMILAR EN LA MISMA CASA (EL MODELO QUE LE HEMOS FACILITADO ES MUY PROBABLE QUE ESTE DESCATALOGADO) Y TB NOS PASARA PRESUPUESTO DE OTROS DOS MODELOS DE IGUALES CARACTERISTICAS.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
	(123, 119, '2013-11-13', '2013-11-29', NULL, 1, '', 'PINTURA SOPORTALES ', '<p>EXPTE. TRANSFERIDO DE OUTLOOK.(archivado en documnts.adjuntos)</p>\r\n<p>SOLICITUD REALIZADA EN LA JUNTA DE FECHA 26/09/2012&nbsp;</p>\r\n<p>Solicitan pedir presupuesto para la pintura de los soportales y barandillas y las puertas de contadores situadas en estos soportales.&nbsp;</p>\r\n<p>EN JUNTA DE FECHA 24/10/2013 SE DETERMINA</p>\r\n<p>&nbsp;<strong style="text-align: justify; font-size: 11px;"><span style="font-size: 10.0pt; font-family: Verdana;">3&ordm; Presentaci&oacute;n y aprobaci&oacute;n de presupuestos para la pintura de los soportales, barandillas y puertas contadores exteriores de los portales.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Se presentan varias propuestas que detallamos a continuaci&oacute;n:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp;</span><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Verdana;">Pinturas Rendueles:</span></span><span style="font-size: 10.0pt; font-family: Verdana;"> Incluye pintura techo soportal, barandillas, &nbsp;puertas exteriores y puerta de acceso peatonal por las escaleras. Importe a pagar 2.277&euro;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Verdana;">Pinturas Jos&eacute; Antonio Leonardo:</span></span><span style="font-size: 10.0pt; font-family: Verdana;"> Incluye pintura techo soportal, barandillas, puertas exteriores y puerta de acceso peatonal por las escaleras. Importe a pagar 2.065,89&euro;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Verdana;">Pinturas Fco. Javier Ordieres Prieto:</span></span><span style="font-size: 10.0pt; font-family: Verdana;"> Incluye pintura techo soportal, barandillas, puertas exteriores y puertas de acceso peatonal por las escaleras. Importe a pagar 1.386,00&euro;.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Verdana;">Decoraciones Chus:</span></span><span style="font-size: 10.0pt; font-family: Verdana;"> Incluye pintura techo soportal, barandillas, puertas exteriores y puerta de acceso peatonal por las escaleras. Importe a pagar 2.904,00&euro;.&nbsp; </span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Verdana;">Rendueles Proyectos y Reforma: </span></span><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp;Incluye pintura techo soportal, barandillas, puertas exteriores y puerta de acceso peatonal por las escaleras. Importe a pagar 4.939,00&euro;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;">SE PRESENTA A VIPASA EL COMPARATIVO DE PRESUPUESTOS INDICANDO QUE EL ELEGIDO X LA CDAD. ES PINTURAS RENDUELES &nbsp;(archivado en docuemnts.adjuntos)</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;"><strong>13/11/2013.-&nbsp;</strong>SE ENVIO DOCUMENTACION A VIPASA X CORREO ELECTRONICO Y X CORREO NORMAL.&nbsp;<br /></span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.0pt; font-family: Verdana;">QUEDAMOS PTES. DE SU AUTORIZACI&Oacute;N.</span></p>'),
	(124, 120, '2013-11-13', '2013-11-27', NULL, 1, '', 'COLOCACION DE MALLAS EN CHIMENEAS', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">EN JUNTA DE FECHA 24/10/2013.-</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="text-indent: -18pt; font-size: 10pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; font-size: 10pt; font-family: Verdana;">Colocaci&oacute;n de mallas en las chimeneas de&nbsp;la Comunidad.&nbsp;Se&nbsp;llevan dos propuestas una propuesta por importe de 1091,73&euro; de Reformas Jos&eacute; Antonio Leonardo y otra por importe de 871,00&euro; de Pinturas Chus. Esta solicitud se realiza con el fin de que no entren palomas por las chimeneas. Explic&oacute; un vecino que en su vivienda hubo que retirar del conducto de la caldera una paloma muerta. Es aprobada por todos los presentes la realizaci&oacute;n de esta obra con fondos de&nbsp;la Comunidad. Se&nbsp;colocaran mallas galvanizadas y electrosoldadas en 18 chimeneas que posee el edificio.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="text-indent: -18pt; font-size: 10pt; font-family: Verdana;"><strong>13/11/2013.-&nbsp;</strong>SE MANDA CORREO A VIPASA CON PRESUPUESTO PARA SU AUTORIZACION DE TRABAJOS (archivado en documents.adjuntos)<br /></span></p>'),
	(125, 121, '2013-11-13', '2013-11-27', NULL, 1, '', 'PUERTA PEATONAL ACCESO A GARAJE', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">EN JUNTA DE FECHA 24/10/2013.-</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">Tema reparaci&oacute;n puerta acceso peatonal por las escaleras al Garaje. Se llevan propuestas de reparaci&oacute;n y propuestas de cambio de la puerta en su conjunto. Determinando por unanimidad de los asistentes reparar la puerta, presupuesto compuesto por el saneado e instalaci&oacute;n de chapas de acero inoxidable con tornillos pasantes y remaches en la parte inferior de la puerta. Importe de la reparaci&oacute;n 122,34&euro;, y los fondos se tomaran de la liquidez de la Comunidad.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;"><strong>13/11/2013.-&nbsp;</strong>SE ENVIA SOLICITUD E INFORMACION DE EJECUCION DE TRABAJOS A VIPASA (Archivado en documentos adjuntos).<br /></span></p>'),
	(126, 122, '2013-11-13', '2013-11-27', NULL, 1, '', 'LIMPIEZA DE TEJADO Y SELLADO DE CLARABOYAS', '<p>EN JUNTA DE FECHA 24/10/2013 SE DETERMINA QUE:</p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).&nbsp;</span></strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">Tema revisi&oacute;n tejado y sellar claraboyas. Se aprueba realizar trabajos con Astur-Obras por importe de 233,86&euro;. Los fondos para la realizaci&oacute;n de obra se tomaran de los fondos de la Comunidad.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">13/11/2013.-</span></strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">&nbsp;SE ENVIA PROPUESTA DE TRABAJO A VIPASA PARA SU APROBACION. LOS TRABAJOS SE REALIZAN IGUAL, YA QUE EL CARGO IRA CON FONDOS DE LA CDAD.</span></p>'),
	(127, 123, '2013-11-13', '2013-11-27', NULL, 1, '', 'SOLICITUD A EMULSA DE CEPOS EN ALCANTARILLAS', '<p><strong>EN JUNTA DE FECHA 24/10/2013 SE DETERMINA QUE:</strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="font-family: Verdana; font-size: 9pt; text-indent: 30pt;">Quiere que se act&uacute;e en cuanto al Tema de Ratas, comentan que se ha observado transito de las mismas por las instalaciones del Garaje. En principio se avisar&aacute; a Emulsa para que coloque cepos por las alcantarillas, pero tambi&eacute;n se solicita a los vecinos revisar sus trasteros y retirar cualquier tipo de comida, papeles, que pueda ayudar a que las mismas hagan el h&aacute;bito de entrar en esa estancia.</span><span style="font-family: Verdana; font-size: 9pt; text-indent: 30pt;">&nbsp;&nbsp;</span><span style="font-family: Verdana; font-size: 9pt; text-indent: 30pt;">De persistir las ratas solicitamos den aviso para pedir propuestas y proceder a realizar alguna actuaci&oacute;n que nos indique los t&eacute;cnicos competentes en este tipo de plagas.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;"><strong style="font-size: 11px;"><span style="font-size: 9pt; font-family: Verdana; color: blue;">PAZ: DAR AVISO A EMULSA Y SI ALGUN VECINO SE SIGUE QUEJANDO DE ESTE TEMA PUES PEDIR PROPUESTAS PARA &nbsp;PONDERAR QUE SOLUCION SE LE PUEDE DAR. EL PROBLEMA ESTA EN QUE LOS TRASTEROS TIENEN AGUJEROS Y COMO NO TODOS DEBEN SER LIMPIOS Y ORGANIZADOS A SABER QUE HAY DENTRO Y A LAS RATAS LES PUEDE GUSTAR</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;">EMULSA.-</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;">TFN.- 985.181.450</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;">emulsa@emulsa.org</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;"><strong><span style="background-color: #ffcc99;">13/11/2013.-</span>&nbsp;</strong> CORREO ENVIADO A EMULSA</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;">&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> mi&eacute;rcoles, 13 de noviembre de 2013 18:32<br /> <strong>Para:</strong> \'EMULSA\'<br /> <strong>Asunto:</strong> SOLICITUD COLOCACION DE CEPOS CP CIGARRERES 40-42-44</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal" style="margin-top: 5.0pt; margin-right: 0cm; margin-bottom: 5.0pt; margin-left: 0cm; text-indent: 35.4pt; text-autospace: none;"><span style="font-size: 8.0pt; font-family: Arial;">Solicitamos a trav&eacute;s de la presente la instalaci&oacute;n de cepos para eliminaci&oacute;n de roedores en la comunidad CP C/LES CIGARRERES 40-42-44, vistos por los vecinos de la zona tanto en la parte de "jard&iacute;n" (enredaderas que sobresalen de pl&aacute;stico negro, por donde parece se meten los roedores), como en la parte de garaje (por zona de veh&iacute;culos y trasteros). Este tema es recurrente, ya que tambi&eacute;n se han localizado (tienen un seguimiento de cepos en ella) por la comunidad adyacente de Cigarreres 46-48-50-52-54. Por favor, se solicita apliquen el producto o el m&eacute;todo m&aacute;s eficaz que tengan. Gracias.</span></p>\r\n<p class="MsoNormal" style="margin-top: 5.0pt; margin-right: 0cm; margin-bottom: 5.0pt; margin-left: 0cm; text-indent: 35.4pt; text-autospace: none;"><span style="font-size: 8.0pt; font-family: Arial;">A la espera de sus noticias, atentamente</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;"><span style="background-color: #ffcc00;"><strong>19/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;CORREO RECIBIDO DE EMULSA</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30pt;"><strong><span style="font-size: 8pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;">&nbsp;EMULSA [mailto:emulsa@emulsa.org]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Tahoma;"><strong>Enviado el:</strong>&nbsp;martes, 19 de noviembre de 2013 10:26<br /><strong>Para:</strong>&nbsp;\'Algonz.Paz\'<br /><strong>Asunto:</strong>&nbsp;RE: SOLICITUD COLOCACION DE CEPOS CP CIGARRERES 40-42-44</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">Estimada se&ntilde;ora:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">En relaci&oacute;n a su petici&oacute;n, le informamos que:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">El servicio de desratizaci&oacute;n de EMULSA ha procedido a colocar cebos en los conductos de saneamiento que seran revisados peri&oacute;dicamente para valorar su efectividad.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">Reciba un cordial saludo</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30.0pt;">&nbsp;</p>\r\n<table class="MsoNormalTable" style="height: 187px;" border="0" width="200" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="height: 18pt;">\r\n<td style="padding: 0cm; height: 18pt;">\r\n<p class="MsoNormal"><span style="font-size: 8pt; color: navy;">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr style="height: 18pt;">\r\n<td style="padding: 0cm; height: 18pt;">\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">&nbsp; &nbsp;&nbsp;&nbsp;<a title="blocked::mailto:emulsa@emulsa.org" href="mailto:emulsa@emulsa.org"><span style="color: #2d6ea8; text-decoration: none;">emulsa@emulsa.org</span></a></span></p>\r\n</td>\r\n</tr>\r\n<tr style="height: 18pt;">\r\n<td style="padding: 0cm; height: 18pt;">\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp; Atenci&oacute;n ciudadana</span></p>\r\n</td>\r\n</tr>\r\n<tr style="height: 18pt;">\r\n<td style="padding: 0cm; height: 18pt;">\r\n<table class="MsoNormalTable" style="width: 150pt;" border="0" width="200" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="height: 18pt;">\r\n<td style="width: 75pt; padding: 0cm; height: 18pt;" width="100">\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp; T 985 181 450</span></p>\r\n</td>\r\n<td style="width: 75pt; padding: 0cm; height: 18pt;" width="100">\r\n<p class="MsoNormal"><span style="font-size: 8pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp; F&nbsp;985 181 490</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="MsoNormal">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>'),
	(128, 124, '2013-11-14', '2013-11-18', '2013-11-25', 2, '', 'RECARGA EXTINTOR 1ª PLANTA ', '<p><strong>14/11/2013.- &nbsp;</strong>CON FECHA 30/10/2013, NOS INFORMA EL VECINO DEL 1&ordm;F QUE TUVO UN INCENDIO EN SU COCINA. A FECHA DE HOY (14/11/2013) EL VECINO PERJUDICADO CAUSANTE NOS INFORMA QUE UTILIZO EL EXTINTOR DE PLANTA PARA APAGAR EL FUEGO Y QUE A FECHA ACTUAL NO ESTA REPUESTO. SOLICITA SE REPONGA CUANTO ANTES MEJOR X PRECAUCION.</p>\r\n<p><strong>14/11/2013 (12:40H).-&nbsp;</strong> SE LLAMA A SOCIEDAD EXTINTORES 902.511.474(MANTENIMIENTO DE EXTINTORES DE ESA CDAD.) PARA SOLICITAR LA RECARGA DE DICHO EXTINTOR, NOS INDICA EL CHICO QUE TIENE A LOS TECNICOS X GIJON Y QUE LES VA A DECIR QUE SE PASEN HOY Y QUE DEJEN UNO DE REPUESTO MIENTRAS SE HACE LA RECARGA DEL PRIMERO, SE LE PREGUNTA PRECIO Y NOS DICE QUE SON +/- 12,00.-&euro;</p>\r\n<p><strong>25/11/13</strong>.- LLAME A SOCIEDAD ASTURIANA DE EXTINTORES ME DICEN QUE YA ESTA RECARGADO EL EXTINTOR Y FACTURADO CON FECHA 18/11/13. SE DA POR CERRADA LA ACTUACION.</p>'),
	(129, 125, '2013-11-14', '2013-11-18', '2013-11-22', 2, '', 'AJUSTE PUERTA PORTAL', '<p><strong>14/11/2013.-&nbsp;</strong>A RAIZ DE AVISOS DE VECINOS DE CARMEN AMAYA 1 (3&ordm;A Y 3&ordm;C) INDICANDO QUE LA PUERTA DEL PORTAL NO LES ABRE DESDE LOS VIDEOPORTEROS, PASAMOS AVISO AL ELECTRICISTA EL CUAL NOS INDICA QUE NO ES PROBLEMA SUYO, QUE EN LA VISITA SE PERCATA QUE LA PARTE FIJA DE LA PUERTA DEL PORTAL ESTA DESAJUSTADA LO QUE OCASIONA QUE LA PARTE MOVIL DE LA PUERTA NO ENCAJE CORRECTAMENTE AL CERRAR CON LA CERRADURA Y NO RECOJA LA SE&Ntilde;AL DE APERTURA.</p>\r\n<p>SE MANDA CORREO A SYTEC PARA QUE PASEN A REGULAR LA PUERTA</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 14 de noviembre de 2013 13:55<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> CP PUERTA DEL SOL C/CARMEN AMAYA 1 AJUSTE DE PUERTA</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de propietarios de la comunidad indicada CP Puerta del Sol c/Carmen Amaya 1, pisos 3&ordm;A y 3&ordm;D, indicando que no pueden abrir la puerta del portal desde los videoporteros. Se procede a llamar al electricista, el cual informa que no es problema electrico pero que si se ve la parte fija de la puerta del portal desajustada y en consecuencia no hace el correcto ajuste al cerrar la cerradura. Por favor, pasarse por all&iacute; para ver que ocurre y solucionarlo, asimismo comprobar dicho arreglo con los vecinos afectados. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 9.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">22/11/2013.-&nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">FACTURA RECIBIDA DE SYTEC. ARCHIVADA EN DOCUMNTS.ADJUNTOS.</span></p>'),
	(130, 126, '2013-11-14', '2013-11-19', '2013-11-15', 2, '', 'SUENA UN PITIDO INTERMITENTE EN LA CENTRAL', '<p>14/11/2013.- ME LLAMAO JOSE ANTONIO EL HIJO DE RAQUEL INFORMANDOME QUE SUENA UN PITIDO INTERMITENTE EN LA CENTRAL DE INCENDIOS, PASO A LAS 4:00 DE LA TARDE POR LA COMUNIDAD Y NO ES UNA CENTRAL COMO TODAS A LAS QUE ESTOY ACOSTUMBRADA EN GARAJES POR LO QUE LLAMO DESDE EL GARAJE A EXTINOR Y LE COMENTO LOS PILOTOS QUE TENGO ENCENDIDOS, INDICANDOME DE EXTINOR QUE PASARAN POR LA COMUNIDAD, YA QUE DEBE SER UN DETERCOR DE CO2 AVERIADO O UN PULSADOR QUE ACTIVARON SIN DARSE CUENTA. LLAMO A JOSE ANTONIO AL MOVIL PARA INFORMAR QUE NO SE PREOCUPE QUE PASARAN LOS TECNICOS COMPETENTES POR LA COMUNIDAD DEL GARAJE PERO NO COGE EL TELEFONO.</p>\r\n<p><strong><span style="background-color: #3366ff;">ME INFORMAN QUE PASARAN HOY DE TARDE POR LA ADMINISTRACI&Oacute;N A RECOGER LLAVES Y PROCEDER A REVISAR LA INCIDENCIA</span></strong></p>\r\n<p><strong><span style="background-color: #ffffff;">14/11/2013 (20:00H).-&nbsp;</span></strong><span style="background-color: #ffffff;">LLAMA ISMAEL INDICANDO QUE YA ESTA SOLUCIONADO. QUEDO OK.</span></p>'),
	(131, 127, '2013-11-14', '2013-11-15', NULL, 1, '', 'DESATASCO EN INODORO ENTR.D', '<p><strong>14/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DEL PROPIETARIO ENTRESUELO D FRANCISCO 630.635.279 / MUJER SANDRA 696.245.712, INDICANDO QUE TIENE UN ATASCO EN EL INODORO DEL BA&Ntilde;O. ES LA PRIMERA VEZ QUE LE PASA.</p>\r\n<p>SE LLAMA A DESATASCOS GESAL JOSE 617.418.568 PARA INIDICARLE TODO EL TEMA, NOS DICE QUE VA A LLAMAR AL AFECTADO PARA VER COMO ESTA LA SITUACION Y VALORAR SI IR HOY O MA&Ntilde;ANA, SE&nbsp;<strong>LE HACE INCAPIE EN QUE TENGAN MUCHO CUIDADO A LA HORA DE PICAR, QUE RECUERDE QUE LA OTRA VEZ FUE MUY COMPLICADO LOCALIZAR LA BAJANTE CORRECTA.</strong></p>\r\n<p><strong>15/11/2013.-&nbsp;</strong>LLAMAMOS A GESAL PARA QUE NOS INFORME SOBRE EL ATASCO Y NOS DICE NORMA QUE EL ATASCO ERA PRIVATIVO, QUE LE HICIERON LA LIMPIEZA DESDE SU CASA, LE INFORMARON DE TODO AL AFECTADO Y QUEDO TOTALMENTE CONFORME, NOS COMENTA NORMA QUE EL VECINO NO SE NEGO A PAGARLO &Eacute;L, NO OBSTANTE DIJO QUE AL DAR NOSOTROS EL AVISO QUE NOS PREGUNTARAN PRIMERO X SI SE FACTURABA A NOMBRE DE LA COMUNIDAD Y LUEGO LO PAGABA &Eacute;L O COMO LO HACIA.</p>\r\n<p>PTE. HABLAR CON EL VECINO PARA DETERMINAR SI LO ABONA DIRECTAMENTE O SI LE HACEMOS EL CARGO EN CTA CONJUNTAMENTE CON LA CDAD., UNA VEZ QUE SE HAYA CONCRETADO ESTE PUNTO MANDAR CORREO A NORMA PARA VER SI TIENE Q FACTURAR A LA CDAD. O AL VECINO.</p>'),
	(132, 128, '2013-11-14', '2013-11-21', NULL, 1, '', 'RETIRADA PLACAS FACHADA C/MON 15', '<p><strong>12/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE VIRTUDES INDICANDO QUE ESTE FIN DE SEMANA CON EL VIENTO HAN VUELTO A VOLAR LAS PLACAS DE LA FACHADA DE LA C/MON N&ordm; 15 Y CAIDO EN LAS TERRAZAS DE SAN MATIAS 14.</p>\r\n<p><strong>14/11/2013.-&nbsp;</strong>SE MANDA CORREO A ADMO.CONTRUECES QUE SON LOS ADMINISTRADORES DE ESTA CDAD.</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 9.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 14 de noviembre de 2013 18:38<br /> <strong>Para:</strong> \'contruecesadmon@hotmail.com\'<br /> <strong>Asunto:</strong> AVISO PLACAS FACHADA C/MON 15 A/ATT. ANA</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 9pt; text-align: justify;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ponemos en contacto con vds. para solicitarles la retirada de las placas de fachada de la comunidad c/Mon n&ordm; 15, ca&iacute;das en las terrazas de la comunidad c/San Matias 12-14, asimismo, por favor, solicitamos la adecuaci&oacute;n de las mismas para evitar m&aacute;s caidas y evitar da&ntilde;os que estas pudieran causar, tanto a nivel personal como material. Gracias.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-family: Arial; font-size: 9pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, atentamente</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">19/11/2013.- &nbsp;</span></strong><span style="font-size: 9.0pt; font-family: Arial;">VIENE SUSANA ENTRESUELO 14 Y NOS INDICA QUE LAS PLACAS SIGUEN EN LA TERRAZA, QUE ELLA DEJO PASAR X SU VIVIENDA A UN PERITO (ASI SE IDENTIFICO) QUE ESTUVO HACIENDO FOTOGRAFIAS Y DEMAS PERO QUE NADIE PASO A QUITAR LAS PLACAS, Y QUE ESTA NOCHE CON EL VIENTO, SE LEVANTAN Y AZOTAN CONTRA LA FACHADA DE SU CASA, Y QUE TB TIENE MIEDO QUE LE ROMPAN UNA PERSIANA O SIMILAR.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 9.0pt; font-family: Arial;">SE ENVIA NUEVAMENTE CORREO A ADMO. CONTRUECES PARA QUE LAS QUITEN DE LA TERRAZA.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 19 de noviembre de 2013 12:11<br /> <strong>Para:</strong> \'contruecesadmon@hotmail.com\'<br /> <strong>Asunto:</strong> RV: AVISO PLACAS FACHADA C/MON 15 A/ATT. ANA</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Transmitimos a trav&eacute;s de la presente segunda solicitud de retirada de las placas de fachada de la comunidad c/Mon n&ordm; 15, (solicitado inicialmente en correo adjunto), ya que est&aacute; noche con el viento dichas placas localizadas a&uacute;n en la terraza de la CP San Matias 12-14 se levantan y dan contra la fachada del edificio indicado, (as&iacute; como el peligro que esto conlleva para las viviendas del entresuelo que estan a la altura de suelo de dicha terraza).</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, atentamente</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="color: navy; font-family: Arial; font-size: 8pt;">Paz Ortiz</span></p>'),
	(133, 129, '2013-11-15', '2014-02-09', NULL, 4, '', 'MANTENIMIENTO LILANDIS (riego y abono)', '<p><strong>13/11/2013.- &nbsp;</strong>NOS LLAMA PATRICIA (LA PROMOTORA DE LA IDEA DEL CIERRE) ENCARGADA DE TODO ESTE TEMA Y NOS INDICA (A PARTE DE LOS DATOS PARA LAS TRANSFERENCIAS) QUE LE HA DICHO LA EMPRESA SUMINISTRADORA DE LOS ARBUSTOS QUE EN MAYO HABRIA QUE ABONAR Y LUEGO TENER EN CUENTA EL RIEGO DE LOS MISMOS.</p>\r\n<p>SE TOMA NOTA DE TODO ELLO, AUN TENIENDO EN CUENTA QUE FUERON LOS PROPIOS VECINOS (PATRICIA QUE FUE LA QUE TODO LO PROPUSO Y MOVIO Y ETC ETC AHORA NO QUIERE SABER NADA DE ESTE TEMA XQ DICE QUE SE VE SOLA, QUE NINGUN VECINO COLABORA Y QUE ELLA ESTA MUY LIADA CON SU HIJO......) LOS QUE QUISIERON ESTE CIERRE Y QUE ELLOS MISMOS SE IBAN A ENCARGAR DE TODO ELLO.</p>\r\n<p>SE TRATARA ESTE TEMA EN LA PROXIMA JUNTA.</p>'),
	(134, 130, '2013-11-15', '2013-11-19', '2013-11-25', 2, '', 'REPOSICION DE LUMINARIAS', '<p><strong>14/11/2013.-&nbsp;</strong>SE RECIBE AVISO</p>\r\n<p><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> administrativo 2 [mailto:fincas@algonz.es]&nbsp;</span></p>\r\n<p><strong style="font-family: Tahoma; font-size: 8pt;">Enviado el:</strong><span style="font-family: Tahoma; font-size: 8pt;"> jueves, 14 de noviembre de 2013 12:34</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Para:</strong> \'Algonz.Paz\'<br /> <strong>Asunto:</strong> Bellavista -Luz Fundida P11</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">12.30hrs Llam&oacute; Jose Lu&iacute;s del P-11 </span>3&ordm;F<span style="font-family: Arial; font-size: 8pt;"> para informar que ya hab&iacute;a avisado hac&iacute;a una semana de que hay un bombillo fundido en el rellano del 3er piso (entre 3&ordm;F-3&ordm;G). Tambi&eacute;n revisar la bombilla del soportal del P-11 que a &eacute;l le parece que est&aacute; fundida, porque no la vio encendida.</span></p>\r\n<p class="MsoNormal"><strong>15/11/2013.- &nbsp;</strong>SE MANDA CORREO A LIMPIEZAS ASTUR</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 15 de noviembre de 2013 18:21<br /> <strong>Para:</strong> \'limpiezasastur@hotmail.es\'<br /> <strong>Asunto:</strong> AVISO LUMINARIAS CP BELLAVISTA</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;B</span><span style="font-size: 8.0pt; font-family: Arial;">uenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del propietario de c/Pe&ntilde;a de los Cuatro Jueces n&ordm; 11 3&ordm;F Jose Luis, indicando que hace ya +/- una semana que hay luminarias fundidas en el rellano de la 3&ordf; planta (entre 3&ordm;F y 3&ordm;G), as&iacute; como luminaria del soportal correspondiente al portal n&ordm; 11, por favor, reponer la fundida y si fuera problema de tipo electrico dar aviso en la administraci&oacute;n para enviar al tecnico. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">EL 25/11/13 LLAME A LUPE ME DIJO QUE LA LUMINARIA DEL RELLANO LA CAMBIO EL MISMO DIA QUE SE LE DIO AVISO Y LA DEL SOPORTAL YA LE HABIA COMENTADO A PAZ QUE TENIA QUE IR UN ELECTRICISTA PORQUE SE NECESITA UNA ESCALERA BASTANTE ALTA. HAY APERTURADO SINIESTRO DE ESTO. ASI QUE SE DA POR CERRADA ESTA ACTUACION.</span></strong></p>'),
	(135, 131, '2013-11-15', '2013-11-19', '2013-11-19', 2, '', 'DESINFECCION DE CUCARACHAS ', '<p><strong>15/11/2013.-</strong> EXPTE. TRANSFERIDO DE OUTLOOK. (ARCHIVADO EN DOCUMNTS. ADJUNTOS)</p>\r\n<p>&nbsp;11/11/2013 (12:10H).- SE HABLA CON CARLOS PARA QUE NOS EXPLIQUE QUE QUIERE EXACTAMENTE, NOS DICE QUE MANDEMOS A FUMIGAR, XQ SU INQUILINA HA VUELTO A VER CUCARACHAS EN SU CASA&hellip;., ZONAS COMUNES, ESCALERAS, DESCANSILLOS, Y DESV&Aacute;N (se necesita escalera para subir), QUE TB INTUYEN QUE ALL&Iacute; SE ENCUENTRE OTRO FOCO DE INFECCION, Y TB FUMIGUEN LA VIVIENDA DE DONDE CREEN QUE PROVIENEN TODAS ESTAS CUCARACHAS QUE ES EL 1&ordm;DCHA, PROPIEDAD DE VIPASA Y ALQUILADO.</p>\r\n<p>ASIMISMO QUE COLOQUEN UNOS CEPOS PARA RATONES EN LA ZONA DE CONTADORES DONDE VIO SANTIAGO DE INTERPLAGA QUE HABIA. TODOS ESTOS TRABAJOS CON CARGO A LA CDAD.</p>\r\n<p>CORREO ENVIADO A INTERPLAGA</p>\r\n<p>De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</p>\r\n<p>Enviado el: lunes, 11 de noviembre de 2013 12:28</p>\r\n<p>Para: \'INTERPLAGA S.L.\'</p>\r\n<p>Asunto: RE: Presupuesto Desinsectaci&oacute;n</p>\r\n<p>Buenos d&iacute;as.-&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente trabajos de fumigaci&oacute;n seg&uacute;n presupuesto remitido sobre la CP c/H Ferradores n&ordm; 5 La Camocha Gij&oacute;n, consistente en fumigaci&oacute;n de zonas comunes (escaleras, descansillos y desv&aacute;n), as&iacute; como de vivienda donde se cree puede provenir el foco de infecci&oacute;n (a raiz de una obras efectuadas en cocina) 1&ordm; Dcha.&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Asimismo solicitamos revisen tema de ratones (posibles en zona de contadores bajo escalera) y si fuera necesario la colocaci&oacute;n de &nbsp;cepos.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Para realizar dichos trabajos han de ponerse en contacto con el pte. de la comunidad Carlos 649.735.256. Tambi&eacute;n indicamos que para el acceso al desv&aacute;n es necesaria una escalera. Gracias.</p>\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</p>\r\n<p>Paz Ortiz</p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p>&nbsp;<strong>19/11/2013.-&nbsp;</strong> VIENE EL PTE. DE LA COMUNIDAD CARLOS VILLA Y NOS INFORMA QUE EL VIERNES 15/11/2013 ESTUVIERON LOS DE INTERPLAGA REALIZANDO EL TRABAJO, QUE &Eacute;L NO PUDO ESTAR PRESENTE PERO QUE LA INQUILINA QUE TIENE EN SU PISO LE CONFIRMO QUE ESTUVIERON.</p>\r\n<p>SE LLAMA A INTERPLAGA PARA CONFIRMAR LOS TRABAJOS QUE REALIZARON, NOS INFORMA LA CHICA QUE EL TECNICO QUE FUE A FUMIGAR QUEDO ASUSTADO (QUE YA ES DECIR), LAS CUCARACHAS ESTABAN X ENCIMA DE LOS NI&Ntilde;OS QUE VIVIEN EN LA VIVIENDA 1&ordm;DCHA, QUE ERA ALGO INCREIBLE Y ASQUEROSO, QUE TIENEN QUE VOLVER EN 20 DIAS A LA VIVIENDA PARA INTENTAR TERMINAR DE ERRADICAR ESE PROBLEMA. TB COLOCARON LOS CEPOS PARA LOS RATONES EN LA ZONA QUE SE MARCO.</p>\r\n<p>PTE. FACTURA DE INTERPLAGA</p>\r\n<p><span style="color: #0000ff;"><strong>SE MARCA UNA NUEVA ACTUACION PARA DENTRO DE SEIS MESES (TODO INCLUIDO EN EL PRECIO INICIAL).</strong></span></p>'),
	(136, 132, '2013-11-15', '2013-12-08', NULL, 1, '', 'ENSERES EN GARAJE', '<p><strong>EN JUNTA 24/10/2013 SE DETERMINA "</strong><strong style="font-size: 11px; text-align: justify;"><span style="font-size: 8pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="font-size: 8pt; font-family: Verdana; text-align: justify; text-indent: 30pt;">El d&iacute;a de realizaci&oacute;n de&nbsp;</span>la Junta<span style="font-size: 8pt; font-family: Verdana; text-align: justify; text-indent: 30pt;">&nbsp;hemos observado que hay en algunas plazas enseres que no corresponden a veh&iacute;culos, hemos tomado nota de las plazas donde se encuentran los mismos, y solicitamos a los vecinos que tienen dichos enseres de retirarlos</span><span style="font-size: 8pt; font-family: Verdana; text-align: justify; text-indent: 30pt;">&nbsp;&nbsp;</span><span style="font-size: 8pt; font-family: Verdana; text-align: justify; text-indent: 30pt;">a la mayor brevedad posible, pues sino los vecinos solicitan que se de aviso a VIPASA para informar de esta situaci&oacute;n."</span></p>\r\n<p><span style="font-size: 8pt; font-family: Verdana; text-align: justify; text-indent: 30pt;">SE ADJUNTA LAS FOTOGRAFIAS EN DOCUMNTS.ADJUNTOS.</span></p>'),
	(137, 133, '2013-11-15', '2014-02-10', NULL, 1, '', 'PRESUPUESTOS REALIZACION RAMPA', '<p>En Junta 31/10/13 se determino:</p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">3&ordm;- Presentaci&oacute;n y aprobaci&oacute;n de presupuestos si procede para la realizaci&oacute;n de rampa de acceso a la Calle Carmen Amaya. Valoraci&oacute;n de los mismos toma de decisi&oacute;n.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><span style="font-size: 10.0pt; font-family: Verdana;">Se presentan dos propuestas una por la calle Carmen Amaya y otra por la parte que da al parque. Teniendo m&aacute;s aceptaci&oacute;n la que discurre por la Calle Carmen Amaya 6, pero siendo la mas costosa, quedo un vecino en pedir m&aacute;s presupuestos y ver si se puede reducir el coste para proponer en la siguiente Junta. El coste que ofrece la empresa Sypsa es 24.024&euro;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">Un vecino dijo que traer&iacute;a m&aacute;s presupuestos. Esperar a que los traiga y seg&uacute;n se vea se piden algun otro o no.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;">&nbsp;LOS ORIGINALES DE LOS PRESUPUESTOS ESTAN ARCHIVADOS EN LA CARPETA DE PRESUPUESTOS PENDIENTES DE APROBACION.</p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify;">&nbsp;</p>'),
	(138, 134, '2013-11-15', '2013-11-29', NULL, 1, '', 'SUSTITUCION LUMINARIA', '<p><strong>EN JUNTA DE FECHA 31/10/2013 SE DETERMINA:&nbsp;</strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 35.4pt;">Hay que sustituir alguna l&aacute;mpara de emergencia pero se ofrece el Presidente entrante del portal </span>4 a<span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 35.4pt;"> realizar la colocaci&oacute;n de las mismas y sac&aacute;ndolas con descuento para </span>la Comunidad.</p>\r\n<p><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: blue; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">PAZ: HAY QUE ABRIR SINIESTRO EN PLATAFORMA HAY UN VECINO EL PRESIDENTE DEL PORTAL 4 - 2&ordm; D HECTOR 615.55.79.39. QUIEREN QUE LAS COLOQUE EL PUES NOS LA VA SACAR CON DESCUENTO Y EL SABE COLOCARLAS</span></strong></p>\r\n<p><span style="color: #000000;"><strong><span style="font-size: 8pt; font-family: Verdana;">*&nbsp;</span></strong><span style="font-size: 8pt; font-family: Verdana;">LAS LUMINARIAS SON PARTE DEL GARAJE Y +/- DOS EN LOS SOPORTALES (haciendo memoria M&ordf; de los ANgeles) CONCRETAR CON EL VECINO CUANTAS LUMINARIAS SON Y DONDE LAS CAMBIO.</span></span></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify; text-indent: 35.4pt;">&nbsp;</p>'),
	(139, 135, '2013-11-18', '2013-11-20', '2013-11-18', 2, '', 'PORTON AVERIADO', '<p><strong>18/11/2013.-&nbsp;</strong>VIENE PABLO X LA ADMINISTRACION PARA INDICAR VARIOS TEMAS DE LA COMUNIDAD Y ENTRE ELLOS NOS DICE QUE EL PORTON DEL GARAJE NO FUNCIONA BIEN, A PARTE QUE ALGUIEN LE DIO UN GOLPE CON EL COCHE Y QUE ENTRE &Eacute;L Y UN VECINO DEL PORTAL 26 TUVIERON QUE VOLVER A METER LAS RUEDAS X LA CARRILERA, EL PORTON QUEDA COMO PILLADO XQ LA CELULA DE ANTIFRICCION O ANTIATRAPAMIENTO (NOSE COMO SE LLAMA) QUEDA COMO ACTIVADA Y HACE QUE EL PORTON NO BAJE DEL TODO, X LO QUE QUEDA ABIERTO HASTA QUE ALGUIEN LO VUELVE A ACTIVAR BIEN SEA CON MANDO O CON LLAVE.</p>\r\n<p>SE LLAMA AL PTE. RUBEN PARA INFORMARLE DE TODO EL TEMA Y NOS DA EL VISTO BUENO PARA LLAMAR A CIAPER.</p>\r\n<p>SE MANDA CORREO A CIAPER</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> lunes, 18 de noviembre de 2013 13:21<br /> <strong>Para:</strong> \'CIAPER AUTOMATISMOS \'; \'ciaper@ciaper.com\'<br /> <strong>Asunto:</strong> RV: AVISO CP EDIF.PRISMA C/BADAJOZ 26-28 VELAZQUEZ 20</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Se me olvidaba comentaros que encima del porton, hay un sensor crepuscular que hace que las luces del garaje se accionen cuando el porton se abre, y ese sensor ha dejado de funcionar. El mismo fue colocado por el instalador del porton en su d&iacute;a, por favor, revisarlo tambi&eacute;n para ver que le ocurre. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"><strong>Enviado el:</strong> lunes, 18 de noviembre de 2013 13:13<br /> <strong>Para:</strong> \'CIAPER AUTOMATISMOS \'; \'ciaper@ciaper.com\'<br /> <strong>Asunto:</strong> AVISO CP EDIF.PRISMA C/BADAJOZ 26-28 VELAZQUEZ 20</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de vecino de la comunidad indicando que el porton del garaje falla y en muchas ocasiones queda abierto, (parece ser que salta el antifricci&oacute;n, o la celula antiatrapamiento, no se como se llama la verdad) y el porton queda pillado y no cierra hasta que alguien vuelve a activarlo. Asimismo indicar que parece ser que &ldquo;alguien&rdquo; le dio un golpe con el coche y lo desajusto&hellip;.. Por favor, pasar a revisarlo y solucionar los desarreglos que tiene. Asimismo indicar a la administraci&oacute;n que problema era el que ten&iacute;a. Gracias.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong>18/11/2013.-&nbsp;</strong>VINIERON DE CIAPER Y DEJARON PARTE DE TRABAJO (ARCHIVADO EN DOCUEMNTOS)</p>\r\n<p class="MsoNormal">PTE.FACTURA CIAPER</p>'),
	(140, 136, '2013-11-18', '2013-11-19', '2013-11-25', 2, '', 'FLUORESCENTE COLGANDO EN GARAJE', '<p><strong>18/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE VECINO DE LA CDAD. PORTAL N&ordm;2 6&ordm;C INDICANDO QUE ENFRENTE DE LAS PLAZAS DE GARAJE 18 -19 HAY UN FLUORESCENTE COLGANDO DEL TECHO QUE SE SUJETA SOLAMENTE POR EL CABLE E IMPIDE EL PASO DE LOS VEHICULOS.</p>\r\n<p>SE MANDA CORREO A ITELCO</p>\r\n<p>&nbsp;</p>\r\n<div class="MsoNormal" style="text-align: center;" align="center"><hr tabindex="-1" align="center" size="2" width="100%" /></div>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 18 de noviembre de 2013 13:50<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO GARAJE CP PLAZA PATRICIO ARDURIZ 1-2-3-4</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del vecino de Plaza Patricio Arduriz n&ordm;2 </span>6&ordm;C<span style="font-family: Arial; font-size: 8pt;"> que el fluorescente que se localiza a la altura de las plazas 18 &ndash; 19 est&aacute; suelto del techo colgando por el cable y los veh&iacute;culos no pueden pasar. Por favor, pasarse por all&iacute; para solucionarlo. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">EL 22/11/13, PASO TOMAS POR LA OFICINA Y NOS CONFIRMO QUE YA ESTABA SOLUCIONADO.&nbsp;</span></strong></p>\r\n<p class="MsoNormal"><span style="background-color: #ff0000;"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">PTE. FACTURA</span></strong></span></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(141, 112, '2013-11-18', '2013-11-19', '2013-11-18', 2, '', 'PORTON C/MURILLO AVERIADO', '<p><strong>18/11/2013.- &nbsp;</strong>RECIBIMOS AVISO DE PROPIETARIA DE C/SAN NICOLAS INDICANDO QUE EL PORTON DE GARAJE DE SALIDA X LA C/MURILLO NO FUNCIONA, NI CON EL MANDO NI CON EL BOTON DE APERTURA INTERIOR, HACE UN RUIDO COMO DE FUNCIONAR PERO QUEDA SIMPLEMENTE EN RUIDO, NI SUBE NI BAJA.</p>\r\n<p><strong>10:30H.-&nbsp;</strong>LLAMAMOS X TFN. A JOSE A.MATILLA 607.585.336 PARA QUE PASE A REVISAR QUE OCURRE CON EL PORTON.</p>\r\n<p><strong>18:00H.-&nbsp;</strong>SE LLAMA A JOSE A.MATILLA Y NOS INDICA QUE LO QUE TENIA ERA ROTA LA UNION DEL PI&Ntilde;ON DE LA CADENA CON EL EJE DEL MOTOR, UNA SOLDADURA QUE TIENE, QUE PUDO SER A CAUSA DE UNA PIEDRA O PALO(RAMA), QUE NO ES UN PROBLEMA IMPORTANTE. QUEDO SOLUCIONADO.</p>\r\n<p>PTE. FACTURA INSMAT (JOSE A.MATILLA)</p>'),
	(142, 131, '2013-11-19', '2014-04-27', NULL, 1, '', 'MANTENIMIENTO DESIFECCION CUCARACHAS', '<p><strong>19/11/2013.-&nbsp;</strong>EN LA ACTUACION INICIAL DE DESINFECCION DE CUCARACHAS DE LA COMUNIDAD INDICADA QUEDA FIJADO E INCLUIDO EN EL PRECIO INICIAL (YA COBRADO) UNA NUEVA ACTUACI&Oacute;N EN +/- 6 MESES, QUE TOCARIA EN ABRIL (FINALES) MAYO.</p>'),
	(143, 137, '2013-11-19', '2013-11-26', NULL, 1, '', 'CONDENSACION V.20 6ºB', '<p><strong>18/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE PROPIETARIO DE V.20 6&ordm;B JOSE 600.454.401, INDICANDO QUE TIENE UNA HUMEDAD EN UNA HABITACION DE SU VIVIENDA Y CREE QUE PUEDE SER X SUCIEDAD EN LOS CANALONES DEL TEJADO. SE LE SOLICITA NOS ENVIEN FOTOGRAFIAS DE DICHA HUMEDAD PARA VALORAR.</p>\r\n<p><strong>19/11/2013.-&nbsp;</strong>NOS MANDA LAS FOTOGRAFIAS EL AFECTADO. ARCHIVADAS EN DOCUMENTOS ADJUNTOS.&nbsp;</p>\r\n<p>EN ELLAS SE APRECIA CLARAMENTE QUE ES CONDENSACION....EN PRINCIPIO SE ENVIARA A JOSE A.LEONARDO PARA QUE REVISE EL TEJADO Y LOS CANALONES PARA EVITAR PROBLEMAS (SE LE SOLICITA TB QUE SAQUE FOTOGRAFIAS PARA PODER REMITIR AL AFECTADO Y ASI EXPLICARLE MEJOR QUE LO QUE TIENE EN LA VIVIENDA EN CONDENSACION).&nbsp;</p>\r\n<p>CORREO ENVIADO A JOSE A.LEONARDO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 19 de noviembre de 2013 13:17<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> CP EDIF.PRISMA C/VELAZQUEZ 20 C/BADAJOZ 26-28</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente visita y si correspondiese limpieza de canalones y tejado de la CP Edificio Prisma c/Velazquez 20 c/Badajoz 26-28. Indicar que antes de ir a ver dicho tejado pasarse por la administraci&oacute;n para llevar camara y hacer fotografias, ya que se han de presentar ante vecino. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong>19/11/2013(18:10H).-&nbsp;</strong>NOS LLAMA EL VECINO AFECTADO PREGUNTANDO, SE LE INFORMA QUE SEGUN LAS FOTOGRAFIAS SE APRECIA QUE ES CONDENSACION.....EL VECINO NO ESTA POR LA LABOR DE ENTENDER Y NOS DICE QUE ESA CONDENSACION NO ES X CAMBIO DE TEMPERATURAS EN INTERIOR Y EXTERIOR, QUE ESO ES XQ EN ALGUN SITIO HAY UN PROBLEMA (&Eacute;L CREE QUE EN EL TEJADO) Y QUE NO LE VALE CON QUE LE DIGAN QUE ES CAMBIO DE TEMPERATURA NI DEMAS, QUE AL MARGEN NO HA IDO NADIE DEL SEGURO PARA DECIR NADA, SE LE INDICA QUE NORMALMENTE EL PROCEDIMIENTO ES CONSTATAR QUE EL TEJADO Y DEMAS NO TIENE NINGUN PROBLEMA Y LUEGO SI PROCEDE APERTURAR SINIESTRO EN EL SEGURO DE LA CDAD. (TODO ELLO PARA NO CARGAR CON UN SINIESTRO Y AUMENTAR LA PRIMA DEL SEGURO)...COMO NO LO ENTIENDE MUY BIEN, SE APERTURA SINIESTRO EN EL SEGURO. SE ABRE UN NUEVO SINIESTRO.</p>\r\n<p class="MsoNormal"><strong>21/11/2013.-&nbsp;</strong>VIENE JOSE A.LEONARDO Y NOS INDICA QUE NO ESTA MUY SUCIA LA TERRAZA, QUE HAY PORQUERIA ACUMULADA EN LAS ESQUINAS PERO NO DE MANERA IMPORTANTE, EN EL TEJADILLO QUE SOBRESALE X LA TERRAZA/TEJADO SI QUE HAY BASTANTE MUSGO ACUMULADO, PERO QUE ESO EN CIERTA MEDIDA NO AFECTARIA A TEJADO NI SALIDAS DE DESAG&Uuml;ES, LO QUE SI NOS INDICA ES <span style="color: #ff0000;"><strong>QUE HAY UNA BOLSA DE AGUA ENTRE LA TEGOLA &nbsp;LOCALIZADA AL SALTAR EL MURETE PEQUE&Ntilde;O QUE HAY EN LA TERRAZA.&nbsp;</strong><span style="color: #000000;">ESO NO LO LLEVA &Eacute;L, TIENE QUE SER ALGUIEN QUE TRATE EL TEMA DE TERRAZAS E IMPERMEABILIZACIONES. SE COMENTA CON M&ordf; DE LOS ANGELES Y NOS INDICA QUE DEMOS EL AVISO A CONSTRUCTORA AMADO PARA QUE VENGA A VERLO</span></span></p>\r\n<p class="MsoNormal"><span style="color: #ff0000;"><span style="color: #000000;">CORREO ENVIADO A C.AMADO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 21 de noviembre de 2013 12:22<br /> <strong>Para:</strong> \'amado.t@construccionesamado.es\'<br /> <strong>Asunto:</strong> RV: TEMAS PENDIENTES CP PRISMA C/Badajoz 26-28 c/Velazquez 20</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos, por favor, si fuera posible, cuando realizaran las visitas/trabajos pendientes remitidos en correo adjunto, efect&uacute;en visita al tejado-terraza de la comunidad donde nos han informado se localiza una bolsa de agua entre la tegola (zona cercana al murete) para darnos su opini&oacute;n al respecto. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Asesor&iacute;a Algonz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Tfn/fax.- 985.14.98.36</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;"><a href="mailto:administrativo@algonz.es">administrativo@algonz.es</a></span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span></p>\r\n<div class="MsoNormal" style="text-align: center;" align="center"><hr tabindex="-1" align="center" size="2" width="100%" /></div>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 04 de septiembre de 2013 13:53<br /> <strong>Para:</strong> \'amado.t@construccionesamado.es\'<br /> <strong>Asunto:</strong> TEMAS PENDIENTES CP PRISMA C/Badajoz 26-28 c/Velazquez 20</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as Teresa.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Detallo a continuaci&oacute;n temas pendientes que ten&iacute;amos para tratar sobre la comunidad indicada CP Edificio Prisma c/Badajoz 26-28 c/Velazquez 20:</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 8.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 8.0pt; font-family: Arial;">HUMEDADES POR FILTRACIONES EN GARAJE (plazas 19-20). Correo enviado el 15/02/2013 y llamada telef&oacute;nica realizada, quedo pendiente de revisar por vuestra parte a la finalizaci&oacute;n de entrega de edificio.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 8.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 8.0pt; font-family: Arial;">HUMEDADES EN HABITACION PRINCIPAL VIVIENDA Badajoz 26 4&ordm;B (David Nu&ntilde;ez 619.029.306). Correo enviado el 24/01/2013 y llamada telef&oacute;nica, quedo pendiente de revisar por vuestra parte a la finalizaci&oacute;n de entrega de edificio.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 8.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 8.0pt; font-family: Arial;">HUMEDADES EN VIVIENDA Badajoz 26 6&ordm;B (Monste 610.013.232). Correo enviado el 08/04/2013 y llamada telef&oacute;nica, quedo pendiente de revisar por vuestra parte a la finalizaci&oacute;n de entrega de edificio. En este mismo correo se informa de otra vivienda con problemas de humedad c/Velazquez 20 3&ordm;C (Eduardo Santos 985.143.279 / 620.486.019).</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 8.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 8.0pt; font-family: Arial;">PINTURA portal Badajoz 28 subida del portal a viviendas por escalera zona al lado de cristalera, una humedad ocasionada por filtraci&oacute;n de agua de lluvia ya solucionada pendiente de pintura.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Por favor, solicitamos informaci&oacute;n sobre estos temas para exponer en junta. Muchas gracias.</span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><span style="font-family: Arial; font-size: 8pt;">Paz Ortiz</span></p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;">&nbsp;</p>\r\n<p class="MsoNormal" style="margin-left: 18.0pt;"><strong>21/11/2013.-&nbsp;</strong>PRESUPUESTO RECIBIDO DE JOSE A.LEONARDO DE LIMPIEZA DE TEJADO. ARCHIVADO EN DOCUMNST. ADJUNTOS.&nbsp;</p>'),
	(144, 138, '2013-11-19', '2013-11-20', '2013-11-25', 2, '', 'RUIDO ASCENSOR', '<p><strong>19/11/2013.-&nbsp;</strong>VINO UN VECINO DE LA COMUNIDAD INDICANDO QUE HOY ESTUVO EL TECNICO DE ASCENSORES HACIENDO LA REVISION (DE HECHO DEJO LA PEGATINA CON LA FECHA DE HOY EN EL ASCENSOR) Y QUE DEJO EL ASCENSOR CON UN RUIDO DE CADENAS SUELTAS CADA VEZ QUE FUNCIONA, TANTO EN LAS SUBIDAS COMO EN LAS BAJADAS.</p>\r\n<p><strong>13:25H.-&nbsp;</strong>SE LLAMA X TFN A THYSSEN, PATRICIA, Y &nbsp;NOS INDICA QUE PASA NOTA AL TECNICO PARA QUE SE PASE HOY SIN FALTA.</p>\r\n<p>EL <strong>25/11/13</strong> LLAME A THYSSEN PREGUNTE SI HABIA PASADO EL TECNICO A VER ESE RUIDO, ME INDICA LA CHICA QUE EL TECNICO PASO PERO QUE NO SABE QU&Eacute; TENIA, QUE DEJARIA EL PARTE EN EL BUZON, PERO ELLA NO TIENE ANOTADO NADA, CON LO CUAL NO DEBE HABER NINGUNA INCIDENCIA. LLAME A VARIOS VECINOS NO ME COGIERON EL TELEFONO Y LUEGO LLAME AL 5&ordm; A ANA MARIA Y ME DIJO QUE ELLA NO NOTO NADA QUE EL ASCENSOR ESTA BIEN, LO UNICO QUE TIENE UNA LUZ FUNDIDA. SE DA POR CERRADA LA INCIDENCIA.</p>'),
	(145, 139, '2013-11-19', '2013-11-21', '2013-11-21', 2, '', 'MANILLA PUERTA PORTAL ROTA', '<p><strong>19/11/2013.-&nbsp;</strong>NOS DA AVISO PABLO (5&ordm;K) QUE LA MANILLA DEL PORTAL ESTA SUELTA Y A PUNTO DE ROMPER, SE INDICA QUE SE MANDARA AL CERRAJERO PARA QUE LO ARREGLE. CORREO ENVIADO</p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> martes, 19 de noviembre de 2013 13:41<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> AVISO CARMEN AMAYA 8</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso vecino del 5&ordm;K Pablo, indicando que la manilla de la puerta del portal interior esta suelta y a punto de romper (no ajusta bien en el perfil de la puerta). Por favor, pasarse por all&iacute; y solucionar el problema. Confirmarlo con vecino de aviso si se encontrara en el domicilio. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">21/11/2013.-</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;TRABAJO FINALIZADO, MANDA FACTURA SYTEC EXPLICATIVA.ARCHIVADO EN DOCUMENTS.ADJUNTOS.</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(146, 140, '2013-11-19', '2013-11-25', NULL, 1, '', 'PINTURA PARED PORTAL (SUBIDA ESCALERAS)', '<p><strong>04/09/2013(12:50h).-</strong> LLAMADA A CONSTRUCTORA AMADO, TERESA NOS INDICA QUE ESTA CON LA MUDANZA DE OFICINA Y QUE ESTA QUE NO ESTA, QUE XFAVOR LE ENVIEMOS UN CORREO CON TODO LO PTE. PARA QUE ELLA LO REVISE Y NOS INDIQUE LO Q SEA.</p>\r\n<p>CORREO ENVIADO&nbsp;</p>\r\n<p><span style="font-size: 11px;">De: Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p>Enviado el: mi&eacute;rcoles, 04 de septiembre de 2013 13:53</p>\r\n<p>Para: \'amado.t@construccionesamado.es\'</p>\r\n<p>Asunto: TEMAS PENDIENTES CP PRISMA C/Badajoz 26-28 c/Velazquez 20</p>\r\n<p><span style="font-size: 11px;">Buenos d&iacute;as Teresa.-</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Detallo a continuaci&oacute;n temas pendientes que ten&iacute;amos para tratar sobre la comunidad indicada CP Edificio Prisma c/Badajoz 26-28 c/Velazquez 20:</span></p>\r\n<p><span style="font-size: 11px;">HUMEDADES POR FILTRACIONES EN GARAJE (plazas 19-20). Correo enviado el 15/02/2013 y llamada telef&oacute;nica realizada, quedo pendiente de revisar por vuestra parte a la finalizaci&oacute;n de entrega de edificio.</span></p>\r\n<p>HUMEDADES EN HABITACION PRINCIPAL VIVIENDA Badajoz 26 4&ordm;B (David Nu&ntilde;ez 619.029.306). Correo enviado el 24/01/2013 y llamada telef&oacute;nica, quedo pendiente de revisar por vuestra parte a la finalizaci&oacute;n de entrega de edificio.</p>\r\n<p>HUMEDADES EN VIVIENDA Badajoz 26 6&ordm;B (Monste 610.013.232). Correo enviado el 08/04/2013 y llamada telef&oacute;nica, quedo pendiente de revisar por vuestra parte a la finalizaci&oacute;n de entrega de edificio. En este mismo correo se informa de otra vivienda con problemas de humedad c/Velazquez 20 3&ordm;C (Eduardo Santos 985.143.279 / 620.486.019).</p>\r\n<p>Pintura de portal Badajoz 28 (zona cristal subida escalera).</p>\r\n<p><span style="font-size: 11px;">Por favor, solicitamos informaci&oacute;n sobre estos temas para exponer en junta. Muchas gracias.</span></p>\r\n<p><span style="font-size: 11px;">&nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p><span style="font-size: 11px;">Paz Ortiz</span></p>\r\n<p>Asesor&iacute;a Algonz</p>\r\n<p><span style="font-size: 11px;"><strong>11/09/2013(12:00h).-</strong> SE LLAMA A TERESA Y NOS DICE QUE RAFAEL (SU HERMANO) LE DIJO QUE YA ESTABA TODO MIRADO Y LISTO, QUE SOLAMENTE ESTABA PTE. EL TEMA DEL GARAJE Y PINTURA XQ NO LO VIO IMPORTANTE. SE LE SOLICITA QUE NOS MANDE CORREO CON LAS EXPLICACIONES PARA PODER TRANSMITIRLO A LOS AFECTADOS E INTERESADOS</span></p>\r\n<p>SE LLAMA AL AFECTADO BADAJOZ 26 4&ordm;B DAVID PARA QUE NOS INFORME 12:35H. EL MOVIL ESTA APAGADO O FUERA DE COBERTURA</p>\r\n<p><strong>19/11/2013.-&nbsp;</strong>SE LLAMA A TERESA <strong>CONST.AMADO 985.37.40.17 / 679.176.301,</strong> NOS COGE EL TFN RAFAEL Y NOS DICE QUE SABE QUE LO TIENE PENDIENTE PARA HACER +/- ESTA SEMANA QUE LO VA A HACER &Eacute;L.</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Angeles [mailto:angeles@algonz.es] <br /> <strong>Enviado el:</strong><strong><span style="background-color: #00ccff;"> lunes, 25 de noviembre de 2013 12:53</span></strong><br /> <strong>Para:</strong> \'amado.t@construccionesamado.es\'<br /> <strong>Asunto:</strong> Edificio Prisma - Calle Velazquez 20</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as Teresa:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Seg&uacute;n conversamos se ha puesto en contacto con la Administraci&oacute;n &nbsp;el vecino de Vel&aacute;zquez 20 ha manifestado que presenta humedad en una habitaci&oacute;n Vel&aacute;squez 20 &ndash; 6&ordm; B 600.454.401, me gustar&iacute;a que como va pasar Rafael por el Edificio a rematar diferentes cuestiones que tenemos pendiente y que te inform&oacute; mi compa&ntilde;era Paz en el correo remitido 04/09/2013, es por ello que os solicito que me revises la incidencia que notifica este vecino.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Te comento tambi&eacute;n que enviamos Alba&ntilde;il a revisar el tejado por si fuera necesario limpiar ya que nos informaba esta incidencia este vecino y lo vio bastante bien, lo que si me comento que hay una bolsa de agua dentro de la t&eacute;gola por el portal 28, para que Rafael tambi&eacute;n nos comente sobre esta situaci&oacute;n.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Un saludo </span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Mar&iacute;a Angeles Gonz&aacute;lez Guti&eacute;rrez</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">C/ Les CIgarreres 25 Bajo </span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">33211 Gijon</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Tel&eacute;fono y Fax : 985.14.98.36</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 7.5pt; font-family: Verdana;"><a href="mailto:angeles@algonz.es"><strong><span style="color: windowtext; text-decoration: none;">angeles@algonz.es</span></strong></a></span></p>'),
	(147, 142, '2013-11-19', '2013-11-29', NULL, 1, '', 'DETECTOR PRESENCIA  PORTAL 25', '<p>EN JUNTA 12/11/13 SE COMENTO POR VARIOS VECINOS QUE EL DETECTOR DE PRESENCIA DEL PORTAL QUEDA PARPADEANDO EN OCASIONES, Y SE ACORDO REVISARLO CUANDO ITELCO FUERA A CAMBIAR LAS EMERGENCIAS DEL GARAJE. LE REMITI E-MAIL A ITELCO EL 19/11/13</p>'),
	(148, 141, '2013-11-19', '2013-11-26', NULL, 1, '392990/2013', 'CONDENSACION V.20 6ºB', '<p><strong>19/11/2013.- &nbsp;</strong>RECIBIMOS LLAMADA DE VECINO AFECTADO:<strong>V.20 6&ordm;B JOSE PARRE&Ntilde;O 600.454.401 / PAULA GASCON 685.363.271,&nbsp;</strong>(ESTE SINIESTRO VIENE APERTURADO A CAUSA DEL SINIESTRO ABIERTO CON JOSE A.LEONARDO</p>\r\n<p><strong>OCASO</strong></p>\r\n<p><strong>N&ordm;POLIZA.- 162273</strong></p>\r\n<p><strong>TFN.- 902.332.313 Agente Beatriz Costales 985.359.542 / 692.636.090</strong></p>\r\n<p><strong>19/11/2013(19:00h).-&nbsp;</strong>OCASO (JOSE) SE APERTURA SINIESTRO Y NOS INDICA EL OPERADOR QUE EN UN PLAZO DE 24 HRS.EL PERITO SE PONDRA EN CONTACTO CON EL AFECTADO</p>\r\n<p><strong>19/11/2013.-&nbsp;</strong>SE LLAMA AL AFECTADO PARA INFORMARLE QUE SE PONDRAN EN CONTACTO CON EL PARA IR A VER EL PROBLEMA, TIENE EL TFN INOPERATIVO.</p>\r\n<p>&nbsp;<strong>21/11/2013.-</strong> 11:45 horas. Llama Jos&eacute; para informanos que paso un t&eacute;cnico de la Compa&ntilde;ia de seguro y le informo que era condensaci&oacute;n, pero luego el vecino me lo adorn&oacute; informando que deb&iacute;a de haber alg&uacute;n tipo de humedad que se la provocaba, o un mal aislamiento que hay de la fachada o terraza con la vivienda. <strong>Le comente que hab&iacute;a pasado operario para revisar el tejado observando que el mismo se ve bien por la zona del 22.</strong></p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10pt; font-family: Tahoma;"> Angeles [mailto:angeles@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong><span style="background-color: #00ccff;"><strong> lunes, 25 de noviembre de 2013 12:53</strong></span><br /> <strong>Para:</strong> \'amado.t@construccionesamado.es\'<br /> <strong>Asunto:</strong> Edificio Prisma - Calle Velazquez 20</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as Teresa:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Seg&uacute;n conversamos se ha puesto en contacto con la Administraci&oacute;n &nbsp;el vecino de Vel&aacute;zquez 20 ha manifestado que presenta humedad en una habitaci&oacute;n Vel&aacute;squez 20 &ndash; 6&ordm; B 600.454.401, me gustar&iacute;a que como va pasar Rafael por el Edificio a rematar diferentes cuestiones que tenemos pendiente y que te inform&oacute; mi compa&ntilde;era Paz en el correo remitido 04/09/2013, es por ello que os solicito que me revises la incidencia que notifica este vecino.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Te comento tambi&eacute;n que enviamos Alba&ntilde;il a revisar el tejado por si fuera necesario limpiar ya que nos informaba esta incidencia este vecino y lo vio bastante bien, lo que si me comento que hay una bolsa de agua dentro de la t&eacute;gola por el portal 28, para que Rafael tambi&eacute;n nos comente sobre esta situaci&oacute;n.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Un saludo </span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Mar&iacute;a Angeles Gonz&aacute;lez Guti&eacute;rrez</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">C/ Les CIgarreres 25 Bajo </span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">33211 Gijon</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Tel&eacute;fono y Fax : 985.14.98.36</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 7.5pt; font-family: Verdana;"><a href="mailto:angeles@algonz.es"><strong><span style="color: windowtext; text-decoration: none;">angeles@algonz.es</span></strong></a></span></p>'),
	(149, 135, '2013-11-20', '2013-11-21', NULL, 1, '', 'PORTON PARADO', '<p><strong>20/11/2013.-&nbsp;</strong> NOS LLAMA PABLO (BADAJOZ 28 3&ordm;B 665.784.117) INDICANDO QUE EL PORTON NO FUNCIONA, QUE SEG&Uacute;N &Eacute;L LO QUE OCURRIO ES QUE EN LA REVISION DE AYER LA PIEZA QUE VA AL MOTOR Q ENGRANA CON LA CADENA, QUEDO MAL ENCAJADA Y SE SOLTO X LO QUE EL MOTOR HACE LA FUNCION PERO QUE NI ABRE NI CIERRA (EVIDENTEMENTE).</p>\r\n<p>SE LLAMA A CIAPER Y CARMEN NOS INDICA QUE X ESAS INDICACIONES TIENE TODA LA PINTA QUE QUITARON EL BULON PARA DEJARLO DE FORMA MANUAL, NOS HACE LA ADVERTENCIA QUE HACE UNOS DIAS FUE UN VECINO DE PRISMA PARA COMPRAR UN MANDO, QUE LE ENVIARON A ASPOR XQ ESOS MANDOS TIENEN CODIGOS DE INICIO, QUE PUEDE SER QUE NO SE HICIERAN CON EL MANDO....... DE TODAS FORMAS SE FACILITA EL TFN DE PABLO PARA QUE LOS DE CIAPER SE PONGAN EN CONTACTO CON &Eacute;L Y VERIFIQUEN IN SITU QUE LE OCURRE AL PORTON.</p>\r\n<p>NOS LLAMAN EN CUANTO LO HAYAN VISTO LOS DE CIAPER</p>\r\n<p><strong>20/11/2013 (19:00hrs.).-&nbsp;</strong> NOS LLAMA CARMEN DE CIAPER, NOS DICE QUE ESTUVO EL TECNICO ALLI REVISANDOLO CON PABLO Y QUE SE PERCATARON QUE EL ARRASTRE DONDE ENGANCHA LA CADENA ESTA GASTADO Y ESO PRODUCE QUE SE DESBLOQUEE SOLO Y CAMBIE LOS TIEMPOS DEL MOTOR, O SEA, QUE NO ABRA LA PUERTA. EL TECNICO REENGANCHO LA PIEZA LA BLOQUEO Y REPROGRAMO LA CENTRALITA, DE MOMENTO QUEDO FUNCIONANDO OK.</p>\r\n<p>NO OBSTANTE HACEN LA ADVERTENCIA QUE SERIA MAS QUE CONVENIENTE CAMBIAR DICHA PIEZA XQ NO GARANTIZAN EL TIEMPO QUE EL ARREGLO PUEDA DURAR, EL ARREGLO SERIA LA PIEZA +/- 50,00&euro; + LA MANO DE OBRA.</p>\r\n<p>SE LLAMA A PABLO PARA INFORMALE DE TODO EL TEMA Y NOS DICE QUE ESA PIEZA YA ESTABA REGULAR CUANDO ASPOR LLEVABA EL MANTENIMIENTO ASI QUE X &Eacute;L VE CORRECTO QUE SE CAMBIE</p>\r\n<p>SE LLAMA AL PTE. RUBEN Y NOS DICE QUE SE CAMBIE,YA QUE TENEMOS RAZON EN QUE SI CADA VEZ QUE SE SALGA ESA PIEZA HAY QUE LLAMAR AL SERVICIO TECNICO AL FINAL NOS SALE MAS CARO EL ARREGLO QUE LA PIEZA EN SI.</p>\r\n<p><strong>21/11/2013.-&nbsp;</strong>SE ENVIA CORREO A CIAPER CON SOLICITUD DE CAMBIO DE PIEZA.</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 21 de noviembre de 2013 13:25<br /> <strong>Para:</strong> \'CIAPER AUTOMATISMOS \'; \'ciaper@ciaper.com\'<br /> <strong>Asunto:</strong> CP EDIF.PRISMA C/VELAZQUEZ 20 C/BADAJOZ 26-28</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente cambio de pieza (enganche a cadena), para </span>porton garaje<span style="font-family: Arial; font-size: 8pt;"> CP Edif.Prisma, (cambio aconsejado en revisi&oacute;n efectuada). Por favor, una vez tengan la pieza informar a la administraci&oacute;n de d&iacute;a previsto para su colocaci&oacute;n y si hay que dejarlo sin funcionamiento. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p><span style="font-family: Arial; font-size: 8pt;">Asesor&iacute;a Algonz</span></p>\r\n<p>&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 10:18<br /> <strong>Para:</strong> \'CIAPER AUTOMATISMOS \'; \'ciaper@ciaper.com\'<br /> <strong>Asunto:</strong> RV: RV: RV: CP EDIF.PRISMA C/VELAZQUEZ 20 C/BADAJOZ 26-28</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto remito correo de Pablo, vecino involucrado en el tema del porton, por s&iacute; os puede servir de ayuda. Por favor, nos comunicais lo que ocurra en dicho porton. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Asesoria Algonz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Tfn/Fax.- 985.14.98.36</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;"><a href="mailto:administrativo@algonz.es">administrativo@algonz.es</a></span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8pt; font-family: Tahoma;"> Pablo Garc&iacute;a Garc&iacute;a [mailto:pablgg@hotmail.com]&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;"> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 1:27<br /> <strong>Para:</strong> Algonz<br /> <strong>Asunto:</strong> RE: RV: RV: CP EDIF.PRISMA C/VELAZQUEZ 20 C/BADAJOZ 26-28</span></p>\r\n<p class="MsoNormal"><span style="font-family: Tahoma; font-size: 8pt;">Hola buenos d&iacute;as Paz.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;">Por la noche consegu&iacute; acoplar la pieza de nuevo y qued&oacute; bien encajada y segura. El port&oacute;n qued&oacute; cerrado.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Tahoma; font-size: 8pt;">Te comento dos temas que he observado y que creo que est&aacute;n haciendo sufrir m&aacute;s a esta pieza, independientemente de que no est&eacute; muy bien. Si puedes transm&iacute;teselo a Jose el de CIAPER para que lo mire &eacute;l a ver que le parece.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Tahoma; font-size: 8pt;">- Me da la sensaci&oacute;n, que desde que se han desdoblado las l&aacute;minas que estaban torcidas el port&oacute;n baja demasiado y fuerza </span>la pieza. Hay<span style="font-family: Tahoma; font-size: 8pt;"> ocasiones que apoya demasiado la goma en el suelo y rebota abri&eacute;ndose&nbsp; de nuevo. Quiz&aacute;s seria interesante, si es posible, reajustar el recorrido para que no baje tanto cuando cierra.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Tahoma; font-size: 8pt;">- Otro punto cr&iacute;tico es cuando empieza a bajar y las l&aacute;minas que se repararon del golpe pasan por el tramo curvo. Quiz&aacute;s est&eacute;n algo descorregidas y en alg&uacute;n momento fuerce el recorrido.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Tahoma; font-size: 8pt;">Ya me coment&aacute;is.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;">Saludos</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Tahoma;">Pablo </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;"><span style="font-size: 8.0pt; font-family: Calibri;">&nbsp;</span><span style="font-family: Calibri; font-size: 8pt;">From: administrativo@</span>algonz<span style="font-family: Calibri; font-size: 8pt;">.es</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 12.0pt;"><span style="font-size: 8.0pt; font-family: Calibri;"> To: pablgg@hotmail.com<br /> Subject: RV: RV: CP EDIF.PRISMA C/VELAZQUEZ 20 C/BADAJOZ 26-28<br /> Date: Thu, 21 Nov 2013 19:06:04 +0100</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Hola Pablo, buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Malas noticias, nos han llamado que el port&oacute;n esta abierto&hellip;..se pasa aviso a Ciaper, ma&ntilde;ana pasaran a recolocar la pieza. Poco nos ha durado&hellip;.</span></p>\r\n<p class="MsoNormal" style="text-indent: 35.4pt;"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Un saludo.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Asesoria Algonz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Tfn/fax.- 985.14.98.36</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;"><a href="mailto:administrativo@algonz.es">administrativo@algonz.es</a></span></p>\r\n<div class="MsoNormal" style="text-align: center;" align="center"><hr tabindex="-1" align="center" size="2" width="100%" /></div>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 21 de noviembre de 2013 11:50<br /> <strong>Para:</strong> \'Pablo Garc&iacute;a Garc&iacute;a\'<br /> <strong>Asunto:</strong> RE: RV: CP EDIF.PRISMA C/VELAZQUEZ 20 C/BADAJOZ 26-28</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">Buenos d&iacute;as Pablo.</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Espero que as&iacute; sea y lo solucione.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Hable con Ciaper y no tienen la pieza, han de pedirla, por lo que este fin de semana hay un riesgo que si se sale la pieza quede inutilizado el porton, esperemos que no sea as&iacute;. Van a pedir la pieza de manera urgente, en cuanto lo tengan se ponen en contacto para fijar fecha de trabajos, lo cual te comunicar&eacute;.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Estamos en contacto. </span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial; color: navy;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; color: navy;">Paz Ortiz</span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="font-size: 8pt; font-family: Arial;">25/11/2013.- SE HABLA CON CARMEN DE CIAPER Y NOS INDICA QUE YA ESTA PEDIDA LA PIEZA DESDE EL JUEVES DE LA SEMANA PASADA, PERO QUE NO LA TIENEN EN STOCK AQUI Y LA TUVIERON QUE PEDIR A ITALIA, X LO TANTO LLEGARA EL VIERNES O LA SEMANA QUE VIENE. CARMEN NOS INDICA QUE LO QUE MANDA PABLO EN EL CORREO NO TIENE NADA QUE VER CONQUE EL PORTON QUEDE PARADO Y SE SALGA LA PIEZA.</span></span></p>\r\n<p class="MsoNormal"><span style="color: #000000;"><span style="font-size: 8pt; font-family: Arial;">SE LLAMA A PABLO Y NOS DICE QUE SI PUDIERAMOS LLAMAR A CIAPER QUE LE PIDA FAVOR A ASPOR X SI TUVIERAN LA PIEZA AQUI EN STOCK, SE LE INDICA QUE IMAGINAMOS QUE CIAPER YA HIZO TODAS LAS GESTIONES POSIBLES PARA CONSEGUIR LA PIEZA, AL MARGEN QUE CON ASPOR NO ES QUE QUEDARAMOS MUY BIEN COMO PARA PEDIR FAVORES....NOS DICE QUE ESO ES CIERTO..., QUEDAMOS EN PONER UN CARTEL EXPLICATIVO X DENTRO DEL GARAJE PARA QUE LOS VECINOS ESTUVIERAN INFORMADOS Y ASI QUE CERRARAN LA PUERTA X LA NOCHE.</span></span></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(150, 144, '2013-11-18', '2013-11-26', '2013-11-20', 2, '', 'COLOCACION DE GANCHOS PARA SOPORTES DE BICICLETAS', '<p><strong>18/11/2013.-&nbsp;</strong> NOS LLAMA LA VECINA DEL 4&ordm;B 607.710.019 PARA PREGUNTAR SI PUEDE PONER UNOS GANCHOS EN SU PLAZA DE GARAJE PARA COLGAR LAS BICICLETAS. SE LE INFORMA QUE HEMOS DE REVISAR EL LIBRO DE ACTAS X SI HUBIERA ALGUN TIPO DE PROHIBICION AL RESPECTO, ASI COMO SOLICITAR LA AUTORIZACION AL PTE. DE LA CDAD.</p>\r\n<p>SE MIRA EL LIBRO DE ACTAS Y NO SE VE NINGUN TIPO DE ALUSION AL RESPECTO, SE COMENTA CON M&ordf; DE LOS ANGELES Y NOS INDICA QUE MIENTRAS LO COLOQUE EN SU PLAZA DE GARAJE SIN MOLESTAR A NINGUN VECINO Y SIN QUE SU VEHICULO SOBRESALGA DE LAS LIMITACIONES DE LA MISMA &nbsp;PODRIA HACERLO.</p>\r\n<p><strong>19/11/2013.-&nbsp;</strong>SE LLAMA AL PTE.ROSA &nbsp;646.911.957, NO COGEN EL TFN</p>\r\n<p><strong>20/11/2013.-&nbsp;</strong>NOS LLAMA LA SOLICITANTE Y SE LE INDICA QUE NO HEMOS VISTO NADA EN EL LIBRO DE ACTAS, QUE HEMOS INTENTADO PONERNOS EN CONTACTO CON EL PTE. PERO QUE NO NOS COGE EL TFN, NOS DICE QUE ES SU VECINA Y QUE INTENTARA HABLAR CON ELLA PARA DECIRSELO.</p>\r\n<p><strong>12:30H.-</strong> SE LLAMA A LA PRESIDENTA ROSA PARA INFORMARLE DE TODO EL TEMA Y NOS DICE QUE LA PLAZA ESTA AL LADO DE LA SUYA, QUE VA A ECHAR UN VISTAZO PARA VER COMO QUEDARIA Y YA HABLA CON LA VECINA.</p>'),
	(151, 143, '2013-11-20', '2013-11-22', '2013-11-25', 2, '', 'VIDEOPORTERO SIN FUNCIONAR', '<p><strong>20/11/2013.- &nbsp;</strong>VIENE EL PROPIETARIO DEL 1&ordm;C ALFONSO 619.500.500, INDICANDO QUE EL VIDEOPORTERO NO FUNCIONA, QUE YA LO ESTUVO MIRANDO &Eacute;L (EL PRIVATIVO PROPIO DE LA VVDA.), SE LE INDICA QUE SE PASA AVISO AL ELECTRICISTA SI ES PROBLEMA COMUNITARIO SE SOLUCIONA, SI ES PRIVATIVO SE LE INDICA PARA QUE EL LO SOLUCIONE.</p>\r\n<p>**12:45H.- SE LLAMA AL PTE. PARA QUE ESTE INFORMADO, SE LE DEJA AVISO EN EL BUZON CON TODA LA INFORMACION</p>\r\n<p>CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 20 de noviembre de 2013 12:51<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO CP LA VEREDA C/RAMON ARECES 18 PORTAL A</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del propietario de c/Ramon Areces n&ordm; 18 portal A 1&ordm;C Alfonso 619.500.500, informando que&nbsp; no le funciona el videoportero, comprob&oacute; en su vivienda todo lo referente a ello y no se percato de nada extra&ntilde;o. Por favor, pasarse por all&iacute;, comprobar que ocurre, si es problema comunitario solucionarlo y si es problema privativo<strong> dar aviso al afectado</strong> y a la administraci&oacute;n. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">22/11/13.- Vino Tom&aacute;s y dijo que era tema privativo, se lo coment&oacute; al se&ntilde;or y quedo con &eacute;l en repararlo.</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">25/11/2013(11:00H).- SE LLAMA AL VECINO AFECTADO PARA VER SI ESTA CONFORME CON LA EXPLICACION DL TECNICO, NOS INDICA QUE YA LO ARREGLA &Eacute;L. TODO OK.</span></strong></p>'),
	(152, 145, '2013-11-20', '2013-11-27', NULL, 1, '16328321', 'HUMEDAD EN ESCALERAS ACCESO A GARAJE', '<p><strong>20/11/2013.-&nbsp;</strong>LLAMAMOS A LA <strong>PTE. ROSA 646.911.957</strong> PARA TRATAR UN TEMA DE GARAJE (colocaci&oacute;n de ganchos para bicicletas) Y NOS INDICA QUE LA LIMPIADORA LE HA INDICADO QUE EN LAS ESCALERAS DE ACCESO AL GARAJE DESDE EL PORTAL (LA PRIMERA PUERTA QUE TE ENCUENTRAS A MANO IZDA) HAY UNA MANCHA DE HUMEDAD. SE LE INDICA QUE SE APERTURA SINIESTRO EN EL SEGURO PARA QUE VAYAN A VERLO.</p>\r\n<p><strong>CATALANA OCCIDENTE&nbsp;</strong></p>\r\n<p><strong>N&ordm; POLIZA.- 8-04812165X</strong></p>\r\n<p><strong>TFN.- 902.206.208 / 902.344.000</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>20/11/2013(13:15H).-&nbsp;</strong>CATALANA (MARC) SE LE INDICA EL TEMA DE LA HUMEDAD EN ESCALERAS DE ACCESO A GARAJE, SE FACILITA TFN DE LA PTE. ROSA, SE PONDRAN EN CONTACTO CON ELLA.</p>\r\n<p><strong>20/11/2013 (16.30).-</strong> LLAMO RUBEN PERITO DE CATALANA PARA QUE LE INFORMARA DEL TEMA, LE COMENTE EL TEMA DE LA HUMEDAD Y FACILITE EL TELEFONO DE LA PRESIDENTA PARA QUE QUEDARA CON ELLA.</p>'),
	(153, 146, '2013-11-21', '2013-12-08', NULL, 1, '', 'PLACA DE METACRILATO DEL PORTAL 52 CABINA ASCENSOR', '<p><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px; background-color: #f9f9f9;">&nbsp;</span><span style="background-color: #00ccff;">20/11/2013.-</span><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px; background-color: #f9f9f9;">&nbsp;Me he puesto en contacto con Victor de Embarba y le he notificado que la placa de metacrilato del techo del ascensor limpiandola la limpiadora se le romp&iacute;o por lo que solicitaba su reposici&oacute;n. Le informe que me suena que cuando firmamos los contratos se determino entre el y yo que nos la iria cambiando seg&uacute;n se vieran de aspecto deplorable.&nbsp;</span><span style="background-color: #00ccff;">633.272.698 Victor personal,&nbsp;<span style="background-color: #ffffff;">&nbsp;Dijo que hablar&iacute;a con David para que le dijera cuantos eran para tambi&eacute;n realizar cambio en otros portales.</span></span></p>'),
	(154, 115, '2013-11-21', '2013-11-22', '2013-11-25', 2, '', 'PLANTA -1 LUMINARIAS', '<p><strong>21/11/2013.-&nbsp;</strong>NOS LLAMA EL VECINO DEL 4&ordm;D INDICANDO QUE LAS LUMINARIAS DEL GARAJE PLANTA -1 ESTA SIN LUZ Y LA CENTRAL DE INCENDIOS PITANDO, REVISO EL CUADRO DE AUTOMATICOS Y VIO QUE TODO ESTABA CORRECTO.</p>\r\n<p>SE PASA CORREO A TOMAS XQ ELLOS ESTUVIERON CAMBIANDO EL RELOJ NO HACE UNA SEMANA</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 21 de noviembre de 2013 12:41<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO CP CARMEN AMAYA 2 GARAJE</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Recibimos aviso del propietario c/Carmen Amaya 2 4&ordm;D indicando que no hay luz en toda la planta -1 del garaje, que reviso el cuadro de automaticos de dicha planta y estaba todo correcto. El 14/11 se cambio un reloj temporizador que estaba mal. Por favor, pasarse por all&iacute;, revisar que ocurre y solucionarlo. Informar a la administraci&oacute;n que ocurr&iacute;a para llamar al presidente. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">Telf./Fax 985.149.836</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">administrativo@algonz.es</span></p>\r\n<p>&nbsp;EL 21/11/13 (17.10) PASO DAVID DE ITELCO A RECOGER LAS LLAVES DE CARMEN AMAYA 2. Se recibe correo de Tom&aacute;s dice que se pas&oacute; por all&iacute; y quedo solucionado en garantia. El reloj que pusimos el otro dia debi&oacute; tener alg&uacute;n fallo de fabrica. El tema de la central qued&oacute; solucionado, me comenta David que la central el otro dia estaba bien.</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;NO VA CON CARGO.</span></p>\r\n<p>&nbsp;</p>'),
	(155, 147, '2013-11-19', '2013-11-22', NULL, 1, '', 'LUMINARIAS SOPORTAL', '<p><strong>19/11/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE LUPE INDICANDO QUE LAS LUMINARIAS DEL SOPORTAL QUE ESTAN DONDE LA ZONA DE GARAJE Y PORTAL 11, ESTAN FUNDIDAS, ELLAS NO PUEDEN CAMBIARLAS XQ SE NECESITA UNA ESCALERA MUY ALTA.&nbsp;</p>\r\n<p>13:55HRS.- SE LLAMA A TOMAS X TFN PARA QUE PASE A CAMBIARLAS Y HAGA UNA REVISION A TODA ESA ZONA X SI HAY ALGUNA OTRA LUZ QUE HAYA QUE CAMBIAR</p>\r\n<p><strong>21/11/2013.-&nbsp;</strong>SE ENVIA CORREO RECORDATORIO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 21 de noviembre de 2013 12:36<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO CP BELLAVISTA</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">(Aviso dado telef&oacute;nicamente).</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos informa la encargada de limpieza (Lupe) que en el soportal de CP Bellavista a la altura de entrada al garaje y del portal n&ordm;11 est&aacute;n las luminarias fundidas. Para su reposici&oacute;n se necesita una escalera bastante grande. Por favor, pasarse por all&iacute; y hacer una revisi&oacute;n de todas las luminarias de soportal y cambiar las que sean precisas. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>'),
	(156, 148, '2013-11-19', '2013-11-28', NULL, 1, '', 'SUST. EMERGENCIAS GARAJE- INSPECCION BAJA TENSION', '<p>EN JUNTA 12/11/2013 SE APROBO EL PRESUPUESTO DE ITELCO DE SUST. DE 2 EMERGENCIAS Y 10 LAMPARAS SA13342 POR IMPORTE DE 221,98&euro;. SE ADJUNTA EL PRESUPUESTO.</p>\r\n<p>TAMBIEN EN LA JUNTA SE ACORD&Oacute; QUE CUANDO FUESE EL ELECTRICISTA AL GARAJE REALICE 2 AVISOS:</p>\r\n<p>- CUANDO SE APERTURA PUERTA DEL PORTON GARAJE NO SE ENCIENDEN LAS LUCES DEL GARAJE</p>\r\n<p>- EN PORTAL 25, EL DETECTOR PRESENCIA DEL PORTAL QUEDA PARPADEANDO EN OCASIONES</p>\r\n<p>LE REMITI E-MAIL A TOMAS EL 19/11/13, CUANDO REALICE TRABAJOS ADJUNTAR LA FACTURA Y ESPECIFICAR A QUE CORRESPONDE.</p>'),
	(157, 149, '2013-11-22', '2013-11-27', NULL, 1, '', 'AJUSTE BARANDILLA ESCALERAS', '<p><strong>22/11/2013.-&nbsp;</strong>EN JUNTA DE FECHA 12/11/2013 SE NOTIFICA&nbsp;<strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: \'Palatino Linotype\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: blue; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">PARA PAZ:&nbsp; NOTIFICARON QUE LA BARANDILLA DE LA ESCALERA ESTA SUELTA / PARA QUE PASE JOSE ANTONIO A SUJETARLO</span></strong></p>\r\n<p><span style="color: #000000;"><span style="font-size: 8pt; font-family: \'Palatino Linotype\';">SE MANDA CORREO A JOSE A.LEONARDO PARA QUE REVISE TODA LA ESCALERA Y EN LAS ZONAS DONDE ESTE SUELTA LO DEJE BIEN SUJETO.</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 11:18<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> AVISO CP EL ROBLE, C/LES CIGARRERES 23-25</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Han notificado en junta de fecha 12/11 que algunas de las barandillas de las escaleras estan sueltas. Por favor, pasarse por la comunidad, revisar y dejar correctas las que as&iacute; se localicen. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;</p>'),
	(158, 150, '2013-11-22', '2013-11-29', NULL, 1, '', 'LIMPIEZA DE TEJADO', '<p><strong>TRANSFERIDO DE OUTLOOK.(</strong>ARCHIVADO EN DOCUMNTS.ADJUNTOS)</p>\r\n<p><strong>22/11/2013.-&nbsp;</strong>EN JUNTA DE FECHA 17/10 SE DETERMINA&nbsp;<span style="font-family: Verdana; font-size: 8pt; text-align: justify;">Para este ejercicio se realizar&aacute; limpieza de tejado antes de que se inicie la temporada de lluvias.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Verdana; color: blue;">PAZ: AQU&Iacute; TENEMOS PRESUPUESTO DE ASTUR &ndash; OBRA PERO ESTE TEJADO LO HA LIMPIADO ANTERIORMENTE JOSE ANTONIO LEONARDO SI ESO PIDELE PROPUESTA Y SI ESTA +/- DE PRECIO ADJUDICASELO PUES EL NOS HACE MUCHAS CHORRADITAS Y TAMBIEN HAY QUE TOMARLO EN CUENTA PARA ESTOS TRABAJITOS.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="color: #000000;"><strong><span style="font-size: 8pt; font-family: Verdana;">CORREO&nbsp;</span></strong><span style="font-size: 8pt; font-family: Verdana;">RECIBIDO DE JOSE A.LEONARDO CON PRESUPUESTO, ARCHIVADO EN DOCUMNTS.ADJUNTOS.</span><br /></span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><strong><span style="color: #000000;"><span style="font-size: 8pt; font-family: Verdana;">22/11/2013.-</span></span></strong><span style="color: #000000;"><span style="font-size: 8pt; font-family: Verdana;">&nbsp;CORREO ENVIADO A JOSE A.LEONARDO CON LA ACEPTACION DEL PRESUPUESTO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 12:32<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> RE: PRESUPUESTO CARBAYO 9-11</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Adjunto remitimos aceptaci&oacute;n de presupuesto sobre los trabajos de limpieza de tejado y canalones. Por favor, comunicar en la administraci&oacute;n cuando esten realizados. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: 8pt;">Paz Ortiz</span></p>'),
	(159, 151, '2013-10-29', '2013-10-31', '2013-10-31', 2, '', 'GOLPE PUERTA Y RUIDO', '<p><strong>EN JUNTA DE FECHA 17/10&nbsp;</strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">Notifican del portal 11 que la puerta del ascensor pega golpe y hace mucho ruido y en la puerta de la 3&ordm; planta chirr&iacute;a.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Verdana; color: blue;">PAZ: AVISA A LA EMPRESA DE ASCENSORES EL AVISO LO DIO SANDRA EN LA JUNTA.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><strong><span style="color: #000000;"><span style="font-size: 8pt; font-family: Verdana;">29/10/2013(12:30H).- </span></span></strong><span style="color: #000000;"><span style="font-size: 8pt; font-family: Verdana;">&nbsp;LLAMADA A SCHINDLER 901.300.800, SERGIO, SE LE DEJA AVISO SOBRE LOS AVISOS Y NOS INDICA QUE MANDARAN A UN TECNICO A LA ZONA PARA QUE REVISE.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="color: #000000;"><span style="font-size: 8pt; font-family: Verdana;">12/11/2013.- VIENE SANDRA X LA OFICINA PARA FIRMAR, SE LE PREGUNTA Y NOS DICE QUE ELLA AHORA LO VE BIEN, QUE SI PERCIBE OTRA VEZ RUIDO Y/O DEMAS QUE NOS LLAMA O LE DA AVISO AL PTE.</span></span></p>'),
	(160, 152, '2013-10-29', '2013-10-30', '2013-10-30', 2, '', 'AVISO A L.MORO DE CIERRE DE PUERTAS', '<p><strong>EN JUNTA DE FECHA 17/10&nbsp;</strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">Solicitan se comunique a la limpiadora que cierre la puerta, apuntando un vecino en Junta que rodea la zona un indigente que entra en los portales y hace sus necesidades fisiol&oacute;gicas en el &uacute;ltimo rellano antes de acceder a los trasteros. Por este tema tambi&eacute;n se solicita encarecidamente a los vecinos no abrir la puerta a desconocidos. Esta misma incidencia tambi&eacute;n ocurre en el portal 22 y 26 de esta misma calle. Un vecino de </span>la Comunidad<span style="font-family: Verdana; font-size: 8pt; text-align: justify;"> propone colocar una puerta en el rellano de la 3&ordm; hacia la 4&ordm; con el fin de evitar la entrada. Este tema se tratar&aacute; en una siguiente Junta.</span><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">&nbsp; </span><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">En cuanto al tema de abrir la puerta a personas desconocidas una de las vecinas que me dio la representaci&oacute;n tambi&eacute;n propon&iacute;a que se reclamara a la suministradora de publicidad la introducci&oacute;n de la propaganda en los buzones, teniendo cesta para la colocaci&oacute;n de la misma. Nos informaremos para enviar carta certificada con acuse de recibo.</span><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Verdana; color: blue;">PAZ: HABLALO CON JULIO LO QUE SEA DE LIMPIEZA Y LO DEMAS SI NO INSISTEN LO DEJAMOS ASI PUES COMO SABEMOS QUIENES SON LAS EMPRESAS QUE ENTREGAN LA PUBLICIDAD PARA ENVIARLE UNA CARTA DE QUE CESEN EN LA ENTREGA DE PUBLICIDAD</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="color: #000000;"><strong><span style="font-size: 8pt; font-family: Verdana;">29/10/2013.- </span></strong><span style="font-size: 8pt; font-family: Verdana;">&nbsp;CORREO ENVIADO A JULIO MORO</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 29 de octubre de 2013 13:11<br /> <strong>Para:</strong> \'limpiezasmoro@hotmail.com\'<br /> <strong>Asunto:</strong> EDIF.CARBAYO SOR JUANA INES DE LA CRUZ 9-11</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenos d&iacute;as Julio.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; En junta de fecha 17/10/2013, los propietarios de las viviendas sito en c/Sor Juana Ines de la Cruz 9 &ndash; 11, solicitaron a la limpiadora que </span><strong style="font-family: Arial; font-size: 8pt;"><span style="text-decoration: underline;">CIERRE LAS PUERTAS</span></strong><span style="font-family: Arial; font-size: 8pt;">, ya que indica un vecino que se ha percatado como hay un indigente por la zona que accede al interior de los portales, y una vez dentro duerme e incluso se permite hacer sus necesidades fisiol&oacute;gicas en el ultimo rellano antes de acceder a los trasteros. Por favor, indicarle este tema a la encargada de la limpieza de la comunidad para que deje cerradas siempre las puertas. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>'),
	(161, 152, '2013-10-29', '2013-11-29', NULL, 1, '', 'LIMPIEZA PUNTOS DE LUZ', '<p><strong>29/10/2013.- EN JUNTA DE FECHA 17/10&nbsp;</strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">En cuanto a la limpieza uno de los vecinos que me dio la representaci&oacute;n reclama que los puntos de luz del trastero y rellanos no se han limpiado, por lo que se reclamar&aacute; a la empresa de limpieza.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Verdana; color: blue;">PAZ: HABLALO CON JULIO LA VERDAD QUE HABLA DE LOS PUNTOS DE LUZ EN EL CONTRATO PERO ENTIENDO QUE SON LOS INTERRUPTORES PERO LOS PLAFONES HAY QUE DESMONTARLOS PASARLE UN PA&Ntilde;O Y VOLVERLOS A COLOCAR. INTENTALO PERO LA VERDAD QUE NO LE CORRESPONDE Y AS&Iacute; SE LO DEJE SABER A ANA MARIA CUANDO PASO POR LA ADM A DEJARNOS LA REPRESENTACION.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><strong><span style="color: #000000;">29/10/2013.- </span><span style="font-size: 8.0pt; font-family: Verdana; color: blue;"><span style="color: #000000;">&nbsp;</span></span></strong><span style="font-size: 8.0pt; font-family: Verdana; color: blue;"></span><strong><span style="font-size: 8.0pt; font-family: Verdana; color: blue;"><br /><br /></span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 12.0pt;"><span style="font-size: 8.0pt; font-family: Verdana; color: blue;"></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 13:24<br /> <strong>Para:</strong> \'limpiezasmoro@hotmail.com\'<br /> <strong>Asunto:</strong> SOLICITUD CP CARBAYO C/SOR JUANA INES DE LA CRUZ 9 -11 </span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as Julio.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; En junta de fecha 17/10/2013, los propietarios de las viviendas sito en c/Sor Juana Ines de la Cruz 9 &ndash; 11, solicitaron (reclamaron) la limpieza de los puntos de luz en la zona de trasteros y rellano de escaleras, por favor, dar una repasada a lo solicitado para que no tengan m&aacute;s que decir. Asimismo dar aviso en la administraci&oacute;n cuando se haya realizado. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>'),
	(162, 110, '2013-11-22', '2014-01-31', NULL, 1, '', 'HACER REJILLA EN GARAJE', '<p><strong>TRANSFERIDO DE OUTLOOK</strong></p>\r\n<p><strong>2</strong>2/11/2013.- VINO EL VECINO AFECTADO, VICTOR, EN UN INICIO VINO PARA RECLAMAR A RENDUELES QUE HABIA PASADO TODO EL VERANO Y NO HABIA ECHO NADA DE LO QUE LE DIJO A &Eacute;L PERSONALMENTE QUE HAR&Iacute;AN (REJILLA DONDE LA PLAZA DE GARAJE N&ordm; 71 Y REVISI&Oacute;N DE SU TRASTERO PARA EL TEMA DE LA HUMEDAD). QUE HOY AL IR A COGER EL COCHE SE HABIA ENCONTRADO CON QUE AL VECINO DE LA PLAZA 51 SE LE HABIA ROTO UN BIDON DE GASOLINA QUE TENIA EN SU PLAZA &iexcl;&iexcl;&iexcl;&iexcl;&iexcl;&iexcl;&iexcl;&iexcl;!!!!!! Y QUE DICHA GASOLINA HABIA BAJADO HASTA SU PLAZA Y ALLI HABIA QUEDADO ESTANCADA PUESTO QUE NO TIENE PARA DONDE FILTRAR, QUE ESO SI HUBIERA HABIDO UNA REJILLA NO HUBIERA PASADO, AL MARGEN QUE CON LAS LLUVIAS QUE HA HABIDO EN LA ZONA YA TIENE AGUA EN LA PLAZA. SE LE INDICA QUE VAMOS A RECLAMAR A RENDUELES ESOS ARREGLOS.</p>\r\n<p>&nbsp;PASADAS UNAS 2 HRS. VUELVE EL AFECTADO VICTOR Y NOS COMENTA QUE NO HAGAMOS NADA, QUE HA ESTADO CON RENDUELES Y QUE HAN VISTO TODO EL TEMA, HAN QUEDADO EN QUE LE HARAN LA REJILLA DONDE LA PLAZA Y LE HARAN UNAS REJILLAS DE VENTILACION TB EN EL TRASTERO, XQ LE DICEN QUE ES CONDENSACION (con este el afectado no esta muy conforme, cree que ese no es el problema, pero que si ven que esa es la soluci&oacute;n pues adelante). VICTOR (AFECTADO) NOS DICE QUE YA QUEDA &Eacute;L CON RENDUELES PARA ESTE TEMA, QUE NOS IRA INFORMANDO.</p>'),
	(163, 153, '2013-11-22', '2013-11-27', NULL, 1, '', 'CERRADURA CUARTO RITI PORTAL', '<p><strong>22/11/2013- EN JUNTA DE FECHA 18/11&nbsp;</strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify;">4</span><strong style="font-family: Verdana; font-size: 8pt; text-align: justify;">&ordm; - Ruegos y preguntas.</strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18.0pt;"><span style="font-size: 8.0pt; font-family: Verdana;">El armario RITI telecomunicaciones que esta en la planta del portal (puerta aluminio blanca seg&uacute;n se entra a la derecha) comunican que est&aacute; siempre abierta, reclaman que se localice llave o en su defecto se coloque bomb&iacute;n para mantener el mismo cerrado. Se le entregar&aacute; una llave al Presidente y otra quedara en la Administraci&oacute;n.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18pt; border: none; padding: 0cm; display: inline !important;"><strong><span style="font-size: 8.0pt; font-family: Verdana; color: #3366ff;">PAZ: PARA ABRIR SINIESTRO EN LA PLATAFORMA LUEGO DAR PONER LLAVE EN EL CAJETIN Y A&Ntilde;ADIR AL LISTADO QUE ESTA ELABORANDO LUISA.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18pt; border: none; padding: 0cm; display: inline !important;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18pt; border: none; padding: 0cm; display: inline !important;"><span style="color: #000000;"><strong><span style="font-size: 8pt; font-family: Verdana;">22/11/2013.-</span></strong><span style="font-size: 8pt; font-family: Verdana;">&nbsp;CORREO ENVIADO A SYTEC</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 19:06<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> AVISO CP CIGARRERES 46</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; En junta de fecha 18/11 se aprueba la colocaci&oacute;n de un bombin en el armario RITI de telecomunicaciones (planta portal puerta de aluminio blanca seg&uacute;n se entra a la derecha). Entregar una copia de dicho bombin en la administraci&oacute;n y otra copia al presidente de la comunidad 1&ordm;D Griselda Mercedes Martinez. Por favor, que la presidenta firme el parte de trabajo as&iacute; como justificante de entrega de dicha llave lo cual, ha de entregarse a la administraci&oacute;n conjunto con </span>la factura. Gracias.</p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 8pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>'),
	(164, 154, '2013-11-22', '2014-12-05', NULL, 1, '', 'REVISION ANUAL BOMBAS GARAJE', '<p>En Junta 10/06/2013 &nbsp;se acord&oacute; revisar bombas de garaje para la temporada oto&ntilde;o-invierno, se hizo revision de las bombas el 18/09/2013, una bomba est&aacute; en la zona de Vizcaina 20 y otra en la zona de Teodoro Cuesta. Programar para el a&ntilde;o 2014, antes de llamar a Eduardo hablar con Fernando Li&ntilde;eira o el Presidente de la Comunidad y comertarles el tema.</p>'),
	(165, 156, '2013-11-22', '2014-03-10', NULL, 1, '', 'REVISION BOMBAS GARAJE', '<p>EL <strong>20/08/2013</strong>, SE REVISARON LAS BOMBAS DEL GARAJE, PORQUE UNA DE ELLAS NO ESTABA FUNCIONANDO, SE REPAR&Oacute; Y SE FIJA UNA SIGUIENTE REVISION PARA DENTRO DE SEIS MESES, MARZO DE 2014, SE VALORAR&Aacute; SI SE REALIZA LA REVISION O SI SE ESPERA OTROS SEIS MESES M&Aacute;S PARA REALIZARLA ANUAL.</p>'),
	(166, 155, '2013-11-22', '2013-11-26', NULL, 1, '', 'RUIDO Y GOLPE DE ASCENSOR', '<p><strong>22/11/2013.- EN JUNTA DE FECHA 18/11&nbsp;</strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 18pt;">Notifican en cuanto al ascensor, que al frenar unos segundos antes en la maniobra de subida se escucha un ruido, se realiz&oacute; in sito maniobra de subida del portal al 2&ordm; y unos segundos antes nos percatamos del ruido. Se notificara a la empresa Embarba para su revisi&oacute;n.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18.0pt;"><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Verdana; color: #3366ff;">PAZ: PARA ABRIR SINIESTRO EN PLATAFORMA ALGONZ.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18.0pt;"><span style="color: #000000;"><strong><span style="font-size: 8pt; font-family: Verdana;">SE MANDA CORREO A EMBARBA</span></strong></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 22 de noviembre de 2013 19:44<br /> <strong>Para:</strong> \'Asturias\'<br /> <strong>Asunto:</strong> AVISO CP CIGARRERES 46</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; En junta de fecha 18/11 se notifica (y se comprueba) que el ascensor al frenar, unos segundos antes en la maniobra de subida se escucha un ruido. Por favor, pasar a revisar que ocurre para que pueda subsanarse. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 18.0pt;">&nbsp;</p>'),
	(167, 157, '2013-11-22', '2014-05-04', NULL, 1, '', 'LIMPIEZA PREVENTIVA DE BAJANTES', '<p>TRAMPILLAS DEL PORTAL 1.- TODAS LAS LETRAS EN EL PORTAL IDENTIFICADAS CON PUERTAS EN FALSO TECHO</p>\r\n<p>TRAMPILLAS DEL PORTAL 2.- UNA EN EL SOPORTAL, DOS EN EL PORTAL, Y LA DE LA LETRA A EN EL CUARTO DE LIMPIEZA.</p>\r\n<p>(SI HAY DUDAS LEER LA TAREA DE OUTLOOK QUE ESTA ADJUNTADA)</p>'),
	(168, 158, '2013-11-22', '2014-01-12', NULL, 1, '', 'PODAR LOS LILANDYS', '<p>EN JUNTA DE FECHA 10/10/13 MARIA ANGELES INDICA QUE AUNQUE NO LO HA VUELTO A MENCIONAR, EN EL ACTA ANTERIOR ESTABA APROBADO LA SIEGA DE LILANDYS, ASI QUE PROGRAMARLA PARA ENERO 2014. VER TAREA ADJUNTADA.</p>'),
	(169, 159, '2013-11-25', '2013-12-01', NULL, 1, '', 'RUIDO EN BAJADA DE ASCENSOR', '<p><strong><span style="background-color: #00ccff;">25/11/2013.-</span> </strong>EN LA JUNTA QUE SE CELEBRO EL 22/11/2013 NOS HEMOS PERCATADO QUE AL BAJAR EL ASCENSOR METE UN RUIDO COMO CLO, CLO, CLO EN MITAD DEL RECORRIDO. PROCEDO A 11:10 HORAS HABLO CON DAVID TECNICO DE EMBARBA Y LE DOY EL AVISO. QUEDA EN PASAR ESTA SEMANA O LA QUE VIENE POR LA CDAD, Y NOS INFORMA SOBRE EL TEMA.&nbsp;<strong><span style="background-color: #ffff00;">SI NO LLAMA PARA INFORMAR, LLAMAR DESDE LA ADMINISTRACION PARA PREGUNTAR SOBRE LE INCIDENCIA.</span></strong><strong><span style="background-color: #ff0000;"><br /></span></strong></p>'),
	(170, 160, '2013-11-25', '2013-11-27', NULL, 1, '', 'DETECTOR PRESENCIA PLANTA 5ª', '<p><strong>25/11/2013.-&nbsp;</strong>NOS LLAMA RICARDO 6&ordm;C INDICANDO QUE LE AVISO LA VECINA DEL 5&ordm;C QUE EL DETECTOR DE PRESENCIA DE LA ESCALERA DEL 5&ordm; NO FUNCIONA (NO ENCIENDE LA LUMINARIA), NOS DICE QUE ESTUVO REVISANDOLO &Eacute;L Y QUE EFECTIVAMENTE EL DETECTOR ESTA ESTROPEADO, QUE SE ENVIE A UN ELECTRICISTA PARA CAMBIARLO.</p>\r\n<p>CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 25 de noviembre de 2013 13:38<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO PLAZA PATRICIO ARDURIZ N&ordm;4 </span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso del vecino del 6&ordm;C, Ricardo, indicando que en la zona de escaleras de la planta 5&ordf; el detector de presencia no funciona, nos comenta que lo ha estado revisando &eacute;l y que no tiene arreglo. Por favor, pasarse por all&iacute;, comprobar con el vecino que dio el aviso que detector es el estropeado y su cambio. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>'),
	(171, 161, '2013-11-25', '2013-12-03', NULL, 1, '', 'MODIF ALTERNANCIA  ENCENDIDO VIAL DEL GARAJE', '<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">EN JUNTA REALIZADA 17/10/2013 SE COMENTO EN LA JUNTA QUE EL FINAL DEL GARAJE ESTABA MUY OSCURO Y QUEDAMOS EN MIRAR COMO SOLUCIONARLO SI A&Ntilde;ADIENDO UNA EMERGENCIA/FLUORESCENTES.</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;"><span style="background-color: #00ccff;">15/10/2013.-</span> </span></strong><span style="font-size: 10.0pt; font-family: Tahoma;">PASO JORGE POR LA ADMINISTRACION INFORMANDO QUE LO MAS ECONOMICO Y VIABLE PARA DAR MAS LUZ ES CAMBIAR LA ALTERNANCIA DEL ENCENDIDO DE ESTA MANERA SE PROMEDIA PARA QUE EL FINAL DEL RECORRIDO DEL VIAL DEL GARAJE QUEDE CON MAS CLARIDAD</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Angeles [mailto:angeles@algonz.es] <br /> <strong>Enviado el:</strong> <strong><span style="background-color: #00ccff;">lunes, 25 de noviembre de 2013 14:15</span></strong><br /> <strong>Para:</strong> \'jorge_cembranos@hotmail.com\'<br /> <strong>Asunto:</strong> Carbayo / Sor Juana In&eacute;s de la Cruz 9-11</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Buenas tardes Jorge:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">En relaci&oacute;n a lo que me comentaste del garaje lo comunique a la vecina encargada y le pareci&oacute; bien la modificaci&oacute;n. Por lo que puedes realizar la mejora seg&uacute;n quedamos. Lo que propusiste fue modificara el encendido en cuanto a la alternancia con la finalidad de que el fondo del pasillo quedara con luz. Cuando lo realices nos avisas para anotar en nuestra tarea y si supone gasto nos lo indicas para proceder al pago.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Mar&iacute;a Angeles Gonz&aacute;lez Guti&eacute;rrez</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">C/ Les CIgarreres 25 Bajo </span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">33211 Gijon</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 7.5pt; font-family: Verdana;">Tel&eacute;fono y Fax : 985.14.98.36</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 7.5pt; font-family: Verdana;"><a href="mailto:angeles@algonz.es"><strong><span style="color: windowtext; text-decoration: none;">angeles@algonz.es</span></strong></a></span></p>'),
	(172, 162, '2013-11-25', '2013-12-24', NULL, 1, '', 'PRESUPUESTOS PASAMANOS ESCALERAS', '<p>EN JUNTA 25/11/13 SE ACORDO:</p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">La vecina del 1&ordm;&nbsp; Izda. solicita la colocaci&oacute;n de pasamanos en las escaleras, ya que tiene dificultada al bajar por las escalera y las misma no tiene de donde sujetarse. En principio se pedir&aacute;n propuestas y nos informaremos de las medidas m&iacute;nimas que debe tener la escalera en cuanto a su ancho para saber cual es la que mejor opci&oacute;n sin incumplir normativa. Dependiendo del importe de la obra se realizar&aacute; Junta Extraordinaria.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">PEDIR PROPUESTAS PARA PONDERAR EN UNA SIGUIENTE JUNTA SEGUN EL IMPORTE. COMENTARON DE PINTURAS JORGE C.B. 985.160.591 Y 629.173.344/661.603.263, DICEN QUE REALIZARON UNA EN OTRA COMUNIDAD Y QUEDARON MUY CONFORMES CON LOS TRABAJOS, PEDIR OTRAS PROPUESTAS M&Aacute;S. QUIEREN ALGO BUENO Y QUE OCUPE POCO, EN CUANTO AL ANCHO QUE DEBE QUEDAR LA ESCALERA HAY QUE INFORMARSE Y SI NO PREGUNTAR A JOSE RAMON OBAYA.&nbsp;</span></p>\r\n<p>&nbsp;</p>'),
	(173, 163, '2013-11-25', '2014-12-01', NULL, 1, '', 'LIMPIEZA PREVENTIVA DE BAJANTES', '<p>LIMPIEZA BAJANTES BAJO A-BAJO B Y BAJO C. LA ULTIMA LIMPIEZA DE BAJANTES SE HIZO EN OCTUBRE 2013, ANTES DE HACERLA ESTE A&Ntilde;O, LLAMAR A LOS AFECTADOS Y COMENTARLO CON EL PRESIDENTE PARA QUE DEN EL VISTO BUENO. VER TAREA DE OUTLOOK ADJUNTADA.</p>'),
	(174, 165, '2013-11-25', '2013-11-28', NULL, 1, '', 'REJUNTEO DE PORTON (zona interior)', '<p><strong>25/11/2013.- &nbsp;</strong>SE SOLICITAN PRESUPUESTOS PARA ARREGLO DE ZONA INTERIOR DE PORTON LADO IZDO VISTO DESDE EL INTERIOR, LO SOLICITO EL PRESIDENTE PERO SIN PRISAS.</p>\r\n<p>SE MANDA CORREO DE SOLICITUD A: JOSE A.LEONARDO, LGA (contratistas nuevos), LUDARU</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> lunes, 25 de noviembre de 2013 18:14<br /> <strong>Para:</strong> \'Jose Antonio Leonardo\'<br /> <strong>Asunto:</strong> SOLICITUD DE PRESUPUESTO CP PLAZA PATRICIO ARDURIZ -GARAJE-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Solicitamos a trav&eacute;s de la presente presupuesto de arreglo para rejunteo de parte lateral izda. de cuadrante porton garaje, y/o rejunteo de todo el per&iacute;metro de porton (presupuestar ambos por separado), de la comunidad arriba indicada c/Plaza Patricio Arduriz n&ordm; 1 (Garaje).</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A la espera de sus noticias, un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>'),
	(175, 164, '2013-11-25', '2014-03-06', NULL, 1, '', 'LIMPIEZA PREVENTIVA DE BAJANTES', '<p><span style="background-color: #ffcc99;"><strong>LIMPIEZA ANUAL 2014:</strong></span></p>\r\n<p><strong>MARZO 2014.</strong>- LIMPIEZA BAJANTES VELAZQUEZ 32 1&ordm; E Y VELAZQUEZ 34 1&ordm; B</p>\r\n<p><strong>ABRIL 2014</strong>.- LIMPIEZA BAJANTES VELAZQUEZ 32 1&ordm; D</p>\r\n<p><strong>MAYO 2014.-</strong> LIMPIEZA BAJANTES ELVIRA MU&Ntilde;IZ 1 1&ordm; H</p>\r\n<p><strong>AGOSTO 2014</strong>.- TUBERIA GARAJE -1 (ARQUETA DE LA CALLE)</p>'),
	(176, 166, '2013-11-25', '2014-05-12', NULL, 1, '', 'LIMPIEZA PREVENTIVA DE BAJANTES', '<p>PARA MAYO/JUNIO 2014.-</p>\r\n<p>C/VELAZQUEZ 40 LETRA A (1&ordm;A)</p>\r\n<p>C/VELAZQUEZ 42 LETRA A (1&ordm; A)</p>\r\n<p>C/VELAZQUEZ 42 LETRA B (1&ordm; B)</p>\r\n<p>C/VELAZQUEZ 42 LETRA C (1&ordm; C)</p>');
