	(6, 21, 'VENCIMIENTO DEL CONTRATO / NEGOCIAR Y TRATAR EN JUNTA(vto.01/01/2014)', '2013-08-01', '2014-01-01', '2013-10-08', 2, '<p>HAY QUE PEDIR PRESUPUESTOS PARA VALORAR SI SEGUIR CON ESTA EMPRESA O CAMBIAR A OTRA EMPRESA DE MANTENIMIENTO. YA TENGO PROPUESTA DE JOS&Eacute; LUIS / FELIX PARA MEJORAR CONDICIONES</p>\r\n<p><strong>EN JUNTA DE FECHA 30/09/2013 SE DETERMINA&nbsp;</strong>APROBAR LA PROPUESTA DE THYSSEN CONSISTENTE EN CONTRATO DE RIESTO LIMITADO (INCLUYE UN TOTAL DE 49 PIEZAS DE MAYOR DESGASTE), AS&Iacute; COMO UNA BONIFICACI&Oacute;N DE 3 MESES GRATIS. DURACION DEL CONTRATO 3 A&Ntilde;OS, SIN SER NECESARIO ESPERAR AL VTO. ENTRA EN VIGOR LA NUEVA PROPUESTA EL 01/10/2013&nbsp;</p>', 75),
	(7, 21, 'INSPECCIÓN CADA CUATRO AÑOS DE LOS ASCENSORES (vto.01/01/2014)', '2013-08-29', '2015-01-04', NULL, 1, '', 20),
