	(9, 28, 'RENOVACIÓN DE LA PÓLIZA COMUNITARIA VALORAR EN JUNTA (Vto.11/10/2013)', '2013-02-11', '2013-10-11', '2013-10-28', 2, '<p>El 01/08/2013 se remite carta de Cancelaci&oacute;n. Pendiente valorar en Junta propuesta y/o renovaci&oacute;n de la misma. FECHA VENCIMIENTO P&Oacute;LIZA 11/10/2013.</p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: small;"><span style="font-size: 10pt;"><span style="background-color: #00ccff;">Mail enviado a Isabel de Mapfre 02/10/2013//</span> Ok Aprobado en Junta de fecha 30/09/2013. a Totales por el importe de 1.631,95&euro;. CIF de la Comunidad H-33849886. No de cuenta en Cajastur 2048-0098-41-3400009468</span></span><span style="color: navy; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">Un saludo</span></span></p>\r\n<p class="MsoNormal"><span style="color: navy; font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span></p>\r\n<p class="MsoNormal" style="display: inline !important;"><strong><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;">De:</span></span></strong><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;"> "Rodriguez Garc&iacute;a, Isabel" [mailto:irodri12@mapfre.com] </span></span></p>\r\n<div>\r\n<p class="MsoNormal"><span style="font-family: Tahoma; font-size: small;"><span style="font-size: 10pt;"><strong>Enviado el:</strong> lunes, 30 de septiembre de 2013 14:20<br /><strong>Para:</strong> angeles@algonz.es<br /><strong>Asunto:</strong> PRESUPUESTO CTRA. CARBONERA 58</span></span></p>\r\n</div>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">&nbsp;</span></span><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Te adjunto la comparativa con Catalana Occidente.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Los presupuestos que me hiciste llegar, con cobertura total y da&ntilde;os est&eacute;ticos, con el descuento para este a&ntilde;o plantean 1.481,88 &euro;.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Nosotros con el descuento del 5% sobre los 1.717 &euro; que te hab&iacute;a ofertado, &nbsp;<span style="background-color: #00ccff;">estamos en 1.631,95 &euro;,</span> pero te adjunto la comparativa de coberturas.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">&nbsp;</span></span><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Respecto al tema del capital que dice Catalana, creo que est&aacute;n teniendo en cuenta m2 que est&aacute;n en la p&oacute;liza de garajes y trasteros. Como puedes ver en el desglose que saque del catastro, figuran en cada piso los m2 de vivienda, los m2 de almacen en sotano, los m2 de almacen en vivienda, los m2 de aparcamiento y los m2 de zonas comunes.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">&nbsp;</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Las superficies de vivienda y almacenes situados en vivienda m&aacute;s la parte proporcional de los comunes, son los que tienen que figurar en esta p&oacute;liza. Viviendas: 2.096 + 390 ; Almacenes en vivienda: 96+4</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">&nbsp;</span></span><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Quedo a tu entera disposici&oacute;n para cualquier aclaraci&oacute;n al respecto.</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">&nbsp;</span></span><span style="font-family: Calibri; font-size: small;"><span style="font-size: 11pt;">Un abrazo,</span></span></p>\r\n<p>&nbsp;</p>', 60),
	(12, 8, 'Renovación póliza Comunitaria / Negociar Prima (vcto. 10/08/2013)', '2013-07-01', '2013-08-10', '2013-10-08', 2, '<p>Se le remiti&oacute; carta a Isabel de Mapfre para negociar renovaci&oacute;n. Nos aumento el capital y nos incluy&oacute; los atascos por el mismo precio. Ve mail Angeles// POLIZA RENOVADA EN SEPTIEMBRE 2013, SE HA AUMENTADO EL CAPITAL ASEGURADO Y SE INCLUYEN ATASCOS, PRORROGABLE ANUALMENTE, PAGO SEMESTRAL EN MARZO Y SEPTIEMBRE// Pendiente scaner p&oacute;liza con capital nuevo, y adjuntar ***CUANDO SE RECIBA &nbsp;SCANEAR LA NUEVA POLIZA RECORDAR ABRIR NUEVO AVISO PARA LA PROXIMA CANCELACION DE ESTA POLIZA NUEVA QUE SERA EN EL 10/08/2014.</p>', 60),
	(13, 30, 'RENOVACIÓN DEL CONTRATO DE MANTENIMIENTO ', '2013-09-01', '2016-07-01', NULL, 1, '<p>En la anterior renovaci&oacute;n realizada el 01/07/2013 nos realizaron un 30% de descuento. ESTE CONTRATO VENCE EL 01/07/2016 - HAY QUE AVISAR CON 90 D&Iacute;AS DE ANTELACION, ES POR 3 A&Ntilde;OS</p>', 90),
