	(19, 46, 'POSIBLE CANCELACION POLIZA', '2013-09-17', '2013-11-18', '2013-11-18', 2, '<p>Tema para tratar en junta, el estudio de cambio de compa&ntilde;ia de seguro. en Junta de fecha 17 de Septiembre se &nbsp;aprob&oacute; cancelar dicha poliza.&nbsp;<span style="background-color: #3366ff;"><strong>&nbsp;ESPERAR A QUE LLEGUE EL VENCIMIENTO PARA APLICAR FECHA DE CIERRE<span style="background-color: #ffffff;"> PORQUE HABRA NUEVA POLIZA DE CASER, Y LUEGO A&Ntilde;ADIR COMO EMPRESA A CASER.</span></strong></span></p>', 60),
	(20, 48, 'CANCELACIÓN SERVICIO MANTENIMIENTO ', '2013-09-19', '2014-07-01', NULL, 1, '<p>Anexo al Contrato con fecha de 01/07/2011 por una duraci&oacute;n de 3 a&ntilde;os y prorrogable por 3 a&ntilde;os m&aacute;s. Ver cla&uacute;sula anexa a con bonificaci&oacute;n en tarifa y cambio de periodicidad en Docs.</p>\r\n<p>E<span style="background-color: #ffcc99;"><strong>n Junta 12/11/13 &nbsp;se acord&oacute; con Tresa el suministro de las lineas telefonicas sin coste de instalaci&oacute;n, suponiendo para la comunidad 10,30&euro; mensuales por ascensor. El contrato de las lineas telefonicas va vinculado al cto de mtto de ascensores y tendr&aacute; una duraci&oacute;n de dos a&ntilde;os.</strong></span></p>', 60),
