	(34, 85, 'RENOVACIÓN DE LA PÓLIZA COMUNITARIA VALORAR EN JUNTA', '2013-09-20', '2013-12-23', NULL, 1, '<p>LLAMO RAFA DE CATALANA A MARIA ANGELES, AL RECIBIR LA CARTA DE CANCELACION SEGURO, QUEDO EN REVISAR LA POLIZA HABER SI PODIA AJUSTAR PRECIO PARA ESTE A&Ntilde;O, NO OBSTANTE SE SOLICITARA A ALLIANZ Y GENERALI,</p>\r\n<p><span style="background-color: #ff99cc;">EN JUNTA EXTRAORDINARIA 22/10/13 SE ACORDO CONTINUAR CON CATALANA Y QUE IBA A BAJAR +- 120&euro;. <strong>PENDIENTE ABRIR RENOVACION DE POLIZA EN OTRO AVISO</strong><strong><br /></strong></span></p>', 65),
