	(40, 94, 'TOCA FUMIGACION ', '2013-09-20', '2013-10-10', '2013-10-08', 2, '<p>PROXIMA FUMIGACION (TRIMESTRAL) MARZO/2013</p>\r\n<p><span style="font-size: 11px;">16/04/2013(17:45H).- VINO LA VECINA DEL 5&ordm;I CIGARRERES 23 PILAR GONZALEZ 649.740.089 INDICANDO QUE TIENE HORMIGAS EN SU VIVIENDA, QUE YA NO SABE QUE VA A APLICAR PARA EVITAR QUE SIGAN ENTRANDO, SE LE INDICA QUE SE DARA AVISO A LA EMPRESA DE FUMIGACION PARA QUE CUANDO LO REALICEN SE PASEN X SU CASA PARA VER QUE OCURRE Y DARLE SOLUCION, YA QUE EN ACTA SE FIJO QUE LAS HORMIGAS QUE CADA VECINO TUVIERA DENTRO DE SU CASA CORRIA X CUENTA PRIVATIVA DE CADA UNO QUITARLAS.</span></p>\r\n<p>CORREO ENVIADO A INTERPLAGA</p>\r\n<p>Buenas tardes.-&nbsp;</p>\r\n<p>Seg&uacute;n el seguimiento sobre fumigaci&oacute;n para hormigas en la comunidad indicada CP El Roble, c/Les Cigarreres 23-25, prevista para este mes de abril/2013, indicamos que nos ha informado la propietaria de la vivienda Cigarreres 23 5&ordm;I Pilar Gonzalez 649.740.089 que sigue teniendo hormigas dentro de su vivienda, y con la mejora del tiempo nota como van en aumento. Por favor, ponerse en contacto con ella para ver el problema y poder dar soluci&oacute;n al mismo, (de manera privativa si correspondiera). Asimismo fumigar bien la zona del tejado-terraza para evitar en la medida de lo posible estos problemas. Gracias.&nbsp;</p>\r\n<p>A la espera de sus noticias, un saludo&nbsp;</p>\r\n<p>Paz Ortiz&nbsp;</p>\r\n<p>Asesoria Algonz</p>\r\n<p>&nbsp;</p>\r\n<p>17/04/2013.- SE REALIZO FUMIGACION EN EL DIA DE HOY, PERIMETRO DEL EDIFICIO Y TEJADO-CUBIERTA. ASIMISMO TRATARON EL TEMA TELEFONICAMENTE CON LA VECINA DEL 5&ordm;I.</p>\r\n<p>&nbsp;</p>\r\n<p>TOCA LA SIGUIENTE REVISION EN JULIO/2013.</p>\r\n<p>&nbsp;</p>\r\n<p>26/06/2013(19:10H).- VINO EL TECNICO DE INTERPLAGA PARA REALIZAR LA FUMIGACION DE LA COMUNIDAD (TERRAZA INCLUIDA), SE ADELANTAN UNOS DIAS XQ AHORA HACE BUEN TIEMPO Y DESPUES DE TANTA LLUVIA PUEDEN EMPEZAR A SALIR MUCHAS HORMIGAS.</p>\r\n<p>(RESTO DE SEGUIMIENTO ANTERIOR EN OUTLOOK)</p>\r\n<p><span style="background-color: #00ff00;">SIGUIENTE REVISION OCTUBRE/2013</span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">TENER EN CUENTA UNA VEZ REALIZADO ESTE AVISO ABRIR OTRO AL TRIMESTRE PARA EL PROXIMO TRABAJO Y ASI SUCESIVAMENTE.</span><br /></span></p>\r\n<p><span style="background-color: #00ff00;"><strong>03/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE MANDO CORREO A INTERPLAGA PARA RECORDARLE LA FUMIGACION</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 03 de octubre de 2013 13:32<br /> <strong>Para:</strong> \'INTERPLAGA SL\'<br /> <strong>Asunto:</strong> CP EL ROBLE C/LES CIGARRERES 23-25</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal" style="margin-top: 5.0pt; margin-right: 0cm; margin-bottom: 5.0pt; margin-left: 0cm; text-indent: 35.4pt; text-autospace: none;"><span style="font-size: 10.0pt; font-family: Arial;">Recordamos a trav&eacute;s de la presente trabajos de fumigaci&oacute;n en la comunidad indicada CP Cigarreres 23-25 (Edif.El Roble), el cual seg&uacute;n nuestra base de datos tocar&iacute;a a principios de octubre/13. Indicarle a su vez que recuerden la fumigaci&oacute;n en la cubierta (tejado) el edificio. Gracias.</span></p>\r\n<p class="MsoNormal" style="margin-top: 5.0pt; margin-right: 0cm; margin-bottom: 5.0pt; margin-left: 0cm; text-indent: 35.4pt; text-autospace: none;">Un saludo</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p class="MsoNormal"><span style="background-color: #00ccff;"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">04/10/2013&nbsp;</span></strong><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #ffffff;">&nbsp;Me he puesto en contacto con Interplaga y me informan que ma&ntilde;ana pasaran a recoger las llaves de esta Comunidad por la Administraci&oacute;n para realizar los trabajos de fumigaci&oacute;n, conjuntamente con el Edificio El Roble.&nbsp;<strong>&nbsp;</strong><span style="background-color: #ff0000;"><strong>PENDIENTE ADJUNTAR PARTE DE TRABAJO</strong>.</span></span></span></span></p>', 2),
	(41, 94, 'RENOVACION Y/O ANULACION SERVICIO FUMIGACION', '2013-09-20', '2014-04-17', NULL, 1, '', 90),
	(42, 97, 'RENOVACIÓN DE LA PÓLIZA COMUNITARIA', '2013-09-20', '2013-12-27', NULL, 1, '<p>HABLARA MARIA ANGELES CON ISABEL PARA VER SI LE REVISA LA POLIZA, NO OBSTANTE SE SOLICITAR&Aacute; PROPUESTA A ALLIANZ Y GENERALI PARA COMPARAR PRECIOS.</p>\r\n<p><strong><span style="background-color: #00ccff;">04/11/2013 &nbsp;<span style="background-color: #ffffff;">&nbsp;MARIA JOSE EN ESTE AVISO LLAMA A ISABEL Y QUE MIRE SI SE PUEDEN INCLUIR LOS ATASCOS PUES SER&Iacute;A CONVENIENTE. YA VA PARA 10 A&Ntilde;OS DE CONSTRUCCION Y NO SE HA TENIDO NINGUN SINIESTO DE ESTA REFERENCIA.</span></span></strong></p>\r\n<p><strong><span style="background-color: #00ccff;"><span style="background-color: #ffffff;">YA SE REMITIO CARTA CANCELACION.</span></span></strong></p>', 75),
