	(62, 153, 'RENOVACIÓN DE LA PÓLIZA COMUNITARIA VALORAR EN JUNTA', '2013-09-27', '2014-04-24', NULL, 1, '<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: aqua; mso-highlight: aqua; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">POLIZA FIRMADA EL 24/04/2006, CON DURACION DE 1 A&Ntilde;O PRORROGABLE, EL SUPLEMENTO ES DE FECHA 24/010/2009, Y LA FORMA DE PAGO SEMESTRAL CADA 24 OCTUBRE Y ABRIL.</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong><span style="font-size: 9.0pt; font-family: Verdana;">EN JUNTA 14/10/13 SE ACORDO:</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Se informa que el seguro de la Comunidad vence en Abril del 2014, procederemos a solicitar otras propuestas en otras aseguradoras con igualdad de coberturas y con estas propuestas negociar con Catalana la renovaci&oacute;n de la prima a pagar por la Comunidad. De no obtener igualdad/reducci&oacute;n de la prima a pagar se realizar&aacute; un comparativos de las propuestas solicitadas para que los representantes y la Administradora acuerden la decisi&oacute;n a tomar en cuanto a este Tema. &nbsp;Es lo acordado por los asistentes a la Junta.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><strong>&nbsp;SOLICITAR PRESUPUESTOS A ALLIANZ, GENERALI Y MAPFRE, Y CUANDO SE TENGAN NEGOCIAR CON CATALANA OCCIDENTE, ANTES DE LOS 2 MESES DE PREAVISO Y SI NO REMITIR CARTA CANCELACION SEGURO. UNA VEZ QUE SE TENGA LA POLIZA NUEVA HAY QUE REMITIR COPIA A LOS VECINOS.</strong></p>', 90),
