	(97, 235, 'INSPECCIÓN CADA CUATRO AÑOS DE LOS ASCENSORES', '2013-10-02', '2015-02-17', NULL, 1, '<p><strong><span style="font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: fuchsia; mso-highlight: fuchsia; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">REVISION EFECTUADA POR APPLUS 17/02/2011, ACTA OK, PROXIMA REVISION 17/02/2015</span></strong></p>', 20),
	(98, 40, 'CANCELACION CONTRATO LIMPIEZA', '2013-10-02', '2013-10-31', '2013-10-31', 2, '<p>EN JUNTA DE FECHA 17/09/2013 SE DETERMINA:</p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-family: \'Palatino Linotype\';">En cuanto al servicio de limpieza se determina por todos los asistentes&nbsp; a la Junta cancelar la actual empresa de limpieza, Limpiezas LF (Lourdes Fern&aacute;ndez) y contratar los servicios de limpieza con Limpiezas Castro ( Mercedes Castro Grandal). El importe mensual a pagar asciende a 135&euro; iva incluido, ahorrando la Comunidad 24,53&euro; mensuales. Las tareas a realizar son las siguientes: Limpieza diaria del portal y todos los elementos, limpieza de las escaleras semanal,&nbsp; baldeado seg&uacute;n necesidad de la zona de soportal que abarca la ubicaci&oacute;n del portal 52, reposici&oacute;n de bombillas (compra de las luminarias corre por cuenta de la Cdad). Los servicios con esta nueva empresa se inicial el 02/ de Noviembre de 2013.<span style="background-color: #00ccff;"> 18/09/2013&nbsp;<span style="background-color: #ffffff;">&nbsp;PASA LOURDES POR LA ADMINSITRACION Y LE COMENTO LO ARODADO EN JUNTA, LE INFORMO QUE LE REMITIRE CARTA AVISANDO LA CANCELACION.&nbsp;<span style="background-color: #00ccff;">ADJUNTAR CARTA REMITIDA A LOURDES PARA EL CESE DE LOS TRABAJOS.&nbsp;</span></span></span></span>&nbsp;SE&nbsp;LE REMITE CARTA EL 3/10/13 POR CORREO ORDINARIO. OK EL 31/10/13 ENTREGO LLAVES EN LA OFICINA.</p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;">&nbsp;</p>', 10),
	(99, 244, 'RENOVACION DE CONTRATO', '2013-10-02', '2013-12-09', NULL, 1, '<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: lime; mso-highlight: lime; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">CONTRATO FIRMADO EL 09/12/2003, CON DURACION DE 1 A&Ntilde;O PRORROGABLE.</span></strong></p>', 60),
	(101, 248, 'RENOVACION CONTRATO MTTO PORTON', '2013-10-03', '2013-12-31', NULL, 1, '<p>TRATAR EN JUNTA SI SE VA A RENOVAR O NO EL MTTO DEL PORTON CON ESTA EMPRESA.&nbsp;<strong><span style="background-color: #00ff00;">SE INFORMO EN JUNTA QUE SE RENOVARIA EL CONTRATO CON EL PORTON, SOBRE TODO PORQUE EL MUELLE ESTA A PUNTO DE CASCAR Y DENTRO DEL MANTENIMIENTO NOS CUBRE LA MANO DE OBRA SOLO RESTA PAGAR EL MUELLE Y CUALQUIER PIEZA QUE SE ESTROPEARA.</span></strong></p>', 30),
	(102, 248, 'REVISION CUATRIMESTRAL PORTON ', '2013-09-18', '2013-12-31', NULL, 1, '<p>ULTIMA REVISION REALIZADA EL 18/9/2013, FACTURA Y PARTE EN EL AZ</p>', 1),
