	(105, 245, 'INSPECCIÓN CADA CUATRO AÑOS DE LOS ASCENSORES', '2013-10-06', '2016-01-12', NULL, 1, '<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: lime; mso-highlight: lime; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">ULTIMA INSPECCION REALIZADA 16/01/2012 &nbsp;PROXIMA INSPECCION 12/01/2016</span></strong></p>', 30),
	(106, 250, 'RENOVACION CONTRATO JARDINERIA', '2013-06-07', '2014-06-07', NULL, 1, '<p>* <strong>DOS ACTUACIONES AL A&Ntilde;O.&nbsp;</strong><span style="font-family: Arial; font-size: 10pt;">Se acord&oacute; en Junta 3/05/12, inicio de los trabajos en la segunda quincena de mayo 2012. Se realizar&aacute;n dos actuaciones al mes.</span><span style="font-family: Arial; font-size: 11pt;"><br /></span></p>\r\n<p><span style="font-family: Arial; font-size: 10pt;"><span style="background-color: #ffff00;">En Junta 24/10/13 se aprob&oacute; continuar con la misma empresa de jardineria (asturdesbroces)</span> y dar seguimiento a los trabajos realizados. "<strong>De la parte trasera no realizan ninguna queja b&aacute;sicamente se quejan de las hiedras no por la siega en si, sino porque las mismas no las rebajan y tienen un grosor considerable entendiendo los vecinos que no est&aacute; bien cuidado. En cuanto a la zona de lavandas en las piedras siguen existiendo hierbas malas</strong>".</span></p>', 15),
