	(149, 131, 'RENOVACION POLIZA COMUNITARIA', '2013-10-10', '2014-10-10', NULL, 1, '<p>REVISAR LOS CAPITALES (CONTINENTE-CONTENIDO) CON REALE</p>\r\n<p>En Junta 31/10/13 se determin&oacute; solicitar presupuestos de otros seguros para el a&ntilde;o 2014</p>', 60),
	(150, 141, 'RENOVACION POLIZA COMUNITARIA', '2013-10-10', '2014-10-10', NULL, 1, '<p>REALE EN 2013 NO HIZO BONIFICACION EN LA POLIZA POR TENER SINIESTRALIDAD DEL 97%. SE VA A VALORAR EN LA JUNTA 31/10/13 SI SE AUMENTAN O NO LOS CAPITALES (CONTINENTE Y CONTENIDO)</p>\r\n<p>En Junta 31/10/13 se determin&oacute; solicitar propuestas de seguros para el a&ntilde;o 2014</p>', 60),
	(151, 332, 'RENOVACION POLIZA COMUNITARIA', '2013-09-29', '2014-09-29', NULL, 1, '<p>EN EL A&Ntilde;O 2013 VAN A REBAJAR A LA POLIZA LA CANTIDAD DE 44&euro;, NO OBSTANTE EN JUNTA DE 31/10/13 SE VALORARA SI SE AMPLIAN O NO LOS CAPITALES DE LA MISMA.&nbsp;</p>\r\n<p>En Junta 31/10/13 se determin&oacute; solicitar presupuestos a varios seguros para el a&ntilde;o 2014.</p>', 90),
	(152, 335, 'RENOVACION POLIZA COMUNITARIA', '2012-10-17', '2013-10-17', '2013-10-22', 2, '<p>EN JUNTA 3/10/13 SE ACORD&Oacute; CONTINUAR CON MAPFRE PERO SE AJUST&Oacute; LA POLIZA.<span style="background-color: #00ffff;"> PTE RECIBIR POLIZA Y ADJUNTARLA.</span></p>', 60),
	(153, 336, 'MOROSO 1º A', '2013-10-10', '2015-12-31', NULL, 1, '<p>R<strong>ECLAMACION MOROSO ESMERALDA MASEDA, 3, 1&ordm; A- JOSE PABLO RODRIGUEZ VIGIL</strong></p>\r\n<p>EN JUNTA <strong>3/10/2013</strong> SE ACUERDA RECLAMAR JUDICIALMENTE AL 1&ordm; A LA CANTIDAD DE 698,98&euro; A FECHA 30/9/13. SE LE VA A REMITIR BUROFAX CON UN PLAZO DE 5 DIAS PARA QUE ABONE Y SI NO PROCEDER A INTERPONER MONITORIO. SE ABRIR&Aacute; EXPEDIENTE EN EL SEGURO CUANDO SE REMITA DOCUMENTACION A JOSE BORDIU, MIENTRAS TANTO NO POR SI ACASO PAGA ANTES. SE ADJUNTA DESGLOSE DE LA DEUDA. Y PTE ADJUNTAR BUROFAX REMITIDO Y DEM&Aacute;S DOCUMENTACI&Oacute;N.</p>\r\n<p>EL 11/10/13 SE REMITE BUROFAX Y &Eacute;STE <strong>RESULTO ENTREGADO EL 11/10/13 A LAS 18.14</strong> A MARISOL FDEZ. REMIS. EN EL BUROFAX SE LE DABA UN PLAZO DE CINCO DIAS PARA ABONAR LA DEUDA. ESPERAREMOS A LA SEMANA DEL 21 DE OCTUBRE Y SI NO ABONA REMITIR DOCUMENTACI&Oacute;N A JOSE BORDIU PARA QUE INICIE MONITORIO Y APERTURAR EXP. EN SEGURO.</p>\r\n<p>EL 23/10/13 REVISE CUENTA CAJA ESPA&Ntilde;A Y NO HA HABIDO NINGUN ABONO DEL 1&ordm; A, CON LO CUAL REMITO DOCUMENTACION POR CORREO CERTIFICADO CON ACUSE DE RECIBO A JOSE BORDIU EL 24/10/13 PARA QUE INICIE MONITORIO Y LUEGO APERTURO EXPEDIENTE EN EL SEGURO.</p>\r\n<p>El 28/10/13 me remite Graciela presentacion del monitorio de Jos&eacute; Pablo, se archiva en carpeta roja. Llame a Mapfre para aperturar expediente, me toman datos y me llamaran del servicio juridico, me asignan el siguiente n&uacute;mero de Expediente 568083361</p>\r\n<p>El 8/11/13 me remiten e-mail del Seguro, solicitandome documentaci&oacute;n en relaci&oacute;n a la deuda pendiente, y con fecha 13/11/13 se le remite por e-mail dicha documentaci&oacute;n. La tramitadora del expediente es Rosa Mar&iacute;a Rodriguez Franco 915.818.771</p>', 10),
	(154, 336, 'MOROSO 2º C', '2013-10-10', '2015-12-31', NULL, 1, '<p><strong>RECLAMACION MOROSO ESMERALDA MASEDA 3, 2&ordm; C- SENEN RATO ZAPICO (DOCUMENTACION QUE NO ESTE ADJUNTA ESTA EN LA CARPETA ROJA DE MOROSOS)</strong></p>\r\n<p><span style="background-color: #00ffff;">1&ordm; RECLAMACION (A&Ntilde;O 2012- ABRIL 2011 A MARZO 2012)</span> EN JUNTA 8/05/2012 SE ACORD&Oacute; RECLAMAR LA CANTIDAD DE 411,99&euro; A FECHA 31/03/2012 M&Aacute;S BUROFAX 26,54&euro; = 438,53&euro;. SE REMITE DOCUMENTACI&Oacute;N A JOSE BORDIU EL 11/07/2012 PARA QUE INICIE MONITORIO N&ordm; 602/2012. SE ABRE EXPEDIENTE EN EL SEGURO CON N&ordm; 543713771. CON FECHA 3/10/13 NOS REMITE GRACIELA LA PROCURADORA LO ULTIMO QUE ES LA EJECUCION DEL PROCEDIMIENTO N&ordm; 23/2013, SE SOLICITA EMBARGO CANTIDADES EN VARIAS CUENTAS BANCARIAS. IRA PARA LARGO.... SE ADJUNTA ESTA EJECUCION.</p>\r\n<p><span style="background-color: #00ffff;">2&ordm; RECLAMACION (A&Ntilde;O 2013- ABRIL 2012 A MARZO 2013)</span> EN JUNTA 22/05/2013 SE ACORDO RECLAMAR LA CANTIDAD DE 780,80&euro; A FECHA 31/03/2013 M&Aacute;S BUROFAX 27,65&euro;. SE REMITE DOCUMENTACION A JOSE BORDIU CON FECHA 5/10/13 PARA QUE INICIE MONITORIO. SE ABRE EXPEDIENTE EN EL SEGURO CON N&ordm; 567253501. PTE RECIBIR COPIA DEMANDA PRESENTADA, EL 16/10/13 REMITE GRACIELA DEMANDA PRESENTADA EL 9/10/13</p>\r\n<p><span style="background-color: #00ffff;">3&ordm; RECLAMACION (A&Ntilde;O 2013- ABRIL 2013 A SEPT. 2013)</span> EN JUNTA 3/10/2013 SE ACORD&Oacute; RECLAMAR LA CANTIDAD DE 413,40&euro; A FECHA 30/9/13 M&Aacute;S BUROFAX 27,65&euro;. PTE REMITIR BUROFAX Y ESPERAR SI NO PAGA, REMITIR DOCUMENTACION A JOSE BORDIU Y ABRIR NUEVO EXPEDIENTE EN EL SEGURO. PTE ADJUNTAR DOCUMENTACION.&nbsp;<strong>11/10/13</strong>, SE REMITI&Oacute; BUROFAX AL MOROSO 2&ordm; C, CON FECHA 14/10/13 SE RECIBE DE CORREOS LA NOTIFICACION DE QUE EL BUROFAX RESULTO <strong>NO ENTREGADO, DEJADO AVISO,</strong> HABR&Aacute; QUE ESPERAR A QUE PASE UN MES Y RESULTE CADUCADO EN LISTA, CON LO CUAL ESPERAREMOS HASTA 11/11/13, PARA LUEGO REMITIR DOC. A JOSE BORDIU Y APERTURAR EXP. EN SEGURO. Con fecha 18/11/13 se va a remitir a Jos&eacute; Bordiu carta certificada con acuse con la documentaci&oacute;n. EL 18/11/13 LLAME A MAPFRE PARA APERTURAR EXPEDIENTE EN SEGURO, ME TOMAN DATOS Y ME FACILITAN N&ordm; EXP. 569100761, EL DPTO JURIDICO SE PONDRA EN CONTACTO CON NOSOTROS.</p>', 10),
	(155, 337, 'RENOVACION CONTRATO LIMPIEZA', '2013-10-11', '2014-09-01', NULL, 1, '<p>EN JUNTA 17/10/13 SE ACORDO SUPRIMIR EL ASPIRADO MECANICO DEL GARAJE QUE SE REALIZABA CADA CUATRO MESES, LO CUAL SUPONE UN AHORRO DE 24,20&euro; MENSUALES. ENTRA EN VIGOR A PARTIR DE 1/11/13.</p>', 30),
	(156, 338, 'RENOVACION CONTRATO ASCENSORES', '2013-10-11', '2013-10-31', NULL, 1, '<p>* <strong>CANCELACI&Oacute;N</strong>. A trav&eacute;s de carta certificada.</p>\r\n<p><span style="background-color: #ffcc00;">EN JUNTA DE 17/10/13 SE RENUEVA MTTO ASCENSORES CON SCHINDLER. PTE RECIBIR CONTRATOS FIRMADOS PARA ADJUNTARLOS. LLAME A PABLO 13/11/13 &nbsp;ME DIJO QUE LA PERSONA QUE FIRMA LOS CONTRATOS ESTA DE BAJA POR MATERNIDAD Y QUE SEGURO HASTA EL MES QUE VIENE NO LOS TENDRA, QUE NO ME PREOCUPE QUE EN CUANTO LOS TENGA NOS LOS ENVIA. LA COPIA CON LA QUE NOS QUEDAMOS ESTA ARCHIVADA EN LA BANDEJA DE ASCENSORES.</span></p>', 30),
	(157, 338, 'INSPECCION PERIODICA ASCENSOR ', '2013-10-11', '2013-12-01', NULL, 1, '<p>* <strong>SEGUNDA INSPECCION</strong>, para solventar deficiencias graves que se vieron en la primera inspecci&oacute;n. Falta de escalera en foso de ascensor. Presupuestos pendientes de aprobaci&oacute;n en Junta OCT 2013.&nbsp;</p>\r\n<p>EN JUNTA 17/10/13 SE ACORDO APROBAR PRESUPUESTO PARA COLOCAR ESCALERA DE ACCESO AL FOSO, POR IMPORTE DE 163,88&euro;, PARA LUEGO PODER PASAR LA INSPECCION DE ASCENSOR. PTE DE COLOCARLO. HABLE CON PABLO EL 13/11/13 ME DICE QUE TODAVIA NO ESTABAN COLOCADAS QUE CUANDO LO HAGAN TRAERAN EL PARTE Y QUE LUEGO YA LLAMAN ELLOS A LA ECA.</p>', 10),
	(158, 346, 'RENOVACION POLIZA COMUNITARIA', '2013-10-11', '2014-07-01', NULL, 1, '', 60),
	(159, 348, 'INSPECCION EXTINTORES', '2013-10-11', '2014-02-01', NULL, 1, '', 10),
	(160, 349, 'RENOVACION CONTRATO ASCENSORES', '2013-10-11', '2017-07-01', NULL, 1, '', 30),
	(161, 356, 'RENOVACION POLIZA COMUNITARIA', '2013-10-11', '2013-11-25', NULL, 1, '<p>NO SE HA REMITIDO CARTA CANCELACION A MAPFRE, QUEDO MARIA ANGELES EN HABLAR CON ISABEL PARA VER SI LE AJUSTA UN POCO EL PRECIO PARA ESTE A&Ntilde;O.</p>\r\n<p class="MsoNormal"><span style="background-color: #00ccff;"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">12/11/2013.-<span style="background-color: #ffffff;">&nbsp;NOS REMITE PROPUESTA ISABEL QUE HE ACEPTADO.</span></span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"><span style="background-color: #ffffff;">&nbsp;</span></span><span style="font-size: 10pt; font-family: Tahoma; background-color: #ffcc99;">PENDIENTE QUE NOS ACERQUE NUEVA POLIZA ADJUNTAR A PLATAFORMA, RESE&Ntilde;AR ATASCOS NUEVA COBERTURA/ ESTA POLIZA INCLUYE PRIVATIVAS Y COMUNES.</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Angeles [mailto:angeles@algonz.es] <br /> <strong>Enviado el:</strong> martes, 12 de noviembre de 2013 10:42<br /> <strong>Para:</strong> \'"Rodriguez Garc&iacute;a, Isabel"\'<br /> <strong>Asunto:</strong> RE: REVISION POLIZA CTRA. VIZCAINA, 20</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial; color: navy;">Ok Isabel con esta prima estamos dejando el pago a nivel del ejercicio anterior. E incrementando la cobertura de Atascos.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial; color: navy;">Un saludo y gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial; color: navy;">Mar&iacute;a de los Angeles</span></p>\r\n<div class="MsoNormal" style="text-align: center;" align="center"><hr tabindex="-1" align="center" size="2" width="100%" /></div>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> "Rodriguez Garc&iacute;a, Isabel" [mailto:irodri12@mapfre.com] <br /> <strong>Enviado el:</strong> martes, 12 de noviembre de 2013 10:08<br /> <strong>Para:</strong> angeles@algonz.es<br /> <strong>Asunto:</strong> REVISION POLIZA CTRA. VIZCAINA, 20</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">Buenos d&iacute;as Maria de los Angeles:</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">He solicitado ajuste para la p&oacute;liza de seguro de la comunidad de propietarios de </span>la Ctra. Vizcaina<span style="font-size: 11px;"> n&ordm; 20. Tiene un aviso de cobro para la anualidad 2013-2014 de 2.527,01 &euro;.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">Me ofrecen ajustarla, manteniendo coberturas y capitales actuales e </span><strong style="font-size: 11px;"><span style="text-decoration: underline;">incluyendo los Atascos</span></strong><span style="font-size: 11px;"> bajando la prima a 2.375 &euro;.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">Te ruego me comuniques la aceptaci&oacute;n de estas condiciones.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 11px;">Un abrazo,</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">Isabel Rodriguez Garc&iacute;a</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;">Directora de Oficina</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Arial; color: red;">Gij&oacute;n-&nbsp;Montevil&nbsp;</span></strong></p>\r\n<p class="MsoNormal"><strong><span lang="DE" style="font-size: 10.0pt; font-family: Arial; color: blue; mso-ansi-language: DE;">T&nbsp; 985 16 52 88 / F 985 39 52 31</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; color: navy;"><a title="mailto:irodri12@mapfre.com\r\nmailto:jferna2@mapfre.com" href="mailto:irodri12@mapfre.com"><strong><span lang="DE">e-mail:irodri12@mapfre.com</span></strong></a></span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>', 60),
