	(204, 462, 'INSPECCION EXTINTORES', '2013-10-14', '2013-10-14', '2013-10-25', 2, '<p>* ESTUVO PAUTADA PARA 3 y 5 DE SEPT 2013, PERO NO HAY ACTA NI COMENTARIO EN CUADRO DE AVISOS VECINALES. HABLE CON ANGEL DE SMR EL 14/10/13 Y ME DIJO QUE ESTA SEMANA PASABA LA REVISION.</p>\r\n<p>HABLE CON ANGEL EL 22/10/13 ME DICE QUE YA ESTA HECHA LA REVISION PERO QUE LES FALTA UN EXTINTOR QUE ESTA BAJO LLAVE, ENTONCES LE DI EL TELEFONO DE CLARA LA PRESIDENTE PARA QUE HABLASE CON ELLA.</p>', 10),
	(205, 464, 'RENOVACION POLIZA COMUNITARIA', '2013-10-14', '2013-11-18', NULL, 1, '<p>LLAME EL 16/10/13 A VILLAMIL SEGUROS, Y QUEDARON EN REVISAR LA POLIZA Y VER SI SE PODIA AJUSTAR EL PRECIO. EL 22/10/13 NOS TRAJO PROPUESTA DE GENERALI Y MUTUA. EN GENERALI ES A PRIVATIVAS Y COMUNES Y SUBE 110.80&euro; CON RESPECTO A LA DEL A&Ntilde;O PASADO, PERO INCLUYE ATASCOS, ME DIJO QUE INTENTARIA NEGOCIAR PARA BAJAR ALGO LA PRIMA. PTE PARA ESCANEAR LA NUEVA POLIZA. EL 6/11/13 ME LLAMO SERGIO PARA DECIR QUE ME REBAJARIAN ALGO LA PRIMA Y QUE TARDARIA UN POCO EN LLEGAR LA POLIZA. LLAME A SERGIO EL 18/11/13 ME REMITIO LA POLIZA PARA ESTE A&Ntilde;O, NO INCLUYE AJUSTE TODAVIA, PERO SI ATASCOS DE 500&euro; QUE VENDRAN EN EL CONDICIONADO PARTICULAR Y QUE TIEINE SOLICITADO AJUSTE PERO TODAVIA NO SABE DE CU&Aacute;NTO.&nbsp;<strong><span style="background-color: #00ccff;">PARA LA JUNTA ME GUSTARIA SABER A CUANTO ASCIENDE ESE DESCUENTO.</span><br /></strong></p>\r\n<p><strong><span style="background-color: #00ccff;">PTE QUE ME CONFIRME AJUSTE</span></strong></p>', 60),
	(206, 292, 'FRECUENCIAS QUINCENALES DEL CONTRATO', '2013-07-17', '2013-11-19', NULL, 1, '<ul style="margin-top: 0cm;" type="disc">\r\n<li class="MsoNormal" style="text-align: justify; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Verdana;"><br />Quitar el &aacute;rbol de campanilla ya que da mucho olor y hay personas al&eacute;rgicas en las 1&ordm; plantas y les hace da&ntilde;o ese olor tan penetrante que reciben.</span></li>\r\n<li class="MsoNormal" style="text-align: justify; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Verdana;">Cuando se siegue la hiedra de la parte frontal dejar el murete al descubierto y la zona de escalera y soportal que no invada la zona peatonal para evitar resbalar al pisar dicha hiedra. <strong>REBAJAR EL GROSOS DE LA HIEDRA NO SOLO RECORTA.</strong></span></li>\r\n<li class="MsoNormal" style="text-align: justify; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Verdana;">En cuanto a los pedregales inform&oacute; que es la &eacute;poca de podar la flor de lavanda que en un principio por haber estado mucho tiempo sin mantenimiento tendr&aacute; un aspecto mustio pero al reto&ntilde;ar volver&aacute; a tener un aspecto agradable y sano. Se realizar&aacute; un triangulo por quincena con el fin de seguir manteniendo la dem&aacute;s zona ajardinada.</span></li>\r\n<li class="MsoNormal" style="text-align: justify; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Verdana;">Podar los &aacute;rboles para dar forma tanto los frontales como el situado en la entrada al garaje.</span></li>\r\n</ul>\r\n<p><span style="font-family: Verdana; font-size: 10pt; text-align: justify;">&nbsp;<strong><span style="background-color: #00ccff;">23/08/2013</span></strong></span>&nbsp;PASO A REPASAR EL JARDIN, SEGO Y CORTO LAS ENRREDADERAS DE LOS FRONTALES QUE SALIAN HACIA LA ACERA, DANDO MAS INCAPIE AL FRONTAL 52-54 REPASO UN POCO NO A PROFUNDIDAD LA HIERBA MALA DE LAS ESQUINA DEL GARAJE. LIMPIO HIERBA MALA DE LAS LAVANDAS CERCA DE LA ASOCIACI&Oacute;N.&nbsp;<span style="background-color: #00ff00;"><strong style="font-family: Verdana; font-size: 13.333333969116211px; text-align: justify;">636.802.990 / JOSE ASTURDESBROCES</strong></span></p>\r\n<p><strong><span style="background-color: #00ccff;">09/09/2013</span> </strong>SEGO LA PARTE TRASERA DEL 46-54&nbsp;</p>\r\n<p><strong><span style="background-color: #00ccff;">16/09/2013</span></strong> LIMPIO LAS ROCALLAS DE LA ENTRADA AL GARAJE EN LA ULTIMA ACTUACI&Oacute;N SE LIMPIO POR ENCIMA AHORA DESHIERBO A CONCIENCIA LA ESQUINA</p>\r\n<p><strong><span style="background-color: #00ccff;">23/09-2013</span></strong> SEGARA PARTE TRASERA, REVISO PARTE DELANTERA SOBRE TODO POR DONDE LAS ENRREDADERAS.</p>\r\n<p><strong><span style="background-color: #00ccff;">14/10/2013</span></strong> PODA DE LAVANDA, ROCIA HERBICIDA, Y ARRANCA MALAS HIERBAS DONDE LAS ZONAS VERDES</p>\r\n<p><strong><span style="background-color: #00ccff;">28/10/2013</span></strong>&nbsp;SEGAR&Aacute; LA PARTE TRASERA Y RECORTARA LAS HIEDRAS DE LA PARTE DELANTERA Y REVISAR LAS ROCALLAS.<span style="background-color: #00ff00;"><strong> HOY NO PUEDE HACER LOS TRABAJOS ESTA LLOVIENDO.<span style="background-color: #00ccff;"> 29/10/2013</span></strong><span style="background-color: #00ccff;">&nbsp;</span><span style="background-color: #ffffff;">&nbsp;PASO POR LA ADMINISTRACION JOSE E INFORMO QUE SEGO LA PARTE TRASERA Y DIO HERBICIDA. DIJO QUE IBA A REALIZAR EL PRIMER TRIANGULO DE LA PARTE DE 40-42-44</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">DEL<strong><span style="background-color: #00ccff;">&nbsp;05-AL 08 DE NOVIEMBRE</span></strong>&nbsp;PASAR&Aacute; DE NUEVO // DIJO QUE QUE LIMPIARIA LAS ROCALLAS QUE SON LAS LAVANDAS Y LAS HIEDRAS QUE LAS RECORTAR&Iacute;A Y REBAJARIA EL ESPESOR DE LAS MISMAS.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;"><strong><span style="background-color: #00ccff;">05/11/2013.-</span></strong>&nbsp;HE LLAMADO A JOSE DE ASTURDESBROCES Y PASAR&Aacute; MA&Ntilde;ANA A REALIZAR EL MANTENIMIENTO. PASA POR LA OFICINA JOSE AHORA EN LA TARDE DEL 06/11/2013 Y ME INFORMA QUE REALIZA LIMPIEZA DE LAS ROCALLAS (LAVANDA) RECORTE PERIMETRAL DE LAS HIEDRAS, LE DIJE QUE HICIERA INCAPIE EN LA ZONA DE PLASTICO VERDE QUE NACE MUCHA HIERBA MALA.&nbsp;</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">20/11/2013.- TOCA MANTENIMIENTO Y REALIZARA HIERBAS MALAS DE LAS HIEDRAS POR DONDE NO HAY MUCHA, RECORTAR LAS PLANTAS DE BOLAS ROJAS QUE ESTAN POR LOS ALREDEDORES DE LA ENTRADA DEL GARAJE. Y EN EL 40-44 REALIZARA REBAJE DE LAS HIEDRAS YA LE INDIQUE QUE NO MUCHO GROSOR.</span></span></p>\r\n<p>&nbsp;<span style="background-color: #00ffff;"><strong>20/11/2013.-</strong><span style="background-color: #ffffff;">&nbsp;PASO JOSE DE ASTURDESBROCES Y &nbsp;NOS INDICA QUE DE ESTA COMUNIDAD HOY NO REALIZO NINGUN TRABAJO, POR LO QUE TODO LO ANTERIOR ESTA PTE., QUE PARA LA PROXIMA VISITA PROGRAMADA +/- 02/12 REALIZARA LO ESTABLECIDO QUE LE DE TIEMPO, YA QUE NO VA A TRABAJAR MAS HORAS DE LO ESTABLECIDO.</span></span></p>\r\n<p><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">TRABAJOS PTES. PARA VISITA SEMANA 02/12, LOS QUE TENIA QUE HABER REALIZADO EL 20/11:&nbsp;</span></span>TOCA MANTENIMIENTO Y REALIZARA HIERBAS MALAS DE LAS HIEDRAS POR DONDE NO HAY MUCHA, RECORTAR LAS PLANTAS DE BOLAS ROJAS QUE ESTAN POR LOS ALREDEDORES DE LA ENTRADA DEL GARAJE. Y EN EL 40-44 REALIZARA REBAJE DE LAS HIEDRAS YA LE INDIQUE QUE NO MUCHO GROSOR.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1),
	(207, 250, 'FRECUENCIAS QUINCENALES DEL CONTRATO', '2013-08-14', '2013-11-19', NULL, 1, '<p><strong><span style="background-color: #00ccff;">14/08/2013</span> </strong>SEGO LA PARTE TRASERA Y DEJO PARA EL VIERNES LAS LAVANDAS &nbsp;<span style="background-color: #ff0000;"><strong> 636 802 990 JOSE / ASTURDESBROCE</strong></span></p>\r\n<p><strong><span style="background-color: #00ccff;">23/08/2013</span></strong> PASO A REPASAR EL JARDIN SEGO Y CORTO LAS ENRREDADERAS DE LA PARTE DEL FRONTAL LIMPIO HIERBA MALA Y LAVANDA.</p>\r\n<p><strong><span style="background-color: #00ccff;">09/09/2013</span></strong> SEGO LA PARTE TRASERA DEL 40-44</p>\r\n<p><strong><span style="background-color: #00ccff;">23/09/2013 </span></strong>REVISAR LA PARTE DELANTERA SOBRE TODO LAS ENRREDADERAS POR LAS PARTE DEL SOPORTAL.</p>\r\n<p><strong><span style="background-color: #00ccff;">14/10/2013</span></strong> PODA DE LAVANDA/ RECORTE ARBUSTO QUE ESTA SITUADO POR LA BAJADA DE LAS ESCALERAS AL GARAJE.</p>\r\n<p>PARA EL <strong><span style="background-color: #00ccff;">28/10/2013</span></strong> RECORTARA LOS DOS ARBOLES QUE DAN OLOR Q ESTAN AL LADO DE LAS ESCALERAS DE ENTRADA QUE DAN ACCESO AL PORTAL 42 Y 44&nbsp;<strong><span style="background-color: #00ff00;"> HOY NO PUEDE REALIZAR LOS TRABAJOS ESTA LLOVIENDO&nbsp;</span></strong>&nbsp;<strong style="font-size: 11px;"><span style="background-color: #00ccff;">29/10/2013</span></strong><span style="background-color: #00ccff;">&nbsp;</span><span style="background-color: #ffffff;">&nbsp;PASO POR LA ADMINISTRACION JOSE E INFORMO QUE SEGO LA PARTE TRASERA Y DIO HERBICIDA. DIJO QUE IBA A REALIZAR EL PRIMER TRIANGULO DE LA PARTE DE 40-42-44</span></p>\r\n<p><span style="background-color: #ffffff;">DEL 05-AL 08 DE NOVIEMBRE PASAR&Aacute; DE NUEVO // DIJO QUE QUE LIMPIARIA LAS ROCALLAS QUE SON LAS LAVANDAS Y LAS HIEDRAS QUE LAS RECORTAR&Iacute;A Y REBAJARIA EL ESPESOR DE LAS MISMAS&nbsp;</span></p>\r\n<p><span style="background-color: #ffffff;"><strong><span style="background-color: #00ccff;">05/11/2013</span></strong> PASAN A REALIZAR MANTENIMIENTO LIMPIAN TODAS LAS ROCALLA (PLANTAS DE LAVANDA). LAS TRES TRIANGULOS. REALIZO RECORTE DE HIEDRA POR LOS LATERALES DE TODO EL PERIMETRO. PODO LOS ARBOLES DE LAS ESCALERAS ACCESO AL PORTAL 42</span></p>\r\n<p><span style="background-color: #ffffff;">&nbsp;20/11/2013.- REALIZARA REBAJE DE LAS HIEDRAS Y RECORTARA LA PLANTAS DE BOLAS ROJAS.</span></p>\r\n<p><span style="background-color: #00ffff;"><strong>20/11/2013.-&nbsp;</strong><span style="background-color: #ffffff;">&nbsp;VINO JOSE DE ASTUR DESBROCES Y NOS INDICA QUE EN EL DIA DE HOY REALIZO LOS SIGUIENTES TRABAJOS: PODA DE LA ENREDADERA DEJANDO PTE. UN REMATE EN LA ESQUINA CONTRA EL GARAJE RECORTE DE PLANTA (BOLAS).</span></span></p>\r\n<p><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">DIJO QUE NO HABIA TERMINADO XQ ESTUVO 4HRS. 2 PERSONAS QUE ES EL TIEMPO ESTABLECIDO Y QUE NO IBA A ECHAR MAS HORAS.</span></span></p>\r\n<p><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">LA PROXIMA VISITA ESTABLECIDA VENDRA LA SEMANA DEL 02/12 Y REALIZARA EL TRABAJO PTE. QUE DEJA EN ESTA CDAD. MAS LOS TRABAJOS PTES. EN CIGARRERES 46 AL 54</span></span></p>', 1),
