	(209, 462, 'INSPECCION EXTINTORES PRUEBA HIDRAULICA', '2013-10-14', '2014-09-16', NULL, 1, '<p>* SEGUN CERTIFICADO 413 DEL 16/9/2009, ADJUNTO EN DOCS.</p>', 10),
	(210, 468, 'MOROSO 1º A', '2013-10-14', '2014-02-28', NULL, 1, '<p><span style="background-color: #ff99cc;"><strong>MOROSO 1&ordm; A. JOSE POSADA GARCIA</strong></span></p>\r\n<p>EN JUNTA 27/05/2013 SE ACORD&Oacute; RECLAMAR JUDICIALMENTE AL 1&ordm; A- JOSE POSADA GARCIA- CANTIDAD PENDIENTE PAGO A FECHA 30/4/13 DE 818.14&euro;. SE LE REMITE BUROFAX CON FECHA 10/06/2013, EL CUAL RESULTO NO ENTREGADO, DEJADO AVISO. CON FECHA 12/7/13 RESULTO CADUCADO EN LISTA. SE REMITE DOCUMENTACI&Oacute;N A JOSE BORDIU EL 27/09/13 PARA QUE INICIE MONITORIO. EL MONITORIO ES PRESENTADO EL 7/10/13 CON N&Uacute;MERO 709/2013, NOS REQUIEREN PARA QUE SE APORTE PODER PARA PLEITOS. EL 14/10/13 EL PRESIDENTE QUEDO EN PASAR POR LA NOTARIA DEL MUELLE A OTORGAR PODER. PTE. QUE NOS LO TRAIGA PARA REMITIRLO A GRACIELA. CON FECHA 26/09/13 SE APERTURA EXPEDIENTE EN EL SEGURO PARA ESTE MONITORIO CON N&ordm; EXP. 566439161. CON FECHA 15/10/13 SE LE REMITE AL SEGURO POR E-MAIL COPIA DE LA DEMANDA PRESENTADA AS&Iacute; COMO DESIGNA DEL LETRADO JOSE BORDIU QUE LLEVARA EL PROCESO. EL 15/10/13 SE LE ENTREGA PERSONALMENTE A JOSE BORDIU EL PODER PARA PLEITOS.</p>\r\n<p><span style="background-color: #ff99cc;"><strong>LA DOCUMENTACION ESTA EN LA CARPETA ROJA DE MOROSOS.</strong></span></p>\r\n<p>&nbsp;</p>', 10),
	(211, 469, 'MOROSO 1º A ', '2013-10-14', '2015-04-30', NULL, 1, '<p><span style="background-color: #ff99cc;"><strong>MOROSO CIGARRERES 19-1&ordm; A- JORGE MARCOS DIAZ RODRIGUEZ</strong></span></p>\r\n<p><span style="background-color: #ffffff;">EN JUNTA 17/12/2012 SE ACORDO RECLAMAR JUDICIALMENTE AL 1&ordm; A- CIGARRERES 19, LA CANTIDAD DE 589.97&euro; PENDIENTE DE PAGO A FECHA 17/12/12. CON FECHA 8/01/13 SE REMITE BUROFAX, EL CUAL FUE NO ENTREGADO, DEJADO AVISO, EL 9/02/13 RESULT&Oacute; CADUCADO EN LISTA. EL 14/02/13 SE REMITE DOCUMENTACION AL ABOGADO ANGEL MENENDEZ-MORAN, PARA QUE INICIE MONITORIO. SE INICIA MONITORIO EL 22/03/2013 CON EL N&Uacute;MERO 209/2013. Y SE APERTURA EXPEDIENTE EN EL SEGURO CON EL NUMERO EXP. 554650781.&nbsp;</span></p>\r\n<p><span style="background-color: #ffffff;">SE PRESENTA EL MONITORIO, SE DILATA UN POCO PORQUE LE REMITIERON DEMANDA A SU DOMICILIO, NO HABIA NADIE, LOS VECINOS DIJERON QUE NO VIVIA ALL&Iacute;, SE PIDIO AVERIGUACION DE DOMICILIO, APARECI&Oacute; UNO EN C/ARAG&Oacute;N, SE LE NOTIFICO ALL&Iacute; PERO RESULT&Oacute; DESCONOCIDO, TUVIERON QUE EMPLAZARLO POR EDICTOS.... EN FIN SE DEMOR&Oacute; M&Aacute;S DE LA CUENTA. EN SEPTIEMBRE 2013 SE INICIO LA EJECUCION DEL MONITORIO Y CON FECHA 6/9/13 SE PRESENTO ESCRITO EN JUZGADO SOLICITANDO EMBARGO DE CUENTAS BANCARIAS EN CAJASTUR Y BBVA Y NOMINA DE HC.&nbsp;</span></p>\r\n<p><span style="background-color: #ffffff;"><strong>23/10/13.</strong>- Llame a Angel &nbsp;y me dijo que de momento no tiene noticia que ese Juzgado el n&uacute;mero 11 es bastante lento, que con fecha 16/10/13 le aprobaron la tasacion de costas del monitorio que tiene que pagar el moroso y le va a remitir un e -mail al Procurador a ver sil e puede agilizar este tema.<br /></span></p>\r\n<p><span style="background-color: #ff99cc;"><strong>DOCUMENTACION EN CARPETA ROJA DE MOROSOS.</strong></span></p>\r\n<p>&nbsp;</p>', 10),
	(212, 470, 'MOROSO BAJO IZQUIERDA', '2013-10-14', '2015-12-31', NULL, 1, '<p><span style="background-color: #ff99cc;"><strong>MOROSO BAJO IZQUIERDA-H FERRADORES 5- MARIA ANGELES CARRIO.</strong></span></p>\r\n<p>EN JUNTA EXTRAORDINARIA 19/07/13 SE ACUERDA RECLAMAR JUDICIALMENTE AL BAJO IZQUIERDA LA CANTIDAD DE 340&euro; A FECHA 19/07/13. SE REMITE BUROFAX CON FECHA 1/08/2013 Y FUE RECOGIDO POR MARIA ANGELES CARRIO EL 5/8/13. NO ABONA CANTIDAD ALGUNA, CON LO QUE SE REMITE EL 27/9/13 DOCUMENTACI&Oacute;N A JOSE BORDIU PARA QUE INICIE MONITORIO. CON FECHA 7/10/13 SE PRESENTA MONITORIO EN EL JUZGADO. HAY QUE APORTAR PODER PARA PLEITOS Y SE LLAMA A CARLOS EL PRESIDENTE PARA QUE PASE EL 14/10/13 POR LA NOTARIA DEL MUELLE A FIRMARLO, CUANDO LO TRAIGA HAY QUE REMITIRLO A GRACIELA PARA QUE LO ADJUNTE AL PROCEDIMIENTO. SE APERTURA EXPED. SEGURO CON EL NUMERO 29636675-69-11, CON FECHA 15/10/13 SE REMITE AL SEGURO POR E-MAIL COPIA DE LAS DEMANDAS PRESENTADAS Y DESIGNA DEL LETRADO QUE LLEVARA EL PROCESO.</p>\r\n<p><strong>DOCUMENTACI&Oacute;N EN LA C</strong><strong>ARPETA ROJA DE MOROSOS.</strong></p>', 10),
	(213, 470, 'MOROSO 1º IZQUIERDA', '2013-10-14', '2015-12-31', NULL, 1, '<p><span style="background-color: #ff99cc;"><strong>MOROSO 1&ordm; IZQUIERDA- H FERRADORES 5- FRANCISCO JAVIER GONZALEZ BARAGA&Ntilde;O</strong></span></p>\r\n<p>EN JUNTA 19/07/2013 SE ACUERDA RECLAMAR JUDICIALMENTE AL 1&ordm; IZQ. LA CANTIDAD DE 380&euro; CANTIDAD PENDIENTE A FECHA 19/7/13, SE LE REMITE BUROFAX CON FECHA 1/08/2013, RESULTA NO ENTREGADO DEJADO AVISO, Y EL 2/9/13 CADUCADO EN LISTA. CON FECHA 27/9/13 SE REMITE DOCUMENTACI&Oacute;N A JOSE BORDIU PARA QUE INICIE MONITORIO, ESTE SE PRESENTA CON FECHA 7/10/13, PERO HACE FALTA PODER PARA PLEITOS, ASI QEU SE LLAMA A CARLOS EL PRESIDENTE PARA QUE VAYA A LA NOTARIA DEL MUELLE EL 14/10/13 A FIRMARLO Y CUANDO NOS LO TRAIGA LO REMITIREMOS A GRACIELA PARA QUE LO ADJUNTE AL PROCEDIMIENTO. SE APERTURA EXP. EN SEGURO CON EL N&ordm; 29636675-69-11, CON FECHA 15/10/13 SE REMITE AL SEGURO POR E-MAIL COPIA DE LAS DEMANDAS PRESENTADAS Y DESIGNA DEL LETRADO QUE LLEVARA EL PROCESO.</p>\r\n<p><strong>DOCUMENTACI&Oacute;N EN CARPETA ROJA MOROSOS.</strong></p>', 10),
	(214, 471, 'MOROSO BAJOCUBIERTA K-SAN MATIAS 12', '2013-10-14', '2015-12-31', NULL, 1, '<p><span style="background-color: #ff99cc;"><strong>MOROSO BAJOCUBIERTA K- SAN MATIAS 12- AVELINO BLANCO GARCIA Y CRISTINA GRANDE ALVAREZ</strong></span></p>\r\n<p>EN JUNTA EXTRAORDINARIA DE FECHA 6/05/2013 SE ACORD&Oacute; RECLAMAR JUDICIALMENTE AL BAJOCUBIERTA K- SAN MATIAS 12- AVELINO BLANCO, LA CANTIDAD PTE. PAGO A FECHA 30/4/13 DE 2.829,91&euro; (SE REUNIFICAN AQUI VARIAS RECLAMACIONES ANTERIORES), CON FECHA 28/5/13 SE REMITE BUROFAX, QUE RESULT&Oacute; ENTREGADO EL 29/5/13 A LAS 11.49 A CRISTINA GRANDE ALVAREZ, NO ABONAN CANTIDAD ALGUNA. CON FECHA 7/7/13 SE REMITE DOCUMENTACION AL ABOGADO JOSE BORDIU PARA QUE INICIE MONITORIO. CON FECHA 7/10/13 SE INICIA MONITORIO CON NUMERO 706/2013, Y EL 10/10/13 REQUIEREN PARA QUE SE ABONE LA TASA JUDICIAL (SE ABONA EN PROCEDIMIENTOS SUPERIORES A LOS 2.000&euro;), POR IMPORTE DE 102,86&euro;. SE HACE TRANSFERENCIA A GRACIELA POR DICHO IMPORTE PARA QUE LO ABONE EN EL JUZGADO. NO SE APERTURA EXPED. EN SEGURO, PORQUE ES UNA DEUDA GENERADA HACE TIEMPO Y PORQUE SE HABIA CAMBIADO DE SEGURO HACE POCO Y NO LA CUBR&Iacute;A.</p>\r\n<p><strong>DOCUMENTACION EN CARPETA ROJA MOROSOS.</strong></p>', 10),
