	(252, 544, 'INSPECCION BAJA TENSION GARAJE', '2009-07-20', '2013-11-26', NULL, 1, '<p>EL 7/11/13 PASO ITELCO A REVISAR EL GARAJE DE CARBAYO Y NOS PASA PRESUPUESTO DE SUST. 2 EMERGENCIAS, OPR IMPORTE DE 143&euro;. HABLAR 1&ordm; CON JORGE CEMBRANOS DEL PORTAL 11-1&ordm; D 984394800 QUE EN JUNTA DIJO QUE SE LE AVISA EN TEMAS ELECTRICOS. Y SI ES POSIBLE PASAR LA INSPECCION DEL GARAJE.</p>', 30),
	(253, 545, 'INSPECCION BAJA TENSION GARAJE', '2009-06-16', '2013-11-03', NULL, 1, '<p><span style="background-color: #00ff00;">SE TRATARA EN JUNTA ORDINARIA A CELEBRAR EL 12/11/2013, SE REMITIO E-MAIL A ITELCO Y FASE PARA QUE REVISARAN LUMINARIAS DEL GARAJE Y PRESUPUESTARAN EN CASO DE SER VARIAS LAS QUE HUBIERA QUE REPONER.</span></p>\r\n<p><span style="background-color: #00ff00;">SE APROBO PRESUPUESTO DE TOMAS, QUEDO EN SOLUCIONARLO PARA LA SEMANA DEL 25 DE NOVIEMBRE</span></p>', 30),
	(255, 547, 'INSPECCION BAJA TENSION GARAJE', '2009-10-05', '2014-10-05', NULL, 1, '', 30),
