	(257, 549, 'INSPECCION BAJA TENSION GARAJE', '2013-10-16', '2013-12-03', NULL, 1, '<p>REALIZAR INSPECCION BAJA TENSION ANTES DE FIN DE A&Ntilde;O QUE ES CUANDO LIQUIDA LA COMUNIDAD, PORQUE EN LA JUNTA DE ABRIL SE HABIA ACORDADO REALIZAR LA INSPECCION. HAY DOCUMENTACION EN LA OFICINA.</p>', 30),
	(258, 550, 'INSPECCION BAJA TENSION GARAJE', '2013-10-16', '2013-11-30', NULL, 1, '<p>EN JUNTA SE APROBO EL PRESUPUESTO DE ITELCO PARA REVISAR EMERGENCIAS Y LUEGO PASAR LA O.C.A.</p>', 20),
	(259, 551, 'INSPECCION BAJA TENSION GARAJE', '2013-10-16', '2013-11-20', NULL, 4, '<p>PENDIENTE DE TRATAR EN JUNTA EL TEMA DE INSPECCION BAJA TENSION DEL GARAJE. HAY PRESUPUESTO DE ITELCO Y FASE SOBRE CAMBIO DE EMERGENCIAS QUE SE TRATARA EN JUNTA.</p>', 10),
