	(271, 563, 'LECTURA DE CONTADOR', '2013-10-16', '2014-03-02', NULL, 1, '<p>EN JUNTA DE FECHA 03/10/2013 EN EL PUNTO 2&ordm; DEL ORDEN DEL DIA SE APROBO X UNANIMIDAD QUE ESTE VECINO COLOCARA SU PROPIO CONTADOR DE AGUA SOLO Y EXCLUSIVAMENTE PARA SU VIVIENDA Y BAJO SU RESPONSABILIDAD Y CUENTA (CORRE CON TODOS LOS GASTOS). HAY QUE REALIZAR UNA LECTURA DE CONTADOR PARA FACTURAR EL AGUA REAL QUE CONSUME.</p>', 30),
	(272, 534, 'ENCENDIDO DE CALEFACCION', '2013-10-17', '2013-11-01', '2013-11-06', 2, '<p>HAY QUE REMITIR A MOMANOR UN E-MAIL O LLAMARLOS PARA QUE ENCIENDA LA CALEFACCION A PARTIR DEL 1/11/13, DEPENDIENDO COMO ESTE EL TIEMPO, SI NO ESTA FRIO DEJARLO PARA MAS ADELANTE. LUEGO ABRIR OTRO AVISO PORQUE LA CALEFACCION SE APAGA EL 30/4/13 SALVO QUE ESTE MUY FRIO Y ENTONCES SE DEJA M&Aacute;S TIEMPO ENCENDIDA.</p>\r\n<p><strong><span style="background-color: #00ccff;">04/11/2013 &nbsp;<span style="background-color: #ffffff;">&nbsp;He mirado el tiempo en Internet y veo que a partir de ma&ntilde;ana suben las temperaturas por lo que esperaremos un poco m&aacute;s para le encendido(MA)</span><span style="background-color: #ffffff;"><br /></span></span></strong></p>\r\n<p><strong>&nbsp;06/11/13</strong> SE REMITE UN E-MAIL A MOMANOR PARA QUE EL JUEVES 7/11/13 ENCIENDA LA CALEFACCION, PUESTO QUE LA VECINA DE ELVIRA MU&Ntilde;IZ 2, 4&ordm; G, MARTA CORTES, LA HA RECLAMADO YA EN DOS OCASIONES.</p>', 5),
	(273, 509, 'ENCENDIDO/ DE CALEFACCION', '2013-10-17', '2013-11-01', '2013-11-13', 2, '<p>LLAMAR A MOMANOR O REMITIR UN E-MAIL PARA RECORDAR EL ENCENDIDO DE CALEFACCION, DEPENDIENDO COMO ESTE EL TIEMPO, SE PUEDE APLAZAR UN TIEMPO, LUEGO APERTURAR OTRO AVISO PARA EL CIERRE DE LA CALEFACCION QUE SUELE SER EL 30/4/13 O M&Aacute;S TARDE SI ESTA FRIO.</p>\r\n<p><strong><span style="background-color: #00ccff;">04/11/2013 &nbsp;<span style="background-color: #ffffff;">&nbsp;He mirado el tiempo en Internet y veo que a partir de ma&ntilde;ana suben las temperaturas por lo que esperaremos un poco m&aacute;s para le encendido(MA)</span></span></strong></p>\r\n<p><span style="background-color: #00ccff;"><strong>12/11/2013.-&nbsp;<span style="background-color: #ffffff;"> HE LLAMADO A MOMANOR PARA QUE PONGAN EN SERVICIO LA CALEFACCI&Oacute;N DEL EDIFICIO EUROPA, YA QUE A PARTIR DEL MI&Eacute;RCOLES BAJAN LAS TEMPERATURAS. ME COMUNIQUE CON ANDRES Y ME DIJO QUE AL MEDIO PASARIA A PONER EN FUNCIONAMIENTO LA CALDERA.</span></strong><span style="background-color: #ffffff;">&nbsp;</span><span style="background-color: #ffffff;"><span style="background-color: #ffff00;">PENDIENTE CONFIRMAR Y LUEGO PROGRAMAR PARA EL APAGADO EL 30 DE ABRIL 2013.<span style="background-color: #ffffff;">&nbsp;<strong>OK PASO POR LA ADMINISTRCION JOSE DE MOMANOR HOY12/11/2013 CERCA DEL MEDIO DIA</strong></span></span></span></span></p>', 5),
	(274, 83, 'ENCENDIDO DE CALEFACCION', '2013-10-17', '2013-11-01', '2013-11-13', 2, '<p>SE TRATARA EN JUNTA SI SE RENUEVA O NO EL CONTRATO CON PRYMASTUR, EN CASO AFIRMATIVO, RECORDARLES POR E-MAIL O TELEFONO EL ENCENDIDO DE CALEFACCION A PRIMEROS DE NOVIEMBRE, SI ESTA BUEN TIEMPO, DEJARLO PARA M&Aacute;S ADELANTE. LUEGO APERTURAR OTRO AVISO PARA EL APAGADO DE CALEFACCION QUE ES EL 30/4/13 O M&Aacute;S TARDE SI ESTA FRIO.</p>\r\n<p><strong><span style="background-color: #00ccff;">04/11/2013 &nbsp;<span style="background-color: #ffffff;">&nbsp;He mirado el tiempo en Internet y veo que a partir de ma&ntilde;ana suben las temperaturas por lo que esperaremos un poco m&aacute;s para le encendido(MA).</span></span></strong></p>\r\n<p><span style="background-color: #00ccff;"><strong>12/11/2013.-</strong><span style="background-color: #ffffff;"> HE LLAMADO A PABLO Y LE HE COMUNICADO QUE NOS PUEDE PONER EN FUNCIONAMIENTO LAS CALDERAS, SEGUN HABLAMOS EN JUNTA EXTRAORDINARIA DE OCTUBRE DE 2013 NO SE PONDRA EN FUNCIONAMIENTO A TODA CAPACIDAD, TOMANDO EN CUENTA QUE NO ESTA HACIENDO DEMASIADO FRIO Y LA UTILIZACI&Oacute;N DE LA MISMA NO ES POR UN GRAN NUMERO DE HABITANTES DEL CONJUNTO DEL INMUEBLE.&nbsp;<strong><span style="background-color: #ffff00;">Cualquier aviso sobre poca temperatura en el agua caliente o en los radiadores avisar a Prymastur para que pasen a regular.</span></strong></span></span></p>', 5),
