	(278, 580, 'INSPECCION ANUAL EXTINTORES', '2013-10-17', '2013-11-14', NULL, 3, '<p>LLAME A SOCIEDAD ASTURIANA DE EXTINTORES ME DIJERON QUE A PRIMEROS DE NOVIEMBRE NOS LLAMARA UN TECNICO PARA CONFIRMAR EL MTTO DE EXTINTORES.</p>\r\n<p>5/11/13.- LLAMO EL TECNICO PARA PASAR LA REVISION DE EXTINTORES. <strong>PTE CERTIFICADOS. EL 25/11/13 ME REMITIO FACTURA PERO NO EL CERTIFICADO, SE LO SOLICITE.</strong></p>', 20),
	(279, 570, 'INSPECCION ANUAL EXTINTORES', '2013-10-17', '2013-11-14', '2013-11-25', 2, '<p>LLAME EL 23/10/13 A SOCIEDAD ASTURIANA DE EXTINTORES Y ME DICE QUE A PRIMEROS DE NOVIEMBRE NOS LLAMARA EL TECNICO PARA CONFIRMAR EL MTTO DE LOS EXTINTORES.</p>\r\n<p>LLAMO EL TECNICO EL 5/11/13 PARA NOTIFICAR QUE PASARA LA INSPECCION.</p>', 20),
