	(285, 589, 'MOROSO 3º B', '2013-10-18', '2015-12-31', NULL, 1, '<p>EN JUNTA 14/10/13 SE ACORDO PROCEDER A RECLAMAR JUDICIALMENTE AL MOROSO DEL 3&ordm; B (PEDRO RUIZ GARCIA) 423,21&euro; A FECHA 31/8/13. 1&ordm; SE LE REMITIR&Aacute; EL ACTA Y PASADOS UNOS DIAS SE COMPROBARA SI HIZO EL ABONO (PORQUE EN OTRAS OCASIONES ASI FUE), SI NO ENVIAR EL BUROFAX Y CONTINUAR CON LOS TRAMITES OPORTUNOS. APERTURAR EXPEDIENTE EN SEGURO....</p>\r\n<p>EL 13/11/13 ABONO 300&euro;, Y EL 14/11/13 HABLO CON MARIA ANGELES Y LE DIJO QUE NO PODIA ABONAR MAS DE MOMENTO, QUEDA PENDIENTE DECIDIR QUE HACER.</p>', 30),
