	(298, 596, 'RENOVACION POLIZA COMUNITARIA', '2013-10-11', '2013-11-13', '2013-11-18', 2, '<p>POLIZA N&ordm; 076-1380500243</p>\r\n<p>INCLUYE ATASCOS. SE REMITE COPIA DE LA POLIZA A CADA VECINO SEGUN LO ACORDADO EN JUNTA ORDINARIA.</p>', 60),
	(299, 221, 'RENOVACION CONTRATO ASCENSORES', '2013-10-28', '2016-01-01', NULL, 1, '<p>EN JUNTA 10/10/13 SE LLEVO LA PROPUESTA DE IMEN, QUE SERIA UN NUEVO CONTRATO MODALIDAD (CONTRATO GLOBAL), INCLUIDA LINEA TELEFONICA.&nbsp;</p>\r\n<p>EL CONTRATO ENTRA EN VIGOR EL 1/1/2014 CON UNA DURACION DE 2 A&Ntilde;OS, PARA RESCINDIR AVISAR CON 4 MESES DE ANTELACI&Oacute;N MEDIANTE CARTA CERTIFICADA CON ACUSE RECIBO. EL PRECIO SERIA: VELAZQUEZ 40- 135&euro;+IVA; VELAZQUEZ 42, 140&euro;+ IVA Y CARMEN AMAYA 1, 138&euro;+IVA IMPORTES MENSUALES. SE HARAN CARGO DE LA LINEA TELEFONICA DE LOS ASCENSORES SIN CARGO ALGUNO PARA LA COMUNIDAD.</p>\r\n<p>RECORDAR EN ENERO CERRAR ESTE AVISO Y APERTURAR OTRO CON LA FECHA DE VENCIMIENTO DEL CONTRATO QUE SERIA PARA 1/01/2016.</p>', 122),
	(300, 10, 'VERIFICAR ARREGLOS DEFICIENCIAS PARA 2DA. INSPECCION ASCENSORES', '2013-10-30', '2013-12-04', NULL, 1, '<p>* En Marzo 2013 se efectu&oacute; la inspecci&oacute;n, pero se descubrieron graves deficiencias que deben ser subsanadas antes del 4/12/2013 cuando se realizar&aacute; la 2da inspecci&oacute;n.</p>\r\n<p><span style="background-color: #ffff00;">*<strong> VERIFICAR QUE CUANDO SE EFECTUE LA 2DA INSPECCION NO HAYA TRASTOS DENTRO DEL CUARTO MAQUINARIAS</strong></span><strong>.</strong></p>', 10),
	(301, 426, 'REVISION SEMESTRAL PORTON ', '2013-10-30', '2013-11-20', NULL, 1, '<p>En Noviembre toca revisi&oacute;n semestral. Estar pendiente que se haya realizado.</p>', 10),
	(303, 423, 'RETIMBRADO EXTINTORES', '2013-10-30', '2017-02-20', NULL, 1, '', 10),
	(304, 84, 'PROPUESTA MANTENIMIENTO PORTON', '2013-10-30', '2014-01-15', NULL, 1, '<p>TAREA DE OUTLOOK. SE SOLICITO PROPUESTA DE CONTRATO MANTENIMIENTO DEL PORTON PARA EL GARAJE SOL DE MONTEVIL, SE TRATARA EN LA JUNTA ORDINARIA DE LA COMUNIDAD QUE TIENE PREVISTO HACER PARA ENERO O FEBRERO 2014.&nbsp;</p>', 15),
	(305, 179, 'REVISIÓN ANUAL DE LOS EXTINTORES y CENTRAL CO2', '2013-10-31', '2014-06-27', NULL, 1, '', 10),
