	(308, 249, 'LIMPIEZA GARAJE MAQUINA BARREDORA CON AGUA', '2013-10-31', '2014-03-01', NULL, 1, '<p>En Junta 24/10/13 se acord&oacute; que la limpieza del garaje se hicera con maquina barredora con agua, para comparar como queda mejor la limpieza, ya que en la actualidad se realiza con maquina barredora aspiradora y se observa bastante polvo.&nbsp;</p>\r\n<p><span style="background-color: #ffff00;">E<strong><span style="background-color: #ffff00;">STA</span> ACTUACION SE REALIZA 2 VECES AL A&Ntilde;O (EN MARZO Y SEPTIEMBRE)</strong></span></p>', 10),
	(309, 47, 'LIMPIEZA TERRAZA ANTES FUMIGACION', '2013-10-31', '2014-01-08', NULL, 1, '<p>TAREA TRASLADADA DE OUTLOOK, SE COORDINA CON LA FUMIGACION DE INTERPLAGA, PORQUE TIENEN QUE LIMPIAR LA TERRAZA ANTES DE QUE FUMIGUEN, UNOS 15 DIAS ANTES.&nbsp;</p>\r\n<p><span style="background-color: #ff0000;"><strong>HAY QUE IR PROGRAMANDO ESTE AVISO SEGUN SE VAYA CERRANDO EL ANTERIOR.</strong></span></p>', 15),
	(310, 608, 'PRESUPUESTOS PUERTA CUARTO MAQUINAS', '2013-10-31', '2014-01-06', NULL, 1, '<p>EN JUNTA ORDINARIA DE ECHEGARAY 29, SE ACORDO SOLICITAR PRESUPUESTOS PARA LA PUERTA DE ACCESO AL CUARTO MAQUINAS DEL ASCENSOR, PARA DAR MAS LUMINOSIDAD AL RELLANO DE LA 7&ordm; PLANTA. SE SOLICITO INFORMACION A TRESA, SOBRE COMO DEB&Iacute;A SER ESA PUERTA, POR SI HUBIERA ALGUNA NORMATIVA AL RESPECTO Y ELLOS NOS INDICAN COMO TIENE QUE SER. VER DOCUMENTO ADJUNTO DE LA TAREA OUTLOOK, Y SOLICITAR PRESUPUESTOS A VENTANAS ROCES, ALUMINIOS TONY...</p>', 20),
