	(315, 613, 'MOROSO 3º B- ALAVA 50', '2013-11-05', '2014-12-31', NULL, 1, '<p>EN JUNTA 22/10/13 SE ACORDO PROCEDER A RECLAMAR JUDICIALMENTE A MARIA DOLORES BARNA GONZALEZ, ALAVA 50, 3&ordm; B, POR IMPORTE DE 1021.84&euro; A FECHA 22/10/13. HABLO MARIA ANGELES CON ELLA LA &Uacute;LTIMA SEMANA DE OCTUBRE, Y LE DIJO QUE PARA EL 4 O 5 DE NOVIEMBRE ABONAR&Iacute;A. CONTROLAR LA CUENTA PUES EN OTRO CASO HAY QUE REMITIR EL BUROFAX.</p>', 10),
