	(320, 428, 'REVISIÓN ANUAL DE LOS EXTINTORES ', '2013-11-07', '2014-09-06', NULL, 1, '<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">INSTALADOR MOTOR TRIFASICO GARAJE EXTRACTOR HUMOS&nbsp;</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial;">JOSE MORALES MA&Ntilde;AS&nbsp;</span></strong><span style="font-size: 11pt; font-family: Arial;">985.141.098/608.787.917</span><strong><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -35.6pt; margin-bottom: .0001pt; margin-left: -35.45pt; text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">LLAMA A LIDER Y PREGUNTA PARA CUANDO TOCA LA REVISION DE LOS EXTINTORES Y DE LA CENTRAL DE CO2. EL TEMA VIENE A RAIZ DE QUE SE CAMBIO UN MOTOR DE LOS EXTRACTORES DE HUMOS QUE VA CONECTADO A LA CENTRAL Y EN LA FACTURA DICE QUE ESTE MOTOR FUNCIONA CON UN RELOJ NOS GUSTARIA QUE PARA CUANDO REALIZARAN LA REVISION QUE HICIERAN INCAPIE EN CONTEJAR SI FUNCIONA CON RELOJ Y CON LA CENTRAL.</span></strong></p>', 10),
