	(326, 624, 'RENOVACION DE CONTRATO', '2013-11-12', '2014-11-12', NULL, 1, '<p>SE FIRMO EL DIA 12/11/13 CONTRATO CON INTEGRA ENERGIA (SERGIO) CON EL PRECIO KW/H DE 0,143248</p>', 30),
	(327, 228, 'INSPECCION BAJA TENSION PISCINA', '2013-11-13', '2016-09-04', NULL, 1, '<p>* Ultima Inspecci&oacute;n el 4/9/2011</p>', 20),
	(328, 228, 'FORMALIZAR CONTRATO CON LIMPIEZAS SAM PISCINA', '2013-11-13', '2014-04-16', NULL, 1, '<p>* 20/4/2013 Formalizar contrato con Limpiezas SAM para mantenimiento de piscina. Contrato por 3 meses, comienza 1/JUN y termina 1/SEPT</p>\r\n<p>* <strong>COPIADO DE ACTA OCTUBRE 2013.&nbsp;</strong></p>\r\n<p>Mantenimiento de piscina, presentar y aprobar presupuestos si procede. Valorar renovaci&oacute;n de los servicios y/o contrataci&oacute;n de una nueva empresa. Informa de actuaciones que se deben llevar a cabo.&nbsp;</p>\r\n<p>Se explica a los asistentes que la empresa que llevaba el mantenimiento (SERCOM) se dio de baja y nos inform&oacute; en Mayo del cese de actividad, determinando entre el Presidente y la Administraci&oacute;n contratar Servicios y Mantenimiento de Piscinas Sam, ya que era la empresa que con +/- las mismas prestaciones, no se incrementaba el coste del mantenimiento seg&uacute;n lo pagado el a&ntilde;o anterior. El inconveniente que se produjo fue que esta empresa s&oacute;lo ten&iacute;a contratada la limpieza de la zona de playa una vez a la semana, mientras que la anterior ten&iacute;a contratado ese servicio tres veces a la semana y este verano se vio descuidado esa zona de la piscina.</p>\r\n<p>Se someten a consideraci&oacute;n tres propuestas:</p>\r\n<p>1.Limpiezas Sam: realizando actuaciones de limpieza y mantenimiento de vaso, control de par&aacute;metros, limpieza de desinfecci&oacute;n de la playa (3 veces por semana), pediluvios y zonas colindantes al vaso. Importe mensual a pagar 475&euro; mas IVA. La puesta en marcha a inicio de temporada 360&euro;mas IVA.</p>\r\n<p>2.Atagua mantenimiento mensual: Analizar, dosificar los productos qu&iacute;micos necesarios para su correcta desinfecci&oacute;n, y anotaciones en el manual de autocontrol. Lavado de filtro, limpieza de prefiltro de bomba y comprobar el funcionamiento de las bombas dosificadoras. Barrer el fondo de la piscina siempre que sea necesario. Limpieza y mantenimiento de las aceras. (Frecuencias de los trabajos Lunes, mi&eacute;rcoles y viernes). Importe de los trabajos 576&euro; mas IVA. La puesta en marcha a inicio de temporada 398,50&euro; mas IVA.</p>\r\n<p>3.Grupo La Campa: Contrataci&oacute;n mantenimiento de piscina del 1-Junio al 30 &ndash; Septiembre, servicios similares a los que ofertan las dos empresas anteriores y una vez al mes en temporada de invierno. Importe mensual a pagar mensualmente tanto en temporada de verano como el resto de a&ntilde;o 220&euro; mas IVA.</p>\r\n<p>Tambi&eacute;n nos recomiendan y as&iacute; tambi&eacute;n lo indica el bolet&iacute;n oficial del Principado de Asturias en el Reglamento T&eacute;cnico &ndash; Sanitario de las Piscinas de Uso Colectivo, Capitulo V, art.22, pto. 4&ordm; Los filtros de arena ser&aacute;n sometidos a una revisi&oacute;n, mantenimiento y limpieza peri&oacute;dica adecuada y se someter&aacute;n a renovaciones parciales o totales de su contenido. Se realizaran una renovaci&oacute;n total del contenido de arena en un intervalo m&aacute;ximo de 10 a&ntilde;os.</p>\r\n<p>Se acuerda contratar la empresa de Mantenimiento Sam para en el siguiente ejercicio seg&uacute;n el coste que se indica (1) y tambi&eacute;n autorizan para la siguiente temporada realizar el cambio Total de la arena seg&uacute;n recomiendan las empresas encuestadas y el Principado. El importe a pagar por el cambio de carga de arena 1.175&euro; mas IVA. Esta partida se toma del fondo de maniobra. &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>', 1),
	(329, 221, 'INSPECCION PERIODICA ASCENSOR CA-1 V-42', '2013-11-13', '2014-09-02', NULL, 1, '<p>VENCE EL 2/09/2014</p>', 15),
	(330, 220, 'RENOVACION CONTRATO LIMPIEZA', '2013-11-13', '2014-10-01', NULL, 1, '<p>* <strong>FECHA VENCIMIENTO CONTRATO</strong>. Contrato es indefinido y se puede cancelar en cualquier momento, avisando con 30 d&iacute;as de antelaci&oacute;n. Tom&eacute; como fecha de vencimiento OCT porque es el mes que se hizo &uacute;ltima Junta Ordinaria en esta comunidad, por si se quiere presupuestar o negociar precios.</p>', 30),
	(331, 83, 'APAGADO SERVICIO DE CALEFACCION', '2013-11-13', '2014-04-30', NULL, 1, '<p>REMITIR UN E-MAIIL A PRYMASTUR PARA QUE SE APAGUE LA CALEFACCI&Oacute;N HACIA EL 30/4/13 SALVO QUE ESTE MUY FRIO Y SE PUEDA PRORROGAR M&Aacute;S TIEMPO.</p>', 10),
