	(346, 655, 'RENOVACION CONTRATO ARRENDAMIENTO TERRAZA', '2013-12-03', '2014-12-03', NULL, 1, '<p>EL CONTRATO ARRENDAMIENTO TERRAZA EDIFICIO EL ROBLE SE FIRMO CON FECHA 3/12/13 POR UN A&Ntilde;O, FIN EL 3/12/14. HAY QUE TRATAR EN JUNTA LA RENOVACION O NO.</p>', 30),
	(347, 48, 'SUMINISTRO LINEA TELEF. ASCENSOR', '2013-11-21', '2014-07-01', NULL, 1, '<p>CON FECHA 25/11/13 SE FIRMA CONTRATO DE SUMINISTRO DE LINEA TELEFONICA EN LOS ASCENSORES, ESTE CONTRATO TIENE UNA DURACION DE 2 A&Ntilde;OS PERO ESTA VINCULADO AL CONTRATO DE MANTENIMIENTO DE LOS ASCENSORES, POR ESO SE PONE COMO FECHA DE VENCIMIENTO LA DEL CONTRATO MTTO, PORQUE ESTE CONTRATO DE LINEA TELEFONICA FINALIZAR&Iacute;A EL 25/11/2015. SE ABONARIAN 10&euro; MENSUALES M&Aacute;S IVA POR ASCENSOR.</p>', 30),
