INSERT INTO `comunidad` (`CN_COMUNIDAD`, `CA_CIF`, `TE_NOMBRE`, `TE_CP`, `TE_OBSERVACIONES`) VALUES
	(4, 'H-33728759', 'C.P. ARAGON BLOQUE 9 DCHA.', '33205', '<p>ESTA COMUNIDAD ALGUNAS VIVIENDAS LAS GESTIONA AGENCIA ALVAREZ</p>\r\n<p>**FIRMA DE MANERA MANCOMUNADA PTE. Y ADMINISTRADORA.</p>'),
	(6, 'H-33717448', 'C.P. ECHEGARAY 29', '33208', '<p>* Las viviendas de la letra A, las habitaciones, dan todas a C/Echegaray</p>\r\n<p>* Las viviendas de la letra B, todas las habitaciones, dan a Echegaray, menos una que da a Alvarez Gonz&aacute;lez</p>\r\n<p>* Las viviendas de la letra C, todas las habitaciones, dan a Juan Alvarez Gonz&aacute;lez</p>\r\n<p><span style="background-color: #ff0000;"><strong>LAS LLAVES DEL CUARTO DE CONTADORES LAS TIENE INDALECIO 2&ordm;C</strong></span></p>\r\n<p><span style="background-color: #ffffff;">* <strong>BOMBILLAS PARA EL PRESIDENTE 2012</strong>. 27/2/2012 El presidente, Jos&eacute; Luis Matr&iacute;nez, solicita que la encargada de la limpieza que cambia las luminarias, le deje una bombillas por si &eacute;l necesita cambiar alguna cuando los de la limpieza no est&eacute;n. El 29/2/2012 llam&oacute; Xenia de la limpieza para informar que ya las ten&iacute;a el presidente y que dej&oacute; el portal OK en cuanto a luminarias.</span></p>\r\n<p><span style="background-color: #ffffff;">* <strong>LLAVES COMUNIDAD CARGOS</strong>. 1/3/2012 el presidente Jos&eacute; Luis Mart&iacute;nez y el vicepresidetne Jos&eacute; Alvarez se han llevado todas las llaves de Echegaray 29 (Caja Blanca entera inclu&iacute;do sello de la comunidad) Las quieren tener ellos, se responsabilizan de ellas.</span></p>'),
	(7, 'H-33897901', 'C.P. MONTEVERDE C/VELAZQUEZ 24-26-28 Y C/ELVIRA MUÑIZ 2', '33211', '<p>**Esta comunidad comparte garaje con C.P. Europa</p>\r\n<p>**<strong>LECTURA CONTADORES AGUA</strong>. Se realizan lectura de contadores cada 6 meses, habiendo que informar previamente a los vecinos.</p>\r\n<p>**<strong>COMIENZO CONTRATOS LUZ INTEGRA 2013</strong>: 8 JULIO Vel&aacute;zquez 26 Bajo / Garaje / Alumbrado Exterior 9 JULIO Elvira Mu&ntilde;&iacute;z 2 29 JULIO Vel&aacute;zquez 24 Bajo / Vel&aacute;zquez 28 Bajo</p>\r\n<p>***<strong>LUZ DE SOPORTALES NORMAL, NO ES ALTERNA.</strong></p>\r\n<p><strong>* PRESIDENTES. </strong>Cuando cambian los cargos tener pendiente actualizarlos en el GARAJE MONTEVERDE-EUROPA</p>'),
	(8, 'H-33849886', 'C.P. CARBONERA 58', '33211', '<p>*Comparte Garaje con CP Carbonera 60 y 62 (la 62 es de otra administraci&oacute;n).</p>\r\n<p>** LAS LUMINARIAS DE LOS SOPORTALES TIPO GLOBO FUNCIONAN CON SENSOR CREPUSCULAR (DE LUMINOSIDAD)</p>\r\n<p>* <strong>TODOS LOS AUTOMATICOS DE LAS ZONAS EXTERIORES</strong> (TODO LO REFERENTE A ELECTRICIDAD) ESTA UBICADO EN LA ZONA TRASERA DE LA TORRE N&ordm; 62, Y EN EL CUADRO DEL GARAJE DE LA ZONA DEL PORTAL 62 ESTA TODO LO DEL GARAJE, O SEA, QUE TODO EL TEMA DE LUMINARIA TANTO EXTERIOR COMO DE GARAJE SE LOCALIZA EN LA TORRE 62.</p>\r\n<p>**En el cuarto de reuniones me he percatado en la Junta realizada en fecha 05 de Marzo de 2013 que hay una trampilla de limpieza de bajantes he preguntado a los vecinos y creen que la misma pertenece a la letra A de las cocinas.</p>\r\n<p>*** PRESIDENTE A&Ntilde;O 2013 (ATILANO) INDICA QUE TODOS LOS AVISOS SE LE DEN A EL PRIMERO ANTES DE ENVIAR REPARADOR.</p>\r\n<p><span style="background-color: #00ff00;">****<strong>EN ESTA COMUNIDAD NO QUIEREN BAJO NINGUN CONCEPTO QUE SE ENVIE A GERARDO ROBLES A REALIZAR TRABAJOS DE ELECTRICIDAD</strong></span></p>'),
	(9, 'H-33842840', 'C.P. CARBONERA 60', '33211', '<p>Comparte garaje con C.P. CARBONERA 58 Y 62 (la 62 la lleva otra administraci&oacute;n)</p>'),
	(10, 'H-33915026', 'C.P. CARMEN AMAYA 2', '33211', '<p>* La llave maestra abre la terraza y el cuarto de la limpieza.</p>\r\n<p>* La llave que trae cubierta es del RITI de Teleomunicaciones que est&aacute; arriba en la &uacute;ltima planta</p>\r\n<p>* <strong>COMIENZO CONTRATO LUZ INTEGRA 2013: 29 JULIO</strong></p>\r\n<p><strong>* HORARIO VENTILADOR GARAJE. </strong>De 11 a 12 hrs y de 17 a 18hrs</p>\r\n<p>* <strong>CODIGO LLAVE ACCESO ASCENSOR</strong>. 2/016829/ (Cerrajeros Ra-ba)</p>'),
	(11, 'H-33923830', 'C.P. CARMEN AMAYA 4', '33211', '<p>1.LA MANCOMUNIDAD HA APROBADO EN JUNTA PARA QUE LA LIMPIEZA DE LOS SOPORTALES Y PATIOS SE UTILICE EL AGUA UNA VEZ DE CADA PORTAL, ES DECIR UNA VEZ X TRIMESTRE SE HAR&Aacute; LAS LIMPIEZAS CON EL AGUA DE CADA UNO DE LOS PORTALES 4 - 6 - 8. 2. POSEEN UN BAJO EN SOPORTAL QUE UTILIZAN PARA GUARDAR BICIS</p>\r\n<p>*&nbsp;<strong>PRESIDENTE MANCOMUNIDAD CARMEN AMAYA 4-6-8 + GARAJE CIGARRERES 29</strong>. El que ejerce de presidente del garaje es el mismo que ejerce en la Mancomunidad. Agreg&eacute; los presidentes de los portales de C.Amaya 4-8 por si alguna vez no estuviera disponible el presidente del Garaje. Pendiente de modificar cambios en Mancomunidad con cada cambio de gobierno.</p>'),
	(12, 'H-33923848', 'C.P. CARMEN AMAYA 8', '33211', '<p>* <strong>LIMPIEZA SOPORTALES</strong>. LA MANCOMUNIDAD HA APROBADO EN JUNTA QUE LA LIMPIEZA DE LOS SOPORTALES Y PATIOS SE UTILICE EL AGUA UNA VEZ DE CADA PORTAL, ES DECIR UNA VEZ X TRIMESTRE SE HARA LAS LIMPIEZAS CON EL AGUA DE CADA UNO DE LOS PORTALES 4-6-8.</p>\r\n<p>* <strong>LLAVES CUADRO ELECTRICO</strong>. 27/04/2012 SE LE HA DEJADO LA LLAVE DEL ARMARIO (LLAVERO ROJO) DONDE EST&Aacute; EL CUADRO EL&Eacute;CTRICO (SITO EN EL PORTAL SEG&Uacute;N SE ENTRA LOS ARMARIOS QUE HAY) AL VECINO DEL 4&ordm;K PABLO, YA QUE SALT&Oacute; UN AUTOMATICO Y NADIE TENIA LLAVE DE ESA PUERTA, SE LE DEJO A EL X SI VUELVE A OCURRIR.</p>\r\n<p>&nbsp;*&nbsp;<strong>PRESIDENTE MANCOMUNIDAD CARMEN AMAYA 4-6-8 + GARAJE CIGARRERES 29</strong>. El que ejerce de presidente del garaje es el mismo que ejerce en la Mancomunidad. Agreg&eacute; los presidentes de los portales de C.Amaya 4-8 por si alguna vez no estuviera disponible el presidente del Garaje. Pendiente de modificar cambios en Mancomunidad con cada cambio de gobierno.</p>'),
	(13, 'H-33923863', 'C.P. GARAJE CIGARRERES 29', '33211', '<p>Es el Garaje de C.P. CARMEN AMAYA 4 - 6 - 8 (CARMEN AMAYA 6 la lleva otra administraci&oacute;n)</p>\r\n<p>* <strong>PRESIDENTE GARAJE + MANCOMUNIDAD CARMEN AMAYA 4-6-8</strong>. El que ejerce de presidente del garaje es el mismo cargo de la Mancomunidad. Pendiente de cambiarlo con cada cambio de gobierno.</p>'),
	(14, 'H-33861709', 'C.P. PLAZA PATRICIO ADURIZ 1-2-3-4', '33211', '<p>EL 22/08/2013 SE PUSO EN FUNCIONAMIENTO EL GRUPO DE PRESI&Oacute;N DE BOMBAS. SE AVIS&Oacute; A SILVINO Y AL PISO DE VIPASA PARA QUE SE TENGA EN OBSERVACI&Oacute;N PARA FUTUROS AJUSTES EL HORARIO DE FUNCIONAMIENTO ES (7:00 HORAS EN LA MA&Ntilde;ANA ENCENDIDO Y APAGADO 23:00HORAS)&nbsp;<span style="background-color: #00ffff;">ABIERTO SEGUIMIENTO DE BOMBAS EN EL PORTAL 2 QUE ES DONDE SE LOCALIZAN.</span></p>\r\n<p><strong><span style="background-color: #00ffff;">PARA CAMBIAR EL RELOJ DE LAS BOMBAS, LO REALIZA EL VECINO DEL PORTAL 4-6&ordm; C RICARDO.</span></strong></p>\r\n<p><span style="background-color: #00ffff;"><span style="background-color: #ff6600;"><strong>NO HAY LLAVE DE RITIS. LOS RITIS ESTAN EN CADA PORTAL A MANO DERECHA.</strong></span></span></p>\r\n<p>&nbsp;</p>'),
	(16, 'H-33938028', 'C.P. EDIFICIO PRISMA', '33211', '<p>* Calle Vel&aacute;zquez 20 y Badajoz 26 - 28</p>\r\n<p>* <strong>Firman en la Cuenta Bancaria de Comunidad,</strong> Presidente y Vicepresidente</p>\r\n<p>* Esta comunidad tuvo cuenta en BBVA hasta 2011/2012. Actualmente, la tiene en Cajastur.</p>\r\n<p>* <strong>PLACAS RECUBREN COLUMNAS SOPORTAL</strong>, en 24/9/2013, Pablo -el entonces presidente- recogi&oacute; de la constructora unas placas del edificio. Estas placas se guardan en PORTAL 28, en el RITI de TV; arriba, en la &uacute;ltima planta (tejado). En existencia hay 12 Piezas, 2 Cajas. Para la colocaci&oacute;n de dichas placas hay que utilizar cola WEBBER H FLEX &nbsp;JOMASA FACHADA KERACOL H FLEX (Cola para fachada).</p>\r\n<p><span style="color: #ff0000;"><strong>* LUCES.- SE DETERMINO EN JUNTA QUE A PARTIR DE LA FECHA HAN DE PEDIRSE LAS LUMINARIAS OSRAM DE 11W. NO QUIEREN DE OTRAS. (PEDIR SIEMPRE LAS DE MAS BAJO CONSUMO Y BARATAS)</strong></span></p>'),
	(17, 'H-33890823', 'C.P. LA VEREDA', '33211', '<p>* Tres portales A - B - C</p>\r\n<p>* 56 Vecinos + 4 Plazas de Garaje Adicionales + 5 Locales</p>\r\n<p>* Portal A - 22 Vecinos / Portal B -12 Vecinos / Portal C - 22 Vecinos</p>\r\n<p>* <strong>INSTALADOR PARQUE INFANTIL.</strong> Lo instal&oacute; Manufacturas Deportivas Tel. 942.336.711 / Fax 942.339.218 /</p>\r\n<p>email: md@manufacturasdeportivas.com</p>\r\n<p>*<strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Arial;">ADMINISTRACION DEL EDIFICIO MAROLA (edif.anexo)</span></strong><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">ANA FERNANDEZ CASTA&Ntilde;O&nbsp;</span></strong><strong><span style="font-size: 8.0pt; font-family: Arial;">C/Traves&iacute;a del Convento, 6, Entresuelo A 33202 Gijon</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">Tfn 984.19.43.04 Fax 984.19.08.67 Movil 617.444.304&nbsp;</span></strong><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">anafernandezcas@telecable.es</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(18, 'H33925041', 'C.P. EL CARBAYO', '33211', '<p>* <strong>FIRMAS ENTIDAD BANCARIA</strong>. &nbsp;Firman mancomunadamente Presidente &oacute; Vicepresidente + Administrador.</p>\r\n<p>* <strong>LLAVES COMUNIDAD</strong>. Se entregan copias al Presidente y Vice cuando toman el cargo.</p>\r\n<p>*&iexcl;&iexcl;&iexcl;&iexcl;&nbsp;<span style="background-color: #ff0000;"><strong>ELECTRICISTAS</strong>.</span> EN JUNTA DE FECHA 17/10/2013, Los vecinos determinan que los trabajos electricos sean realizados por un vecino de la comunidad, p.11 - 1&ordm;D Jorge Cembranos Glez. (Este vecino se le llamo para indicarle que debido al acuerdo de junta habia que ponerle en el documento indicativo de tfn y direcciones, se paso x la oficina y dijo que nada de n&ordm; de tfn. que solamente su nombre y piso, que &eacute;l se brindaba a arreglar lo que pudiera x un favor a la cdad. pero que no queria tener alli a todos los vecinos para dar avisos, que queria que se filtraran a traves de la admo.)</p>\r\n<p><strong>ANULADO el servicio con Hector Pablo Ruig.-!!!!</strong>Con los ptes. 2012/2013 (Sandra, p.11 2&ordm;D, su marido Sergio, el 17/05/2013 indico que bajo su total responsabilidad habriamos de avisar primero a HECTOR PABLO RUIG en cuanto a avisos de car&aacute;cter el&eacute;ctrico. Ver nota en Empresas &gt; Hector Ruig.</p>'),
	(19, 'H-33939414', 'C.P. DOMINGO JULIANA 23 ', '33212', '<p>*<strong> HORARIO Extractores del Garaje</strong> 9:30 a 10 hrs y 20 a 20:30 hrs</p>\r\n<p><span style="background-color: #cc99ff;">* Seg&uacute;n lo acordado en Junta 9/12/2009: Cuando se produzca <strong>conducta inadecuada</strong> en la comunidad, se le notificar&aacute; al vecino que ocasione esas molestias a trav&eacute;s de un escrito y NO colocando avisos, en el portal, de manera generalizada.</span></p>\r\n<p>* <strong>Las Actas se enviar&aacute;n a CASPILES</strong>, mientras sean propietarios de las plazas de garaje, Carta Certificada + Acuse de Recibo (NO BUROFAX)</p>\r\n<p>* DATOS PERRO ZEUS -PROPIETARIO BJ A : Alejandro Sierro S&aacute;nchez Exp Ayuntamiento 028607/2010 Expedido 2/8/2010 vigencia 5 a&ntilde;os ES 0535557252-G El perro no est&aacute; en el piso, aparentemente, se lo llevaron a una finca</p>'),
	(20, 'H-33711995', 'C.P. CATALUÑA 38', '33210', ''),
	(21, 'H-33894494', 'C.P. TIODA', '33211', '<p>* Tres portales: Les Cigarreres 19 - 21 y Elvira Mu&ntilde;&iacute;z 10</p>'),
	(22, 'H-33927914', 'C.P. SOL DE MONTEVIL', '33211', '<p>* Tres Portales: CALLE ALAVA 46 -48 -50</p>\r\n<p>* <strong>LLAVE ACCESO CONTADORES AGUA</strong>.Para la lectura de los contadores de Agua y Calefacci&oacute;n se abre con la maestra</p>\r\n<p>* <strong>CODIGOS ACCESO LLAVE ASCENSOR</strong>: Portal 46 -0416 Portal 48 -0428 Portal 50 -0530</p>'),
	(23, 'H-33916701', 'C.P. BELLAVISTA', '33211', '<p>* Calle Pe&ntilde;a de los Cuatro Jueces 7 - 11</p>'),
	(24, 'H-33907817', 'C.P. EUROPA', '33211', '<p>* Calles Badajoz 27 - 29 - 31 y Vel&aacute;zquez 22</p>\r\n<p>* <strong>El RITI de TELECOMUNICACIONES</strong> se encuentra en el soportal de Vel&aacute;zquez 22, en un lateral, un cuarto con puerta gris</p>'),
	(25, 'H-33938713', 'C.P. ESMERALDA MASEDA 3', '33211', '<p><span style="color: #000000; background-color: #ffffff;"><strong>* ADMINISTRACION GARAJE DE ESTA COMUNIDAD. </strong>La lleva Principado Administraciones, Teresa, T. 985.133.227</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;"><strong>* CHEQUERA CTA. BANCO. </strong>En el acorde&oacute;n granate en administraci&oacute;n.</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>LLAVES COMUNIDAD</strong>. Tenemos las llaves del PORTAL + TABLON ANUNCIOS + RITI TV, est&aacute;n colocadas en la puerta del armario de llaves. Adem&aacute;s, tenemos las llaves del RITI de TELEFONO, que est&aacute; en el rellano del 1&ordm; y 4&ordf; planta. Las llaves de todas las instalaciones las tiene el presidente de turno, se las pasan con cada nombramiento.</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>UBICACION RITI TELECOMUNICACIONES (TLF)</strong>. Est&aacute; en el portal a la izquierda, puerta beige. A fecha de 20/5/2011 no est&aacute; cerrada y no se sabe quien puede tener esta llave.</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">*&nbsp;<strong>UBICACION RITI TV</strong>. Est&aacute; pendiente de localizar.</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>UBICACION CUADRO ELECTRICO PORTAL</strong>. Es una puerta de madera que est&aacute; en el portal, seg&uacute;n se entra al fondo a la derecha. La puerta que est&aacute; justa al lado del espejo. Tampoco est&aacute; cerrada.</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>UBICACION CUARTO LIMPIEZA</strong>. Est&ntilde;a seg&uacute;n se entra a la izquierda. Una puerta marr&oacute;n de madera.&nbsp;</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">*<strong> CONTADORES DEL AGUA</strong>. El contador de agua (Puerta abierta) est&aacute; al lado del armario del cuadro elc&eacute;trico.&nbsp;</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>CONTADOR DE GAS</strong>. Est&aacute; fuera del portal.</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>CONTADORES ELECTRICOS</strong>. Seg&uacute;n se entra a la izquierda antes del cuarto de limpieza. (Esto es tema de HC)</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">* <strong>PROTECCION DATOS</strong>. Realizada por PROTEMIN, Ana, T.984.158.040, email:ana.vicasa@protemin.es). Nombre del Fichero: CORRESPONDENCIA, N&ordm; Inscripci&oacute;n: 2092090636</span></p>\r\n<p><span style="color: #000000; background-color: #ffffff;">&nbsp;</span></p>\r\n<p><span style="color: #ff0000;"><strong>REVISAR TEMA CONTADOR DE VECINO 5&ordm;K EN SU PREDIO.</strong></span></p>\r\n<p>EN JUNTA DE FECHA 03/10/2013, SE DETERMINA QUE:<span style="font-family: \'Palatino Linotype\';">La vecina del piso 4&ordm; A solicita autorizaci&oacute;n para la colocaci&oacute;n de una verja en la ventana del sal&oacute;n para colocar plantas y que las mismas est&eacute;n seguras y no caigan con el viento. Los asistentes a la Junta le dan la autorizaci&oacute;n para la colaci&oacute;n.</span></p>\r\n<p><span style="font-family: \'Palatino Linotype\';">&nbsp;</span></p>'),
	(26, 'H-33757402', 'C.P. FERMIN CANELLA 4', '33207', '<p>* El GARAJE de este portal no tiene administrador, los cargos se van rotando anualmente, correlativamente, por plazas. En per&iacute;odo 2013-2014 el presidente es Evaristo Rubio Garc&iacute;a, quien coincidi&oacute; tambi&eacute;n como presidente en el portal.</p>\r\n<p>* Creemos que ese garaje se comparte con otros portales.</p>'),
	(27, 'H-33914888', 'C.P. CIGARRERES 52', '33211', '<p>* NO ESTA TRANSFERIDA A VIPASA</p>\r\n<p>**Con fecha 18/09/2013 en junta extraordinaria realizada se cambio de compa&ntilde;ia aseguradora, se cambio de Catalana a Caser</p>'),
	(28, 'H-33911280', 'C.P. EL ROBLE', '33211', '<p>* Firman en la cuenta el Presidente + Vicepresidente **Ubicaci&oacute;n de llaves: LLAVE N&ordm; 1.- MAESTRA (2 LLAVES) LLAVERO LILA Y LLAVERO NEGRO. LLAVE N&ordm; 2.- LLAVE DE ACCESO A CUARTO DE LIMPIEZA (SITO EN LA PLANTA -1 DE ACCESO AL GARAJE, PUERTA DE LA IZDA SEG&Uacute;N SE BAJA X LAS ESCALERAS O SE SALE DE LOS ASCENSORES. TIENE ENCHUFE, ES DONDE SE CONECTA LA HIDROLIMPIADORA). LLAVE N&ordm; 3.- RITI TELECOMUNICACIONES (LLAVERO DORADO) RITI GENERAL. (SITO EN LA BAJADA AL GARAJE, PUERTA DE LA DCHA.). LLAVE N&ordm; 4.- REJA DE ACCESO A EXTRACTORES DEL GARAJE (SITO EN EL GARAJE, SEG&Uacute;N SE SALE X LA PUERTA DE ACCESO INTERIOR DEL EDIFICIO A LA DCHA.) LLAVE N&ordm; 5.- RITI DE TV (SITA EN LA PLANTA DE ACCESO A LA AZOTEA-TERRAZA, PUERTA SIGUIENTE A LA DEL CUARTO DE MAQUINAS). LLAVE N&ordm; 6.- LLAVES DE RITIS DE TELECOMUNICACIONES DE RELLANOS. (CADA RELLANO TIENE SU ARMARIO DE RITI DE TELECOMUNICACIONES). LLAVE N&ordm; 7.- LLAVE DE ACCESO A TERRAZA (PUERTAS (2) DE ENFRENTE DE LA VENTANA). LLAVE N&ordm; 8.- LLAVE DE ALMACEN AL LADO DE LAS PUERTAS DE ACCESO A LA TERRAZA (ALMACEN DE AZULEJOS Y SUELOS). LLAVE N&ordm; 9.- LLAVE TABLON DE ANUNCIOS SITO EN LOS PORTALES. CUADRO ELECTRICO PORTALES.- SITO EN EL DESCANSILLO (PASILLO) QUE COMUNICA LOS DOS PORTALES (MAS CERCANO AL PORTAL N&ordm; 23) ACCESO A LA ZONA DE LOS TRASTEROS.- SITO EN LA PLANTA -1, NO TIENE CERRADURA, VA SIN LLAVE PORTON GARAJE.- TIENE ACCESO PUERTA PEATONAL CON LA MAESTRA. CUADRO ELECTRICO GARAJE.- NO TIENE LLAVE, SITO EN EL GARAJE (TIENEN ENCHUFE).</p>'),
	(29, 'H-33892837', 'C.P. H FERRADORES 5', '33350', ''),
	(30, 'H-33830308', 'C.P. GUIPUZCOA 41', '33210', '<p><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; background: red; mso-highlight: red; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">Junta de fecha 30/07/2013 se determina que:&nbsp; &ldquo;EN CUANTO AL AGUA DE LA LIMPIADORA SE DETERMINO en a&ntilde;os anteriores pero no se dej&oacute; constancia en el libro de actas QUE EL AGUA QUE HAY QUE FACILITAR A LA LIMPIADORA HA DE SER SUMINISTRADA DE LA ACOMETIDA DEL PISO DEL PTE. DE TURNO DURANTE EL A&Ntilde;O QUE LE TOCA a cada vecino ejercer de pte., EL VECINO DEL 5&ordm;B CESAR SE RESPONSABILIZA DE REALIZAR EL CAMBIO CORRESPONDIENTE con el fin de no incurrir en gastos y asi no tener que llamar a un fontanero para que cambie el latiguillo.</span></strong></p>'),
	(31, 'H-33859596', 'C.P. PLAZA DONANTES 1 - 2', '33211', ''),
	(32, 'H-33891904', 'C.P. PUERTA DEL SOL', '33211', '<p>*&nbsp;<strong>LLAVES MAESTRAS.&nbsp;</strong>La llave maestra que est&aacute; en el llavero verde abre el PORTAL 40. La maestra en el llavero negro abre PORTAL 42 y 1, pero NO el 40.</p>\r\n<p>* <strong>FIRMAS ENTIDAD BANCARIA</strong>. Firman mancomunadamente en la cuenta de Cajastur el Presidente con el Vicepresidente 1</p>\r\n<p>* <strong>PROTOCOLO APERTURA PISCINA VERANO</strong> / 1 JUNIO a 30 SEPTIEMBRE - Dar de alta la apertura ante la Consejer&iacute;a (modelo en internet) - En 2009 sali&oacute; un nuevo reglamento sobre aguas en el Principado de Asturias, Decreto 140/2009 que os aconsejo os repas&eacute;is.</p>\r\n<p>&nbsp;</p>'),
	(33, 'H-33686023', 'C.P. LEONCIO SUAREZ 10', '33208', '<p>* Firman en la cuenta de la Comunidad de manera mancomunada el presidente y vicepresidente</p>'),
	(34, 'H-33918822', 'C.P. LOS PINTORES 15', '33211', ''),
	(35, 'H-33745183', 'C.P. LA MANCHA 3', '33210', '<p>* Las bombillas de la comunidad las tiene el Presidente, pero es responsabilidad de todos los vecinos cambiar la de su planta seg&uacute;n vean que se van &nbsp; &nbsp; &nbsp; fundiendo.</p>\r\n<p>*El presidente se encarga de orientar a los t&eacute;cnicos, en cuanto a incidencias.</p>\r\n<p>*<strong>EN LA ADMINISTRACION NO HAY LLAVES DE ESTA COMUNIDAD</strong></p>\r\n<p><span style="background-color: #00ccff;"><strong><span style="color: #ff0000;">OJO MARIA JOSE </span>LLEVA LAS CUENTAS DE AFRICA LA SRA. DE LA LIMPIEZA UNA TAL ANA 985.34.32.81. SE PUSO EN CONTACTO CONMIGO HOY 03/10/2013 &nbsp;PARA ACTUALIZAR LAS CUOTAS QUE TIENE PENDIENTE.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>*JUNIO 2013, al no vivir en la comunidad la presidente de este per&iacute;odo (2013-2014), tiene las&nbsp;<strong>llaves del ascensor y las bombillas</strong>&nbsp;para sustituir en rellanos y escaleras, el vecino del&nbsp;<strong>2&ordm; B</strong></p>'),
	(36, 'H-33873886', 'C.P. JAPON 14', '33211', '<p><strong>* FIRMAS ENTIDAD BANCARIA</strong>. Firman mancomunadamente Presidente + Vicepresidente</p>\r\n<p><strong>* LLAVES COMUNIDAD</strong>, Tenemos llaves de la Comunidad (Puerta del armario)</p>\r\n<p>* <strong>RITI TELEFONO</strong> est&aacute; ubicado en portal, seg&uacute;n se entra, la puerta marr&oacute;n que est&aacute; a la derecha. Se abre con la maestra de la comunidad.</p>\r\n<p>* <strong>CABLEADO RITI TELFEFONO</strong>, hay una puerta peque&ntilde;a en el portal exterior, donde los micros abajo. Se abre con la misma llave y est&aacute; todo el cableado que va hacia el Riti del Telf. del portal.</p>\r\n<p>* <strong>RITI TV&nbsp;</strong>est&aacute; en la 12&ordf; planta, subiendo por las escaleras desde el 11&ordm;. Llave de acceso est&aacute; rotulada con TELEVISION.</p>\r\n<p>* <strong>CUADRO ELECTRICO PORTAL</strong>, es un armario de madera que est&aacute; en el portal hacia la derecha seg&uacute;n entras. Para la llave de este armario hay que bajar al garaje seg&uacute;n se sale del ascensor se tira a la izquierda y se sale por la puerta de la izquierda hacia el garaje y a 25M de la columna hay una puerta que dice SIN SALIDA. Dentro de esta habitaci&oacute;n hay un llavero con todas las llaves de la comunidad.</p>\r\n<p>* <strong>EMERGENCIAS LED</strong>. En Junta del 17/5/2011 se aprob&oacute; que si las l&aacute;mparas de emergencia se da&ntilde;aban, que se sustituyan por l&aacute;mparas emergencia LED, tanto para el Garaje como para las plantas.</p>\r\n<p>* <strong>BALDOSAS PARA PISOS</strong>, hay baldosas en un cuarto velux al cual se accede a trav&eacute;s de: 1ro. subir a la &uacute;ltima planta (N&ordm;11), hay dos escaleras, una de ellas tiene antes de llegar, una ventana peque&ntilde;a desde la cual se ve otra ventana en el tejado. 2do Hay que salir por esta ventana al lado de la escalera, caminar por el tejado. <span style="color: #ff6600;"><span style="color: #ff0000;">Tener cuidado con las tejas.</span>&nbsp;<span style="color: #000000;">Acceder por otra ventana a un cuarto tipo velux que es donde est&aacute;n todas las baldosas.</span></span></p>\r\n<p><span style="color: #ff6600;"><span style="color: #000000;">* <strong>CODIGO DOMOTICO TELEFONILLO</strong>/ CODIGO ACCESO POR MICROLARBI: CAMPANA 2000 APERTURA</span></span></p>\r\n<p><span style="color: #ff6600;"><span style="color: #000000;">*&nbsp;</span></span><strong style="text-align: justify;"><span style="text-decoration: underline;"><span style="font-size: 11.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">EN JUNTA DE FECHA 17 DE MAYO DE 2011</span></span></strong><span style="text-align: justify; font-size: 11pt; font-family: Arial;"> SE APROB&Oacute; QUE SI <strong><span style="background: aqua; mso-highlight: aqua;">LAS LAMPARAS DE EMERGENCIA</span></strong> SE DA&Ntilde;ABAN QUE SE <strong><span style="background: aqua; mso-highlight: aqua;">SUSTITUYAN</span></strong> POR LAMPARAS DE <strong><span style="background: aqua; mso-highlight: aqua;">EMERGENCIAS LED</span></strong> TANTO PARA EL GARAJE COMO PARA LAS PLANTAS.</span></p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt;">&nbsp;</div>\r\n<p class="MsoNormal" style="margin-right: -40.4pt;"><span style="background-color: #ffcc00;"><strong><span style="font-size: 10.0pt; font-family: Arial;">MANCOMUNIDAD URBANIZACION PARQUE MARIA LUISA:</span></strong></span></p>\r\n<p class="MsoNormal" style="margin-right: -40.4pt;"><span style="font-size: 10.0pt; font-family: Arial;">COMPRENDE PORTALES C/JAPON 16-18-20, C/JAPON 14, C/VELAZQUEZ 17-C y otros 3, C/VELAZQUEZ 21</span></p>\r\n<ul style="margin-top: 0cm;" type="disc">\r\n<li class="MsoNormal" style="margin-right: -40.4pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Arial;">JARDINES</span></li>\r\n<li class="MsoNormal" style="margin-right: -40.4pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Arial;">CANCELA</span></li>\r\n<li class="MsoNormal" style="margin-right: -40.4pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><span style="font-size: 10.0pt; font-family: Arial;">PORTON DE GARAJE &ndash; CORREDERA -</span></li>\r\n</ul>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -40.4pt; margin-bottom: .0001pt; margin-left: 18.0pt;"><span style="font-size: 10.0pt; font-family: Arial;">FERCO &ndash; HECTOR &ndash; 984.19.66.40&nbsp; / 985.35.73.19;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -40.4pt; margin-bottom: .0001pt; margin-left: 18.0pt;"><span style="font-size: 10.0pt; font-family: Arial;">fax 985.17.60.89</span></p>\r\n<p><span style="color: #ff6600;"><span style="color: #000000;"> <span style="font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;"><a href="mailto:hfernandez@corugedo.org">hfernandez@corugedo.org</a></span></span></span></p>'),
	(37, 'H-33775529', 'C.P. GARAJE PABLO PICASSO 10', '33210', ''),
	(38, 'H-33965799', 'C.P. GARAJE BADAJOZ 45', '33211', '<p class="MsoNormal"><strong>En el Garaje recordar a Tom&aacute;s, cuando tenga que ir a alguna cosa, que en el cuadro el&eacute;ctrico, en el circuito de emergencias del 5 hay que cambiar el neutro por la fase. Me lo coment&oacute; el chico que pas&oacute; la Inspecci&oacute;n del Garaje el 25/4/13.</strong></p>'),
	(39, 'H-00000000', 'C.P. GARAJE MONTEVERDE - EUROPA', '33211', '<p>Garaje C.P. EUROPA y C.P. MONTEVERDE</p>\r\n<p>*<span style="background-color: #ffff00;"><strong>&nbsp;APERTURA AVISOS</strong></span>. Los avisos que se abren por el GARAJE MONTEVERDE-EUROPA son: Inspeccion Baja Tensi&oacute;n Garaje + Avisos relacionados a la renovaci&oacute;n del contrato del mantenimiento del Port&oacute;n.&nbsp;</p>\r\n<p>* <strong>POLIZA SEGURO</strong>. Es igual a la p&oacute;liza de seguro de C.P. MONTEVERDE, los avisos de renovaci&oacute;n de contrato se hacen a trav&eacute;s de la CP MONTEVERDE.</p>\r\n<p>* <strong>CONTRATO LIMPIEZA</strong>. Est&aacute; inclu&iacute;do en el de la comunidad de MONTEVERDE. Aviso de renovaci&oacute;n contrato por medio de Monteverde.&nbsp;</p>\r\n<p>* <strong>REVISION EXTINTORES</strong>. El aviso de renovaci&oacute;n de contrato se hace a traves de MONTEVERDE</p>\r\n<p>**<strong>COMIENZO CONTRATOS LUZ INTEGRA 2013</strong>: 8 JULIO Vel&aacute;zquez 26 Bajo / Garaje / Alumbrado Exterior 9 JULIO Elvira Mu&ntilde;&iacute;z 2 29 JULIO Vel&aacute;zquez 24 Bajo / Vel&aacute;zquez 28 Bajo</p>\r\n<p>&nbsp;</p>'),
	(40, 'H33923871', 'MANCOMUNIDAD CARMEN AMAYA 4-6-8', '33211', '<p>MANCOMUNIDAD CREADA POR TRES COMUNIDADES, CARMEN AMAYA 4-6-8, CREADA PARA LAS ZONAS COMUNES (SOPORTALES, PATIO, ZONA DE JUEGOS).</p>\r\n<p><span style="background-color: #00ff00;"><strong>TODOS LOS SINIESTROS SE APERTURARAN DESDE EL PORTAL DENOMINADO MANCOMUNIDAD.</strong></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">*&nbsp;</span><strong style="background-color: #ffffff;">PRESIDENTE MANCOMUNIDAD CARMEN AMAYA 4-6-8 + GARAJE CIGARRERES 29</strong><span style="background-color: #ffffff;">. El que ejerce de presidente del garaje es el mismo que ejerce en la Mancomunidad. Agreg&eacute; los presidentes de los portales de C.Amaya 4-8 por si alguna vezno estuviera disponible el presidente del Garaje.</span></span></p>'),
	(41, 'H-33837402', 'C.P. GARAJE VIZCAINA 20', '33207', '<p>*&nbsp;<strong>Poner convocatoria en la Puerta Peatonal del Garaje</strong>&nbsp;para que, los que no viven en Teodoro Cuesta y Vizcaina 20, puedan verla y saber la fecha de la misma.</p>\r\n<p>*&nbsp;<strong>E.mail de Administradora Teodoro Cuesta</strong>&nbsp;, M&ordf; Isabel Varela: iva1532@colegiados.icagijon.es</p>\r\n<p>*&nbsp;<strong>Llaves.&nbsp;</strong>La misma llave del garaje es la de acceso al portal. Est&aacute; en la puerta del armario en Algonz.</p>'),
	(42, 'H-33743410', 'C.P. GARAJE AMPURDAN 13', '33202', '<p>* <strong>FIRMAS ENTIDAD FINANCIERA, </strong>firmaran de manera indistinta en la cuenta de la comunidad el Presidente y el Vicepresidente. CAJA LABORAL (Quique) Telf. 985.160.583.</p>\r\n<p>En relaci&oacute;n al tema por las filtraciones del Garaje de las plazas de los alrededores del 17-18, me he puesto en contacto con I&ntilde;aqui el propietario de la plaza 22 y me ha confirmado que le entr&oacute; agua en el garaje, llov&iacute;o bastante la noche del 02/10/2013</p>'),
	(43, 'H-33835554', 'C.P. GARAJE CARBONERA 58-60-62', '33210', '<p class="MsoNormal"><span style="font-family: Verdana;"><span style="font-size: 15px;"><strong>*</strong><strong>ADMINISTRADOR DE CARBONERA 62 /</strong></span></span><strong><span style="font-family: Verdana; font-size: 15px;">H33835679</span></strong><span style="font-family: Verdana;"><span style="font-size: 15px;"><strong>.&nbsp;</strong></span></span><span style="font-size: 15px; font-family: Verdana;">FELIX QUINTANA VEGA</span></p>\r\n<p class="MsoNormal"><span style="font-family: Verdana;"><span style="font-size: 15px;">TEL: 985.34.78.82 /&nbsp;</span></span><span style="font-family: Verdana;"><span style="font-size: 15px;">Felix Quintana [FQuintana@serincogrupo.com]</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Verdana;"><span style="font-size: 15px;">(Cada cierto tiempo pasa factura de EMA, correspondiente al agua de los Jardines)</span></span></p>\r\n<p class="MsoNormal">&nbsp;</p>'),
	(44, 'H-33913963', 'C.P. CIGARRERES 40', '33211', '<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: \'Palatino Linotype\';">(Anotaci&oacute;n de Word).-DEJO UN LLAVERO <span style="color: navy;">BLANCO</span> PARA CUANDO SE ENTREGEN LAS ACTAS EN EL 4<span style="color: navy;">0</span>, &nbsp;CONFIRMAR QUE AMBAS LLAVES ABREN LA PUERTA CORRECTAMENTE. UNA ES PARA NOSOTROS Y LA OTRA ES PARA ENTREGAR A LA VECINA DEL PISO <span style="color: navy;">4</span>&ordm; A <span style="color: navy;">MARIA DEL CARMEN </span>&nbsp;DEJO SU NUMERO DE TELEFONO<span style="color: navy;"> 616.50.60.47</span>. ANOTAS QUE HAS ENTREGADO A ESTA SRA. LA LLAVE EN TELEFONOS Y DIRECCIONES WORD.</span></p>\r\n<p>&nbsp;<span style="font-size: 10.0pt; font-family: \'Palatino Linotype\';">SE LE HACE ENTREGA DE ESTA LLAVE PORQUE SI HAY UNA AVERIA ELECTRICA EN FINES DE SEMANA Y NO ME CONSIGUEN TIENE ALGUIEN LA LLAVE PARA PODER SUBIR AUTOMATICOS O PARA QUE UN ELECTRICISTA REALICE LA REPARACION QUE SE CREA CONVENIENTE. (ESTO ESTA HABLADO CON VIPASA Y ESTA AUTORIZADO) ESTA SRA. TIENE LAS LLAVES PERO ES PARA UNA URGENCIA LOS FESTIVOS Y FIN DE SEMANA LOS DEMAS REQUERIMIENTOS TIENEN QUE HACERSE EN LA ADMINISTRACI&Oacute;N. &nbsp;</span></p>'),
	(45, 'H-33913914', 'C.P. CIGARRERES 42', '33211', '<p>* Transferidos a VIPASA la administraci&oacute;n de todos los servicios</p>\r\n<p>*<strong> ENTREGA LLAVES -AUTOMATICOS ELECTRICOS- PARA EMERGENCIAS FIN DE SEMANA/FESTIVOS. </strong>Se decidi&oacute; en Junta 2012 que se entregar&iacute;a llaves del cuarto de limpieza, d&oacute;nde est&aacute;n localizados los autom&aacute;ticos el&eacute;ctricos, a la vecina del 3&ordm; A, MATILDE, Telf. 639.563.952 para que en caso de que haya una aver&iacute;a el&eacute;ctrica en la comunidad durante el fin de semana, y no consigan comunicarse con el Administrador, se pueda acceder a subir los autom&aacute;ticos o acceda el electricista para hacer la reparaci&oacute;n pertinente. Se habl&oacute; con VIPASA y di&oacute; su autorizaci&oacute;n. Seguir este protocolo SOLO PARA FINES DE SEMANA y FESTIVOS - los dem&aacute;s d&iacute;as laborables debe de procesarse a trav&eacute;s de la Administraci&oacute;n.</p>'),
	(46, 'H-33914037', 'C.P. CIGARRERES 44', '33211', '<p>* Transferida a VIPASA la administraci&oacute;n de todos los servicios.</p>\r\n<p>* <strong>SEGURO COMUNIDAD,</strong> al ser transferida a VIPASA cualquier incidencia que pueda ser reclamable al seguro corre por cuenta de VIPASA. Seg&uacute;n LUDY tiene ellos contratado el seguro para todo el parque de viviendas que ellos administran.</p>'),
	(47, 'H-33914938', 'C.P. CIGARRERES 46', '33211', '<p>* <strong><span style="background-color: #ffff99;">NO ESTA TRANSFERIDA A VIPASA.</span></strong></p>\r\n<p><strong><span style="background-color: #ffff99;"><span style="background-color: #ffffff;">* FIRMAN PTE. Y VICEPTE. DE MANERA MANCOMUNADA EN CAJASTUR.</span><br /></span></strong></p>\r\n<p>*&nbsp;<strong>SEGURO COMUNITARIO</strong>, LO LLEVA VIPASA. Se cancel&oacute; el de Santa Lucia, cualquier aver&iacute;a de agua y cristales hay que notificar a VIPASA al departamento de REPARACIONES.</p>\r\n<p>*&nbsp;<strong>NO TIENE AMAESTRAMIENTO</strong>. Esta comunidad no tiene amaestramiento.</p>\r\n<p>*&nbsp;<strong>ENCENDIDO RELLANOS.&nbsp;</strong>En Junta de fecha 12/12/2011 en el punto 2&ordm; determinan que "se acuerda que en los rellanos se va a eliminar el encendido de la luz del medio de cada uno de los rellanos, en el portal se van a eliminar del encendido tres bombillas y en el soportal los down light tienen dos l&aacute;mparas cada uno, se va a eliminar el encendido de una de estas dos l&aacute;mparas que tiene cada foco con el fin de no consumir tanta corriente el&eacute;ctrica.&nbsp;</p>'),
	(48, 'H-33834706', 'C.P. VIZCAINA 20', '33207', '<p>* EMAIL, administradora Teodoro Cuesta, M&ordf; Isabel Varela:<strong> iva1532@colegiados.icagijon.es</strong></p>'),
	(49, 'H-33700329', 'C.P. TRUEBA 13', '33211', '<p>*&nbsp;<strong>BOMBILLAS</strong>. Las bombillas las cambia el presidente.</p>'),
	(50, 'H-33904582', 'C.P. VELAZQUEZ 32 - 34 y ELVIRA MUÑIZ 1', '33211', '<p>*<strong> ACCESO CUBIERTA (TEJADO)</strong>, se accede con la llave MAESTRA a cubierta, por el PORTAL 34 y ELVIRA MU&Ntilde;IZ 1, planta 6&ordf; a trav&eacute;s de la puerta cortafuegos, coger las escaleras hac&iacute;a arriba -donde tambi&eacute;n est&aacute; el cuarto de ascensores y el armario de RITIS). Salir a cubierta.</p>\r\n<p>* <strong>PLAQUETAS DEL TECHO SOPORTAL</strong>, J.A. Leonardo las dej&oacute; en el cuarto RITI que hay entre el portal y la Autoescuela. Las llaves est&aacute;n en LLAVERO AZUL- "PORTAL 1 TELECOMUNICACIONES"&nbsp;</p>\r\n<p><strong>** LAS CLAVES DE LAS CAMARAS DE SEGURIDAD&nbsp;</strong>LAS TIENE M&ordf; DE LOS ANGELES QUE SE LAS HA FACILITADO DECIBELIOS.</p>'),
	(51, 'H-33808825', 'C.P. SENDA DEL ARCEDIANO 2', '33211', '<p>* <strong>BOMBILLAS</strong>. Se hacen cargo del cambio de bombillas el Presidente y Vicepresidente. 18/6/2012 (11:26hrs)</p>'),
	(52, 'H-33831454', 'C.P. MECANICOS 2', '33211', '<p>* <strong>LUZ + GAS</strong>. Contrato con HC Energ&iacute;a.</p>'),
	(53, 'H-33889924', 'C.P. SAN MATIAS 12 - 14 - 16', '33210', '<p>* <strong>FIRMAS ENTIDAD BANCARIA</strong>, la firma es mancomunada Presidente y Administrador.</p>\r\n<p>*<strong> LLAVES RITI PLANTA P-12. </strong>En la administraci&oacute;n tenemos copia de la llave del RITI de PLANTA DEL PORTAL 12</p>\r\n<p>* <strong>LLAVES CANDADO VENTANA PATIO P-14. &nbsp;</strong>El 22/6/2011 se habl&oacute; con Susana del BJ-B y dijo que hab&iacute;a comprado un candado para la ventana que da al patio desde este portal, porque el otro se hab&iacute;a roto. Ella tiene la llave y se la di&oacute; a otros dos vecinos. Si alguno pregunta que sepan que la llave la tiene esta chica.</p>\r\n<p>* <strong>OBRA TEJADO 2011</strong>. Esta comunidad tuvo reparaci&oacute;n de tejado en Sept. 2011, obra realizada por Acrobacias Verticales.</p>\r\n<p>*<strong>&nbsp;FRECUENCIA ACTUACIONES LIMPIEZA</strong>. En Junta 25/7/2013 se aprob&oacute; por unanimidad reducir la frecuencia de limpieza, pasando de ser todos los d&iacute;as, durante la semana, a ser solamente los lunes, mi&eacute;rcoles y viernes.</p>\r\n<p>*&nbsp;<strong>LIMPIEZA GARAJE</strong>.&nbsp;&nbsp;Desde 2010 la limpieza del garaje la est&aacute;n realizando los vecinos.&nbsp;</p>\r\n<p>*&nbsp;<strong>LIMPIEZA GARAJE 2013</strong>.&nbsp;&nbsp;Encargados de la limpieza 2&ordm; G y 2&ordm; E</p>\r\n<p>* LIMPIEZA GARAJE 2012. Encargados de la limpieza 1&ordm; M y 3&ordm; F</p>'),
	(54, 'H-33955725', 'C.P. SOR JUANA INES DE LA CRUZ 22 - 26 y BADAJOZ 47', '33211', '<p>*&nbsp;<strong>OCULOS PORTAL</strong>. 3/4/2012 Llam&oacute; Jovino, padre de Aranzazu 1&ordm; B, para informar que &eacute;l pod&iacute;a conseguir, en el almac&eacute;n a precio m&aacute;s barato, los &oacute;culos de bajo consumo que se iban a cambiar en el portal. Para tener en cuenta.</p>\r\n<p>** Con fecha 13/11/2013 la propietaria encargada y promotora del cierre del perimetro de la comunidad, Patricia, nos indica que la empresa suministradora de los lilandis le dice que en mayo han de abonar los mismos y tener en cuenta el tema de riego de los mismos.</p>'),
	(55, 'H-33879578', 'C.P. SAN NICOLAS 80', '33210', '<p>* <strong>FIRMAS&nbsp;ENTIDAD BANCARIA.</strong> Firman de manera mancomunada el Presidente y el Vicepresidente.</p>\r\n<p>* <strong>LLAVES COMUNIDAD.</strong> No tenemos todas las llaves en la administraci&oacute;n. Tenemos: &nbsp;Maestra + Grupo Presi&oacute;n + Candado Verja Jard&iacute;n + Cuadro Telef&oacute;nica Exterior C/Murillo + Candado Pozo de Aguas. Las llaves completas de la comunidad las tienen el Presidente y el Vicepresidente de turno.</p>\r\n<p>* <strong>LLAVES RITI TELEFONO.</strong> Las tiene el Presidente y el Vicepresidente de turno.</p>\r\n<p>* <strong>CUADRO ELECTRICO PORTAL.</strong> Es un armario de madera que est&aacute; en el portal, a la derecha, seg&uacute;n se entra.</p>\r\n<p>* <strong>TRAMPILLA PARA DESATASCOS.</strong> El 29/9/2011 inform&oacute; Jes&uacute;s, de Desatascos, que hab&iacute;an dejado una trampilla abierta por el 1&ordm; C para utilizar en posteriores actuaciones, puesto que hacerlo por el bajo de la Canon es imposible debido al falso techo, cableado, etc.... Tambi&eacute;n coment&oacute; que cuando se hizo est&aacute; intervenci&oacute;n hab&iacute;an determinado, con el otro administrador, hacer un mantenimiento anual, para evitar una futura situaci&oacute;n de atasco. Pero cuando toc&oacute; hacerlo el presidente de turno di&oacute; su negativa a la intervenci&oacute;n.</p>\r\n<p>* <strong>LAMPARAS EMERGENCIA LED.</strong> En Junta 20/5/2011 se aprob&oacute; que cuando se da&ntilde;e alguna l&aacute;mpara de emergencia -de plantas y garaje- se vayan sustituyendo por l&aacute;mparas de emergencia LED. Idea propuesta por vecino del 6&ordm; F.</p>\r\n<p>* <strong>LIMPIEZA CANALONES HORIZONTALES.</strong> En Sept. 2011 se realiz&oacute; limpieza.</p>\r\n<p>* <strong>ASPIRADO DEL GARAJE.</strong> Es de caracter anual. Hay que poner avisos antes de la actuaci&oacute;n para que los vecinos saquen los veh&iacute;culos del garaje.</p>\r\n<p>* <strong>MANTENIMIENTO PORTON</strong>. El control de las revisiones semestral se realiza por SINIESTROS porque no tiene contrato, hay un presupuesto (Ver nota en Empresas&gt;Jose Matilla)</p>'),
	(56, 'H-33914169', 'C.P. GARAJE CIGARRERES 40 - 42 - 44', '33211', '<p>* Garaje General de los Portales Cigarreres 40 - 42 - 44</p>\r\n<p>* <strong>TRANSFERIDO</strong> a VIPASA</p>\r\n<p>* <strong>SEGURO COMUNIDAD.</strong> Ha sido transferido a VIPASA, cualquier incidencia reclamable al seguro corre se hace a trav&eacute;s de VIPASA. En la Administraci&oacute;n no tenemos datos de la p&oacute;liza porque es pol&iacute;tica de VIPASA no suministrarlos.</p>\r\n<p>* <strong>NO HAY CARGOS PRESIDENTE &oacute; VICE.</strong> VIPASA gestiona todo.</p>'),
	(57, 'H-33915018', 'C.P. GARAJE CIGARRERES 46 al 54', '33211', '<p>* Garaje general de los portales CIGARRERES 46 - 48 - 50 - 52 - 54</p>'),
	(58, 'H-33914961', 'C.P. CIGARRERES 54', '33211', ''),
	(59, 'H-33915059', 'C.P. CIGARRERES 48', '33211', '<p>* <strong>TRANSFERIDA A VIPASA</strong></p>\r\n<p><strong>* SEGURO. </strong>Este portal ha sido transferido a VIPASA por lo que cualquier incidencia que pueda ser reclamable al seguro corre por cuenta de VIPASA. Inform&oacute; LUDY que ellos tienen contratado &nbsp;el seguro para todo el parque de viviendas que ellos administran. En la administraci&oacute;n NO tenemos datos del seguro, porque no es pol&iacute;tica de VIPASA dar esa informaci&oacute;n.</p>\r\n<p>* <strong>BOMBILLAS</strong>. Se encarga la empresa limpieza de cambiarlas. Cuando lo haga que cargue a la factura de limpieza, seg&uacute;n autorizaci&oacute;n de VIPASA. En caso de tener que comprar material el&eacute;ctrico, entonces se llama a un electricista.</p>\r\n<p>&nbsp;*<strong>NO HAY AMAESTRAMIENTO DE LLAVES.</strong></p>\r\n<p>&nbsp;<strong>*** LUMINARIAS.- &nbsp;EN JUNTA DE FECHA 06/11/2013, PUNTO 3.-&nbsp;</strong><span style="color: #ff0000;"><span style="font-family: \'Palatino Linotype\'; font-size: 8pt; text-align: justify; text-indent: 36pt;">Se comentan algunas cuestiones sobre luminaria. Solicitan se repongan la luz fundida del rellano 4&ordm; planta. Eliminar el encendido de la 2&ordm; bombilla sito justo a la entrada al portal. (dejar encendida la que esta justo enfrente de la puerta del portal</span><span style="font-family: \'Palatino Linotype\'; font-size: 8pt; text-align: justify; text-indent: 36pt;">&nbsp;&nbsp;</span><span style="font-family: \'Palatino Linotype\'; font-size: 8pt; text-align: justify; text-indent: 36pt;">por fuera y la segunda se puede eliminar el encendido). Dentro del portal eliminar el encendido de la bombilla que est&aacute; m&aacute;s alejada de la puerta de entrada dentro del portal.</span></span></p>'),
	(60, 'H-33915083', 'C.P. CIGARRERES 50', '33211', '<p>* <strong>NO TRANSFERIDA A VIPASA.</strong></p>\r\n<p>* <strong>SEGURO</strong>. VIGENTE CON MAPFRE.</p>\r\n<p>* <strong>NO TIENE COMPA&Ntilde;&Iacute;A DE LIMPIEZA</strong>. La limpieza de la comunidad la realizan los mismos vecinos.</p>\r\n<p>**&nbsp;<span style="color: #ff0000;"><strong>PEQUE&Ntilde;OS TRABAJOS ELECTRICOS LLAMAR AL VECINO DEL 2&ordm;C JULIO 618.90.43.59 (20/11/2013VIENE EL VECINO A LA ADMO. Y ASI SE LO INDICA A M&ordf; DE LOS ANGELES)</strong></span></p>');
