	(20, 8, 26, '2005-01-01', '2050-01-01', '<p>* <strong>NO HAY CONTRATO</strong> F&Iacute;SICO FIRMADO, SOLO PRESUPUESTO CON LAS FRECUENCIAS DE LIMPIEZA. Avisar con un mes de antelaci&oacute;n para su finalizaci&oacute;n con carta certificada con Acuse de Recibo. ESTA INFORMACI&Oacute;N FUE SUMINISTRADA 20/01/2012 POR VIRGINIA LA EMPLEADA DE LIMPIEZAS LIDAS.</p>'),
	(21, 8, 27, '2013-10-01', '2016-10-01', '<p>Contrato firmado en un inicio en el 01/01/1999 por un periodo de 5 a&ntilde;os renovable por per&iacute;odo iguales. AVISAR CON 90 D&Iacute;AS ANTES DE SU FECHA DE RENOVACI&Oacute;N, MEDIANTE CARTA CERTIFICADA CON ACUSE DE RECIBO. INSPECCI&Oacute;N DE LOS ASCENSORES REALIZADA EL 04/01/2011 PR&Oacute;XIMA REVISI&Oacute;N 04/01/2015</p>\r\n<p><strong>EN JUNTA DE FECHA 30/09/2013 SE DETERMINA&nbsp;</strong>APROBAR LA PROPUESTA DE THYSSEN CONSISTENTE EN CONTRATO DE RIESTO LIMITADO (INCLUYE UN TOTAL DE 49 PIEZAS DE MAYOR DESGASTE), AS&Iacute; COMO UNA BONIFICACI&Oacute;N DE 3 MESES GRATIS. DURACION DEL CONTRATO 3 A&Ntilde;OS, SIN SER NECESARIO ESPERAR AL VTO. ENTRA EN VIGOR LA NUEVA PROPUESTA EL 01/10/2013&nbsp;</p>\r\n<p>* <strong>ULTIMA INSPECCION CADA 4 A&Ntilde;OS</strong>. Se realiz&oacute; el 4/01/2011.&nbsp;</p>'),
