	(38, 27, 40, '2013-08-27', '2014-08-27', '<p><strong>CONTRATO</strong> A TODO RIESGO. Bianual. Prorrogable por per&iacute;odos iguales. Aviso cancelaci&oacute;n 60 d&iacute;as antelaci&oacute;n</p>\r\n<p><strong>INSPECCION 4 A&Ntilde;OS</strong>. FECHA DE REALIZACION OCA (PASADA CON LA EMPRESA ECA BUREAU VERITAS) 18/03/2013 PROXIMA REVISION 15/01/2017.&nbsp;</p>\r\n<p>JUNTA D/F 02/10/2013 NOS INFORMA UN VECINO DEL 1&ordm; (SR. MAYOR) QUE SU MUJER QUEDO ATRAPADA EN EL ASCENSOR QUE TARDARON COMO 45 MINUTOS EN RESACATAR</p>'),
	(39, 27, 7, '2013-09-17', '2018-02-04', 'Esta comunidad no tiene amaestramiento.\r\nEs una empresa ocasional, no hay contrato de mantenimiento.'),
	(40, 27, 100, '2013-09-17', '2013-10-31', '<p>No tenemos contrato de esta empresa de limpieza (autonoma)</p>\r\n<p>EN JUNTA DE FECHA 17/09/2013 SE DETERMINA:</p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-family: \'Palatino Linotype\';">En cuanto al servicio de limpieza se determina por todos los asistentes&nbsp; a la Junta cancelar la actual empresa de limpieza, Limpiezas LF (Lourdes Fern&aacute;ndez) y contratar los servicios de limpieza con Limpiezas Castro ( Mercedes Castro Grandal). El importe mensual a pagar asciende a 135&euro; iva incluido, ahorrando la Comunidad 24,53&euro; mensuales. Las tareas a realizar son las siguientes: Limpieza diaria del portal y todos los elementos, limpieza de las escaleras semanal,&nbsp; baldeado seg&uacute;n necesidad de la zona de soportal que abarca la ubicaci&oacute;n del portal 52, reposici&oacute;n de bombillas (compra de las luminarias corre por cuenta de la Cdad). Los servicios con esta nueva empresa se inicial el 02/ de Noviembre de 2013.</span></p>'),
