	(47, 28, 45, '2010-10-21', '2017-10-21', '<p>Contrato indefinido. Aviso de cancelaci&oacute;n con un mes de antelaci&oacute;n</p>\r\n<p>* De mayo a septiembre la zona de los soportales de juegos se limpiara semanalmente (de viernes).(29/05/2012 09:45h). *</p>\r\n<p>* En junta de fecha 29/10/2012 se determin&oacute; que en cada lampara de fluorescentes del garaje (tienen dos) se dejar&aacute; funcionando solamente uno y el otro colocado pero no conectado, para que en caso de fundirse el primero solamente tuvieran que apretar el segundo y ya tendr&iacute;a luz.(esto se informo a L.Pelayo a trav&eacute;s de correo electronico el 30/10/2012).</p>'),
