	(168, 16, 19, '2009-10-01', '2014-10-01', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial; background: aqua; mso-highlight: aqua;">CONTRATO FIRMADO EL 01/10/2009, CON DURACION DE UN A&Ntilde;O, PRORROGABLE, PARA RESCINDIR AVISAR CON 1 MES DE ANTELACION</span></strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial;">.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial; background: fuchsia; mso-highlight: fuchsia;">LAS LUCES VAN CON RELOJ, Y EL CUADRO DE ELLO ESTA EN EL PORTAL</span></strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial; background: fuchsia; mso-highlight: fuchsia;">.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">los problemas de luminarias, (que sean para el electricista) se van acumulando y se dar&aacute; un aviso por mes con todos los arreglos, solicitando el v&ordm;b&ordm; del presidente. (se determino en la junta 30/11/2011)</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">EN JUNTA DE FECHA 27/11/2012 SE APROBO QUE LA PROXIMA COMPRA DE BOMBILLAS SEAN DE BAJO CONSUMO Y DE 13W EN LUGAR DE 18W, YA QUE CON LA LUZ Q TIENEN EN LOS SOPORTALES ES + Q SUFICIENTE.</span></strong></p>'),
	(169, 16, 27, '2006-09-01', '2015-09-01', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial; background: aqua; mso-highlight: aqua;">CONTRATO EN VIGOR DESDE 01/09/2006, CON DURACION DE 3 A&Ntilde;OS, PRORROGABLE AUTOMATICAMENTE POR PERIODOS IGUALES, LA PRORROGA QUEDA SIN EFECTO, SI EN LOS 15 DIAS SIGUIENTES A LA FINALIZACION DEL CONTRATO, ALGUNA DE LAS PARTES DENUNCIE LA RENOVACION MEDIANTE CARTA CERTIFICADA CON ACUSE</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial; background: aqua; mso-highlight: aqua;">RECIBO</span></strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial; background: aqua; mso-highlight: aqua;">.</span></p>'),
