	(217, 20, 29, '2013-04-22', '2014-04-22', '<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;"><span style="background-color: #00ff00;"><strong>POLIZA N&ordm; 8-5.446.342-Y &nbsp; &nbsp;<span style="background-color: #ffffff;">NO SE VA A PRESENTAR CARTA CANCELACION SE NEGOCIARA CON RAFA</span></strong></span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">AGENTE: Rafael Ismael Dom&iacute;nguez Rou&ntilde;ada</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">C/La Uni&oacute;n 11, s/n, 33930 Langreo (610.98.23.09)</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;"><a href="mailto:rafael.ismael@agentes.catalanaoccidente.com">rafael.ismael@agentes.catalanaoccidente.com</a></span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">PERIODO VIGENCIA 22/4/13-22/4/14</span></p>\r\n<p>&nbsp;<span style="font-size: 10pt; font-family: Arial; background-color: #ffffff; background-position: initial initial; background-repeat: initial initial;">CUALQUIER SINIESTRO&nbsp; QUE HAYA EN LA COMUNIDAD NOTIFICARSELO A RAFA PARA QUE LO GESTIONE &Eacute;L</span><span style="font-size: 10.0pt; font-family: Arial;">.</span></p>\r\n<p><span style="color: #ff99cc;"><strong><span style="font-size: 10.0pt; font-family: Arial;">POLIZA ANTERIOR MAPFRE 076-0380137881</span></strong></span></p>'),
