	(219, 27, 157, '2013-11-03', '2014-11-03', '<p class="MsoNormal" style="margin-top: 0cm; margin-right: -.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-family: \'Palatino Linotype\';">EEN JUNTA DE FECHA 17/09/2013 SE DETERMINA QUE:</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">En cuanto al servicio de limpieza se determina por todos los asistentes&nbsp; </span><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">a </span>la Junta<span style="font-family: \'Palatino Linotype\'; font-size: 11px;"> cancelar la actual empresa de limpieza, Limpiezas LF (Lourdes Fern&aacute;ndez) y contratar los servicios de limpieza con Limpiezas Castro ( Mercedes Castro Grandal). El importe mensual a pagar asciende a 135&euro; iva incluido, ahorrando </span>la Comunidad<span style="font-family: \'Palatino Linotype\'; font-size: 11px;"> 24,53&euro; mensuales. <strong>Las tareas a realizar son las siguientes: Limpieza diaria del portal y todos los elementos, limpieza de las escaleras semanal,</strong></span><strong><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">&nbsp; </span><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">baldeado seg&uacute;n necesidad de la zona de soportal que abarca la ubicaci&oacute;n del portal 52, reposici&oacute;n de bombillas (compra de las luminarias corre por cuenta de </span></strong>la Cdad<strong><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">). Los servicios con esta nueva empresa se inicial el 02/ de Noviembre de 2013.</span></strong></p>'),
	(220, 32, 45, '2013-09-30', '2014-10-01', '<p class="MsoNormal" style="text-align: justify;"><span style="background-color: #ffffff;"><strong><span style="font-size: 8pt; font-family: Arial;">EL SUMINISTRO (LA COMPRA) DE BOMBILLAS A PARTIR DEL 14/10/11 SE HACE CARGO LA ADMINISTRACION, EN LUGAR DE LIMPIEZAS PELAYO</span></strong></span></p>\r\n<p><span style="background-color: #ffffff;"> <strong><span style="font-size: 8pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">23/10/2012.- VINO EL PTE. DE LA CDAD. Y NOS INDICA QUE &Eacute;L REPONE LAS LUMINARIAS FUNDIDAS Y CAMBIA LAS ESTROPEADAS</span></strong></span></p>\r\n<p><span style="background-color: #ffffff;">*&nbsp;<strong>FECHA VENCIMIENTO CONTRATO</strong>. Contrato es indefinido y se puede cancelar en cualquier momento, avisando con 30 d&iacute;as de antelaci&oacute;n. Tomo como fecha de vencimiento OCT porque es el mes que se hizo la &uacute;ltima &nbsp;Junta Ordinaria en esta comunidad, por si se quiere presupuestar o negociar precios.</span></p>'),
	(221, 32, 37, '2013-10-07', '2016-01-01', '<p><strong>*NUEVO <span style="background-color: #ffff99;">CONTRATO 2013 entra en vigor el 1/1/2014. Duraci&oacute;n 2 a&ntilde;os</span>. </strong>Prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n con 4 MESES de antelaci&oacute;n respecto a la fecha de vencimiento, &nbsp;mediante Carta Certificada + Acuse de Recibo.</p>\r\n<p>&nbsp;ACTUALMENTE ES CONTRATO A TODO RIESGO. <span style="background-color: #ffff99;">EL PRECIO ACORDADO SE ACTUALIZARA CADA A&Ntilde;O</span>.</p>\r\n<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">* SUSTITUCION POLEA TRACCI&Oacute;N. </span></strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">El 3/10/12, </span><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;"><span style="text-decoration: underline;">en Vel&aacute;zquez 42</span> se ha sustituido polea de traccion y sust. Rodamiento de la silleta, por importe de 2146.43&euro;, no tiene coste para la comunidad porque es un contrato a todo riesgo</span><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">.</span></p>\r\n<p>&nbsp;* <strong>INSPECCION PERIODICA ASCENSOR 4 A&Ntilde;OS</strong>. Los portales C. Amaya 1 y Vel&aacute;zquez 42 tienen inspecci&oacute;n el 2/9/2014. El portal Vel&aacute;zquez 40 la tiene el 7/7/2014.</p>'),
