	(228, 32, 158, '2013-06-01', '2014-04-20', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial; background: lime; mso-highlight: lime;">Inicio de temporada 1 de Junio de c/a&ntilde;o y finalizaci&oacute;n de la temporada de piscina el 30 de Septiembre de c/a&ntilde;o</span></strong><strong><span style="text-decoration: underline;"><span style="font-size: 8.0pt; font-family: Arial;">. Se puede utilizar hasta mediados de Septiembre.&nbsp;</span></span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">INSPECCIONES PISCINA:&nbsp;</span></strong><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">ESTABISOL S.A.</span></strong><span style="font-size: 8.0pt; font-family: Arial;">985.981.100 / Fax 985.981.102</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial; background: fuchsia; mso-highlight: fuchsia;">CERTIFICADO DE INSPECCION DE INSTALACION DE BAJA TENSION PISCINA 04/09/2006, PROXIMA REVISION 04/09/2011, INSPECCION CADA 5 A&Ntilde;OS, SERVICIOS DE CONTROL E INSPECCION SA</span></strong></p>'),
	(229, 32, 56, '2013-09-30', '2020-12-31', '<p>REALIZA LOS MANTENIMIENTOS ANUALES. NO HAY CONTRATO.</p>\r\n<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: fuchsia; mso-highlight: fuchsia; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">CERTIFICADO DE INSPECCION INTALACION DE BAJA TENSION GARAJE 04/09/2006, PROXIMA REVISION 04/09/2011, INSPECCION CADA 5 A&Ntilde;OS, SERVICIOS DE CONTROL E INSPECCION SA</span></strong></p>'),
	(230, 32, 23, '2013-09-30', '2020-12-31', '<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; mso-bidi-font-weight: bold;">Se indico que la hora de trabajo en horario normal es de 80,00.-&euro;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">INDICAR A GESAL QUE MARQUEN CON DISTINTIVOS LOS HUECOS QUE ABRAN PARA LAS LIMPIEZAS, PARA TENER DETERMINADOS A QUE CORRESPONDE CADA UNO, YA QUE NO QUEREMOS TENER EL PORTAL LLENO DE HUECOS, Y QUE CADA VEZ QUE VAYAN TENGAN QUE ABRIR UNO</span></strong><strong><span style="font-size: 8.0pt; font-family: Arial;">.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">SE PAUTO EN LA JUNTA REALIZAR DESATASCOS DE LAS BAJANTES AFECTADAS CADA 8 MESES A PARTIR DE LA ULTIMA INTERVENCION.-</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; mso-bidi-font-weight: bold;">V.40 1&ordm;A.- El propietario de este predio pregunta si se pudiera realizar las limpiezas desde el garaje.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; mso-bidi-font-weight: bold;">V.42 1&ordm;A.- Entro en colera xq todos los demas han tenido atascos y se teme qu el sea el siguiente, quiere que se le revise x si acaso.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; mso-bidi-font-weight: bold;">V.42 1&ordm;B.-</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; mso-bidi-font-weight: bold;">V.42 1&ordm;C.-</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial; mso-bidi-font-weight: bold;">C.A.1 1&ordm;B.-</span></p>'),
	(231, 32, 11, '2012-11-19', '2013-11-19', '<p class="MsoNormal"><strong><span style="font-size: 8pt; font-family: Arial; background-color: #00ff00;">N&ordm;POLIZA.- 076-0280407846 INCLUYE ATASCOS</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">902.13.65.24 (24 HORAS)</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial; color: red; background: yellow; mso-highlight: yellow;">(TIENE AMPLIA COBERTURA EN TUBERIAS TANTO PRIVATIVAS COMO GENERALES, Y AMPLIA COBERTURA EN CRISTALES)</span></strong></p>\r\n<p class="MsoNormal"><span style="background-color: #ffffff;"><strong><span style="font-size: 9pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">CUANDO SE APERTURE SINIESTRO DE AGUA SOLICITAR EL TECNICO 193-B (IVAN) 625.040.363 ES MUY COMPETENTE</span></strong></span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial; color: red;">&nbsp;</span></strong><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial; color: red;">19/11/2012 A 19/11/2013&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="background-color: #ffff00;"><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial; color: red;">EN LA NUEVA POLIZA PARA 2013-2014 SE INCLUYEN ATASCOS, EN JUNTA 10/10/2013 SE ACORDO CONTINUAR CON MAPFRE INCLUYENDO ATASCOS EN LA POLIZA SIN AUMENTAR LA PRIMA. PTE ESCANEAR CUANDO LLEGUE LA POLIZA Y CREAR AVISO PARA EL A&Ntilde;O SIGUIENTE.</span></strong></span></p>'),
