	(247, 45, 74, '2013-10-03', '2020-12-31', '<p><strong><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; color: red; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">La bombillas seg&uacute;n VIPASA que las ponga la limpiadora y las agregue en la factura</span><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">) A MENOS QUE SEA UN TRABAJO ESPECIAL Y HAYA QUE COMPRAR COMPRAR MATERIAL ELECTRICO EN ESE CASO SE ENCARGA A UN ELECTRICISTA</span></strong></p>'),
	(248, 18, 77, '2013-01-01', '2013-12-31', '<p>* MANTENIMIENTO DE PORTON</p>\r\n<p>*&nbsp;<strong>PROTOCOLO&nbsp;</strong><strong>REVISIONES PORTON</strong>. Se determin&oacute; en Junta 26/9/2011 que cuando se hagan revisiones deben estar presentes el presidente o el vicepresidente y firmar el parte.</p>\r\n<p>* <strong>IMPORTE MANTENIMIENTO</strong>. A partir de ENERO 2013 el importe anual es de 1199&euro; a pagar en dos semestres. Desde la obra de colocaci&oacute;n de Silenbloc hasta SEP 2012, Fedecor, atendi&oacute; avisos &nbsp;bajo garant&iacute;a de dicha obra. De SEP 2012 a DIC 2012 se inici&oacute; per&iacute;odo de mantenimiento, por el que cobraron 399,66&euro;</p>'),
	(249, 56, 74, '2013-10-02', '2014-10-02', '<p>&nbsp;*&nbsp;<strong>CONTRATO</strong>. Anual. Prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n 30 d&iacute;as.</p>\r\n<p>* <strong>BOMBILLAS.&nbsp;</strong><span style="font-size: 10pt; font-family: Arial; background-color: #ffffff;">(La bombillas seg&uacute;n VIPASA que las ponga la limpiadora y las agregue en la factura</span><span style="font-size: 10pt; font-family: Arial;">) A MENOS QUE SEA UN TRABAJO ESPECIAL Y HAYA QUE COMPRAR&nbsp; MATERIAL ELECTRICO</span></p>\r\n<p><span style="font-size: 10pt; font-family: Arial;">* <strong>LUZ ESCALERA QUE BAJA A GARAJE.</strong>&nbsp;</span><span style="font-family: Arial; font-size: 10pt;">EN </span>LA JUNTA REALIZADA<span style="font-family: Arial; font-size: 10pt;"> 27/09/2012 SE DETERMINO QUE </span>LA LUZ QUE BAJA<span style="font-family: Arial; font-size: 10pt;"> POR LAS ESCALERAS PARA ACCESO AL GARAJE DEBE COLOCARSE&nbsp; DE LED A PORDER SER SINO DE BAJO CONSUMO PUES COMO TE COMENTE POR TLFNO QUIEREN QUE ENCIENDA TODA </span>LA NOCHE PORQUE HAY<span style="font-family: Arial; font-size: 10pt;"> VECINOS QUE LLEGAN MUY TARDE Y OTROS MADRUGAN MUCHO PARA IR A SU TRABAJO</span></p>\r\n<p class="MsoNormal"><span style="background-color: #ffff00;"><strong>EN JUNTA 24/10/13 SE ACORDO QUE LA LIMPIEZA DEL GARAJE SE REALICE CON MAQUINA BARREDORA CON AGUA, PARA COMPARAR COMO QUEDA MEJOR LA LIMPIEZA, YA QUE EN LA ACTUALIDAD SE REALIZA CON MAQUINA BARREDORA ASPIRADORA Y SE OBSERVA CON BASTANTE POLVO.</strong></span></p>\r\n<p class="MsoNormal"><span style="background-color: #ffff00;"><strong>EN JUNTA 24/10/13 SE ACORDO QUE EN LA ENTRADA AL GARAJE POR LAS ESCALERAS PEATONALES SIEMPRE HAY MUCHOS RESIDUOS, HOJAS Y OTROS VERTIDOS, HACIENDO QUE SE ENSUCIE EL SUMIDERO Y DEJANDO UN ASPECTO DEPLORABLE DICHO ACCESO. SE ACORDO CON JULIO MORO QUE REALIZAR&Iacute;A LIMPIEZA DE ESA ZONA 3 VECES A LA SEMANA, NO SUPONIENDO INCREMENTO DE COSTE ALGUNO.</strong></span></p>'),
	(250, 56, 138, '2013-05-15', '2014-05-15', '<p><span style="font-family: Arial; font-size: 10pt;">* <strong>TELEFONOS JOSE</strong>&nbsp;</span><span style="font-family: Arial; font-size: 11pt;">636.802.990 / 985.920619</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 10pt;">* <strong>DOS ACTUACIONES AL MES.</strong>&nbsp;</span><span style="font-family: Arial; font-size: 11pt;">Se acord&oacute; en Junta 3/05/12, inicio de los trabajos en la segunda quincena de mayo 2012. Se realizar&aacute;n dos actuaciones al mes.&nbsp;</span><strong>&nbsp;</strong><span style="font-family: Arial; font-size: 13px;">Pasar&aacute; por la Administraci&oacute;n de la Empresa cada vez que realicen una actuaci&oacute;n para que nos quede constancia de la misma, por si alg&uacute;n vecino protesta.</span><span style="font-family: Arial; font-size: 11pt;">&nbsp;</span><span style="color: #000000; background-color: #ccffff;">Ver Acta Sept. 2012 para m&aacute;s detalles.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: 10pt;">* &nbsp;Despu&eacute;s de separaci&oacute;n de socios, la compa&ntilde;&iacute;a se llama ASTURDESBROCES, antes era JARDINERIA LA MADERA. El&nbsp;</span><span style="font-family: Arial; font-size: 10pt;">21/02/2013 (17:15H)&nbsp;</span><span style="font-family: Arial; font-size: 13px;">JUAN</span><span style="font-family: Arial; font-size: 10pt;">&nbsp; Telf. 617.091.862. Vino Juan para indicarnos que &eacute;l y su socio se habian separado y que estos trabajos los iba a realizar su ex-socio Jos&eacute;</span><span style="font-family: Arial; font-size: 10pt;">.&nbsp;</span></p>'),
