	(292, 57, 138, '2013-05-01', '2014-05-01', '<p>* <strong>DOS ACTUACIONES AL MES.&nbsp;</strong><span style="font-family: Arial; font-size: 13px;">Pasar&aacute;n por la Administraci&oacute;n de la Empresa cada vez que realicen una actuaci&oacute;n para que nos quede constancia de la misma, por si alg&uacute;n vecino protesta. Se llam&oacute; el 25/6/2012 (18:12 hrs) a Juan y nos inform&oacute; que las actuaciones son: Al inicio del mes y el 15 del mismo (semana si, semana no) para realizar trabajos de segado y control de poda de las enredaderas del soportal. As&iacute; como efectuar limpieza de la posible basura que all&iacute; puedan localizar.</span></p>\r\n<p><span style="font-family: Arial; font-size: 13px;">* <strong>REPLANTACION ENREDADERAS. </strong>Se efectuar&aacute; bien en Septiembre o en Primavera, ya que en verano no es conveniente -podr&iacute;an no salir bien- debido al calor y falta de lluvia.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;">* <strong>ANTERIORMENTE ESTA EMPRESA SE LLAMABA JARDINES LA MADERA.&nbsp;</strong><span style="font-family: Arial; font-size: 10pt;">21/02/2013(17:15H)617.091.862(JUAN) vino Juan para indicarnos que &eacute;l y su socio se habian separado y que estos trabajos los iba a realizar su ex-socio Jose.</span></p>\r\n<p>&nbsp;*&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Se acord&oacute; en Junta 2/05/12, pasaran el 1&ordm; recibo en el mes de Junio, la anterior empresa Jardiner&iacute;a la Belerda, cesa su actuaci&oacute;n el 4/5/12.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">&nbsp;</span></p>\r\n<p>&nbsp;</p>'),
	(293, 57, 72, '2004-12-01', '2013-12-01', '<p>* POLIZA N&ordm; 28837</p>\r\n<p>* <strong>CONTRATO</strong>. Anual. Prorrogable. Aviso Cancelaci&oacute;n con 60 d&iacute;as antelaci&oacute;n mediante carta certificada.</p>'),
	(294, 53, 19, '2010-01-01', '2014-01-01', '<p>*<strong> FRECUENCIA ACTUACIONES LIMPIEZA</strong>. En Junta 25/7/2013 se aprob&oacute; por unanimidad reducir la frecuencia de limpieza, pasando de ser todos los d&iacute;as, durante la semana, a ser solamente los lunes, mi&eacute;rcoles y viernes.</p>\r\n<p>* <strong>LIMPIEZA GARAJE</strong>. &nbsp;Desde 2010 la limpieza del garaje la est&aacute;n realizando los vecinos.&nbsp;</p>\r\n<p>* <strong>LIMPIEZA GARAJE 2013</strong>. &nbsp;Encargados de la limpieza 2&ordm; G y 2&ordm; E</p>\r\n<p>* LIMPIEZA GARAJE 2012. Encargados de la limpieza 1&ordm; M y 3&ordm; F</p>'),
