	(312, 55, 221, '2013-10-09', '2014-10-09', '<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: lime; mso-highlight: lime; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">CONTRATO FIRMADO POR 1 A&Ntilde;O PRORROGABLE ANUALMENTE, PUDIENDO SER RESCINDIDO EL MISMO POR CUALQUIERA DE LAS PARTES AL FINALIZAR UNA MENSUALIDAD CON LOS TRABAJOS REALIZADOS EN ESE MOMENTO.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 9.0pt; font-family: Arial;"><span style="background-color: #ff0000;"><strong>Periocidad de trabajos:</strong></span></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">marzo a septiembre quincenal desbroce y recogida de hierba</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 9.0pt; font-family: Arial;">de octubre a febrero mensual desbroce y recogida de hierba</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="fo