	(315, 55, 212, '2012-01-01', '2014-04-09', '<p><strong><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: fuchsia; mso-highlight: fuchsia; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">HUBO QUEJAS DE QUE DEJARON POCOS EXTINTORES EN LAS PLANTAS A LA HORA DE REALIZAR LA REVISION TOMAR EN CUENTA PARA AVISAR A EXTINOR A LA HORA DE REALIZAR LA PROXIMA REVISION</span></strong></p>\r\n<p><strong><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: fuchsia; mso-highlight: fuchsia; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;"><span style="background-color: #ffffff;">ULTIMA REVISION ANUAL 9/04/2013</span><br /></span></strong></p>'),
	(316, 55, 11, '2011-07-13', '2014-07-13', '<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: Arial;"><strong>N&ordm; POLIZA.- 076-0880246215</strong></span></p>\r\n<p class="MsoNormal"><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial; background: silver; mso-highlight: silver;">periodo de vigencia 13/07/2011 &ndash; 13/07/2012</span></strong></p>\r\n<p>&nbsp;<span style="font-size: 11.0pt; font-family: Arial;">902.13.65.24</span></p>'),
	(317, 55, 234, '2011-11-01', '2014-11-01', '<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">EN NOVIEMBRE/2011 INSTALO EL PORTON NUEVO DE C/MURILLO Y ARREGLO EL DE C/ SAN NICOLAS (SE APROBO EN JUNTA OCTB/2011), POR LO TANTO A PARTIR DE LA FECHA EL ES EL RESPONSABLE DEL TEMA DEL PORTON DEL GARAJE</span></p>\r\n<p><span style="font-size: 8.0pt; font-family: Arial;">EN JUNTA DE FECHA 21/05/2012 SE HABLO QUE JOSE ANGEL MATILLA NO TIENE SERVICIO DE URGENCIA NI RECOGE AVISOS A PARTIR&nbsp; DE LAS 19:30H.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Arial;"><strong>EN JUNTA 21/05/2012</strong> SE APROBO DAR UN MANTENIMIENTO SEMESTRAL DE LOS PORTONES DEL GARAJE, APROBANDO LA OPCION 1 QUE PRESUPUESTO JOSE A.MATILLA (ARCHIVADO EN EL AZ DE GTOS E INGRESOS CON EL ACTA DE LA JUNTA 2011-2012) DE 95,00.-&euro; </span><span style="font-size: 10.0pt; font-family: Arial; color: blue;">mantenimiento preventivo (incluye la revisi&oacute;n de los elementos el&eacute;ctricos y mecanicos; comprobaci&oacute;n de sistemas de seguridad y engrase de partes m&oacute;viles; informe de deficiencias observadas).</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">1&ordm; REVISION EN JULIO/2012 (calcular a partir de esa fecha semestralmente el mantenimiento y dar aviso a Insmat)</span></p>'),
	(318, 55, 59, '2013-10-09', '2050-01-01', '<p>INSTALADOR DE PORTON</p>'),
	(319, 55, 235, '2013-10-09', '2020-12-31', '<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: Arial;">ANA COMERCIAL POST VENTA 678.069.703</span></p>\r\n<p><strong><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">05/06/2012.-NOS LLAMO ELISEO SOTO DE ASPRUSA PARA INDICARNOS QUE LA COLOCACION DE LAS PLACAS EN LA FACHADA SERA LA ULTIMA ACTUACION QUE ELLOS REALICEN EN ESA CDAD., YA QUE HACE 12 A&Ntilde;OS Q ENTREGARON EL EDIFICIO.</span></strong></p>'),
	(320, 54, 12, '2008-12-01', '2014-03-18', '<p>* <strong>A PARTIR DE 18/2/2013 TODA LA LIMPIEZA LA REALIZA LIMPIEZA ASTUR</strong>. Antes, los portales estaban a cargo de Limpiezas Loan y las zonas exteriores de Limpiezas Astur.</p>\r\n<p>* <strong>ENCARGADA DE LIMPIEZA</strong> - <span style="background-color: #ffff99;">Beatriz 626.865.970</span></p>\r\n<p><span style="background-color: #ccffff;">* <strong>LIMPIEZA PORTALES. </strong></span></p>\r\n<p><strong>&nbsp; &nbsp;DIARIA</strong> -Portales (Lunes a Viernes, excepto festivos)</p>\r\n<p>&nbsp; &nbsp;<strong>SEMANAL</strong> -Escaleras</p>\r\n<p>&nbsp; &nbsp;<strong>QUINCENAL</strong> -Ventanas + Trasteros</p>\r\n<p>&nbsp; &nbsp;<strong>ANUAL</strong> - Abrillantado</p>\r\n<p><span style="background-color: #ccffff;">* <strong>LIMPIEZA EXTERIORES.</strong></span></p>\r\n<p><span style="background-color: #ffffff;"><strong>&nbsp; &nbsp;DIARIA -</strong> Recogida de papeles, colillas,etc...</span></p>\r\n<p><span style="background-color: #ffffff;"><strong>&nbsp; &nbsp;SEMANAL -</strong>Recogida papeleras + zona infantil</span></p>\r\n<p><span style="background-color: #ffffff;"><strong>&nbsp; &nbsp;MENSUAL -</strong>Mantenimiento y limpieza zonas ajardinadas y plantas</span></p>\r\n<p><span style="background-color: #ffffff;"><strong>&nbsp; &nbsp;CUATRIMESTRAL -</strong>Baldeado de Patio (Nota: Se har&aacute; con m&aacute;quina a presi&oacute;n a finales Julio, principios Agosto 2012)</span></p>\r\n<p><span style="background-color: #ffffff;">* &nbsp;<strong>ASPERSORES. </strong>A partir de 30/9/2011 vino la chica de la limpieza para que le explic&aacute;semos el tema de los aspersores. Hasta ese momento se encargaba M&ordf; Angeles. Fue con Angeles a la comunidad, d&oacute;nde se le explic&oacute; y se le entreg&oacute; copia del libro de instrucciones de los mismos, para hacerse cargo del tema de los aspersores desde ese momento. <span style="background-color: #ccffff;">La central est&aacute; en el Garaje.</span> Instrucciones del encendido de los aspersores en Documentos Permanentes.</span></p>\r\n<p>* <strong>NOS FALTA CONTRATO B-47</strong>, s&oacute;lo tenemos presupuesto . Tenemos contratos exteriores + portales 22 - 26</p>'),
	(321, 54, 9, '2013-10-10', '2050-10-10', '<p>* <strong>FOCO SOPORTAL BADAJOZ 47</strong>. &nbsp;Este foco se estropea con frecuencia y es porque es de estanca (es decir, de exterior) y entonces cuando le entra un poco de humedad se estropea.</p>'),
	(322, 54, 39, '2013-04-01', '2015-04-01', '<p>* <strong>FACTURACION</strong>. Se hace de manera mensual, por anticipado.</p>\r\n<p>* <strong>INSPECCIONES ASCENSOR</strong>. Cada 4 a&ntilde;os. Ultima inspecci&oacute;n P-22 - 26 el d&iacute;a 13/7/2011. Ultima inspecci&oacute;n P-47 el d&iacute;a 31/4/2012</p>\r\n<p>* <strong>CONTRATO</strong>. 1/4/2013. Bianual. Prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n con 30 d&iacute;as antelaci&oacute;n.</p>'),
