	(325, 54, 212, '2013-10-10', '2014-04-01', '<p>* <strong>RETIMBRADO.&nbsp;</strong>El retimbrado de los extintores se hace de dos veces. Un grupo: Badajoz 45 + parte &nbsp;de 47 + parte de Sor Juana 22 - 26, que tuvo el &uacute;ltimo retimbrado en 2012; y otro grupo, cuatro extintores de Sor Juana 22 - 26 y Badajoz 47, en 2013. El retimbrado se hace cada 5 a&ntilde;os.</p>\r\n<p>* <strong>REVISIONES</strong>. De caracter anual. Todos los extintores juntos.</p>'),
