	(329, 54, 223, '2013-10-10', '2014-10-10', '<p>* PERSONAS DE CONTACTO. PACO (Oficina) 985.334.020 y CANCIO (M&oacute;vil) 609.849.696</p>\r\n<p>* &nbsp;<strong>ASPERSORES.&nbsp;</strong>A partir de 30/9/2011 vino la chica de la limpieza para que le explic&aacute;semos el tema de los aspersores. Hasta ese momento se encargaba M&ordf; Angeles. Fue con Angeles a la comunidad, d&oacute;nde se le explic&oacute; y se le entreg&oacute; copia del libro de instrucciones de los mismos, para hacerse cargo del tema de los aspersores desde ese momento. Instrucciones del encendido de los aspersores en Documentos Permanentes. &nbsp;<strong><span style="background-color: #ccffff;">La central est&aacute; en el Garaje.</span></strong>&nbsp;&nbsp;Aspersores tienen una programaci&oacute;n en el garaje, pasillo central, seg&uacute;n se entra al garaje a la izquierda para regular el regad&iacute;o de la zona del jard&iacute;n.</p>'),
	(330, 54, 70, '2012-02-11', '2014-02-11', '<p>* POLIZA&nbsp;<strong>N&ordm; 526454</strong></p>\r\n<p>* 11/2/2011 se modific&oacute; p&oacute;liza, ampli&aacute;ndola e incluyendo a Badajoz 47.</p>\r\n<p>*&nbsp;<strong>PERSONAS CONTACTO</strong>. MARIO (Mutua Gij&oacute;n) 984.105.013 / 932.154.116. LUIS ANGEL GARCIA, BANCORLIFE.</p>\r\n<p>* <strong>CONTRATO</strong>. Anual. Prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n con 60 d&iacute;as de antelaci&oacute;n.</p>'),
