	(337, 18, 74, '2013-09-01', '2014-09-01', '<p>* <strong>CONTRATO</strong>. Anual, prorrogable por igual per&iacute;odos.&nbsp;</p>\r\n<p>* <strong>TERMINOS CANCELACION</strong>. Aviso con 30 d&iacute;as antelaci&oacute;n.</p>\r\n<p>EN JUNTA 17/10/13 SE ACORDO SUPRIMIR EL ASPIRADO MECANICO DEL GARAJE QUE SE REALIZABA CADA CUATRO MESES, SUPONIENDO UN AHORRO MENSUAL DE 24,20&euro;, ENTRA EN VIGOR A PARTIR DEL 1/11/13</p>'),
	(338, 18, 17, '2011-07-01', '2013-10-31', '<p>*<strong> DURACION CONTRATO</strong>. 3 A&Ntilde;OS.</p>\r\n<p>* <strong>CANCELACION CONTRATO</strong>. 30 dias de antelaci&oacute;n a trav&eacute;s de Carta Certificada</p>\r\n<p>* <strong>INSPECCION ASCENSORES</strong>. Est&aacute; pendiente de que se vuelva a realizar la inspecci&oacute;n en DIC 2013 por unas deficiencias graves (falta de escalera dentro del foso). Ya hay presupuestos en administraci&oacute;n, falta presentarlos en Junta OCT 2013.</p>'),
