	(349, 48, 46, '2013-07-01', '2017-07-01', '<p>* <strong>CONTRATO</strong>.&nbsp;CADA 4 A&Ntilde;OS.&nbsp;</p>\r\n<p>* <strong>CANCELACION</strong>. Se puede cancelar en cualquier momento, siempre y cuando, se abone el 50% de las cuotas restantes. Sino no requiere aviso previo.</p>'),
