	(378, 30, 238, '2002-01-21', '2014-01-21', '<p><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">CONTRATO FIRMADO EL 21/01/2002, PARA RESCINDIR CONTRATO AVISAR CON 30 DIAS DE ANTELACION.</span></strong></p>\r\n<p><strong><span style="font-size: 8.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; background: red; mso-highlight: red; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">Junta de fecha 30/07/2013 se determina que:&nbsp; &ldquo;EN CUANTO AL AGUA DE LA LIMPIADORA SE DETERMINO en a&ntilde;os anteriores pero no se dej&oacute; constancia en el libro de actas QUE EL AGUA QUE HAY QUE FACILITAR A LA LIMPIADORA HA DE SER SUMINISTRADA DE LA ACOMETIDA DEL PISO DEL PTE. DE TURNO DURANTE EL A&Ntilde;O QUE LE TOCA a cada vecino ejercer de pte., EL VECINO DEL 5&ordm;B CESAR SE RESPONSABILIZA DE REALIZAR EL CAMBIO CORRESPONDIENTE con el fin de no incurrir en gastos y asi no tener que llamar a un fontanero para que cambie el latiguillo.</span></strong></p>'),
