	(394, 30, 70, '2011-03-11', '2014-03-11', '<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial;">N&ordm; POLIZA.- 503410</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial;">902.50.01.01 Averias</span></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial;">902.500.033 </span></p>\r\n<p><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">POLIZA VIGENTE Y ACTIVA FIRMADA EL 11/03/2011, PRORROGABLE POR PERIODOS ANUALES</span></strong></p>\r\n<p><strong><span style="font-size: 9.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">EL 15/11/13 HABLE CON MARIA ANGELES, ME DICE QUE ANTES DE REMITIR CARTA CANCELACION HAY QUE VER SI ALGUNA COMPA&Ntilde;IA ASEGURARIA A ESTA COMUNIDAD PORQUE ES MUY ANTIGUA. PEDIR A OCASO Y REALE.</span></strong></p>'),
	(395, 31, 74, '2013-01-10', '2014-01-10', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">CONTRATO FIRMADO EL 10/01/2008, CON DURACION ANUAL Y PARA RESCINDIR AVISAR CON 1 MES DE ANTELACION</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial; background: lime; mso-highlight: lime;">24/06/11JULIO MORO HABLO CON JOSE PADUANO Y CON ANGEL, VICEPTE. Y VECINO DEL PORTAL 1, RESPECTIVAMENTE, &nbsp;SOBRE EL TEMA DE LA LIMPIEZA DEL PATIO, Y ACORDARON QUE:</span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: Arial; background: lime; mso-highlight: lime;">1.<span style="font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></strong><!--[endif]--><strong><span style="font-size: 8.0pt; font-family: Arial; background: lime; mso-highlight: lime;">IBA A FUMIGAR LAS PLANTAS DEL PATIO (tiene que presentar presupuesto antes)</span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: Arial; background: lime; mso-highlight: lime;">2.<span style="font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></strong><!--[endif]--><strong><span style="font-size: 8.0pt; font-family: Arial; background: lime; mso-highlight: lime;">EL BALDEADO DEL PATIO PASA DE SER MENSUAL CON AGUA NADA MAS A TRIMESTRAL&nbsp; DE BALDEADO CON CEPILLO DE LAS ZONAS MAS SUCIAS Y AGUA.</span></strong></p>\r\n<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: lime; mso-highlight: lime; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">Julio les comento si esto no deberia tratarse en junta, y el vecino Angel le comento que no, que si alguien decia algo que fueran a hablar con &eacute;l, estando el vicepte.delante sin decir nada.</span></strong></p>'),
	(396, 31, 41, '2003-12-30', '2013-12-30', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Tahoma; background: yellow; mso-highlight: yellow;"><span style="background-color: #ffffff;">* CONTRATO. </span></span></span></strong><span style="text-decoration: underline; background-color: #ffffff;"><span style="font-size: 10pt; font-family: Tahoma; background-position: initial initial; background-repeat: initial initial;">30/12/2003. Duraci&oacute;n 5 a&ntilde;os, prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n con 60 d&iacute;as de antelaci&oacute;n a la fecha de vencimiento.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Tahoma; background: yellow; mso-highlight: yellow;">SE ACORDO EN JUNTA 15/02/11 QUE RESPECTO AL CAMBIO DE OCULOS EN EL ASCENSOR DEL PORTAL 1, A PARTIR DE LA FECHA SE HACE CARGO EL VECINO ANGEL FERNANDEZ FERNANDEZ 2&ordm; A</span></span></strong><strong><span style="font-size: 10.0pt; font-family: Tahoma; background: yellow; mso-highlight: yellow;">. se notifico a CPS de la decisi&oacute;n por correo electr&oacute;nico 18/02/11</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Tahoma; background: yellow; mso-highlight: yellow;">**<span style="text-decoration: underline;">CON FECHA 10/05/2013 LA VECINA DEL 1&ordm;A DEL PORTAL 2 SE HACE CARGO ELLA DEL CAMBIO DE OCULOS EN ESE PORTAL</span>. Se notifico x correo electronico a CPS 14/05/2013.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Arial;">10/05/2013.-</span></span></strong><strong><span style="font-size: 10.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">envia M&ordf; de los Angeles correo indicando los datos personales de los vecinos del portal 2 2&ordm;A x si dan avisos a la empresa de ascensores estos se realicen con urgencia debido a la incapacidad de su hija, (esta en silla de ruedas y sin ascensor no puede salir de casa). Se anota en excell para si hubiera alg&uacute;n cargo extra se indique el motivo.</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 10.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">p.2 &ndash; 2&ordm;A</span></span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 9.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">Pilar Chicharro Rodr&iacute;guez 10.841.933D</span></span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;">&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 9.0pt; font-family: Arial; background: aqua; mso-highlight: aqua;">Juan Jose Terrones Rdguez 10.836.080K</span></span></strong></p>'),
	(397, 35, 240, '2012-12-10', '2013-12-10', '<p class="MsoNormal"><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">Cobra el servicio de limpieza por banco <span style="color: red;">NO </span>hay que emitir cheque para el pago</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Arial;">10/12/2012.-<strong> SE HABLO CON AFRICA X TFN Y SE LE PREGUNTARON LAS FRECUENCIAS:</strong></span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style="font-size: 9.0pt; font-family: Arial;">DIARIO:PORTAL, ASCENSOR </span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style="font-size: 9.0pt; font-family: Arial;">SEMANAL:ESCALERAS Y DESCANSILLOS</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><st