	(416, 31, 201, '2013-10-11', '2018-12-31', '<p><strong>MOROSO DONANTES N&ordm; 1-6&ordm; B JOSE ANGEL HERNANDEZ GARCIA</strong></p>\r\n<p>En Junta 25/3/13 se acord&oacute; reclamar judicialmente la deuda de Jos&eacute; Angel Hernandez Garc&iacute;a del portal 1-6&ordm; B por importe de 533&euro; a fecha 31/3/13. Se le va a remitir burofax en cuanto lo firme el presidente y administradora.</p>\r\n<p>Con fecha 17/4/13 habl&eacute; con Reyes y me dice que tiene pensado liquidar la deuda el 6 o 7 de mayo y que me facilitar&aacute; otro n&uacute;mero de cuenta para pasar el recibo.</p>\r\n<p>El 15/5/13 llame a Reyes me dijo que la semana que viene abonar&iacute;a 150&euro; y para Junio tratar&aacute; de abonar m&aacute;s, hasta liquidar la deuda.&nbsp;</p>\r\n<p>En el mes de junio 2013 abona 100&euro;. Esperaremos a ver si sigue abonando, en otro caso, remitir burofax</p>\r\n<p>22/8/13 Desde Junio 2013 no ha hecho ning&uacute;n otro abono.&nbsp;</p>\r\n<p>ESTA COMUNIDAD LIQUIDA EL 30/9/13, Y MARIA ANGELES EXPONDR&Aacute; EN JUNTA QUE SI NO SE PROCEDI&Oacute; A LA RECLAMACION JUDICIAL FUE PORQUE ALGUN VECINO NO HA QUERIDO. PORQUE NOSOTROS TENEMOS PREPARADO PARA REMITIR BUROFAX, FIRMADO POR PRESIDENTE.</p>'),
	(417, 37, 12, '2013-04-18', '2014-04-18', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">* CONTRATO. </span></strong><span style="font-size: 8.0pt; font-family: Arial;">Anual. Prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n con 30 d&iacute;as de antelaci&oacute;n antes de fecha vencimiento.</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">18/04/2013.- EN LA ULTIMA JUNTA REALIZADA SE FIJO QUE SE LIMPIARIA UNA VEZ AL A&Ntilde;O, REALIZANDO DICHA LIMPIEZA LIMPIEZAS ASTUR (MAIKA-LUPE), Y QUEDANDO EN SUMINISTRAR EL AGUA DE LA SIGUIENTE MANERA: (CORREO ENVIADO A L.ASTUR)</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-language: ES;">Hoy se ha puesto en contacto conmigo el Presidente de la CP Eulalia del Llano y Noriega 2, &nbsp;&nbsp;Manuel Param&aacute; Blanco 4&ordm; Izda. 692.65.39.91 el os va dejar el agua para proceder a la limpieza del patio. Me coment&oacute; que para el 29/04/2013 se marcha para Galicia por 10 d&iacute;as para que lo teng&aacute;is en cuenta. Se lo comentas a Lupe que estaba pendiente de que nosotros se lo informaramos.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-language: ES;">Un saludo</span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">LA LIMPIEZA SE</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;"> REALIZO</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;"> EN ABRIL/2013</span></strong></p>'),
	(418, 38, 12, '2012-12-01', '2013-12-01', '<p><strong><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: lime; mso-highlight: lime; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">&nbsp;<span style="text-decoration: underline;">EN JUNTA 22/3/13 SE ACORD&Oacute; ELIMINAR EL ASPIRADO DEL GARAJE ANUAL.</span></span><span style="text-decoration: underline;"><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;"> <span style="background: lime; mso-highlight: lime;">EL 2/04/13 AVISE A MAYCA PARA COMENTARSELO Y QUE NOS DESCUENTE EL IMPORTE DEL ASPIRADO.</span></span></span></strong></p>\r\n<div>\r\n<table cellspacing="0" cellpadding="0" align="left">\r\n<tbody>\r\n<tr>\r\n<td style="padding-top: 0cm; padding-right: 7.05pt; padding-bottom: 0cm; padding-left: 7.05pt;" align="left" valign="top">\r\n<p class="MsoNormal"><strong><span style="font-size: 11.0pt; mso-bidi-font-size: 9.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">Encargada de limpieza Beatriz 626.865.970</span></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<table style="height: 114px;" width="820" cellspacing="0" cellpadding="0" align="left">\r\n<tbody>\r\n<tr>\r\n<td style="padding-top: 0cm; padding-right: 7.05pt; padding-bottom: 0cm; padding-left: 7.05pt;" align="left" valign="top">\r\n<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span style="font-size: 8.0pt; font-family: Arial;">ACTUALMENTE LOS SERVICIOS CONTRATADOS DE LIMPIEZA A MARZO 2013 SON</span></span></strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; mso-bidi-font-size: 9.0pt; font-family: Arial;">:</span></span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">LIMPIEZA SEMANAL: RECOGIDA PAPELES, COLILLAS Y PAPE