	(426, 38, 244, '2013-04-01', '2015-04-01', '<div>*&nbsp;<strong>INSTALADOR DEL PORTON</strong>. ASPOR S.L. &nbsp;T.985.363.081. C/Alarc&oacute;n 34, Gij&oacute;n</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<table cellspacing="0" cellpadding="0" align="left">\r\n<tbody>\r\n<tr>\r\n<td style="padding-top: 0cm; padding-right: 7.05pt; padding-bottom: 0cm; padding-left: 7.05pt;" align="left" valign="top">\r\n<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span style="font-size: 9.0pt; font-family: Arial; background: lime; mso-highlight: lime;">CONTRATO MTTO PORTON CON KONE BIANUAL, A PARTIR DEL 1/4/13, VINCULADO A LA DURACION DEL CTO DE MTTO ASCENSORES (2 A&Ntilde;OS), COSTE 0&euro; Y 2 VISITAS ANUALES UNA EN NOVIEMBRE Y OTRA EN MAYO.</span></span></strong></p>\r\n<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; mso-bidi-font-size: 9.0pt; font-family: Arial;">PARA DAR AVISOS DE AVERIA DE PORTON COMUNICAR EL NOMBRE DE LA COMUNIDAD COMPLETA O BADAJOZ 47</span></span></strong></p>\r\n<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; mso-bidi-font-size: 9.0pt; font-family: Arial;">ES IMPORTANTE GUARDAR LOS PARTES QUE NOS HAGAN FIRMAR.</span></span></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>'),
	(427, 38, 11, '2013-02-19', '2014-02-19', '<p class="MsoNormal"><span style="background-color: #ffffff;"><strong><span style="font-size: 9pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">POLIZA N&ordm; 0760980132756</span></strong></span></p>\r\n<p class="MsoNormal"><span style="background-color: #ffffff;"><strong><span style="font-size: 9pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">* CONTRATO. &nbsp;</span></strong><span style="font-size: 9pt; font-family: Arial; background-position: initial initial; background-repeat: initial initial;">Anual. Prorrogable por iguales per&iacute;odos. Aviso cancelaci&oacute;n con 60 d&iacute;as antelaci&oacute;n.</span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Arial; background: lime; mso-highlight: lime;">CUANDO SE APERTURE SINIESTRO DE AGUA SOLICITAR EL TECNICO 193-B (IVAN) 625.040.363 ES MUY COMPETENTE</span></strong></p>'),
	(428, 37, 16, '2011-10-27', '2014-10-27', '<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">(se cambio en la junta de 27/10/2011, y se determino que ellos serian los encargados de poner en marcha las centrales y realizar todos los cambios oportunos, se aprobo en dicha junta).</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">INSTALADOR MOTOR TRIFASICO GARAJE EXTRACTOR HUMOS&nbsp;</span></strong><strong style="font-size: 11px;"><span style="font-size: 11.0pt; font-family: Arial;">JOSE MORALES MA&Ntilde;AS&nbsp;</span></strong><span style="font-size: 11pt; font-family: Arial;">985.141.098/608.787.917</span><strong style="font-size: 11px;"><span style="font-size: 11.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: AR-SA; mso-bidi-language: AR-SA;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -35.6pt; margin-bottom: .0001pt; margin-left: -35.45pt; text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">LLAMA A LIDER Y PREGUNTA PARA CUANDO TOCA LA REVISION DE LOS EXTINTORES Y DE LA CENTRAL DE CO2. EL TEMA VIENE A RAIZ DE QUE SE CAMBIO UN MOTOR DE LOS EXTRACTORES DE HUMOS QUE VA CONECTADO A LA CENTRAL Y EN LA FACTURA DICE QUE ESTE MOTOR FUNCIONA CON UN RELOJ NOS GUSTARIA QUE PARA CUANDO REALIZARAN LA REVISION QUE HICIERAN INCAPIE EN CONTEJAR SI FUNCIONA CON RELOJ Y CON LA CENTRAL.</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -35.6pt; margin-bottom: .0001pt; margin-left: -35.45pt; text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -35.6pt; margin-bottom: .0001pt; margin-left: -35.45pt; text-align: justify;"><strong><span style="font-size: 10pt; font-family: Verdana;">SI NO TOCA PARA AHORA PRONTO DEJALO SIN ARCHIVAR EN EL CASILLERO PARA QUE TE ACUERDES CUANDO HAGAS LAS CONTABILIDADES. 23/05/2011</span></strong></p>'),
	(429, 42, 245, '2013-10-11', '2015-12-31', '<p><span style="background-color: #ccffcc;"><strong>NO HAY CONTRATO DE LIMPIEZA. ES AUTONOMA POR LO QUE NO HAY AVISO DE RENOVACI&Oacute;N.</strong></span></p>\r\n<p><span style="font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">PURI NOS INDICA QUE SU TRABAJO CONSISTE EN LA LIMPIEZA DEL&nbsp; BA&Ntilde;O, ENTRADA Y SALIDA DEL GARAJE, LAS ZONAS DE LOS VEHICULOS NO TIENE ACCESO Y NO ENTRA DENTRO DE LO CONVENIDO EN SU TRABAJO.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial;">EN LA JUNTA DE FECHA 27/02/2013 SE DETERMINO PONER UN CARTEL EN EL GARAJE EN EL CUAL SE IBAN INDICANDO LAS LUMINARIAS QUE SE CAMBIARAN, ASI SE PODRIA VER LA FRECUENCIA Y DURACION DE LAS MISMAS.</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Arial;">COLOCADO X I&Ntilde;AKI.</span></strong></p>'),
