	(467, 51, 251, '2013-10-14', '2050-10-14', '<p>* <strong>SUMINISTRO ELECTRICO</strong></p>\r\n<p><strong>CON FECHA 7/11/13 LLAME A HC PARA CAMBIAR DE CONTRATO ELECTRICO DE IBERDROLA A HC ENERGIA, EL PRECIO DEL KW ES DE 0.151769&euro; CON UN 4&ordm; DTO EN EL CONSUMO QUEDARIA EN 0.145698&euro;. POTENCIA 3,382972&euro; AL MES, AL REALIZAR EL ALTA DEL CONTRATO ME DICEN QUE EL SISTEMA NO LES PERMITE REALIZAR EL CAMBIO DE SUMINISTRO PORQUE ESTA COMUNIDAD A TENIDO VARIOS AVISOS DE CORTE DE SUMINISTRO Y TIENEN QUE TRANSCURRIR 12 MESES SIN NINGUN AVISO. QUEDARON EN LLAMARME PARA FACILITARME LA FECHA EN LA QUE SE PUEDE HACER EL CAMBIO. SI NO HABLAR CON INTEGRA.</strong></p>'),
