	(483, 36, 148, '2013-01-01', '2014-01-01', '<p class="MsoNormal" style="margin-right: -40.4pt;"><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">LIMPIEZAS LA CAMPA</span><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;"> LO QUE HACE ES CAMBIAR LAS LUMINARIAS DEL EDIFICIO, PORTAL, ESCALERAS, DESCANSILLOS, ETC, PERO LAS DEL GARAJE NO, ME DIJERON&nbsp; DE LA CAMPA QUE PODIAN CAMBIARLAS ELLOS, QUE MANDABAN A UN ELECTRICISTA, PERO ME DA QUE NOS COBRAN, ASI QUE EVITAR QUE LAS CAMBIEN ELLOS</span></p>\r\n<p class="MsoNormal" style="margin-right: -40.4pt;"><strong><span style="font-size: 9.0pt; font-family: Arial;">30/09/2011.- Mara dice que la limpiadora no tiene, y no va a ir a pedir la firma del pte. ni de nadie del portal, que ella anota las cosas cuando las hace en un papel que esta donde los trasteros, se le indica que es para evitar problemas presentes y futuros de dudas de que se este ejecutando la limpieza de acuerdo con el contrato, dice que ellos no lo van a hacer, que si quieren saber si se hace o no que lo miren en el papel.</span></strong></p>'),
