	(495, 43, 19, '2013-01-10', '2014-01-10', '<p class="MsoNormal"><span style="font-size: 9.0pt; font-family: Verdana; mso-bidi-font-family: Arial;"><span style="background-color: #ffff00;"><strong>FRECUENCIAS DE TRABAJO XENIA</strong></span>:</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Semanal Garaje: &Eacute;poca de oto&ntilde;o (Septiembre, Octubre, Noviembre y Diciembre) revisi&oacute;n de la superficie del garaje, barrido de papeles y colillas, limpieza de extintores vaciado de papeleras y barrido de rampas acceso veh&iacute;culos.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Quincenal Garaje: Resto de meses, idem servicios que la frecuencia Semanal.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Semestral Garaje: Limpieza y aspirado de garajes con maquina apropiada, limpieza de portones.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Quincenal Zona Com&uacute;n Exterior: Revisi&oacute;n de la superficie, recogida de papeles y colillas, revisi&oacute;n de papeleras y zona de juegos.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">Anual Zona Com&uacute;n Exterior: Limpieza con m&aacute;quina a presi&oacute;n &ldquo;Hidrolimpiadora&rdquo; de soportales, zona de juegos y parrilla.</span></p>'),
