	(512, 47, 148, '2011-01-03', '2014-12-01', '<p>* <strong>CONRATO</strong>. En 16/12/2011 se modific&oacute; el contrato. Es el que est&aacute; adjunto en documentos escaneados. Fecha de inicio fue el 3/1/2011</p>\r\n<p>* <strong>FRECUENCIA LIMPIEZA</strong>. Indica Maria de la Campa que la limpieza se realizar&aacute; los lunes y los jueves.</p>\r\n<p>* <strong>BALDEADO</strong>. En 17/7/2012 llam&oacute; Mar&iacute;a para decir que est&aacute;n baldeando esta semana los soportales, que no est&aacute; contratado pero ella lo hace igual.</p>\r\n<p>* <strong>ENCENDIDO RELLANOS.&nbsp;</strong>En Junta de fecha 12/12/2011 en el punto 2&ordm; determinan que "se acuerda que en los rellanos se va a eliminar el encendido de la luz del medio de cada uno de los rellanos, en el portal se van a eliminar del encendido tres bombillas y en el soportal los down light tienen dos l&aacute;mparas cada uno, se va a eliminar el encendido de una de estas dos l&aacute;mparas que tiene cada foco con el fin de no consumir tanta corriente el&eacute;ctrica.&nbsp;</p>'),
