	(542, 19, 260, '2013-01-28', '2018-01-28', '<p>INSPECCION BAJA TENSION GARAJE REALIZADA POR SEINCO (YA NO EXISTE), CADA CINCO A&Ntilde;OS, HAY DOCUMENTACI&Oacute;N EN PERMANENTES. AUNQUE ESTE GARAJE NO ES OBLIGATORIO HACERLO PORQUE NO SUPERA LAS 25 PLAZAS.</p>'),
	(543, 16, 260, '2012-07-30', '2017-07-30', '<p>* <strong>INSPECCION BAJA TENSION</strong>. Ultima inspecci&oacute;n se realiz&oacute; el 30/7/2012. Certificado est&aacute; adjunto.</p>\r\n<p>*INSPECCION REALIZADA POR SEINCO (YA NO EXISTE) ES CADA CINCO A&Ntilde;OS, HAY DOCUMENTACION EN PERMANENTES, SE NECESITA BOLETIN DE HC, PROYECTO Y MEMORIA DE INSTALACION ELECTRICA BAJA TENSION Y LA ULTIMA FACTURA DE ELECTRICIDAD.</p>'),
