	(572, 58, 185, '2013-10-17', '2020-12-31', '<p><strong><span style="text-decoration: underline;"><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">ESTE PORTAL HA SIDO TRANSFERIDO A VIPASA CUALQUIER INCIDENCIA QUE PUEDA SER RECLAMABLE AL SEGURO CORRE POR CUENTA DE VIPASA. </span></span><em><span style="font-size: 9.0pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; background: yellow; mso-highlight: yellow; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">SEG&Uacute;N LUDY TIENEN ELLOS CONTRATADO EL SEGURO PARA TODO EL PARQUE DE VIVIENDAS QUE ELLOS ADMINISTRAN</span></em></strong></p>'),
	(573, 59, 19, '2008-09-15', '2014-09-15', '<p>* <strong>CONTRATO</strong>. Indefinido. Aviso Cancelaci&oacute;n con 30 d&iacute;as de aviso.</p>\r\n<p>* <strong>BOMBILLAS</strong>. VIPASA autoriz&oacute; que reponga las bombillas la compa&ntilde;&iacute;a de limpieza. Cuando lo haga, que lo agrege a la factura. En caso de que haya que comprar material el&eacute;ctrico, entonces se procede a llamar a un electricista.</p>\r\n<p>* <strong>DOWNLIGHTS SOPORTAL</strong>. En Junta 7/11/2011 se aprob&oacute; por unanimidad apagar algunos downlight de los soportales como medida de ahorro (se le pas&oacute; a Xenia un plano que hizo M&ordf; Angeles para que tuvieran claro las que hay que apagar. Se le envi&oacute; a Xenia por correo el 8/11/2011.</p>'),
