	(12, 8, 'CARBONERA ', '58', '<p>En el cuarto de reuniones me he percatado en la Junta realizada en fecha 05 de Marzo de 2013 que hay una trampilla de limpieza de bajantes he preguntado a los vecinos y creen que la misma pertenece a la letra A de las cocinas. PRESIDENTE A&Ntilde;O 2013 (ATILANO) INDICA QUE TODOS LOS AVISOS SE LE DEN A EL PRIMERO ANTES DE ENVIAR REPARADOR.</p>'),
	(13, 9, 'CARRETERA CARBONERA', '60', ''),
	(14, 10, 'CARMEN AMAYA ', '2', ''),
	(15, 11, 'CALLE CARMEN AMAYA ', '4', '<p>1. LA MANCOMUNIDAD HA APROBADO EN JUNTA PARA QUE LA LIMPIEZA DE LOS SOPORTALES Y PATIOS SE UTILICE EL AGUA UNA VEZ DE CADA PORTAL, ES DECIR UNA VEZ X TRIMESTRE SE HAR&Aacute; LAS LIMPIEZAS CON EL AGUA DE CADA UNO DE LOS PORTALES 4 - 6 - 8. 2. POSEE UN LOCAL PROPIEDAD DE TODOS LOS VECINOS QUE UTILIZAN PARA GUARDAR BICIS.</p>'),
	(16, 12, 'CALLE CARMEN AMAYA ', '8', ''),
	(17, 13, 'CIGARRERES ', '29', '<p>Garaje de CP CARMEN AMAYA 4 - 6 - 8 (CP CARMEN AMAYA 6 la lleva otra administraci&oacute;n)</p>'),
	(18, 14, 'PLAZA PATRICIO ADURIZ ', '1', ''),
	(19, 14, 'PLAZA PATRICIO ADURIZ', '2', '<p>En este portal esta ubicado el Grupo de Presi&oacute;n de la Cdad. El cual se ha puesto en funcionamiento despu&eacute;s de realizar una serie de trabajos para que diera ruido al vecino del 1&ordm; C y para que de mayor presi&oacute;n a varios vecinos afectados. Los vecinos afectados eran Silvino y Jos&eacute; Miguel del portal 2 y portal 3 respectivamente..</p>'),
