	(25, 17, 'RAMON ARECES ', '18 PORTAL A', '* Tres portales A - B - C\r\n* 56 Vecinos + 4 Plazas de Garaje Adicionales + 5 Locales\r\n* Portal A - 22 Vecinos / Portal B -12 Vecinos / Portal C - 22 Vecinos'),
