	(30, 18, 'SOR JUANA INES DE LA CRUZ', '11', '<p>* Las llaves del Portal 11 se las ha de entregar el vicepresidente saliente. Daniel no se las entrega, nos las traer&aacute; a nosotros , puesto que el propietario del piso y el vicepresidente no vive all&iacute;.</p>'),
	(31, 18, 'SOR JUANA INES DE LA CRUZ', '9', '<p>* Las llaves del Portal 9, las tenemos en la cajita que se entrega al presidente, a la firma del libro de actas.</p>'),
	(32, 18, 'SOR JUANA INES DE LA CRUZ', 'GARAJE', '<p>* 10 Plazas</p>\r\n<p>*Junta de fecha 17/10/2013, se determina que "<span style="font-family: Verdana; font-size: 10pt; text-align: justify;">Se renueva el mantenimiento con Fedecor, no incrementar&aacute; IPC para el siguiente a&ntilde;o, informo que se ha confirmado con la empresa que tienen el muelle en stock para proceder a su sustituci&oacute;n una vez deje de funcionar el que se tiene colocado en la actualidad.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; border: none; padding: 0cm; display: inline !important;"><strong><span style="font-size: 10.0pt; font-family: Verdana; color: blue;">MARIA JOSE: PARA ACTUALIZAR EN PLATAFORMA Y TENER EN CUENTA NO HAY AUMENTO DE IPC PARA EL SIGUIENTE EJERCICIO.</span></strong></p>'),
	(33, 19, 'DOMINGO JULIANA', '23', '<p>* HORARIO Extractores del Garaje 9:30 a 10 hrs y 20 a 20:30 hrs * Seg&uacute;n lo acordado en Junta 9/12/2009: Cuando se produzca conducta inadecuada en la comunidad, se le notificar&aacute; al vecino que ocasione esas molestias a trav&eacute;s de un escrito y NO colocando avisos, en el portal, de manera generalizada. * Las Actas se enviar&aacute;n a CASPILES, mientras sean propietarios de las plazas de garaje, Carta Certificada + Acuse de Recibo (NO BUROFAX)</p>'),
