	(47, 23, 'PEÑA DE LOS CUATRO JUECES', '11', '<p>**24/09/2013.- RECIBIMOS LLAMADA DE CARLOS BALLESTEROS 639.983.503 (PERITO DE ALLIANZ), INDICANDO QUE LLAMA X EL SEGURO PRIVATIVO DE LA VECINA DEL 1&ordm;G ROSARIO CARRASCO(SEGURO PRIVATIVO ALLIANZ), LA CUAL HA TENIDO UN SINIESTRO EN SU VIVIENDA Y HA CAUSADO DA&Ntilde;OS EN EL ENTRESUELO E Y F Y EN ZONAS COMUNES (CAJA ESCALERA, TECHO Y PAREDES). SE TOMA NOTA DEL MISMO X SI HUBIERA QUE RECLAMAR.</p>'),
	(48, 23, 'PEÑA DE LOS CUATRO JUECES', 'GARAJE', '<p>*<strong>* <span style="background-color: #00ff00;">ESTAS SON PLAZAS ADICIONALES</span>, EN LOS PREDIOS CADA UNO ESTA ASOCIADO CON SU PLAZA</strong></p>'),
