	(53, 25, 'ESMERALDA MASEDA', '3', '<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><strong><span style="font-family: \'Palatino Linotype\';">10/10/2013.- EN JUNTA DE FECHA 03/10/2013 SE DETERMINA QUE:</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><strong><span style="font-family: \'Palatino Linotype\';">2&ordm;- Presentaci&oacute;n y aprobaci&oacute;n de presupuestos para la colocaci&oacute;n de contadores individuales en los rellanos de cada planta, seg&uacute;n solicitud en Junta de fecha 20/05/2013. Aprobaci&oacute;n de derrama. </span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Se explica que los contadores se colocar&iacute;a en los rellanos en cada una de las tuber&iacute;a que entran hacia la vivienda con el fin de que cada vivienda pague seg&uacute;n los m3 que consuma, la propuesta m&aacute;s econ&oacute;mica para la colocaci&oacute;n de un contador por vivienda asciende a un total de 1.149,50&euro; que por vecino habr&iacute;a que aportar 45,98&euro; del total de vecinos que asisti&oacute; a </span>la Junta<span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;"> solo le interesaba al piso 5&ordm;K. Por lo que el planteamiento a los vecinos fue el siguiente &ldquo;Autorizar al Vecino del 5&ordm; K Victor Rodr&iacute;guez Villabrille a la colocaci&oacute;n por su cuenta y coste del contador en el armario de la escalera. Aprobar lectura anual del mismo, as&iacute; como aprobar del cobro del Agua seg&uacute;n los m3 consumidos&rdquo;.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Por unanimidad de los asistentes se autoriza al vecino del 5&ordm; K a la colocaci&oacute;n del contador individual para su vivienda,</span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">&nbsp; </span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">siempre y cuando corra con los costes de colocaci&oacute;n y cualquier gasto futuro que pueda ocasionar el contador o sus elementos de enganche. Tambi&eacute;n est&aacute;n de acuerdo y as&iacute; lo autorizan para que en su caso se cobre el agua no por coeficiente sino seg&uacute;n los m3 consumidos, participando al igual que los dem&aacute;s vecinos en los t&eacute;rminos fijos de la facturaci&oacute;n.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;">&nbsp;</p>'),
	(54, 26, 'FERMIN CANELLA', '4', ''),
	(55, 27, 'LES CIGARRERES', '52', '<p>* Las llaves del cuarto de la limpieza, donde est&aacute;n situados los autom&aacute;ticos, se entregan con cada cambio de cargos a los presidentes. * Se entreg&oacute; a Ana, 3&ordm; C en oficina. Al terminar su per&iacute;odo, ella se las entreg&oacute; a Susana 3&ordm; D (2013) * Tenemos la firma del Presidente + Vicepresidente en el cambio de firmas de Cajastur. Est&aacute; en la carpeta amarilla, archivada detr&aacute;s de MariaJo.</p>'),
