	(70, 32, 'VELAZQUEZ ', '42', '<p>*VECINA DEL 2&ordm;B A PRINCIPIOS A&Ntilde;O 2013 COLOCO UNA ANTENA EN TEJADO (AUTORIZACION DADA X EL PTE. Y LA CDAD)INDICADO EN JUNTA DE FECHA 10/10/2013. "<span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Se informa que la vecina del portal 42 &ndash; 2&ordm; B solicito a principios de a&ntilde;os autorizaci&oacute;n para colocaci&oacute;n de antena, siendo autorizada para la colocaci&oacute;n de la misma con t&eacute;cnico autorizado y aportando la documentaci&oacute;n necesaria para tener las garant&iacute;as de que los trabajos a realizar estaban siendo realizados por personas autorizadas por industria. Se deja constar en Acta por posibles da&ntilde;os o reparaciones para que conste que es de su cargo la reparaci&oacute;n y/o sustituci&oacute;n de la misma y los da&ntilde;os que pueda ocasionar."</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;">&nbsp;</p>'),
	(71, 32, 'VELAZQUEZ ', 'GARAJE', '<p>Plazas independientes</p>\r\n<p><strong>* EN JUNTA DE FECHA 10/10/2013 SE DETERMINA QUE "</strong><span style="text-align: justify; font-size: 11px;">Informan que el techo de la rampa de entrada al garaje (veh&iacute;culos) por fuera est&aacute; sucia, requieren que se solicite a la empresa de limpieza cada determinado tiempo lo mantenga limpio."&nbsp;<strong>SE DIO AVISO CON FECHA 28/10/2013 DE ESTE TEMA A LA EMPRESA DE LIMPIEZA (A CARMEN).</strong></span></p>'),
