	(78, 35, 'LA MANCHA', '3', '<p>* Las bombillas de la comunidad las tiene el Presidente, pero es responsabilidad de todos los vecinos cambiar la de su planta seg&uacute;n vean que se van &nbsp; &nbsp; &nbsp; fundiendo.</p>\r\n<p>*El presidente se encarga de orientar a los t&eacute;cnicos, en cuanto a incidencias.</p>\r\n<p>*<strong>EN LA ADMINISTRACION NO HAY LLAVES DE ESTA COMUNIDAD</strong></p>\r\n<p>*JUNIO 2013, al no vivir en la comunidad la presidente de este per&iacute;odo (2013-2014), tiene las <strong>llaves del ascensor y las bombillas</strong> para sustituir en rellanos y escaleras, el vecino del <strong>2&ordm; B</strong></p>'),
