	(90, 41, 'VIZCAINA 20', 'GARAJE', '<p>* <strong>Poner convocatoria en la Puerta Peatonal del Garaje</strong> para que, los que no viven en Teodoro Cuesta y Vizcaina 20, puedan verla y saber la fecha de la misma.</p>\r\n<p>* <strong>E.mail de Administradora Teodoro Cuesta</strong> , M&ordf; Isabel Varela: iva1532@colegiados.icagijon.es</p>\r\n<p>* <strong>Llaves. </strong>La misma llave del garaje es la de acceso al portal. Est&aacute; en la puerta del armario en Algonz.</p>'),
	(91, 42, 'AMPURDAN 13', 'GARAJE', '<p>*&nbsp;<strong>FIRMAS ENTIDAD FINANCIERA,&nbsp;</strong>firmaran de manera indistinta en la cuenta de la comunidad el Presidente y el Vicepresidente. CAJA LABORAL (Quique) Telf. 985.160.583</p>'),
