	(124, 58, 'LES CIGARRERES', '54', '<p>* <strong>SEGURO</strong>. Transferido a VIPASA. Todas las incidencias del seguro se hace a trav&eacute;s de ellos. En la administraci&oacute;n NO tenemos ning&uacute;n dato de este seguro, porque VIPASA no tiene como pol&iacute;tica compartir esa infromaci&oacute;n.</p>'),
	(126, 59, 'LES CIGARRERES', '48', '<p>*&nbsp;<strong>TRANSFERIDA A VIPASA. NO HAY PRESIDENTE.</strong></p>\r\n<p><strong>* SEGURO.&nbsp;</strong>Este portal ha sido transferido a VIPASA por lo que cualquier incidencia que pueda ser reclamable al seguro corre por cuenta de VIPASA. Inform&oacute; LUDY que ellos tienen contratado &nbsp;el seguro para todo el parque de viviendas que ellos administran. En la administraci&oacute;n NO tenemos datos del seguro, porque no es pol&iacute;tica de VIPASA dar esa informaci&oacute;n.</p>\r\n<p>*&nbsp;<strong>BOMBILLAS</strong>. Se encarga la empresa limpieza de cambiarlas. Cuando lo haga que cargue a la factura de limpieza, seg&uacute;n autorizaci&oacute;n de VIPASA. En caso de tener que comprar material el&eacute;ctrico, entonces se llama a un electricista.</p>\r\n<p>&nbsp;<strong>*** LUMINARIAS.- &nbsp;EN JUNTA DE FECHA 06/11/2013, PUNTO 3.-&nbsp;</strong><span style="color: #ff0000;"><span style="font-family: \'Palatino Linotype\'; font-size: 8pt; text-align: justify; text-indent: 36pt;">Se comentan algunas cuestiones sobre luminaria. Solicitan se repongan la luz fundida del rellano 4&ordm; planta. Eliminar el encendido de la 2&ordm; bombilla sito justo a la entrada al portal. (dejar encendida la que esta justo enfrente de la puerta del portal</span><span style="font-family: \'Palatino Linotype\'; font-size: 8pt; text-align: justify; text-indent: 36pt;">&nbsp; </span><span style="font-family: \'Palatino Linotype\'; font-size: 8pt; text-align: justify; text-indent: 36pt;">por fuera y la segunda se puede eliminar el encendido). Dentro del portal eliminar el encendido de la bombilla que est&aacute; m&aacute;s alejada de la puerta de entrada dentro del portal.</span></span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -15.9pt; margin-bottom: .0001pt; margin-left: -9.05pt; text-align: justify; text-indent: 36.0pt;">&nbsp;</p>'),
	(127, 60, 'LES CIGARRERES', '50', '<p>* <strong>NO TRANSFERIDA A VIPASA.</strong></p>\r\n<p>* <strong>SEGURO COMUNITARIO</strong>. VIGENTE CON MAPFRE.</p>\r\n<p>* <strong>NO TIENE COMPA&Ntilde;IA DE LIMPIEZA</strong>. Se encargan de la limpieza los inquilinos.&nbsp;</p>\r\n<p>**&nbsp;<span style="color: #ff0000;"><strong>PEQUE&Ntilde;OS TRABAJOS ELECTRICOS LLAMAR AL VECINO DEL 2&ordm;C JULIO 618.90.43.59 (20/11/2013 VIENE EL VECINO Y ASI SE LO INDICA A M&ordf; DE LOS ANGELES)</strong></span></p>'),
	(128, 6, 'LOCALES ECHEGARAY', '29', '<p><strong>21/10/2013.-&nbsp;</strong>RECIBIMOS LLAMADA TELEFONICA DE JULIO HONORIO INDICANDO QUE LE HA LLAMADO EL PTE. DEL PORTAL CONTIGUO AL LOCAL DE REPUESTOS X LA C/JUAN ALVAREZ GONZALEZ INDICANDO QUE ELLOS RECIBIERON LLAMADA DEL INQUILINO DEL LOCAL INFORMANDO QUE LES CAIA AGUA EN EL LOCAL X UNA BAJANTE Q TIENEN. LOS DEL PORTAL DE J.A.G.(calle Juan Alvarez Gonzalez) LLAMAN A SU SEGURO Y EL FONTANERO QUE FUE LES INDICO QUE ERA UN ATASCO DE UNA BAJANTE COMUNITARIA Y QUE&nbsp;<span style="color: #ff0000;"><strong>ESA BAJANTE ES COMPARTIDA POR LAS COCINAS TANTO DEL PORTAL ECHEGARAY 29 COMO DEL PORTAL JUAN ALVAREZ GONZALEZ.</strong>&nbsp;<span style="color: #000000;">EN ESTE CASO, EL FONTANERO DEL SEGURO DEL PORTAL J.A.G. LLAMO A LA CUBA PARA QUE REALIZARA EL DESTASCO. MANTENDRAN INFORMADO AL PTE. DE ECHEGARAY 29.</span></span></p>'),
