	(119, 14, 1, 6, 'B', 371, 369, 370, NULL, '10 SOTANO 2', '8 SOTANO 1', '<p>TELEFONO FACILITADO POR BELEN LA MUJER DE FERMIN VECINO DE LA CDAD. BELEN NO QUIERE QUE POR NINGUN CONCEPTO SE LE DIGA A PEDRO QUE TENEMOS SU TELEFONO GRACIAS A ELLA PUES LE TIENE UNA PLAZA DE GARAJE ALQUILADA Y NO LE GUSTARIA QUE SE LA QUITARAN POR FACILITARNOS EL TLFN.&nbsp;<strong><span style="background-color: #0000ff;">&nbsp;<span style="background-color: #00ccff;">TELEFONO DE PEDRO RUIZ</span></span></strong><span style="background-color: #0000ff;"><span style="background-color: #00ccff;"> 681.360.479</span></span><span style="background-color: #0000ff;"><span style="background-color: #00ccff;"><span style="background-color: #ffffff;"> POR SI SE NECESITA EN OTRA OCASION PUES LLAMO ISABEL EL 24/10/2013 TODA INDIGNADA Y DIJO QUE PAGARIA.</span></span></span></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 12 de noviembre de 2013 13:38<br /> <strong>Para:</strong> \'administrativo 2\'; \'Angeles\'<br /> <strong>Asunto:</strong> MOROSO CARMEN AMAYA 2</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">LLAMO LA MADRE (MARISA 985.149.252) Y EL PROPIETARIO PEDRO INDICANDO QUE HOY HAN INGRESADO //300,00//.-&euro; Y QUE EN DICIEMBRE PAGARA EL RESTO XQ AHORA NO TIENE DISPONIBILIDAD PARA ABONAR MAS. QUIERE SABER SI AUN ASI SE LE VA A LLEVAR A JUICIO O LE DAN MARGEN. QUEDE EN QUE LO COMENTARIA CON LA ADMO. Y SE INFORMARIA AL PTE. DE LA CDAD PARA QUE TOMARAN UNA DETERMINACION.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></strong><strong><span style="font-size: 10pt; font-family: Arial; background-color: #00ccff;">&nbsp;ME PUSE EN CONTACTO 13/11/13 CON LA MADRE DE PEDRO (MARISA) Y ME DIJO QUE HAR&Iacute;AN TODO LO POSIBLE POR &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;INGRESAR 100&euro; PARA ANULAR LA RECLAMACION.</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>', NULL),
