	(266, 21, 1, 4, 'A', 812, 810, 811, NULL, '', '', '<p>SE HA QUEJADO DEL HIJO DE MARIA AMADA EN REFERENCIA A QUE VIENE A ALTAS HORA DE LA MADRUGADA CANTANDO Y TIRANDO COSAS Y HACIENDO MUCHO RUIDO EN CASA, TAMBIEN MONTA FIESTAS Y DEMAS. HEMOS HABLADO CON LA HIJA DE MARIA AMADA VECINA DEL 2&ordm; A LE HEMOS INFORMANDO DE LA QUEJA HOY 06/11/2013 Y SE COMPROMETIO HABLAR CON EL HERMANO. A CONTINUACION PUSE EN CONOCIMIENTO LO TRAMITADO CON FRANCISCO Y EL IGUALMETE QUEDO EN COMENTARME CUALQUIER INCIDENCIA QUE SURJA.</p>', NULL),
	(267, 21, 1, 4, 'B', 815, 813, 814, NULL, '', '', '', NULL),
	(268, 21, 1, 4, 'C', 818, 816, 817, NULL, '', '', '', NULL),
	(269, 21, 1, 5, 'A', 821, 819, 820, NULL, '', '', '<p>HA PASADO 05/11/2013 EL VECINO DEL 1&ordm; MARIDO DE MAR INFORMANDO QUE EL HIJO DE ESTA SRA. LLEGA BORRACHO A ALTAS HORA DE LA MADRUGADA Y HACE UNOS RUIDOS TREMENDOS, E INSULTA TANTO A LA PERSONA QUE ESTA CON EL COMO CUANDO LOS VECINOS LES AVISAN QUE ESTA METIENDO MUCHO RUIDO. HOY 06/11/2013 ME HE PUESTO EN CONTACTO LA HIJA DE MARIA AMADA LE INFORMAMOS LO QUE SUCEDE Y QUEDO EN HABLAR CON EL HERMANO. SI PERSISTE EN SU ACTUACION ENVIAREMOS CARTA QUE YA PAZA TIENE UNA CONFECCIONADA.</p>', NULL),
