	(753, 53, 1, 8, 'K', 2294, 2292, 2293, NULL, '', '', '<p>* Se puede acceder al tejado desde su vivienda. 23/2/2011 vino a informar que NO DABA PERMISO PARA ACCEDER AL TEJADO desde su vivienda y que si quer&iacute;an que lo denunciaran. 9/5/2011 Parece ser que los vecinos le convencieron para que diera acceso al tejado desde su vivienda. Accedi&oacute; con la condici&oacute;n de que se le avisara con BASTANTE tiempo de antelaci&oacute;n y le dejaran la vivienda en perfecto estado y no con suciedad como ocurri&oacute; la &uacute;ltima vez. As&iacute; como que tuvieran cuidado con el velux, que la &uacute;ltima vez se lo rallaron. * Telf. anterior suscrito 678.643.576</p>\r\n<p><strong>**<span style="color: #ff0000;">EN JUNTA DE FECHA 03/10/2013 SE DETERMINA QUE "&nbsp;</span></strong><strong style="text-align: justify; text-indent: 35.25pt; font-size: 11px;"><span style="font-family: \'Palatino Linotype\';">2&ordm;- Presentaci&oacute;n y aprobaci&oacute;n de presupuestos para la colocaci&oacute;n de contadores individuales en los rellanos de cada planta, seg&uacute;n solicitud en Junta de fecha 20/05/2013. Aprobaci&oacute;n de derrama.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Se explica que los contadores se colocar&iacute;a en los rellanos en cada una de las tuber&iacute;a que entran hacia la vivienda con el fin de que cada vivienda pague seg&uacute;n los m3 que consuma, la propuesta m&aacute;s econ&oacute;mica para la colocaci&oacute;n de un contador por vivienda asciende a un total de 1.149,50&euro; que por vecino habr&iacute;a que aportar 45,98&euro; del total de vecinos que asisti&oacute; a </span>la Junta<span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;"> solo le interesaba al piso 5&ordm;K. Por lo que el planteamiento a los vecinos fue el siguiente &ldquo;<span style="color: #008000;"><strong>Autorizar al Vecino del 5&ordm; K Victor Rodr&iacute;guez Villabrille a la colocaci&oacute;n por su cuenta y coste del contador en el armario de la escalera. Aprobar lectura anual del mismo, as&iacute; como aprobar del cobro del Agua seg&uacute;n los m3 consumidos&rdquo;.</strong></span></span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="color: #008000;"><strong><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Por unanimidad de los asistentes se autoriza al vecino del 5&ordm; K a la colocaci&oacute;n del contador individual para su vivienda,</span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">&nbsp; </span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">siempre y cuando corra con los costes de colocaci&oacute;n y cualquier gasto futuro que pueda ocasionar el contador o sus elementos de enganche. Tambi&eacute;n est&aacute;n de acuerdo y as&iacute; lo autorizan para que en su caso se cobre el agua no por coeficiente sino seg&uacute;n los m3 consumidos, participando al igual que los dem&aacute;s vecinos en los t&eacute;rminos fijos de la facturaci&oacute;n."</span></strong></span></p>', NULL),
