	(986, 70, 1, 5, 'B', 2993, 2991, 2992, NULL, '', '', '<p>** En Junta de fecha 16 de Junio de 2011 dijo que si no quitaban los vecinos las motos de las zonas comunes que ella tiene una vespa que es de su padre y la tiene en su plaza de garaje ya que tuvo que alquilar plaza fuera de aqu&iacute; para su moto que si no la quitan que pone la vespa en el cuadrilatero.</p>\r\n<p>*** 28/10/2013.-&nbsp;<span style="font-size: 11px;">VECINA DEL 2&ordm;B A PRINCIPIOS A&Ntilde;O 2013 COLOCO UNA ANTENA EN TEJADO (AUTORIZACION DADA X EL PTE. Y LA CDAD)INDICADO EN JUNTA DE FECHA 10/10/2013. "</span><span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Se informa que la vecina del portal 42 &ndash; 2&ordm; B solicito a principios de a&ntilde;os autorizaci&oacute;n para colocaci&oacute;n de antena, siendo autorizada para la colocaci&oacute;n de la misma con t&eacute;cnico autorizado y aportando la documentaci&oacute;n necesaria para tener las garant&iacute;as de que los trabajos a realizar estaban siendo realizados por personas autorizadas por industria. Se deja constar en Acta por posibles da&ntilde;os o reparaciones para que conste que es de su cargo la reparaci&oacute;n y/o sustituci&oacute;n de la misma y los da&ntilde;os que pueda ocasionar."</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;">&nbsp;</p>', NULL),
