	(1113, 78, 1, 4, 'C', 3374, 3372, 3373, NULL, '', '', '<p>* PRESIDENTE, nombrada en Junta 15/5/2013</p>\r\n<p>* Piso Alquilado</p>\r\n<p>* Tuvo un siniestro con el BAJO, propietario 606.111.647. El propietario del Bajo pas&oacute; por la ADM por este tema, pero se le indic&oacute; que tiene que hablarlo con la propietaria, o en este caso, el inquilino. El 19/3/2012 vuelve el propietario del Local, se llama M&ordf; del Carmen, se le llama y hablan los dos predios y quedaron en verse en 1hora para hacer fotos y llamar al seguro. Se les vuelve a informar que el problema no es de caracter comunitario y que deben ponerse en contacto y de acuerdo entre ellos.</p>', 1),
