	(1142, 80, 1, 5, 'E', 3461, 3459, 3460, NULL, '', '', '<p>* COEFICIENTE 1,09600</p>\r\n<p>*&nbsp;<span style="font-family: \'Century Gothic\'; font-size: 10pt;">Se ha pasado M&ordf; Jose por la oficina y nos ha comentado que el piso est&aacute; a nombre de M&ordf; Belen Montes Rodriguez, que falleci&oacute; y el piso pas&oacute; a nombre de su madre Angeles Rodriguez Ortiz, la cual, es tia de M&ordf; Jose, y esta en una residencia de ancianos. Todo el tema de esta vivienda lo lleva M&ordf; Jose, ella recoge la correspondencia en Japon 14 y realiza los tramites que sean necesarios, con lo cual, para cualquier cosa llamarla a ella.</span></p>', NULL),
