	(1145, 80, 1, 6, 'B', 3470, 3468, 3469, NULL, '', '', '<p><span style="font-size: 10.0pt; font-family: \'Century Gothic\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">* COEFICIENTE 1,09600</span></p>', NULL),
	(1146, 80, 1, 6, 'C', 3473, 3471, 3472, NULL, '', '', '<p><span style="font-size: 10.0pt; font-family: \'Century Gothic\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">* COEFICIENTE 1,42400</span></p>\r\n<p><span style="font-size: 10.0pt; font-family: \'Century Gothic\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">* La cuota que paga de comunidad es mayor porque tiene dos plazas de garaje.</span></p>', NULL),
	(1147, 80, 1, 6, 'D', 3476, 3474, 3475, NULL, '29', '', '<p><span style="font-family: \'Century Gothic\'; font-size: 13px;">* COEFICIENTE 1,42400</span></p>\r\n<p><span style="font-family: \'Century Gothic\'; font-size: 13px;">* <strong>28/6/2011</strong> Ha llamado para informar que ha puesto un enchufe en su trastero -N&ordm;29 - y que a partir de esta fecha se le cargue el importe que se ha fijado para ello. Se llam&oacute; al presidente saliente -Luis 5&ordf; E- y no estuvo de acuerdo, que en 2006 hab&iacute;an denunciado a otro vecino que hab&iacute;a hecho lo mismo y tuvo, este vecino, que anularlo y pagar por ello. El vecino 3&ordm; D no dej&oacute; su telf para informarle.</span></p>\r\n<p><span style="font-family: \'Century Gothic\'; font-size: 13px;">* 5/7/2011 Llam&oacute; el vecino 3&ordm; D para informarse del tema, se le di&oacute; a conocer lo que nos hab&iacute;a dicho el presidente. Coment&oacute; que no sab&iacute;a nada de eso y que iba a llamar a HC para ver si pod&iacute;a conectar el enchufe y el trastero a su contador. Se le inform&oacute; que no pod&ntilde;ia hacer un cambio en la isntalaci&oacute;n el&eacute;ctrica sin antes pedir autorizaci&oacute;n a la comunidad. Dijo que nos llamar&iacute;a inform&aacute;ndonos sobre lo que le dijera HC. Aprovech&oacute; para preguntar porqu&eacute; su vecino - 3&ordm; C - que tiene el mismo coeficiente que &eacute;l, paga m&aacute;s de comunidad que &eacute;l, porque el entend&iacute;a que era porque ese vecino ten&iacute;a un enchufe en su trastero.</span></p>\r\n<p><span style="font-family: \'Century Gothic\'; font-size: 13px;">*6/7/2011 Nos hemos comunicado con el anterior administrador para que nos explique la raz&oacute;n de la diferencia de las cuotas de predios con mismo coeficientes. Nos comunica que es porque tienen dos plazas de garaje, en vez de una. Que no tiene que ver nada con tema de enchufes.</span></p>', NULL),
