	(1771, 106, 1, 7, 'A', 5348, 5346, 5347, NULL, 'SOT.1 - 22', 'SOT.1 PZ 02', '<p>* PISO ALQUILADO</p>\r\n<p>* <strong>CUOTA AGUA</strong>, corre por cuenta del inquilino. &nbsp;</p>\r\n<p>* HISTORIAL CUOTA AGUA:</p>\r\n<p>6/7/2011 (12hrs) vino la propietaria del piso y nos indic&oacute; que a partir de la fecha (inclu&iacute;do lo que se debe de agua exclusivamente a fecha de hoy ) se pase directamente al inquilino. Haci&eacute;ndole llegar carta a nombre de Milagro, tanto apropietaria como a inquilino. El tema del agua s&oacute;lo se le pasar&aacute; al inquilino, el resto se hace cargo la propietaria.&nbsp;</p>\r\n<p>12/7/2011 Llam&oacute;, enfadado, el inquilino avisando que cualquier gasto inclu&iacute;do el del agua se le remita a la propietaria. Y que ella se ponga en contacto con &eacute;l para pagar recibos. Que no le remitamos ninguna carta.</p>\r\n<p>21/7/2011 Pasa propietaria por la Administraci&oacute;n, hab&iacute;a hablado con el inquilino y quedaron en que se le remita la carta a EL (inquilino) con los gastos del agua, pero que se remita a nombre de MILAGROS (propietaria).</p>\r\n<p>&nbsp;</p>', NULL),
