	(1856, 112, 1, 6, 'G', 5603, 5601, 5602, NULL, '', '08', '<p>* PISO a nombre de HOTEL LA AZOTADA S.L. ( Jos&eacute; Cuervo Bello)</p>\r\n<p>* A partir de 4/5/2011 llam&oacute; Jos&eacute; para avisar que a partir de ese momento est&aacute;n ellos viviendo en San Mat&iacute;as.</p>\r\n<p>&nbsp; &nbsp;Anterior Segunda Direcci&oacute;n: HOTEL LA BORO&Ntilde;A/ HOTEL LA AZOTADA S.L., AS II, N&ordm;1602, Km.22,5, 33392 Porcey&oacute;, Gij&oacute;n</p>\r\n<p>* VICEPRESIDENTE, nombrado en Junta 25/7/2013</p>', 2),
