	(1858, 113, 1, 2, 'A', 5609, 5607, 5608, NULL, '11', '', '<p>* PRESIDENTE, nombrada en Junta 25/7/2012. Representa el cargo, la hija, Pilar Mor&aacute;n. Pilar, pas&oacute; varias veces a firmar libro actas, porque pensaba que su nombramiento era un tipo de venganza por un tema que tuvo con la comunidad de que les cobr&oacute; un arreglo.</p>\r\n<p>* PISO ALQUILADO.</p>\r\n<p>* <strong>ENV&Iacute;O&nbsp;AVISOS + CONVOCATORIAS</strong>. Enviarlos por e.mail y al telf. de Pilar, hija.</p>\r\n<p>* Ovidio Mor&aacute;n Guti&eacute;rrez, muri&oacute; en verano 2010, el piso qued&oacute; a nombre de su mujer, Isolina. Pilar Mor&aacute;n Llaneza es la hija de ambos.</p>\r\n<p>* ANTERIOR PROPIETARIO. Avelino Formoso Zapico.</p>\r\n<p>* En 2012, llam&oacute; para informar de que los inquilinos hab&iacute;an estado de vacaciones y cuando regresaron encontraron la casa llena de bichos -que pican. Quer&iacute;a saber si alg&uacute;n vecino m&aacute;s se hab&iacute;a quejado de lo mismo. Qued&oacute; en pasar ella por piso e informarnos.</p>', 1),
