INSERT INTO `siniestro` (`CN_SINIESTRO`, `CN_PORTAL`, `TE_NOMBRE`, `TE_OBSERVACIONES`, `CN_EMPRESA_COMUNIDAD`) VALUES
	(9, 72, 'SENSORES ', '<p>SE VA A PROBAR LA NUEVA EMPRESA INST.FASE SL</p>', 67),
	(10, 41, 'SUSTITUCION LUMINARIA', '<p><span style="color: #00ccff;"><strong><span style="background-color: #000000;">23/09/2013</span>&nbsp;</strong></span>&nbsp;Nos llama la inquilina de Aladino Riestra informando que falta una luminaria en el rellano de su planta. Q puso aviso en el tabl&oacute;n de anuncios ayer domingo y a&uacute;n hoy 23/09/2013 no se le hab&iacute;a sustituido. Quer&iacute;a saber qui&eacute;n las cambiaba. Le inform&eacute; que la limpiadora que se dar&iacute;a aviso y en 1 - 2 d&iacute;as la misma estar&iacute;a sustituida.</p>\r\n<p class="MsoNormal"><span style="color: black; font-family: Verdana; font-size: large;"><span style="font-size: 14pt; background-position: initial initial; background-repeat: initial initial;">Correo enviado a Xenia 23-09/2013//Nos llama la inquilina de Aladino Riestra informando que falta una luminaria en el rellano de su planta. Q puso aviso en el tabl&oacute;n de anuncios ayer domingo y a&uacute;n hoy 23/09/2013 no se le hab&iacute;a sustituido. Quer&iacute;a saber qui&eacute;n las cambiaba. Le inform&eacute; que la limpiadora que se dar&iacute;a aviso y en 1 - 2 d&iacute;as la misma estar&iacute;a sustituida.</span>&nbsp;Ya puestos en la Comunidad te agradecer&iacute;a que se revisara las luces del soportal ya que pase hace unos d&iacute;a y observ&eacute; que faltaban algunos downlight.</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><strong><strong><span style="font-family: Verdana; font-size: xx-small;"><span style="font-size: 7.5pt;">Mar&iacute;a Angeles Gonz&aacute;lez Guti&eacute;rrez</span></span></strong></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>', 74),
	(11, 19, 'REVISIÓN DEL GRUPO DE PRESION', '<p class="MsoNormal"><span style="color: #000000;"><span style="background-color: #3366ff;"><strong>24/09/2013&nbsp;</strong></span>&nbsp;&nbsp;&nbsp;</span>&nbsp;Grupo de Bombas de Presi&oacute;n // Me he puesto en contacto con los dos afectados Vanesa del 1&ordm; y Silvino del 5&ordm;, me comentan que todo bien en relaci&oacute;n a este Tema. &nbsp;Programo revis&oacute;n p<span style="font-size: 11px;">ara dentro de 6 meses que Eduardo pase por el Grupo de Presi&oacute;n y nos de una revisada al Calder&oacute;n u otros elementos que considere de importancia.</span></p>', 114),
	(14, 89, 'FILTRACIONES A TRAVES DE TEJADO', '<p>SE APERTURA SINIESTRO EN OUTLOOK ADJUNTADO EN PDF</p>', 119),
	(15, 89, 'SOLICITUD PARA MANTENIMIENTO HIDROFUGADO DEL TEJADO', '<p><span style="background-color: #00ff00;"><strong>24/09/2013.-</strong><strong><span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">LOS ULTIMOS TRABAJOS REALIZADOS SOBRE ESTA ACTUACION FUERON EJECUTADOS POR LA CONSTRUCTORA EN LA FECHA INDICADA. OUTLOOK</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">COMENTA LA VECINA DE CARMEN AMAYA 6 1&ordm;E (TRATA CON LA CONSTRUCTORA) QUE SERIA CONVENIENTE PARA NO TENER PROBLEMAS REALIZAR UN MANTENIMIENTO SOBRE DICHAS ACTUACIONES CADA +/- 3 &Oacute; 4 A&Ntilde;OS CON EL PRODUCTO "HIDROREPELL, HIDROFUGANTE EN FACHADAS, DISTRIBUIDOR CURESES (NORE&Ntilde;A)".</span></span></p>', 120),
	(16, 89, 'LIMPIEZA DE TEJADO', '<p><span style="background-color: #00ff00;"><strong>24/09/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE FIJA DE FORMA ANUAL UNA LIMPIEZA DE TEJADO (PARA QUITAR PLANTAS Y SUCIEDAD, YA QUE ESE TEJADO-TERRAZA ES DE PIEDRA). SE HABLA CON LA ADMO.DEL PORTAL 6 Y DA EL VISTO BUENO (ESTA MUY DE ACUERDO).</span></span></p>', 121),
	(17, 14, 'REVISON PORTON', '<p>06/09/2013.- REVISION PASADA EN EL DIA DE HOY X CIAPER. PARTE DE TRABAJO</p>\r\n<p>&nbsp;PTE. FACTURA DE CIAPER CORRESPONDIENTE A LA REVISION SEPT/2013</p>\r\n<p>&nbsp;</p>\r\n<p><span style="background-color: #00ff00;"><strong>SE PROGRAMA NUEVA REVISION PARA MARZO/2014 (CONSULTAR PRIMERO CON M&ordf; DE LOS ANGELES).</strong></span></p>', 152),
	(18, 37, 'NOTIFICACIONES, AVERIAS, AVISOS', '', 88),
	(19, 34, 'MANTENIMIENTO PORTON', '<p>REVISAR SEGUIMIENTO EN OUTLOOK.</p>\r\n<p>ANTERIOR EMPRESA DE MANTENIMIENTO Y/O CONTROL DEL PORTON (SIN CONTRATO) QUE SE ENCARGO A SU VEZ EN ENERO/2011 DEL CAMBIO INTEGRAL DEL PORTON (se cambio entero) X CHOQUE ERA ROPER 985.264.606 / 985.261.989 / roper@roper.es. SE MANTUVO EL MANTENIMIENTO CON ELLOS XQ ESE TRABAJO TENIA UNA GARANTIA DE DOS A&Ntilde;OS. Una vez cumplida dicha garant&iacute;a pasamos a trabajar el mantenimiento del porton con MONTERO.</p>', 201),
	(20, 55, 'RENOVACION DE LUMINARIA TIPO LED', '<p>EN JUNTA DE FECHA 17/09/2013 SE DETERMINA QUE:</p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">1&ordm;- Proponer y aprobar la colocaci&oacute;n de l&aacute;mparas de emergencias permanentes en rellanos y portal. Presentaci&oacute;n de propuestas y aprobaci&oacute;n de derrama.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">&nbsp;</span><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Despu&eacute;s de debatir el tema, se determina por unanimidad de los asistentes no colocar las l&aacute;mparas de emergencias, sino realizar colocaci&oacute;n de detectores de presencia empotrados en el falso techo, tipo Orbis, Mod Dicromat, independizando todas las plantas sus encendidos. Totalmente &nbsp;montado y conexionado.</span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><span style="font-size: 11.0pt; font-family: \'Palatino Linotype\';">&nbsp;</span><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style="font-family: \'Palatino Linotype\'; font-size: 11px;">El importe de los trabajos 452,50&euro; iva incluido, el aporte por vecino asciende a 27&euro;. Esta cuota &uacute;nica la cobrar&aacute; VIPASA, conjuntamente con la cuota de Comunidad del mes de Noviembre/13.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-right: -.8pt; text-align: justify;"><strong><span style="font-size: 12.0pt; font-family: \'Palatino Linotype\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: red; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">PAZ: ABRIR SINIESTRO EN PLATAFORMA ALGONZ, YA LE REMITI FAX CON LA APROBACI&Oacute;N A FASE. LA FECHA ESTIMADA PARA LA EJECUCION DE LOS TRABAJOS SEG&Uacute;N ME DIJO QUIQUE (FASE) SER&Iacute;AN ANTES DEL 11/10/2013</span></strong></p>', 218),
	(21, 99, 'ACTOS VANDALICOS (hundimiento de botoneras)', '<p><span style="background-color: #00ff00;"><strong>27/09/2013.-</strong><span style="background-color: #ffffff;">&nbsp;RECIBIMOS LLAMADA DEL PTE. DE LA COMUNIDAD, ANTONIO, Y NOS INDICA QUE SE HA PERCATADO QUE EN DOS PORTALES DE LA COMUNIDAD HAN HUNDIDO VARIOS BOTONES DE LAS VIVIENDAS. SE LE INDICA QUE PARA QUE LO CUBRA EL SEGURO HA DE PONER UNA DENUNCIA. NOS DICE QUE ESTA EN MIERES EN EL HOSPITAL CON UN FAMILIAR, QUE EL LUNES LA PONDRA.</span></span></p>\r\n<p><strong><span style="background-color: #00ff00;">30/09/2013.-&nbsp;</span></strong><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">&nbsp;NOS TRAE EL PTE. LA DENUNCIA (ADJUNTADA EN DOCUMTS Y DEJADA EN CAJETIN HASTA QUE SE CIERRE EL MISMO Y SE ADJUNTE) SE APERTURA SINIESTRO EN EL SEGURO SE LA COMUNIDAD.</span></span></p>', 231),
	(22, 14, 'PRESUPUESTOS INSPECCION BAJA TENSION GARAJE', '<p>SE SOLICITAN PRESUPUESTOS PARA LA INSPECCION DE BAJA TENSION DEL GARAJE. (PETICION M&ordf; DE LOS ANGELS 02/10/2013).</p>', 233),
	(23, 98, 'PRESUPUESTOS PINTURA PORTAL', '<p><span style="background-color: #00ff00;"><strong>02/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;M&ordf; DE LOS ANGELES SOLICITA PRESUPUESTOS DE PINTURA DEL PORTAL PARA EXPONER EN JUNTA DE FECHA 15/10/2013.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">&nbsp;</span></span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp;</span></span><span style="font-family: Arial; font-size: small;"><span style="font-size: 10pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></p>\r\n<p>&nbsp;</p>', 243),
	(24, 45, 'FILTRACIONES EN GARAJE', '<p>DESDE HACE UNOS MESES NOS HA INFORMADO ALFREDO QUE LE CAE AGUA A SU PLAZA DE GARAJE SE CREE QUE PUEDAN SER POR LA REJILLAS DE VENTILACION Y LA OTRA PREMISA QUE SE TIENE ES LA DE QUE SE HA DETERIORADO LA RELA ASFALTICA Y FILTRA POR LA MISMA. PASO A PRINCIPIOS DE SEPTIEMBRE ALFREDO Y SOLEDAD POR LA ADMINISTRACI&Oacute;N.</p>', 246),
	(25, 97, 'SUSTITUCION LUMINARIA', '<p>EN LA JUNTA REALIZADA EL 03/10/2013 NOS HAN COMUNICADO QUE HAY VARIAS LUMINARIAS FUNDIDAS. 1. APLIQUE ESCALERA SEGUN SE SUBE PARA LA PRIMERA PLANTA. 2. APLIQUE DE LA ESCALERA SEGUN SE SUBE PARA LA 2&ordm; PLANTA. 3. FOCO DEL TECHO PORTAL EL QUE ESTA JUSTO EN F<span style="font-size: 11px;">E</span><span style="font-size: 11px;">RENTE DEL ASCENSOR.</span></p>\r\n<p><strong><span style="background-color: #00ccff;">04/10/2013&nbsp;<span style="background-color: #ffffff;">&nbsp;HE LLAMADO A JULIO MORO PARA INFORMALE QUE HAY ESTAS LUMINARIA PENDIENTE DE REPONER.&nbsp;<span style="background-color: #ffff00;">TELF JULIO 639.005.970</span></span></span></strong></p>\r\n<p><span style="background-color: #33cccc;"><strong>08/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;SE DEJA NOTA A M&ordf; JOSE PARA QUE HOY CUANDO VAYA A LLEVAR EL ACTA VERIFIQUE SI LAS LUMINARIAS ESTAN REPUESTAS O NO.</span></span></p>', 247),
	(26, 27, 'ASCENSOR PARADO', '<p><span style="background-color: #00ff00;"><strong>07/10/2013(09:20H).-<span style="background-color: #ffffff;">&nbsp;</span></strong><span style="background-color: #ffffff;">RECIBIMOS LLAMADA DE VECINO DEL PORTAL C INDICANDO QUE EL ASCENSOR ESTA PARADO.</span></span></p>\r\n<p><span style="background-color: #00ff00;"><span style="background-color: #ffffff;">SE DA AVISO A EMBARBA</span></span></p>\r\n<p><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;">985.252.517 / 952.176.517 / 610.175.239 (M&oacute;vil de empresa Victor) /&nbsp;</span></p>\r\n<p><span style="background-color: #00ff00;"><strong><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;">07/10/2013(10:30H).-</span></strong><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A EMBARBA X TFN, NOTIFICADA AVERIA, SE PASAN CUANTO ANTES.</span></span></span></p>', 186),
	(27, 56, 'ASCENSORES', '<p><strong>07/10/2013.-&nbsp;</strong>DA AVISO VECINO ASCENSOR PARADO CON PERSONA ATRAPADA (MANUEL, CHICO EN SILLA DE RUEDAS), SE COMPRUEBA QUE EL ASCENSOR ESTA PARADO EN EL PORTAL CON LAS PUERTAS SEMI-ABIERTAS Y DESENCAJADAS, UN VECINO TRATA DE EMPUJARLAS PARA PODER SACAR A MANUEL, EMPUJA VARIAS VECES Y LOGRA QUE SE ABRAN, SE COMPRUEBA QUE&nbsp;<span style="background-color: #00ffff;"><strong>NO FUNCIONA NINGUN TFNO.</strong><span style="background-color: #ffffff;">&nbsp;NI EN EL ASCENSOR DEL 23 NI DEL 25, SE LLAMA AL TFN DE URGENCIAS (902....) &nbsp;Y SE INFORMA DEL TODO EL TEMA ASI COMO DE QUE NO HAY LINEA TELEFONICA.</span></span></p>\r\n<p><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">PRIMERA LLAMADA DESDE LA ADMINISTRACION AL N&ordm; DE URGENCIAS DEL ASCENSOR A LAS 19:30H. , A LAS 20:00H. NO HABIA APARECIDO NINGUN OPERARIO.....</span></span></p>\r\n<p><strong><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">08/10/2013(11:20H).-</span></span></strong><span style="background-color: #00ffff;"><span style="background-color: #ffffff;">&nbsp;SE LLAMA A OLGA DE TRESA Y SE LE INFORMA Y SOLICITA QUE VENGA UN TECNICO DE MANERA URGENTE A REVISAR ESE ASCENSOR Y COMPROBAR XQ NO HAY LINEA DE TFN EN NINGUNO DE LOS ASCENSORES, AYER EL CHICO INTENTANDO LLAMAR Y NADA DE NADA, SONABA UNA ALARMA........, DICE OLGA QUE INTENTARAN VENIR HOY, SE LE DICE QUE NADA DE INTENTAR, QUE NO HAY LINEA DE TFN Y ESO ES UN PROBLEMA MUY GRAVE SI ALGUIEN SE QUEDA ATRAPADO, NOS DICE QUE SINO PASAN X LA MA&Ntilde;ANA PASARAN X LA TARDE.</span></span></p>', 48),
	(28, 97, 'PULSADORES', '<p><strong><span style="background-color: #00ff00;">08/10/2013.-</span> EN JUNTA DE FECHA 02/10/2013 SE DETERMINA QUE&nbsp;</strong>PUNTO 3&ordm; RUEGOS Y PREGUNTAS, "SOLICITAN SE REPARE VARIOS PULSADORES DE MICRO QUE NO TIENEN PULSADOR, Y QUE SE APROVECHE Y SE LE SANEE YA QUE INTERMITENTEMENTE ALGUNOS VECINOS SE PERCATAN QUE EN OCASIONES EL TIMBRE NO HACE CONTACTO. EN JUNTA NOTIFICARON 1&ordm; PLANTA (ROCIO) Y 4&ordm; PLANTA (M&ordf; CARMEN).</p>\r\n<p>CORREO ENVIADO A TOMAS ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> martes, 08 de octubre de 2013 12:17<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> AVISO CIGARRERES 42</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Han solicitado los vecinos de la comunidad indicada CP Cigarreres 42,&nbsp; la reparaci&oacute;n y/o saneamiento de pulsadores en placa exterior de micros. En junta notificaron que no les hace contacto (no les funciona) los vecinos de 1&ordf; y 4&ordf; planta, pero parece ser que es generalizado. Por favor, pasarse por all&iacute; y solucionarlo, comprobarlo con los vecinos que se encuentren en las viviendas y sobre todo con el 1&ordm;B (Rocio) y 4&ordm;A (Carmen) que fueron las que iniciaron el aviso. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>', 267),
	(29, 12, 'LUZ EXTERIOR PORTAL (GLOBOS)', '<p><strong><span style="background-color: #00ff00;">08/10/2013.-</span> EN JUNTA DE FECHA 30/09/2013 INFORMAN QUE&nbsp;</strong>LOS GLOBOS DE LUZ QUE ESTAN SITOS A LA ENTRADA DEL PORTAL, SOPORTAL, PARED DE ENTRADA AL PORTAL, ESTAN ENCENDIDOS EN HORARIO DE MA&Ntilde;ANA. LOS VECINOS QUIEREN QUE SE DETERMINE DONDE SE CENTRALIZA EL ENCENDIDO DE LOS MISMOS Y CUAL ES EL INTERVALO HORARIO QUE TIENEN DE ENCENDIDO, YA QUE NO COINCIDE CON NINGUNO DE LOS OTROS DOS PORTALES E INSISTEN QUE X LAS MA&Ntilde;ANA ESTAN ENCENDIDOS.</p>\r\n<p>ENTERARSE BIEN DE TODO EL TEMA E INFORMAR A TRAV&Eacute;S DEL TABLON DE ANUNCIOS A LOS VECINOS.</p>\r\n<p>CORREO ENVIADO A TOMAS PARA QUEDAR CON &Eacute;L E IR ALL&Iacute; PARA VERIFICAR QUE OCURRE.</p>\r\n<p>&nbsp;</p>', 25),
	(30, 12, 'PINTURA Y ESCAYOLA 6ºA', '<p><strong>08/10/2013.- EN JUNTA DE FECHA 30/09/2013 SE DETERMINO QUE</strong>&nbsp;<span style="font-family: Verdana; font-size: 10pt; text-align: justify; text-indent: 35.4pt;">En referencia al tema de desperfectos en la escayola del piso 6&ordm; A, se ha determinado en Junta que se solicite presupuestos a dos reparadores para que le sea reparada la escayola a esta vecina, indicando la misma que no reclama pintura del techo ni de pared del sal&oacute;n. Se presentaran estas propuestas al Presidente para determinar con cual de los reparadores realizar los trabajos y as&iacute; liquidar este tema que ya se viene comentando en Junta desde 17/02/2012.</span></p>\r\n<p><span style="font-family: Verdana; font-size: 10pt; text-align: justify; text-indent: 35.4pt;">SEGUIMIENTO TOTAL ARCHIVADO EN DOCUMENTOS ADJUNTOS PDF</span></p>\r\n<p class="MsoNormal" style="margin-right: 5.2pt; text-align: justify; text-indent: 35.4pt;">&nbsp;</p>', 271),
	(31, 121, 'PUERTA DE ACCESO AL GARAJE SALIDA DE ASCENSOR BADAJOZ 26', '<p><strong>08/10/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE RESPONSABLE DE PORTAL, IVAN BADAJOZ 26 6&ordm;A 984.394.553, INDICANDO VARIOS TEMAS, (LUMINARIAS Y PUERTAS), TEMA DE PUERTAS CORRESPONDIENTE A LA SALIDA AL GARAJE DEL ASCENSOR POR EL PORTAL BADAJOZ 26, LA PUERTA CORTA FUEGOS TIENE EL MUELLE (RUEDA ROTO).</p>\r\n<p><strong>09/10/2013.-&nbsp;</strong>SE PASA CORREO A SYTEC PARA QUE PASEN A REVISAR DICHA PUERTA</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> mi&eacute;rcoles, 09 de octubre de 2013 11:36<br /> <strong>Para:</strong> \'Noelia Ortiz\'; \'Puri Campa\'<br /> <strong>Asunto:</strong> AVISO BADAJOZ 26 CP PRISMA</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de responsable de portal Iv&aacute;n c/Badajoz 26 6&ordm;A 984.394.553, indicando que la puerta de acceso al garaje, salida del ascensor por el portal Badajoz 26 no funciona, tiene la rueda de arriba (muelle) rota y desencajada de la puerta. Por favor, pasarse por all&iacute; y dejarlo solucionado. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>', 170),
	(32, 23, 'LUMINARIAS FUNDIDAS', '<p>1&ordm; AVISO A EMPRESA DE LIMPIEZA</p>', 168),
	(33, 121, 'LUMINARIAS FUNDIDAS', '<p>1&ordm; AVISO EMPRESA LIMPIEZA</p>', 168),
	(34, 122, 'PRESUPUESTOS DE MANTENIMIENTO JARDINES', '<p><strong>09/10/2013.-</strong> SOLICITAR PRESUPUESTOS PARA PRESENTAR EN JUNTA MANTENIMIENTO JARDINES.</p>', 305),
	(35, 53, 'COMPROBACION SI EL VECINO DEL 5ºK HA INSTALADO SU CONTADOR DE AGUA', '<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="background-color: #00ff00;"><strong><span style="font-family: \'Palatino Linotype\';">10/10/2013.-<span style="background-color: #ffffff;"> EN JUNTA DE FECHA 03/10/2013, SE DETERMINA QUE:</span></span></strong></span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><strong style="text-indent: 35.25pt; font-size: 11px;"><span style="font-family: \'Palatino Linotype\';">2&ordm;- Presentaci&oacute;n y aprobaci&oacute;n de presupuestos para la colocaci&oacute;n de contadores individuales en los rellanos de cada planta, seg&uacute;n solicitud en Junta de fecha 20/05/2013. Aprobaci&oacute;n de derrama.</span></strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Se explica que los contadores se colocar&iacute;a en los rellanos en cada una de las tuber&iacute;a que entran hacia la vivienda con el fin de que cada vivienda pague seg&uacute;n los m3 que consuma, la propuesta m&aacute;s econ&oacute;mica para la colocaci&oacute;n de un contador por vivienda asciende a un total de 1.149,50&euro; que por vecino habr&iacute;a que aportar 45,98&euro; del total de vecinos que asisti&oacute; a </span>la Junta<span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;"> solo le interesaba al piso 5&ordm;K. Por lo que el planteamiento a los vecinos fue el siguiente &ldquo;Autorizar al Vecino del 5&ordm; K Victor Rodr&iacute;guez Villabrille a la colocaci&oacute;n por su cuenta y coste del contador en el armario de la escalera. Aprobar lectura anual del mismo, as&iacute; como aprobar del cobro del Agua seg&uacute;n los m3 consumidos&rdquo;.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">Por unanimidad de los asistentes se autoriza al vecino del 5&ordm; K a la colocaci&oacute;n del contador individual para su vivienda,</span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">&nbsp; </span><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;">siempre y cuando corra con los costes de colocaci&oacute;n y cualquier gasto futuro que pueda ocasionar el contador o sus elementos de enganche. Tambi&eacute;n est&aacute;n de acuerdo y as&iacute; lo autorizan para que en su caso se cobre el agua no por coeficiente sino seg&uacute;n los m3 consumidos, participando al igual que los dem&aacute;s vecinos en los t&eacute;rminos fijos de la facturaci&oacute;n.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-family: \'Palatino Linotype\'; text-indent: 35.25pt; font-size: 11px;"><span style="color: #ff0000;"><strong>COMPROBAR SI EL VECINO HA HECHO LA INSTALACION DEL CONTADOR PARA TENER EN CUENTA E IR A REALIZAR LA LECTURA.</strong></span><br /></span></p>', 328),
	(36, 68, 'NOTIFICACIONES BOTONERAS ASCENSOR', '', 221),
	(37, 27, 'ASCENSOR CON PROBLEMAS', '<p>14/10/2013(12:55H).- RECIBIMOS LLAMADA DE VECINO 5&ordm;A INDICANDO QUE EL ASCENSOR VA MAL, NO SE ENCIENDE EL BOTON DE INTERIOR DE LUMINARIA, CUANDO SUBE Y BAJA PARA EN TODOS LOS PISOS, Y HACE UN RUIDO BASTANTE EXTRA&Ntilde;O.&nbsp;</p>', 186),
	(38, 105, 'GOTERA AGUA TECHO COCINA 3ºD', '<p><strong>14/10/2013.-&nbsp;</strong>VINO EL PROPIETARIO DEL 3&ordm;D PEDRO 619.499.534, INDICANDO QUE TIENE UNA HUMEDAD EN EL TECHO DE SU COCINA, JUSTO ENCIMA DEL FREGADERO QUE INCLUSO HA CAUSADO UN AGUJERO EN EL MISMO X DONDE CAE EL AGUA, ES UN GOTEO.</p>\r\n<p>SEGURO DE LA COMUNIDAD CON BAJANTES PRIVATIVAS Y COMUNES. SE APERTURA SINIESTRO EN EL MISMO.</p>', 261),
	(39, 90, 'REJILLAS DESAGÜE ENTRADA GARAJE', '<p><strong>10/10/2013.-&nbsp;</strong>LA EMPRESA DE LIMPIEZA (L.LOZANO) NOS HA DADO AVISO A TRAVES DE CORREO ELECTRONICO QUE LAS REJILLAS DE ENTRADA AL GARAJE (DESAG&Uuml;E) ESTAN LLENAS DE HOJAS Y SUCIEDAD, PERO QUE NO PUEDEN LIMPIARLO XQ ESTAN ATORNILLADAS Y ES IMPOSIBLE.</p>', 533),
	(40, 12, 'TIMBRES FUNDIDOS', '<p><strong><span style="background-color: #ff00ff;">15/10/2013(13:15H).-</span>&nbsp;</strong>RECIBIMOS LLAMADA DE LA VECINA DEL 1&ordm;A CRISTINA 658.575.654 / 984.047.610, INDICANDO QUE NO LE FUNCIONA EL TIMBRE DESDE EL SABADO APROX., QUE NO DIJO NADA ANTES XQ PENSO QUE ERA PROBLEMA SUYO, PERO QUE SE ENCONTRO CON UNA VECINA DEL 6&ordm; QUE LE DIJO LO MISMO. SE LE INDICA QUE SE DARA AVISO AL PTE. PARA QUE INTERPONGA LA CORRESPONDIENTE DENUNCIA Y ASI PODER GESTIONARLO A TRAVES DEL SEGURO, NOS DICE QUE OK.</p>\r\n<p><span style="background-color: #ff00ff;"><strong>15/10/2013(18:00H).-</strong><span style="background-color: #ffffff;">&nbsp;SE LLAMA AL PTE. PARA INDICARLE DE LO DICHO X LA VECINA DEL 1&ordm;A Y NOS DICE QUE &Eacute;L ES LA PRIMERA NOTICIA QUE TIENE, QUE &Eacute;L VIVE SOLO Y NO SE TOCA AL TIMBRE, QUE LO COMPROBARA Y CON LO QUE SEA, VERA SI PROCEDE A PONER LA DENUNCIA.</span></span></p>', 28),
	(41, 53, 'RECLAMACION LIMPIEZA', '<p><strong>EN JUNTA DE FECHA 03/10/2013, APARTADO RUEGOS Y PREGUNTAS INDICAN QUE:</strong></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;"><span style="font-size: 9.0pt; font-family: \'Palatino Linotype\';">Se le dar&aacute; un toque de atenci&oacute;n a la limpiadora, posterior a la Junta he hablado con la encargada de limpiezas Loan y me confirma que la empleado habitual que tiene la Comunidad tom&oacute; vacaciones del 13/09/2013 al 30/09/2013 por lo que es probable que est&aacute; dejadez se hubiera producido durante el periodo de vacaciones de la empleada. El Presidente de la Comunidad si observa dejadez de la empresa que lo notifique a la Administraci&oacute;n para que asignen otro personal para el desempe&ntilde;o de los servicios contratados.</span></p>\r\n<p class="MsoNormal" style="margin-right: -30.8pt; text-align: justify; text-indent: 35.25pt;">&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: 0cm; margin-right: -30.8pt;">\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.25pt; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; font-family: \'Palatino Linotype\'; color: red;">PAZ: ESTO YA LO COMENTE CON ROSA DE LIMPIEZAS LOAN SI QUIERES ABRIR SINIESTRO O TAMBIEN SE PUEDE ESPERAR A VER EN QUE QUEDA EL ASUNTO PUES ME PARECE QUE PUDO SER EN EL PERIODO DE VACIONES DE LA LIMPIADORA HABITUAL.</span></strong></p>\r\n</div>', 272),
	(42, 94, 'LUMINARIAS', '<p><strong>EN JUNTA DE FECHA 07/10/2013 SE DETERMINA QUE:</strong></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-size: 9.0pt; line-height: 150%; font-family: Verdana;">3&ordm; - Ruegos y Preguntas</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Con la finalidad de ahorrar energ&iacute;a el&eacute;ctrica se determina por todos los asistentes en eliminar el encendido de algunas bombillas del portal y de los rellanos de las escaleras. En el portal se eliminaran dos una cerca de la puerta de la vivienda letra B y la mas alejada seg&uacute;n se entra al portal a la izquierda. En los rellanos se dejar&aacute; &uacute;nicamente para que encienda la que esta sito enfrente de los ascensores. Tambi&eacute;n se determino disminuir a 30 segundos el encendido de las plantas ya que est&aacute;n agrupadas de dos en dos y al pulsar cualquier vecino se encienden 6 bombillas, de esta forma solo se encender&aacute;n dos. Tambi&eacute;n es este mismo tema se aprueba por todos los asistentes colocar un sensor crepuscular/movimiento en el portal&nbsp; para que en el d&iacute;a no se enciendan las bombillas del portal ya que el portal es lo suficientemente luminoso y no ven la necesidad que tienen algunos vecinos en encender para entrar y salir del mismo durante el d&iacute;a. El predio del mismos asciende a +/- 70&euro; m&aacute;s el IVA. </span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: -12.0pt; margin-right: -12.8pt;">\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">&nbsp;</span></strong><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">PAZ: TE DEJO CROQUIS DE LAS BOMBILLAS QUE SE QUIEREN ANULAR QUE SE LLEVE UNA COPIA JULIO MORO Y QUE LO PEGUE EN EL CUARTO DE CONTADORES PARA CUANDO TENGAN QUE CAMBIAR BOMBILLAS NO SE LES PASE Y NOS LA CAMBIEN TODAS PENSANDO QUE LAS ANULADAS ESTAN FUNDIDAS, SCANEA EN PLATAFORMA ALGONZ PARA QUE NO SE NOS OLVIDE A NOSOTROS DILE A JULIO QUE NOS QUITE LAS QUE SE ANULAN O QUE LAS DEJE SI ENRROSCAR TOTALMENTE. </span></strong><strong><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">LUEGO EN CUENTO AL DETECTOR QUE QUIEREN COLOCAR LLAMA A FASE PARA QUE LE COLOQUE UNO EN EL PORTAL UNICAMENTE (INDIVIDUALIZAR PORTAL Y COLOCAR DETECTOR). ES DECIR QUE LAS PLANTAS QUEDAN TAL CUAL ENCENDIENDO DE DOS EN DOS, LES DICES A LOS DE FASE QUE TE AJUSTEN LOS ENCENDIDOS DE LOS RELLANOS A 30 SEGUNDOS.</span></strong></p>\r\n</div>', 155),
	(43, 94, 'COLOCACION DE SENSOR Y AJUSTE DE ILUMINACION', '<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-size: 9.0pt; line-height: 150%; font-family: Verdana;">3&ordm; - Ruegos y Preguntas</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Con la finalidad de ahorrar energ&iacute;a el&eacute;ctrica se determina por todos los asistentes en eliminar el encendido de algunas bombillas del portal y de los rellanos de las escaleras. En el portal se eliminaran dos una cerca de la puerta de la vivienda letra B y la mas alejada seg&uacute;n se entra al portal a la izquierda. En los rellanos se dejar&aacute; &uacute;nicamente para que encienda la que esta sito enfrente de los ascensores. Tambi&eacute;n se determino disminuir a 30 segundos el encendido de las plantas ya que est&aacute;n agrupadas de dos en dos y al pulsar cualquier vecino se encienden 6 bombillas, de esta forma solo se encender&aacute;n dos. Tambi&eacute;n es este mismo tema se aprueba por todos los asistentes colocar un sensor crepuscular/movimiento en el portal&nbsp; para que en el d&iacute;a no se enciendan las bombillas del portal ya que el portal es lo suficientemente luminoso y no ven la necesidad que tienen algunos vecinos en encender para entrar y salir del mismo durante el d&iacute;a. El predio del mismos asciende a +/- 70&euro; m&aacute;s el IVA. </span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: -12.8pt; margin-bottom: .0001pt; margin-left: -12.0pt; text-align: justify;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: -12.0pt; margin-right: -12.8pt;">\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">&nbsp;</span></strong><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">PAZ: T</span></strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;"><span style="color: #000000;">E DEJO CROQUIS DE LAS BOMBILLAS QUE SE QUIEREN ANULAR QUE SE LLEVE UNA COPIA JULIO MORO Y QUE LO PEGUE EN EL CUARTO DE CONTADORES PARA CUANDO TENGAN QUE CAMBIAR BOMBILLAS NO SE LES PASE Y NOS</span> </span><strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">L</span></strong><span style="font-size: 9.0pt; font-family: Verdana; color: red;">A CAMBIEN TODAS</span><span style="font-size: 9.0pt; font-family: Verdana; color: red;"> P<span style="color: #000000;">ENSANDO QUE LAS ANULADAS ESTAN FUNDIDAS, SCANEA EN PLATAFORMA ALGONZ PARA QUE NO SE NOS OLVIDE A NOSOTROS DILE A JULIO QUE NOS QUITE LAS QUE SE ANULAN O QUE LAS DEJE SI ENRROSCAR TOTALMENTE.</span> </span><strong><span style="font-size: 9.0pt; font-family: Verdana; color: blue;">LUEGO EN CUENTO AL DETECTOR QUE QUIEREN COLOCAR LLAMA A FASE PARA QUE LE COLOQUE UNO EN EL PORTAL UNICAMENTE (INDIVIDUALIZAR PORTAL Y COLOCAR DETECTOR). ES DECIR QUE LAS PLANTAS QUEDAN TAL CUAL ENCENDIENDO DE DOS EN DOS, LES DICES A LOS DE FASE QUE TE AJUSTEN LOS ENCENDIDOS DE LOS RELLANOS A 30 SEGUNDOS.</span></strong></p>\r\n</div>', 564),
	(44, 124, 'PULSADORES', '<p><strong>16/10/2013.-&nbsp;</strong>VIENE X LA ADMINISTRACION VECINO DE LA COMUNIDAD (CUBANO) INDICANDO QUE EL PULSADOR QUE ESTA AL LADO DEL ASCENSOR DE LA PLANTA BAJA ESTA ROTO, QUEDA CONECTADO TODO EL TIEMPO, ES DECIR, CUANDO LO PULSAN PARA LA LUZ, QUEDA LA MISMA ENCENDIDA HASTA QUE VUELVEN A PULSARLO.</p>\r\n<p>SE MANDA A ELECTRICISTA PARA QUE LO SOLUCIONE.</p>\r\n<p><strong>17/10/2013.-</strong> CORREO ENVIADO A ITELCO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 10.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 10.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> jueves, 17 de octubre de 2013 12:58<br /> <strong>Para:</strong> \'Itelco\'<br /> <strong>Asunto:</strong> CP CIGARRERES 54</span></p>\r\n<p class="MsoNormal">&nbsp;<span style="font-size: 10.0pt; font-family: Arial;">Buenos d&iacute;as.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hemos recibido aviso de vecino de la comunidad indicando que el pulsador sito al lado del ascensor en el portal CP Cigarreres 54, cuando se pulsa queda encajado todo el tiempo, hay que volver a pulsar para que desencaje, esto acarrea que las luces esten continuamente encendidas, ya que nadie se percata que tiene que volver a pulsar. Por favor, pasarse por all&iacute; y solucionarlo. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 10.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 10.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 10.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>', 569),
	(45, 66, 'LUMINARIAS', '<p><strong>16/10/2013.-&nbsp;</strong>AVISO DADO X JOSE A.PADUANO</p>', 395),
	(46, 95, 'RECLAMACION LIMPIEZA', '<p><strong>18/10/2013.-&nbsp;</strong>VINO LA PROPIETARIA DEL LOCAL CAF.LA ESTACION INDICANDO UNA QUEJA/RECLAMACION SOBRE EL SERVICIO DE LIMPIEZA, YA QUE PINTARON LA FACHADA XQ VAN A ALQUILAR NUEVAMENTE EL LOCAL Y LA EMPRESA DE LIMPIEZA QUE ESTABA REALIZANDO LOS TRABAJOS DE LIMPIEZA DE EXTERIORES, CON LA GOMA DEL AGUA DE ROZAR, LE ESCACHO TODAS LAS ESQUINAS Y SE LAS MANCHO, ASI COMO LA SALPICADURA DE LAS CRISTALERAS. SE LE INDICA QUE PASAREMOS NOTA A LA EMPRESA DE LIMPIEZA.</p>\r\n<p>CORREO ENVIADO A XENIA</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 18 de octubre de 2013 18:13<br /> <strong>Para:</strong> \'Xenia\'<br /> <strong>Asunto:</strong> RECLAMACION PROPIETARIO LOCAL VELAZQUEZ 20 ESQ.BADAJOZ -CAFETERIA LA ESTACION-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes Xenia.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hoy ha venido la propietaria del local de la cafeter&iacute;a La Estaci&oacute;n para reclamar los da&ntilde;os que le ha causado en las esquinas de la fachada la goma del agua que se utiliza para limpiar los soportales, parece ser que acababan de arreglar y pintar la fachada, y la goma dejo todas las esquinas picadas y con manchas, as&iacute; como las cristaleras del local salpicadas de agua. Por favor, a la hora de la limpieza de exteriores, extremar los cuidados en esta zona, ya que ahora estos peque&ntilde;os arreglos suponen un gasto para la comunidad que hay que justificar ante los representantes de la misma, que lo miran al dedillo. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">Asesor&iacute;a Algonz</span></p>', 168),
	(47, 52, 'LUMINARIAS FUNDIDAS', '<p><strong>18/10/2013.-&nbsp;</strong>RECIBIMOS LLAMADA DE LA VECINA V.22 2&ordm;G INDICANDO QUE LA LUZ DEL RELLANO DE SU DESCANSILLO ESTA FUNDIDA DESDE HACE DIAS.</p>\r\n<p>* SE PASA CORREO A XENIA PARA QUE LA CAMBIE Y SINO QUE DE AVISO A LA ADMINISTRACION. CORREO ENVIADO</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Tahoma;">De:</span></strong><span style="font-size: 8.0pt; font-family: Tahoma;"> Algonz.Paz [mailto:administrativo@algonz.es] <br /> <strong>Enviado el:</strong> viernes, 18 de octubre de 2013 18:40<br /> <strong>Para:</strong> \'Xenia\'<br /> <strong>Asunto:</strong> CP EUROPA VELAZQUEZ 22 </span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">Buenas tardes Xenia.-</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Nos ha dado aviso la propietaria de Velazquez 22 2&ordm;G indicando que el descansillo de su planta tiene la luminaria fundida desde hace tiempo&hellip;, por favor, pasarse por all&iacute;, reponerla y&nbsp; si fuera problema de tipo electrico dar aviso en la administraci&oacute;n para enviar al tecnico. Si pudiera ser lo m&aacute;s r&aacute;pido posible, ya que la propietaria est&aacute; un poquito enfadada. Gracias.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><span style="font-size: 8.0pt; font-family: Arial;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Un saludo</span></p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial;">&nbsp;</span><strong style="font-size: 11px;"><span style="font-size: 8.0pt; font-family: Arial;">Paz Ortiz</span></strong></p>', 503),
	(48, 43, 'TIMBRES', '<p><strong>16/10/2013.-&nbsp;</strong>AVISO PROPIETARIA ALAVA 50 4&ordm;A NATIVIDAD, TIMBRE NO LE FUNCIONA...A VECES...</p>', 590),
	(49, 12, 'INCIDENCIAS ELECTRICAS', '<p><strong>16/10/2013.-&nbsp;</strong>VINO ATILANO EL PTE. DE LA COMUNIDAD INDICANDO QUE CUANDO TENGA QUE IR EL ELECTRICISTA A REALIZAR CUALQUIER TRABAJO A LA COMUNIDAD SE APROVECHE LA SALIDA Y CAMBIE LA EMERGENCIA DE LA CUARTA PLANTA Y ARREGLE EL PULSADOR &nbsp;DE LA ZONA DE LOS TRASTEROS,</p>', 25),
	(50, 12, 'SEÑAL ANTENA TV (TDT)', '<p>21/10/2013.- AVISO DE VECINOS PERDIDA DE CANALES TV TDT,</p>', 25),
	(51, 110, 'SEÑAL ANTENA TV (TDT)', '<p><strong>21/10/2013.-&nbsp;</strong>RECIBIMOS LLAMADA EL VIERNES TARDE (a ultima hora)18/10/2013 DE BAJO D MANUELA 636.869.910, INDICANDO QUE NO VE LA TV (TDT), QUE NO VE NINGUN CANAL (no entiende absolutamente nada de lo que se le dice....es como hablar con una pared).</p>\r\n<p>SE DA AVISO A ITELCO</p>', 461),
	(52, 91, 'PUERTA PEATONAL GARAJE', '<p><strong>21/10/2013.-&nbsp;</strong> NOS DA AVISO EL PROPIETARIO DE LA PLAZA N&ordm; 30, INDICANDO QUE EL BOMBIN DE LA PUERTA PEATONAL DE ACCESO AL GARAJE ESTA SUELTA Y ESTROPEADA</p>\r\n<p>SE ENVIA CORREO A RABA (AMAESTRAMIENTO) PARA QUE SE PASEN</p>\r\n<p class="MsoNormal"><strong><span style="font-size: 9.0pt; font-family: Tahoma;">&nbsp;</span></strong></p>', 430),
