	(57, 14, 'TENSOR SOMBRERETE EOLICO TEJADO', '<p>EN JUNTA DE FECHA 14/10/2013 SE DETERMINA FIJAR TENSOR DE SOMBRERETE SUELTO.</p>', 592),
	(58, 14, 'PUERTA PORTAL', '<p><strong>EN JUNTA DE FECHA 14/10/2013 SE DETERMINA RECLAMAR DA&Ntilde;OS X EL SEGURO.</strong></p>', 153),
	(59, 118, 'SUELO DESCANSILLOS Y/O ESCALERAS', '<p><strong>25/10/2013.-</strong>VARIOS VECINOS CUANDO SE ESTA ARREGLANDO EL PORTAL LE INDICAN AL CONTRATISTA QUE REALIZA LOS TRABAJOS QUE PODIA ARREGLAR LO QUE ESTA MAL EN LOS DESCANSILLOS. SE HABLA CON EL PTE. Y NOS DICE QUE ESO ES PARA TRATAR EN OTRA JUNTA, QUE HAY MUCHAS PLANTAS AFECTADAS (EL EDIFICIO TIENE SUS A&Ntilde;OS.....) Y HABRIA QUE PEDIR PRESUPUESTOS.</p>', 594),
	(60, 13, 'PUERTA PORTAL', '<p><span style="background-color: #00ff00;"><strong>28/10/2013.-</strong><span style="background-color: #ffffff;">&nbsp;CORREO RECIBIDO DE GERARDO ROBLES CON FOTOGRAFIA INCLUIDA.</span></span></p>', 31),
