	(66, 71, 'MOTOS APARCADAS EN ZONAS COMUNES GARAJE', '<p><strong>28/10/2013.- EN JUNTA DE FECHA 10/10/2013 SE DETERMINA QUE "&nbsp;</strong><span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Por &uacute;ltimo pero no menos importante se ha vuelto a tratar el tema de las motos colocadas en las zonas comunes del garaje. Se ha informado recurrentemente que los estatutos de la comunidad indican que dichas zonas deben ser utilizada como zona de paso y/o maniobra de veh&iacute;culos, se ha realizado una Junta Extraordinaria &uacute;nica y exclusivamente para tratar ese Tema y no ha habido asistencia suficiente para tomar una determinaci&oacute;n en cuanto a las propuestas ofrecidas (alquiler, cierre etc). En cuanto a la moto colocada en el lateral del portal 40, la propietaria informa que si los dem&aacute;s vecinos retiran las motos de las zonas de paso y/o maniobra ella tambi&eacute;n lo har&iacute;a. En cuanto a este tema se acuerda por todos los presentes dar de plazo de un mes a los vecinos usuarios de estas zonas para sacar las motos y conseguir donde guardarlas, de permanecer las motos aparcadas en las zonas de paso y maniobra para el 1 de Diciembre de 2013, se autoriza al Presidente de </span>la Comunidad<span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;"> para interponer una denuncia en los Juzgados donde solicite la retirada de la moto &oacute; motos que est&eacute;n aparcadas en dichas zonas.</span><span style="font-size: 9pt; text-align: justify; text-indent: 35.4pt;">&nbsp;&nbsp;</span></p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt;">\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 9.0pt; color: blue;">PAZ: PROGRAMA PARA QUE VENZA A FINALES DE NOVIEMBRE ESTA TAREA. MIENTRAS &nbsp;1. HAY QUE TOMAR FOTOS DE LAS MOTOS QUE ESTAN APARCADAS Y ANOTAR MATRICULA 2. CON LAS MATRICULAS DE ESAS MOTOS HAY QUE SACAR EN TRAFICO UNA NOTA SIMPLE PARA SABER A QUIEN PERTENECEN Y CUANDO ESTE A PUNTO DE VENCER EL PLAZO ENVIARLES UN BUROFAX PARA QUE QUEDE FEHACIENTEMENTE ENTERADO.</span></strong></p>\r\n</div>', 597),
	(67, 99, 'LLAVE CONTADORES HC', '<p>SOLICITADO X PROPIETARIO EN JUNTA DE FECHA 10/10/2013.</p>', 598),
	(68, 99, 'APERTURA Y CIERRE PISCINA', '<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial; background: lime; mso-highlight: lime;">Inicio de temporada 1 de Junio de c/a&ntilde;o y finalizaci&oacute;n de la temporada de piscina el 30 de Septiembre de c/a&ntilde;o</span></strong><strong><span style="text-decoration: underline;"><span style="font-size: 8.0pt; font-family: Arial;">. Se puede utilizar hasta mediados de Septiembre.</span></span></strong></p>\r\n<p class="MsoNormal"><strong>EN JUNTA DE FECHA 10/10/2013 SE HABLA Y&nbsp;</strong>M&ordf; DE LOS ANGELES HACE LA ANOTACION CORRESPONDIENTE.</p>\r\n<p class="MsoNormal">&nbsp;</p>', 599),
	(69, 83, 'LIMPIEZA ANUAL', '<p class="MsoNormal"><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;">LA LIMPIEZA SE</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;"> REALIZO</span></strong><strong><span style="font-size: 11.0pt; font-family: Arial; background: yellow; mso-highlight: yellow;"> EN ABRIL/2013</span></strong></p>\r\n<p class="MsoNormal"><strong><span style="font-size: 8.0pt; font-family: Arial;">18/04/2013.- EN LA ULTIMA JUNTA REALIZADA SE FIJO QUE SE LIMPIARIA UNA VEZ AL A&Ntilde;O, REALIZANDO DICHA LIMPIEZA LIMPIEZAS ASTUR (MAIKA-LUPE), Y QUEDANDO EN SUMINISTRAR EL AGUA DE LA SIGUIENTE MANERA: (CORREO ENVIADO A L.ASTUR)</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 8.0pt; font-family: Arial; mso-fareast-language: ES;">Hoy se ha puesto en contacto conmigo el Presidente de la CP Eulalia del Llano y Noriega 2, &nbsp;&nbsp;Manuel Param&aacute; Blanco 4&ordm; Izda. 692.65.39.91 el os va dejar el agua para proceder a la limpieza del patio. Me coment&oacute; que para el 29/04/2013 se marcha para Galicia por 10 d&iacute;as para que lo teng&aacute;is en cuenta. Se lo comentas a Lupe que estaba pendiente de que nosotros se lo informaramos.</span></p>\r\n<p class="MsoNormal">&nbsp;</p>', 417),
