	(101, 54, 'ROTURA DE CRISTALES EN VELUX 6ºA - 6ºC', '<p>EN JUNTA DE FECHA 31/07/2013 SE TRATA "<span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;">Solicitan se pidan presupuestos para la limpieza del tejado, ya que hace unos a&ntilde;os que no se revisa e informan que hay gaviotas y puede est&aacute; sucio. Se autoriza pedir al menos dos propuestas y valorarlas con el Presidente para determinar la ejecuci&oacute;n de </span>la obra. En<span style="font-family: Verdana; font-size: 9pt; text-align: justify; text-indent: 35.4pt;"><span style="color: #ff0000;"><strong> este mismo tema las vecinas del piso 6&ordm; A y 6&ordm; C indican que tienen los cristales rotos del velux, solicitan que se de parte al seguro por si en el mismo tienen cobertura,</strong></span> se determina primero realizar la obra de limpieza del tejado y luego dar parte al seguro siempre aprovechando una mala inclemencia del tiempo.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 35.4pt;"><span style="font-size: 9.0pt; font-family: Verdana;">&nbsp;</span></p>', 167),
	(102, 101, 'PUERTA CERRADURAS', '<p><strong>07/11/2013.-&nbsp;</strong>LLAMO EL PTE. LLAVE ATASCADA EN PTA.ACCESO A TRASTEROS.</p>\r\n<p><strong>11/11/2013.-&nbsp;</strong>LLAMO VECINO 2&ordm;A PTA.PORTAL NO CIERRA.</p>', 351),
	(103, 130, 'GOTERAS EN PLAZAS DE GARAJE', '', 86),
	(104, 118, 'PROPUESTAS SEGURO COMUNIDAD', '<p>EN JUNTA 18/07/2013 SE ACORDO SOLICITAR VARIAS PROPUETAS PARA PONDERAR EN UNA SIGUIENTE JUNTA LA RENOVACION/O CANCELACION DE LA POLIZA. ACTUALMENTE ESTA CON MAPFRE Y VENCE EL 13/07/2014.</p>\r\n<p>POLIZA N&ordm; 076-0880246215</p>', 594),
	(105, 118, 'PRESUPUESTOS ELECTRICIDAD', '<p><strong>En Junta 18 de julio de 2013 se acord&oacute;:</strong></p>\r\n<p><span style="font-size: 10.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">"<span style="background-color: #ffff99;">Para una siguiente Junta requieren que se solicite propuestas para la renovaci&oacute;n de los pulsadores ya que observa piso 6&ordm; F que los del 3&ordm;,&nbsp; 4&ordm;, y 5&ordm;&nbsp; en ocasiones est&aacute;n las luces permanentes y es por que queda atascado alg&uacute;n interruptor. Tambi&eacute;n quieren que una vez puesto con el tema el&eacute;ctrico se mire la posibilidad de independizar las escaleras de los rellanos. "</span></span></p>\r\n<p><span style="font-size: 10pt; font-family: Verdana; background-color: #ffffff;">Se solicitaran presupuestos a Matilla, Itelco, Fase y Ruben</span></p>', 594),
	(106, 66, 'PRESUPUESTOS MANTENIMIENTO ASCENSORES', '<p>SOLICITAR PRESUPUESTOS A IMEN-TRESA-OTIS-CANTABRICO, VENCEN PARA EL 31/12/13.</p>', 616),
	(107, 118, 'DAÑOS EN PATIO (VARIOS)', '<p><strong>RECIBIMOS AVISO DE PROPIETARIOS INDICANDO QUE SE HAN PRODUCIDO ACTOS VANDALICOS CAUSANDO DA&Ntilde;OS A LA COMUNIDAD.</strong></p>', 316),
	(108, 130, 'MOTOS APARCADAS DEBAJO RAMPA GARAJE - ZONA COMUN', '<p class="MsoNormal" style="margin-left: 71.25pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 71.25pt;"><!--[if !supportLists]--><span style="font-size: 10.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style="font-size: 9.0pt; font-family: Verdana;">Motos aparcadas en hueco debajo rampa garaje.</span></strong><span style="font-size: 8.0pt; font-family: Verdana;">En cuanto a este Tema en una de las primera Juntas se aprob&oacute; que se utilizara este hueco por propietarios que tengan motos, ya en la anterior Junta hubo quejas de que un vecino tiene aparcada m&aacute;s de una moto dentro de ese hueco impidiendo que otro vecino haga uso de ese espacio. Al haber mas usuarios que espacio en principio se requiere que cada propietario de piso haga uso de un solo espacio para dar facilidad a otros y puedan aparcar. De todas maneras requieren la mayor&iacute;a de los presentes en esta Junta que se lleve el Tema a la siguiente Junta y se trate de manera detallada, con el fin de tambi&eacute;n tener identificados los usuarios de esos espacios no vayan a estar utilizados por personas ajenas a la Comunidad. En este punto tambi&eacute;n requieren que se les informe de las coberturas de la p&oacute;liza comunitaria ante un siniestro de incendi&oacute; o robo&nbsp; tomando en cuenta que estas motos no est&aacute;n situadas en plazas destinadas para el estacionamiento de veh&iacute;culos.</span></p>\r\n<p>&nbsp;</p>\r\n<div style="mso-element: para-border-div; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 1.0pt 4.0pt 1.0pt 4.0pt; margin-left: 53.25pt; margin-right: 0cm;">\r\n<p class="MsoNormal" style="text-align: justify; border: none; mso-border-alt: solid windowtext .5pt; padding: 0cm; mso-padding-alt: 1.0pt 4.0pt 1.0pt 4.0pt;"><strong><span style="font-size: 6.0pt; font-family: Verdana; color: blue;">MARIA JOSE: ESTE TEMA VIENE POR LAS MOTOS APARCADAS POR EL MARIDO DE ENCARNACION PISO EN BADAJOZ TAMBIEN, ESCRIBELE UN MAIL INFORMANDO QUE ESTE PTO&nbsp; SE HABL&Oacute; PORQUE SEG&Uacute;N ME INFORMAN LOS VECINOS Y ME HAB&Iacute;A CONFIRMADO SU MARIDO HACE UNOS MESES QUE LE PREGUNTE TIENEN DOS MOTOS APARCADAS EN ESA ZONA, SI PODRIAN POR FAVOR SACARNOS UNA.</span></strong></p>\r\n</div>', 601),
	(109, 118, 'AVERIA - ASCENSOR PARADO', '<p>* 8/11/2013 Llama un vecino y habla con Angeles para informar que el ascensor est&aacute; parado, fuera de servicio.</p>\r\n<p>* 8/11/2013 Luisa: A las 11:05hrs se informa a Thyssen por telefono de la aver&iacute;a, quedaron en avisar al t&eacute;cnico para que pase.</p>', 307),
	(110, 84, 'OBRAS EN  GARAJE ', '', 623),
	(111, 9, 'OBRA ARREGLO ALERONES TEJADO', '<p>EN JUNTA DE FECHA 23/07/2013 SE DETERMINO QUE 4&ordm;- Presentar propuesta para pintar el alero de la Comunidad. Aprobaci&oacute;n de derrama si procede.</p>\r\n<p><span style="font-size: 11px;">Este punto se determina tratar en la Junta General del a&ntilde;o que viene, se llevaran m&aacute;s propuestas que las presentadas en esta Junta con el fin de comparar prestaciones que ofrezcan los contratistas.</span></p>\r\n<p><span style="font-size: 11px;">02/09/2013.- &nbsp;SE SOLICITAN PRESUPUESTOS DE PINTURA A ASTUR OBRAS, ACROBACIAS, TECONS</span></p>\r\n<p>TODO ARCHIVADO EN DOCUMNTS.ADJUNTOS. EXPTE. TRASNFERIDO DE OUTLOOK.</p>', 608),
	(112, 120, 'MANTENIMIENTO PORTON', '<p>EXPTE.TRANSFERIDO DE OUTLOOK. MANTENIMIENTO PORTON</p>', 317),
	(113, 116, 'DAÑOS EN ANTENA TV', '<p>POLIZA N&ordm; 526454</p>\r\n<p>EL 11/11/13 SE LLAMA A MUTUA DE PROPIETARIOS A LAS 15.30 (902.500.033) Y SE APERTURA EXPEDIENTE EN EL SEGURO POR LOS DA&Ntilde;OS OCASIONADOS EN ANTENA TV COMUNITARIA (FUENTE DE ALIMENTACION MODULAR) OCURRIDOS EL 4/11/13 DEBIDO A UNA DESCARGA ELECTRICA.</p>\r\n<p>LA REFERENCIA DEL SINIESTRO ES 42364866, y hay que remitir por e-mail siniestros@mutuadepropietarios.es el presupuestos o factura de reparacion de esta incidencia.&nbsp;</p>', 330),
	(114, 68, 'SEÑAL ANTENA TV (TDT)', '<p><strong>11/11/2013.-&nbsp;</strong>EL 09/11/2013 SE RECIBE CORREO (AL CORREO DE ALGONZ) DE VECINO CARMEN AMAYA 1 2&ordm;A INDICANDO QUE NO VE LOS CANALES DEL 35 Y 32 TELEVES.</p>', 226),
	(115, 129, 'LUMINARIAS', '<p><strong>11/11/2013.- &nbsp;</strong>NOS INFORMA EL VICEPTE. HERIBERTO INDICANDO Q UN VECINO LE HA INFORMADO QUE LAS LUMINARIAS DE LA PLANTA -1 LLEVA UNA SEMANA ENCENDIDA DE CONTINUO.</p>\r\n<p>&nbsp;</p>', 148),
	(116, 118, 'TUBERIAS Y CALDERA (RUIDOS, SUCIEDAD, ETC)', '<p><strong>26/09/2013.-&nbsp;</strong>DA AVISO VECINO QUE SE HA QUEDADO SIN AGUA.</p>\r\n<p><strong>07/11/2013.- &nbsp;</strong>DA AVISO VECINO DE RUIDO EN TUBERIAS DE AGUA.</p>', 314),
	(117, 68, 'MICROS', '<p><strong>12/11/2013.-&nbsp;</strong> LLAMO LA VECINA DE CARMEN AMAYA 1 3&ordm;A SU MICRO NI SE ESCUCHA NI ABRE.</p>', 226),
	(118, 85, 'BOMBAS GARAJE CUADRO ', '<p><strong>12/11/2013.-&nbsp;</strong>LLAMADA DE VECINO INDICANDO QUE CUADRO DE GARAJE PLANTA -2 PILOTO ROJO DE SOBRECALENTAMIENTO ENCEDIDO.</p>', 626),
	(119, 122, 'PINTURA SOPORTALES ', '<p>SOLICITUD REALIZADA EN LA JUNTA DE FECHA 26/09/2012&nbsp;</p>\r\n<p>Solicitan pedir presupuesto para la pintura de los soportales y barandillas y las puertas de contadores situadas en estos soportales.&nbsp;</p>\r\n<p>&nbsp;</p>', 628),
	(120, 122, 'COLOCACION DE MALLA EN CHIMENEAS (18)', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">EN JUNTA DE FECHA 24/10/2013.-</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="text-indent: -18pt; font-size: 10pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="text-indent: -18pt; font-size: 10pt; font-family: Verdana;">Colocaci&oacute;n de mallas en las chimeneas de la Comunidad. Se llevan dos propuestas una propuesta por importe de 1091,73&euro; de Reformas Jos&eacute; Antonio Leonardo y otra por importe de 871,00&euro; de Pinturas Chus. Esta solicitud se realiza con el fin de que no entren palomas por las chimeneas. Explic&oacute; un vecino que en su vivienda hubo que retirar del conducto de la caldera una paloma muerta. Es aprobada por todos los presentes la realizaci&oacute;n de esta obra con fondos de la Comunidad. Se colocaran mallas galvanizadas y electrosoldadas en 18 chimeneas que posee el edificio.</span></p>\r\n<p class="MsoNormal" style="margin-left: 71.25pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 71.25pt;">&nbsp;</p>', 629),
	(121, 122, 'PUERTA PEATONAL ACCESO AL GARAJE', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">EN JUNTA DE FECHA 24/10/2013.-</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">Tema reparaci&oacute;n puerta acceso peatonal por las escaleras al Garaje. Se llevan propuestas de reparaci&oacute;n y propuestas de cambio de la puerta en su conjunto. Determinando por unanimidad de los asistentes reparar la puerta, presupuesto compuesto por el saneado e instalaci&oacute;n de chapas de acero inoxidable con tornillos pasantes y remaches en la parte inferior de la puerta. Importe de la reparaci&oacute;n 122,34&euro;, y los fondos se tomaran de la liquidez de la Comunidad.</span></p>\r\n<p class="MsoNormal" style="margin-left: 71.25pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 71.25pt;">&nbsp;</p>', 285),
	(122, 122, 'LIMPIEZA DE TEJADO Y SELLADO DE CLARABOYAS', '<p>EN JUNTA DE FECHA 24/10/2013 SE DETERMINA QUE:</p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 8.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).&nbsp;</span></strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Symbol;">&middot;<span style="font-size: 7pt; font-family: \'Times New Roman\';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">Tema revisi&oacute;n tejado y sellar claraboyas. Se aprueba realizar trabajos con Astur-Obras por importe de 233,86&euro;. Los fondos para la realizaci&oacute;n de obra se tomaran de los fondos de la Comunidad.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">13/11/2013.-</span></strong><span style="text-indent: -18pt; font-size: 8pt; font-family: Verdana;">&nbsp;SE ENVIA PROPUESTA DE TRABAJO A VIPASA PARA SU APROBACION. LOS TRABAJOS SE REALIZAN IGUAL, YA QUE EL CARGO IRA CON FONDOS DE LA CDAD.</span></p>\r\n<p class="MsoNormal" style="margin-left: 71.25pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 71.25pt;">&nbsp;</p>', 630),
	(123, 122, 'COLOCACIÓN DE CEPOS EN ALCANTARILLAS', '<p><strong>EN JUNTA DE FECHA 24/10/2013 SE DETERMINA QUE:</strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-size: 10.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="font-family: Verdana; font-size: 9pt; text-indent: 30pt;">Quiere que se act&uacute;e en cuanto al Tema de Ratas, comentan que se ha observado transito de las mismas por las instalaciones del Garaje. En principio se avisar&aacute; a Emulsa para que coloque cepos por las alcantarillas, pero tambi&eacute;n se solicita a los vecinos revisar sus trasteros y retirar cualquier tipo de comida, papeles, que pueda ayudar a que las mismas hagan el h&aacute;bito de entrar en esa estancia.</span><span style="font-family: Verdana; font-size: 9pt; text-indent: 30pt;">&nbsp; </span><span style="font-family: Verdana; font-size: 9pt; text-indent: 30pt;">De persistir las ratas solicitamos den aviso para pedir propuestas y proceder a realizar alguna actuaci&oacute;n que nos indique los t&eacute;cnicos competentes en este tipo de plagas.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-indent: 30.0pt;"><strong style="font-size: 11px;"><span style="font-size: 9.0pt; font-family: Verdana; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; color: blue; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;">PAZ: DAR AVISO A EMULSA Y SI ALGUN VECINO SE SIGUE QUEJANDO DE ESTE TEMA PUES PEDIR PROPUESTAS PARA &nbsp;PONDERAR QUE SOLUCION SE LE PUEDE DAR. EL PROBLEMA ESTA EN QUE LOS TRASTEROS TIENEN AGUJEROS Y COMO NO TODOS DEBEN SER LIMPIOS Y ORGANIZADOS A SABER QUE HAY DENTRO Y A LAS RATAS LES PUEDE GUSTAR</span></strong></p>', 631),
	(124, 53, 'REPOSICION (RECARGA) DE EXTINTOR 1º PLANTA', '<p>TRAS INCENDIO EN VIVIENDA 1&ordm;F, EN LA CUAL SE UTILIZO EXTINTOR DE PLANTA, SOLICITAN REPOSICION DEL MISMO.</p>', 275),
	(125, 68, 'AJUSTE DE PUERTA PORTAL ', '<p>SE ABRE SEGUIMIENTO A RAIZ DE SEGUIMIENTO "C.P. PUERTA DEL SOL MICRO 3&ordm;A electricista", YA QUE NO ERA PROBLEMA ELECTRICO SINO DE CERRAJERIA.</p>', 223),
	(126, 84, 'INCIDENCIAS CON LA CENTRAL DE INCENDIOS', '', 423),
