	(132, 122, 'ENSERES EN GARAJE', '<p><strong>EN JUNTA 24/10/2013 SE DETERMINA "</strong><strong style="text-align: justify; font-size: 11px;"><span style="font-size: 8.0pt; font-family: Verdana;">4&ordm; Ruegos y preguntas. (Varios temas a tratar).</span></strong><span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 30pt;">El d&iacute;a de realizaci&oacute;n de </span>la Junta<span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 30pt;"> hemos observado que hay en algunas plazas enseres que no corresponden a veh&iacute;culos, hemos tomado nota de las plazas donde se encuentran los mismos, y solicitamos a los vecinos que tienen dichos enseres de retirarlos</span><span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 30pt;">&nbsp; </span><span style="font-family: Verdana; font-size: 8pt; text-align: justify; text-indent: 30pt;">a la mayor brevedad posible, pues sino los vecinos solicitan que se de aviso a VIPASA para informar de esta situaci&oacute;n."</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 8.0pt; font-family: Verdana;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;">&nbsp;</p>', 646),
