	(146, 55, 'PLACA DE METACRILATO DEL TECHO DEL ASCENSOR', '<p><span style="color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14.44444465637207px; line-height: 22.22222328186035px; background-color: #f9f9f9;">&nbsp;<span style="background-color: #00ccff;">20/11/2013.-</span> Me he puesto en contacto con Victor de Embarba y le he notificado que la placa de metacrilato del techo del ascensor limpiandola la limpiadora se le romp&iacute;o por lo que solicitaba su reposici&oacute;n. Le informe que me suena que cuando firmamos los contratos se determino entre el y yo que nos la iria cambiando seg&uacute;n se vieran de aspecto deplorable. <span style="background-color: #00ccff;">633.272.698 Victor personal,&nbsp;<span style="background-color: #ffffff;">&nbsp;Dijo que hablar&iacute;a con David para que le dijera cuantos eran para tambi&eacute;n realizar cambio en otros portales.</span></span></span></p>\r\n<p>&nbsp;</p>', 38),
